INSERT INTO "public"."reviews" ("id", "place_id", "name", "relative_time", "rating", "text", "created_at", "updated_at") VALUES
	('cm8qvz64c0000gi6rrukra1ms', 'ChIJifIePKtZwokRVZ-UdRGkZzs', 'places/ChIJifIePKtZwokRVZ-UdRGkZzs/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3LWFqUUpREAE', 'a week ago', 4, 'Joe’s Pizza is a very popular and well-known restaurant in New York City. Although the place is really not bad, it cannot be called unsurpassed. However, if you are in New York, you should visit this place at least once to try the insanely famous pizza slices.

The pizzeria is very popular, especially because of its location on Broadway. Given this, in the evening, you need to be prepared for a long line - during our visit, it stretched for an entire street to the next intersection, moving at an average speed.

It was very cozy inside, with a really cool atmosphere. Despite the large number of visitors, we even managed to find a seat and enjoy the pizza inside. We ordered three different slices of pizza (pepperoni, regular cheese, and cheese with extra mozzarella), all of which were large and fresh. As for the taste, I can say that the pizza was standard tasty without any special features, but not the best you can find in New York. There are many lesser-known pizzerias on the streets where you can buy a similar pizza at a lower price, and it tastes and is identical in size.
A nice bonus was the opportunity to add extra Parmesan or other spices for free.

To summarize, it is worth visiting Joe’s Pizza at least once while in New York, if only because of the incredible atmosphere of the place. However, I would not recommend wasting time waiting in line for a piece of pizza again, as the city offers many other places with a variety of delicious food.', '2025-03-27 05:01:38.364', '2025-03-27 05:01:38.364'),
	('cm8qvz64c0001gi6r2ph16m5s', 'ChIJifIePKtZwokRVZ-UdRGkZzs', 'places/ChIJifIePKtZwokRVZ-UdRGkZzs/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3ck02QjBBRRAB', 'a week ago', 5, 'Had to try the famous Joe''s Pizza and it did not disappoint! There was about a 15-20 minute line to get in. It was super busy on a Sunday night at 10pm. But it was worth the wait, they churn out fresh Pizzas constantly and only takes a couple of minutes for a slice to be ready after you order.', '2025-03-27 05:01:38.364', '2025-03-27 05:01:38.364'),
	('cm8qvz64c0002gi6r4e1goakd', 'ChIJifIePKtZwokRVZ-UdRGkZzs', 'places/ChIJifIePKtZwokRVZ-UdRGkZzs/reviews/ChdDSUhNMG9nS0VJQ0FnTURRMGFQdXdRRRAB', '2 weeks ago', 5, 'There was a pretty long line when I walked past and decided to join. It moved quickly, with no more than a 15 minute wait. I got the pepperoni and it was everything you need in a slice of pizza: hot, cheesy with just the right amount of sauce. Whether you''re a Spiderman fan or just hungry, I''d recommend.', '2025-03-27 05:01:38.364', '2025-03-27 05:01:38.364'),
	('cm8qvz64c0003gi6rts7dbm8b', 'ChIJifIePKtZwokRVZ-UdRGkZzs', 'places/ChIJifIePKtZwokRVZ-UdRGkZzs/reviews/ChZDSUhNMG9nS0VJQ0FnSUNmZzZfUEZBEAE', '2 months ago', 5, 'Pretty famous pizza joint for the classic New York slice. It definitely lived up to the hype. The slices are massive, but it tastes so good you''ll just want more and more. The bottom is perfectly crispy. However, I believe they accidentally double charged us. Definitely ask for a receipt and double check! Service was otherwise great! Note that it''ll be pretty crowded at peak times.', '2025-03-27 05:01:38.364', '2025-03-27 05:01:38.364'),
	('cm8qvz64c0004gi6rh72kgqsv', 'ChIJifIePKtZwokRVZ-UdRGkZzs', 'places/ChIJifIePKtZwokRVZ-UdRGkZzs/reviews/ChZDSUhNMG9nS0VJQ0FnTURneDhmc05REAE', '3 weeks ago', 5, 'Joe''s Pizza is a staple in New York, and I can never visit NYC without having it. My husband and I decided to go after seeing a Broadway show. The line stretched down the sidewalk, but it moved quickly. Fortunately, right before we ordered, I was able to snag a table for us. We ordered a variety of slices, including white pie, pepperoni, and fresh mozzarella. The restaurant was packed with customers picking up to-go orders and placing new ones. The pizza came out quickly and was piping hot. Joe''s is our favorite--always consistent and delicious. We can''t wait for our next trip to NYC, and of course, Joe''s will be at the top of our list!', '2025-03-27 05:01:38.364', '2025-03-27 05:01:38.364'),
	('cm8qxg2mi0005gi6rvx87a7pa', 'ChIJQ-hJIuBbwokRRUdquw_5w5U', 'places/ChIJQ-hJIuBbwokRRUdquw_5w5U/reviews/ChdDSUhNMG9nS0VJQ0FnTURnLTg2WnRnRRAB', '3 weeks ago', 5, 'Who knew I needed crispy based pizza in my life! I enjoyed the crust as much as I did the main bit with toppings on. Very simple menu so they can serve everyone quickly. Cheap too.
There’s always a queue outside this one! I walked past him when it wasn’t too big and didn’t have to wait too long.', '2025-03-27 05:42:46.602', '2025-03-27 05:42:46.602'),
	('cm8qxg2mi0006gi6rh0vlir9h', 'ChIJQ-hJIuBbwokRRUdquw_5w5U', 'places/ChIJQ-hJIuBbwokRRUdquw_5w5U/reviews/ChdDSUhNMG9nS0VJQ0FnTURRODhmbGpnRRAB', 'a week ago', 5, 'The pizza is really good. I don''t know what they did to the dough, but the crust is probably the best crust I''ve had. Very delicious pizza.

It can get very crowded though. I went during the weekend and barely got a place to eat. The staff try their best to move everything along.

I recommend giving this pizzeria a try.', '2025-03-27 05:42:46.602', '2025-03-27 05:42:46.602'),
	('cm8qxg2mi0007gi6r713uizz5', 'ChIJQ-hJIuBbwokRRUdquw_5w5U', 'places/ChIJQ-hJIuBbwokRRUdquw_5w5U/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3NEtLRGtnRRAB', 'a week ago', 5, 'Visited L''Industrie Pizzeria on a Saturday evening with friends and it was absolutely worth the 30-minute wait! My college friend (a local) recommended this as his favorite pizza spot in NYC after trying many places, and I can see why.

We shared three slices - the Margherita, The New Yorker, and a pesto and sausage white slice. The crust was perfectly thin and crispy with amazing structural integrity when folded - no drooping! For the first time ever, I actually wanted to finish the crust, not just the part with toppings. The red sauce was exceptional and the slices were generously sized.

There''s a line out the door (be prepared to know your order when you reach the counter), and they call your name when your slices are ready. Inside is packed but they have plenty of bar counters for standing while you eat.

Possibly the best pizza I''ve ever had and exactly what I imagined authentic NYC pizza should be. My wife''s favorite was the pesto slice, while I loved them all equally. Definitely a must-visit for pizza lovers!', '2025-03-27 05:42:46.602', '2025-03-27 05:42:46.602'),
	('cm8qxg2mi0008gi6rghd8em62', 'ChIJQ-hJIuBbwokRRUdquw_5w5U', 'places/ChIJQ-hJIuBbwokRRUdquw_5w5U/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnLWVEMFFBEAE', 'a month ago', 4, 'I recently tried Industry Pizza in Brooklyn, and unfortunately, I wasn’t too impressed. I had heard a lot of good things about the place, so maybe I just happened to catch them on a bad day. For starters, the bathrooms were out of order, which was a bit frustrating.

I ordered my food to-go, and when I got it, the pizza was burnt and, to my surprise, a bit cold. Considering all the hype, I was expecting much better quality. The pricing is also a bit on the high side, especially for a regular slice — I’ve had better for less.

On the plus side, they are one of the few pizza spots that offer sparkling water, which I really appreciated. Parking in the area can be tricky, but the metered parking is much cheaper than it is in other parts of NYC, so that’s a small win.

I’m willing to give Industry Pizza a second chance since it might have just been an off day, but based on this experience, it didn’t quite live up to the expectations.', '2025-03-27 05:42:46.602', '2025-03-27 05:42:46.602'),
	('cm8qxg2mi0009gi6rnx63pmk6', 'ChIJQ-hJIuBbwokRRUdquw_5w5U', 'places/ChIJQ-hJIuBbwokRRUdquw_5w5U/reviews/ChZDSUhNMG9nS0VJQ0FnTURRZ2EtR0lBEAE', 'a week ago', 5, 'Loved the atmosphere and the stuff. You can tell they are very proud of what they have build and continue to keep building relationships with customers. The different pizzas were to die for and I am a big fan of salty and sweet so the prosciutto and fig jam was my favorite. Definitely worth the hype', '2025-03-27 05:42:46.602', '2025-03-27 05:42:46.602'),
	('cm8rrvymd0007gnu6t8frv70g', 'ChIJ-aP3IHa1RIYRUlcGMckBLvw', 'places/ChIJ-aP3IHa1RIYRUlcGMckBLvw/reviews/ChZDSUhNMG9nS0VJQ0FnSURYNXRyMEtnEAE', '5 months ago', 4, 'I went there late morning for a spicy steak fajitas burrito and he delivered! Such a charismatic guy who I disappointed by not pairing it with a drink. The atmosphere of the factory is bumpin with good music but when you get your meal you’re in a food court which is why I only gave it a 4.
Would love to go back, very delicious, very well priced', '2025-03-27 19:54:56.388', '2025-03-27 19:54:56.388'),
	('cm8rrvymd0008gnu6fu27f8to', 'ChIJ-aP3IHa1RIYRUlcGMckBLvw', 'places/ChIJ-aP3IHa1RIYRUlcGMckBLvw/reviews/ChZDSUhNMG9nS0VJQ0FnSURQMmZiTFFBEAE', '3 months ago', 5, 'I wish they got more hype! The main guy who works there is so kind and makes great conversation while making the food. The ingredients are fresh and flavorful! Affordable food that doesn''t wreck my stomach like Chipotle and it''s a small business which is always a plus to support! I love coming here for a filling meal in between class and study sessions. ', '2025-03-27 19:54:56.388', '2025-03-27 19:54:56.388'),
	('cm8rrvymd0009gnu6zda79ibh', 'ChIJ-aP3IHa1RIYRUlcGMckBLvw', 'places/ChIJ-aP3IHa1RIYRUlcGMckBLvw/reviews/ChdDSUhNMG9nS0VJQ0FnSUNlcHJIXy1BRRAB', '2 years ago', 4, 'Big burritos for good price.
