Thank you', '2025-03-27 19:54:56.388', '2025-03-27 19:54:56.388'),
	('cm8rrvymd000agnu63n9s8nvj', 'ChIJ-aP3IHa1RIYRUlcGMckBLvw', 'places/ChIJ-aP3IHa1RIYRUlcGMckBLvw/reviews/ChZDSUhNMG9nS0VJQ0FnSUNKMU02X0l3EAE', 'a year ago', 4, 'You''ll recognize the owner first, he''s the ecstatic guy behind the counter 😄. He stands out because you''d first think, ''man, it''d be hard for him to replace himself.'' His service is great, you can tell he knows what he''s doing, and he loves what he is doing. It''s clearly obvious. Food is a SOLID 4*. It''s good, the prices are good, and I enjoyed every bit of it. 👍 👌 😋', '2025-03-27 19:54:56.388', '2025-03-27 19:54:56.388'),
	('cm8rrvymd000bgnu6llj6wcyk', 'ChIJ-aP3IHa1RIYRUlcGMckBLvw', 'places/ChIJ-aP3IHa1RIYRUlcGMckBLvw/reviews/ChdDSUhNMG9nS0VJQ0FnSURVOTlUWXlRRRAB', '5 years ago', 5, 'This is a MUST go place if you are a student at UT. The staff are really nice and always remember your order. Their menu has vegetarian friendly options, and the food is amazing! They also have aguas frescas, and their horchata is the bomb. They have a super spicy red salsa, so unless you can handle it don''t ask for it or you will ruin your food :).', '2025-03-27 19:54:56.388', '2025-03-27 19:54:56.388'),
	('cm8rxso2w0000js0qnjovwwqn', 'ChIJ0ZhsQs0G3IARYXre7Ctn80w', 'places/ChIJ0ZhsQs0G3IARYXre7Ctn80w/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2NEt6dXNnRRAB', '3 months ago', 5, 'Got my bowl for 12 bucks today. It wasn’t bad, however this is definitely the kind of location where you want to ask for half chicken half steak for your bowl cause they’re skimpy. I saw them make a burrito for the girl in front of me and I literally felt bad for how little that thing was. But anyways, if you don’t want to get scammed make sure they’re adding 2 rice scoops and then specify that you want half of one meat and half of another. It sucks to play mind games with them but her scoops were nice so I’m just glad I got what I wanted. My friend did steak and she only got one scoop🙁, not even heaping. They did get me with the guacamole tho. Make sure you tell them that LAST because they will put it in the middle even if you mention it lastly. I got nervous and just told her everything I wanted on it and she was the one to decide what order the ingradients went on so next time trust I will be acting like I’d ALMOST forgotten the guac for extra measure. Outside of that always get a tortilla on the side and ask for a water cup that just so happens to not be see through🌚 and you have your side and drink cover. I also have a love/hate relationship with the vinaigrette so try that if it interests you. Overall, not a bad location and I’d go again. It was better than the chipotle I had in Chula Vista so 🤲 ig that has to mean something. But pay attention here I’m just sure they have a lot of college student customers and they gotta make the ingredients last but if you’re reading this, stay strong solider and make sure they don’t scam you before you can scam them🤣🤣🤣🤣 And the drinks station is well organized with a properly carbonized diet coke so more points for that!', '2025-03-27 22:40:20.456', '2025-03-27 22:40:20.456'),
	('cm8tbb57x000pjr0nuyzfs68l', 'ChIJbRauj2cVkFQRM-KsVnew8eg', 'places/ChIJbRauj2cVkFQRM-KsVnew8eg/reviews/ChdDSUhNMG9nS0VJQ0FnSUM1MU5DNXV3RRAB', 'a year ago', 5, 'I’ve been ordering with NwFitmeals for years and it’s amazing! Gena is the best and her team makes delicious, healthy food that I always feel good eating. 10/10 recommend! ❤️', '2025-03-28 21:46:23.662', '2025-03-28 21:46:23.662'),
	('cm8tbb57x000qjr0nrea0i3vn', 'ChIJbRauj2cVkFQRM-KsVnew8eg', 'places/ChIJbRauj2cVkFQRM-KsVnew8eg/reviews/ChZDSUhNMG9nS0VJQ0FnSUM1bFBpM093EAE', 'a year ago', 5, 'The food is delicious and service is easy and convenient to use.  The Grab and Go option is very handy and I’ve used it to grab additional healthy food options for parents post op situations and it was easy for them to prepare and enjoy as well.  We have also taken these to sports events to keep in the hotel room.  Love Love Love these meals and Highly recommend all the options as I have never received one I didn’t like.', '2025-03-28 21:46:23.662', '2025-03-28 21:46:23.662'),
	('cm8tbb57y000rjr0nccq73mz1', 'ChIJbRauj2cVkFQRM-KsVnew8eg', 'places/ChIJbRauj2cVkFQRM-KsVnew8eg/reviews/ChdDSUhNMG9nS0VJQ0FnSUNoaXVhTnhnRRAB', '2 years ago', 5, 'When my husband is out of town for work I grab these lunches for myself it makes me week so much better when solo parenting to take time to eat healthy!  They taste great and are super healthy.  Worth the price for how much more energized I feel during the day.', '2025-03-28 21:46:23.662', '2025-03-28 21:46:23.662'),
	('cm8uvf3ol000dl40jxlyqs01p', 'ChIJkxjuR-w9socRxV0RNmwD83g', 'places/ChIJkxjuR-w9socRxV0RNmwD83g/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfNVBEQmVREAE', '2 months ago', 5, 'My first time here. Excellent service and sushi. Pleasant find. Will come here much more.', '2025-03-29 23:57:06.789', '2025-03-29 23:57:06.789'),
	('cm8uvf3ol000el40jrmsxi4r7', 'ChIJkxjuR-w9socRxV0RNmwD83g', 'places/ChIJkxjuR-w9socRxV0RNmwD83g/reviews/ChdDSUhNMG9nS0VJQ0FnTURROWZhdG5BRRAB', '2 weeks ago', 4, 'Pretty good overall I''d say. Very good menu with beautiful pictures of all of their specialty rolls. The sashimi while delicious was not quite as firm as I am used to and was quite soft. Not too bad though', '2025-03-29 23:57:06.789', '2025-03-29 23:57:06.789'),
	('cm8uvf3ql000fl40ju5fb2j66', 'ChIJ9Sy2td4TsocRail9mnIkf8Y', 'places/ChIJ9Sy2td4TsocRail9mnIkf8Y/reviews/ChdDSUhNMG9nS0VJQ0FnTURnOXZQdDJRRRAB', 'a month ago', 5, 'We had a wonderful experience at this restaurant. The food was incredibly fresh, and our server was both friendly and attentive. As a special treat, they offered us two pieces of smoked salmon nigiri to sample for free - a new item soon to be added to the menu, and it was absolutely delicious. We’ll definitely be back!', '2025-03-29 23:57:06.862', '2025-03-29 23:57:06.862'),
	('cm8v6quhw0007i20rn8ohfhm8', 'ChIJA_UyqZf_24ARIOYMlXtjsHw', 'places/ChIJA_UyqZf_24ARIOYMlXtjsHw/reviews/ChZDSUhNMG9nS0VJQ0FnSUMwMWVENENnEAE', '5 years ago', 5, 'I am obsessed with acaí bowls and wanted to try this place out. I wasn''t disappointed. The space is pretty small but cute. I built my own bowl and chose from a big selection of items. The acaí they use is in sorbet form. It was delicious! When I''m in the area again I''ll be visiting again.', '2025-03-30 05:14:10.532', '2025-03-30 05:14:10.532'),
	('cm8rxso2w0001js0q5pismg7a', 'ChIJ0ZhsQs0G3IARYXre7Ctn80w', 'places/ChIJ0ZhsQs0G3IARYXre7Ctn80w/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBdXBmYWxBRRAB', 'a month ago', 2, 'The service should be greatly improved as on arriving around 9:30, an hour and a half before the mentioned closing time they don’t refill their items. Don’t know why refilling the items is such an issue when they should be aware it’s one of the few places open till late, people would come and expect to have the right meal which they pay for. It has been couple of times that this had happened would be appreciated if efforts are taken to correct it.', '2025-03-27 22:40:20.456', '2025-03-27 22:40:20.456'),
	('cm8rxso2w0002js0q6b7sj2bw', 'ChIJ0ZhsQs0G3IARYXre7Ctn80w', 'places/ChIJ0ZhsQs0G3IARYXre7Ctn80w/reviews/ChZDSUhNMG9nS0VJQ0FnTURRNG9id0xREAE', '2 weeks ago', 1, 'If you drive AVOID THIS CHIPOTLE at all times. Want good portions? Manger is stingy and hawking down her employees. Want a water cup or vinaigrette? Ran out. Want steak or chicken past 7:30? Out for the day. Terrible management absolute UCSD scam.', '2025-03-27 22:40:20.456', '2025-03-27 22:40:20.456'),
	('cm8rxso2w0003js0ql7fq0y41', 'ChIJ0ZhsQs0G3IARYXre7Ctn80w', 'places/ChIJ0ZhsQs0G3IARYXre7Ctn80w/reviews/ChZDSUhNMG9nS0VJQ0FnTURnOU5uQldnEAE', 'a month ago', 3, 'Food is good.  Tables are dirty most of the times I’ve been (typically Sundays).  It’s busy, but still… employees empty trash, but they dont clean tables often enough for the traffic.  I’ll update my review if things get better.', '2025-03-27 22:40:20.456', '2025-03-27 22:40:20.456'),
	('cm8rxso2w0004js0qnylx1m1g', 'ChIJ0ZhsQs0G3IARYXre7Ctn80w', 'places/ChIJ0ZhsQs0G3IARYXre7Ctn80w/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2ejdYZURREAE', '3 months ago', 5, 'Whoever was cooking the steak today around 1:30 needs a raise.
I had the best steak bowl I’ve ever had in my life and I eat Chipotle once or twice every week. The steak was seasoned great and perfectly cooked.
Only downside is that from now on I will hope every steak bowl is as good as this one. Please teach Del Mar chipotle how to cook', '2025-03-27 22:40:20.456', '2025-03-27 22:40:20.456'),
	('cm8s2j85o0005js0qamj1rl3j', 'ChIJvcSjadgG3IAR2poiOH8FFcU', 'places/ChIJvcSjadgG3IAR2poiOH8FFcU/reviews/ChdDSUhNMG9nS0VJQ0FnSURYcHNic2p3RRAB', '5 months ago', 5, 'I discovered Yogurt World last year and have have been coming frequently ever since!! The froyo is outstanding (it doesn’t have that weird artificial/overly sweet flavor that I’ve found at most froyo chains) and the flavors are incredibly creative. The owner is also the NICEST man and the prices are reasonable. My favorite flavors are Saffron Rose, Black Sesame, Taro, Matcha, and Chocolate Brownie. The saffron rose is pictured here in both photos, and the multi flavor photo also has matcha (green), taro (purple), and chocolate brownie. The saffron rose reminds me so much of faloodeh and malabi, which are so hard to find in the US. The last photo is the flavors schedule. Highly recommend!! A perfect place to decompress after class.', '2025-03-28 00:52:57.996', '2025-03-28 00:52:57.996'),
	('cm8s2j85o0006js0qlzbdj7rh', 'ChIJvcSjadgG3IAR2poiOH8FFcU', 'places/ChIJvcSjadgG3IAR2poiOH8FFcU/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRcDVHMS1nRRAB', '2 weeks ago', 5, 'Long time customer of Yogurt World (going on 10+ years at this point). The store is meticulously cleaned and owner is very understanding of allergens. Super cute cups and spoons. Good mix of unique and classic flavors. Ample outdoor seating in front. A great place for a snack, to catch up with friends, or to de-stress.', '2025-03-28 00:52:57.996', '2025-03-28 00:52:57.996'),
	('cm8s2j85o0007js0qnrp5ef4j', 'ChIJvcSjadgG3IAR2poiOH8FFcU', 'places/ChIJvcSjadgG3IAR2poiOH8FFcU/reviews/ChZDSUhNMG9nS0VJQ0FnSUQ3czRyRUdREAE', '7 months ago', 5, 'Have consistently eaten here every chance I''ve gotten, well worth it! I can''t stress enough just how nice the owner is. All of my experiences with him have been strictly positive. Also, all the flavors of the frozen yogurt that I''ve had are great! Sometimes the dispensers are a bit inconsistent with how they pour out the yogurt, but it''s nothing that''d ruin the flavor or something of the sorts, and it''s only something I''ve noticed with a few flavors, like the Pink Lemonade Sorbet. Do be aware that the flavors rotate, depending on the day, but I''m fairly certain that the owner keeps the schedule for that up on the front window. As for seating, it can get a bit crammed if you''re planning on eating inside, but there''s plenty of outdoor seating nearby. Despite these few minor complaints of mine, it''s still a VERY easy place to recommend stopping by every once in a while! Don''t let the small inconveniences discourage you from visiting!

Also, I recommend the Frozen Lemonade Sorbet if it''s available!', '2025-03-28 00:52:57.996', '2025-03-28 00:52:57.996'),
	('cm8s2j85o0008js0qtjp6ib99', 'ChIJvcSjadgG3IAR2poiOH8FFcU', 'places/ChIJvcSjadgG3IAR2poiOH8FFcU/reviews/ChdDSUhNMG9nS0VJQ0FnSUN4bDRYUWd3RRAB', 'a year ago', 5, 'Yogurt World is very based. They often have 10% discounts so you can support clubs. Also, the owner is very nice.

They have a lot of flavors, but I don''t think it really matters what you get since they all taste good. I just put a bit of each and forget what flavors I get. They each taste different so eating the milk tea flavor right after a fruit flavor makes it taste bitter at first.

They have little sample cups if you ask. Personally I don''t really bother sampling since they''re all good', '2025-03-28 00:52:57.996', '2025-03-28 00:52:57.996'),
	('cm8s2j85o0009js0qrxyag5aw', 'ChIJvcSjadgG3IAR2poiOH8FFcU', 'places/ChIJvcSjadgG3IAR2poiOH8FFcU/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRaU9hZnV3RRAB', '3 weeks ago', 5, 'Literally one of the best frozen yogurt spots in San Diego. I still come all the way to campus for this place even after graduating. The owner is always so nice and all the employees are too. I love how unique their flavors are and they rotate pretty often. Tbh I go there especially because they''ll do some really interesting Asian inspired flavors and they''re so good every time. It''s hard now for froyo places to differentiate themselves but this one stands out!', '2025-03-28 00:52:57.996', '2025-03-28 00:52:57.996'),
	('cm8s4aeld0000jp0p79659qhh', 'ChIJwyDI93bMRIYR38GEET3DD3Q', 'places/ChIJwyDI93bMRIYR38GEET3DD3Q/reviews/ChdDSUhNMG9nS0VJQ0FnSURfX2NPMDRBRRAB', '2 months ago', 4, 'While it may be a chain, Maggiano’s North Austin location stands out as a great experience for anyone looking for a quick, moderately priced date night. The location is just off a free parking garage and the setting feels intimate despite the busy atmosphere, not to mention their service was fantastic.

As a whole, their food was solid and the portion sizes were generous. The mushroom ravioli was good although the sauce was a bit too sweet and the chicken fettuccine alfredo was decent but came in a large portion which was nice. The standout of the meal was the crispy mozzarella which is essentially a mozzarella stick but with a bit more flavor and perfect crunchy exterior. The drinks were solid and the chocolate cake was rich and very layered.

All in all Maggiano’s is a clear step above traditional Italian restaurants like Olive Garden and their offer of Marco’s meal for two (1 app, 2 classic pastas, and a dessert for $57) is a strong option for any date night.', '2025-03-28 01:42:05.665', '2025-03-28 01:42:05.665'),
	('cm8s4aeld0001jp0pl1qsrv37', 'ChIJwyDI93bMRIYR38GEET3DD3Q', 'places/ChIJwyDI93bMRIYR38GEET3DD3Q/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBOHVpTlhnEAE', 'a month ago', 5, 'Excellent restaurant at the right price. All the food was delicious, the portions were good. The pizza is very good. After our first visit we have returned several times. And now we are already clients of this little piece of Italy.', '2025-03-28 01:42:05.665', '2025-03-28 01:42:05.665'),
	('cm8tbzqlm000tjl0jufkd87n8', 'ChIJs6-KANy0RIYRRTcMhnhoFaE', 'places/ChIJs6-KANy0RIYRRTcMhnhoFaE/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYcE8zbTFnRRAB', '5 months ago', 5, 'We ate outdoor. Great food and beer...they''ve got everything covered. We enjoyed dining out this evening. Definitely one of the best places if you want to eat out.', '2025-03-28 22:05:31.115', '2025-03-28 22:05:31.115'),
	('cm8s4aeld0002jp0puxz5mqrm', 'ChIJwyDI93bMRIYR38GEET3DD3Q', 'places/ChIJwyDI93bMRIYR38GEET3DD3Q/reviews/ChdDSUhNMG9nS0VJQ0FnSURmbGRhal9BRRAB', '2 months ago', 5, 'We met here on a Saturday evening at 7pm because it was a convenient location for our group of six - mid way point for all of us in different parts of the Austin area.
We were seated at our reservation time when all of us were present.
Our waitress was amazing! It was the first time there for a few of us, so she went over the menu and how the family style order worked. We had a lot of questions. She took her time explaining what each option was on the family style and that’s what we decided to go with. You get allot of food on the family style! But you will have leftovers to take home. Every thing we ordered was delicious. Dessert is included and you get to pick your dessert choices. One of our choices was the chocolate cake. Let me tell you, this piece was HUGE!!!
The family style worked for our group because it came with a few options, several courses, a lot of amazing food, and desserts, which pleased everyone in our group. We were there probably 2 1/2 hours and never felt like we were abandoned or rushed.
I dont know how much the final bill was because I wasn’t paying, but I would say that the family style is definitely worth it for a group of four or more and that’s what we will get next time we go back!', '2025-03-28 01:42:05.665', '2025-03-28 01:42:05.665'),
	('cm8s4aeld0003jp0pke36fpy3', 'ChIJwyDI93bMRIYR38GEET3DD3Q', 'places/ChIJwyDI93bMRIYR38GEET3DD3Q/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBdGZqRUpREAE', 'a month ago', 5, 'I had an amazing experience at Maggianos. My husband and I had our wedding dinner here and it was a group of 15 of us. We made a reservation online about 2 weeks in advance. Our servers Connor and Dylan were lovely and very attentive. The service was fantastic and the food was delicious! Thank y’all!', '2025-03-28 01:42:05.665', '2025-03-28 01:42:05.665'),
	('cm8s4aeld0004jp0pg9tf6do3', 'ChIJwyDI93bMRIYR38GEET3DD3Q', 'places/ChIJwyDI93bMRIYR38GEET3DD3Q/reviews/ChdDSUhNMG9nS0VJQ0FnSURQMkpqYXB3RRAB', '3 months ago', 5, 'My family has been coming here for years for the holidays. We ate here for Thanksgiving 2024. The family style menu is well worth the price. Sam, our waitor was so excellent. We will continue coming back for the holidays', '2025-03-28 01:42:05.665', '2025-03-28 01:42:05.665'),
	('cm8s4ay370005jp0pt3qur4ol', 'ChIJhXsx6PvNRIYRDV3SClWlpzk', 'places/ChIJhXsx6PvNRIYRDV3SClWlpzk/reviews/ChZDSUhNMG9nS0VJQ0FnTURRMDVmcklBEAE', '2 weeks ago', 3, 'They cook fresh and the food itself is good. I recommend switching out the aluminum foil that wraps the sandwich. The smell and taste of the metal overpowers the taste of the food. The Francisco sandwich was really good tho! I just was sad that the good food taste was masked by the foil', '2025-03-28 01:42:30.931', '2025-03-28 01:42:30.931'),
	('cm8s4ay370006jp0pmq29djxj', 'ChIJhXsx6PvNRIYRDV3SClWlpzk', 'places/ChIJhXsx6PvNRIYRDV3SClWlpzk/reviews/ChZDSUhNMG9nS0VJQ0FnSURmeG9PRVd3EAE', '2 months ago', 5, 'I recently tried fried cheese potato sandwich and Philadelphia sandwich ,and it was absolutely delicious! Every bite was packed with amazing flavors. The presentation was beautiful, and the service was excellent. I can’t wait to go back. Highly recommend!', '2025-03-28 01:42:30.931', '2025-03-28 01:42:30.931'),
	('cm8s4ay370007jp0pwk4t9kd6', 'ChIJhXsx6PvNRIYRDV3SClWlpzk', 'places/ChIJhXsx6PvNRIYRDV3SClWlpzk/reviews/ChZDSUhNMG9nS0VJQ0FnSURIanEtQlBREAE', '6 months ago', 5, 'I recently grabbed a Gyro over Rice from a food truck at the Domain while searching for some halal options, and wow, it did not disappoint! The gyro was packed with flavor, perfectly seasoned, and paired with the delicious yellow basmati rice and fresh salad on the side. The creamy white sauce and a hint of hot sauce tied everything together so well. I couldn’t stop eating it! Plus, they gave me a soft pita to go with it. Definitely recommend it if you''re around the Domain area and craving some tasty halal food! 😋✨', '2025-03-28 01:42:30.931', '2025-03-28 01:42:30.931'),
	('cm8s4ay370008jp0phcxf5674', 'ChIJhXsx6PvNRIYRDV3SClWlpzk', 'places/ChIJhXsx6PvNRIYRDV3SClWlpzk/reviews/ChdDSUhNMG9nS0VJQ0FnSUQ3ajl6Um1nRRAB', '7 months ago', 5, 'Ihab is the man! He’s from Egypt and only been here for a short time and has excellent customer service. Very friendly guy and made me want to come back simply because of good conversation and good food. I recommend the shish taouk! The sauce is really good on it. Now, it says Italian food and there definitely are some Italian dishes, but a lot of Mediterranean food comprises the menu. You can’t go wrong with any of the sandwiches or platters. It’s right by shake shack and I would rather support a local small business than a chain, but that’s just me! Show him some love and help boost his ratings so he can attract more business and let’s see how far he can take a good restaurant!', '2025-03-28 01:42:30.931', '2025-03-28 01:42:30.931'),
	('cm8s4ay370009jp0png5uphlw', 'ChIJhXsx6PvNRIYRDV3SClWlpzk', 'places/ChIJhXsx6PvNRIYRDV3SClWlpzk/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRdWRPVEZREAE', '3 weeks ago', 5, 'The best fettuccine alfredo I''ve ever had. Plenty of chicken on top of thick cheese pasta!', '2025-03-28 01:42:30.931', '2025-03-28 01:42:30.931'),
	('cm8s4b2eb000ajp0pckev0ngw', 'ChIJsZFfbA3NRIYR5HXqSS2ZeD4', 'places/ChIJsZFfbA3NRIYR5HXqSS2ZeD4/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfNU9LemFnEAE', '2 months ago', 5, 'Today I  tried a burger that completely blew me away! It was perfectly crafted, with a balance of flavors and textures that made every bite memorable.

The patty was juicy and cooked to perfection — a beautiful sear on the outside and tender, flavorful meat on the inside. The chef clearly knows how to season properly because every bite was bursting with taste.

I tried the French and Italian burgers! The filling was very tasty and juicy! I will definitely come back here again!', '2025-03-28 01:42:36.516', '2025-03-28 01:42:36.516'),
	('cm8s4b2eb000bjp0p1bzprt4m', 'ChIJsZFfbA3NRIYR5HXqSS2ZeD4', 'places/ChIJsZFfbA3NRIYR5HXqSS2ZeD4/reviews/ChZDSUhNMG9nS0VJQ0FnTURBaWFuY1h3EAE', 'a month ago', 3, 'I decided to try a burger spot that had promising reviews. It’s a food truck near the Domain area, with two benches for seating. I ordered the French Burger and the Italian Burger. Both came with fries, which were generously portioned and pretty good. However, the burgers were disappointing. The French Burger had strawberry jam on top of the bread, which didn’t work at all for me. The Italian Burger was overly greasy and tasted far from healthy. Unfortunately, I wouldn’t recommend this place.', '2025-03-28 01:42:36.516', '2025-03-28 01:42:36.516'),
	('cm8s4b2eb000cjp0pjo34kd7w', 'ChIJsZFfbA3NRIYR5HXqSS2ZeD4', 'places/ChIJsZFfbA3NRIYR5HXqSS2ZeD4/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBaTVfcl93RRAB', 'a month ago', 5, 'My husband and I aren''t typically huge food truck people but we wanted to try the highly rated That Burger and WOW was that a good call! I had the French Burger as is, he had the American Burger without most toppings (he left the bacon, mayo, and cheese). We are definitely going back to try more of their offerings.

Standouts from The French Burger
Pillowy bun
Toppings (brie, arugula, mushrooms, jam, truffle mayo) are a perfect balance of savory and sweet and perfectly compliment the burger

You order on an ipad. I don''t remember there being an opportunity to specify how you want your burger done, but if there is, don''t get snooty about it. Just take it as it comes. They know what they''re doing!', '2025-03-28 01:42:36.516', '2025-03-28 01:42:36.516'),
	('cm8s4b2eb000djp0pdfgeen1y', 'ChIJsZFfbA3NRIYR5HXqSS2ZeD4', 'places/ChIJsZFfbA3NRIYR5HXqSS2ZeD4/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfNS1HNUFREAE', '2 months ago', 5, 'I love how unique these burgers are. Each one representing the flavors specific to a country. The smashburger is simple but delicious. The Italiano is flavorful and the Argentinian also was well made. The loaded and truffle fries are packed with seasoning and toppings. Overall love the service, food. Thanks Arturo for your hospitality!', '2025-03-28 01:42:36.516', '2025-03-28 01:42:36.516'),
	('cm8s4b2eb000ejp0plobrlrks', 'ChIJsZFfbA3NRIYR5HXqSS2ZeD4', 'places/ChIJsZFfbA3NRIYR5HXqSS2ZeD4/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnMXBUZ0h3EAE', 'a month ago', 1, 'A huge fan of your burgers but I’m really upset about the burger I got today. Let this be a lesson for That Burger to make sure that you cook your meat all the way. I am currently 6 months pregnant and this could be detrimental to my health and unborn baby :( I caught it late and hopefully I did not consume any of the raw meat.', '2025-03-28 01:42:36.516', '2025-03-28 01:42:36.516'),
	('cm8s4b4fa000fjp0pggypfrm9', 'ChIJj12FzeHNRIYRcC4Fk_Jodes', 'places/ChIJj12FzeHNRIYRcC4Fk_Jodes/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfOVpDdzRnRRAB', '2 months ago', 5, 'Food is so good, presentation, packaging, price point and efficiently done. Their containers are more environment conscious too!
