	('cm8s4b4fa000gjp0pxvn2972i', 'ChIJj12FzeHNRIYRcC4Fk_Jodes', 'places/ChIJj12FzeHNRIYRcC4Fk_Jodes/reviews/ChZDSUhNMG9nS0VJQ0FnSURYdVB1Rk9BEAE', '5 months ago', 5, 'Literally 5 bites in & had to come and write a review! This is the best poke I’ve had !! I got the truffle bowl and added mango (I feel like it’s not poke without some mango lol)!! You could taste the truffle instantly & the pickled red onions were a HIT !! Never had them in a poke bowl before & I am officially obsessed !! GO HERE', '2025-03-28 01:42:39.142', '2025-03-28 01:42:39.142'),
	('cm8s4b4fa000hjp0prbk1xyps', 'ChIJj12FzeHNRIYRcC4Fk_Jodes', 'places/ChIJj12FzeHNRIYRcC4Fk_Jodes/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYdGJqZG13RRAB', '5 months ago', 5, 'Look man, I’ll get straight to the point. This place is phenomenal. The portions? HUGE! The fish? FRESH! The price? REASONABLE! Finding good quality poke in Austin is like trying to mop the ocean, but man this place was legit. Don’t be fooled by their food truck, this place is truly a hidden gem and I’m glad I chose to eat here instead of the other overpriced places at the domain.', '2025-03-28 01:42:39.142', '2025-03-28 01:42:39.142'),
	('cm8s4b4fa000ijp0pomd1fzv6', 'ChIJj12FzeHNRIYRcC4Fk_Jodes', 'places/ChIJj12FzeHNRIYRcC4Fk_Jodes/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRdzVmcmdRRRAB', '3 weeks ago', 5, 'So delicious! I ordered through UberEats and the musubi came hot, my cold drink was still cold, and my poke bowl was fresh. I definitely recommend this place.', '2025-03-28 01:42:39.142', '2025-03-28 01:42:39.142'),
	('cm8s4b4fa000jjp0pus3buvnr', 'ChIJj12FzeHNRIYRcC4Fk_Jodes', 'places/ChIJj12FzeHNRIYRcC4Fk_Jodes/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2MTZXS0dBEAE', '3 months ago', 5, 'Great poke, good portions, wish they had more sides like sweet corn.', '2025-03-28 01:42:39.142', '2025-03-28 01:42:39.142'),
	('cm8s4c5l5000kjp0pq01tz5y3', 'ChIJnVXWw_3RRIYRrdWBcLCiuyU', 'places/ChIJnVXWw_3RRIYRrdWBcLCiuyU/reviews/ChZDSUhNMG9nS0VJQ0FnTURRczdEeFBBEAE', '2 weeks ago', 5, 'I cannot say enough good things about this restaurant. We were huge fans when the original location was in Round Rock and we were thrilled when they re-opened in the Domain. The staff are the most delightful and kind people and the food is 100 stars. The atmosphere is relaxed but gorgeously upscale and the service/food are beyond compare. I recommend this restaurant to anyone who is looking for a special location for dinner or an event.', '2025-03-28 01:43:27.305', '2025-03-28 01:43:27.305'),
	('cm8s4c5l5000ljp0pf7z6tnjr', 'ChIJnVXWw_3RRIYRrdWBcLCiuyU', 'places/ChIJnVXWw_3RRIYRrdWBcLCiuyU/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRel9hNTdRRRAB', '2 weeks ago', 5, 'I celebrate my birthday at Fogueira restaurant with my husband.
If you want elegant and cozy place this is it , I love the  atmosphere music no noise excellent attention to the costumer to every single detail, and delicious food, congratulations to the team , good organization.', '2025-03-28 01:43:27.305', '2025-03-28 01:43:27.305'),
	('cm8s4c5l5000mjp0ptgwm92ox', 'ChIJnVXWw_3RRIYRrdWBcLCiuyU', 'places/ChIJnVXWw_3RRIYRrdWBcLCiuyU/reviews/ChZDSUhNMG9nS0VJQ0FnTURBaWJHU09nEAE', 'a month ago', 5, 'Excellent service and excellent atmosphere. The food was incredible!! I have no idea why there wasn''t a huge crowd here but lucky us! The dessert was beautiful. We will definitely come back soon.', '2025-03-28 01:43:27.305', '2025-03-28 01:43:27.305'),
	('cm8s4c5l5000njp0pec9zzxym', 'ChIJnVXWw_3RRIYRrdWBcLCiuyU', 'places/ChIJnVXWw_3RRIYRrdWBcLCiuyU/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBNTlTNGRBEAE', 'a month ago', 5, 'We had the best evening! The staff was very kind, attentive and helpful with my gluten allergy. The food and dessert was absolutely delicious and they made me feel so celebrated! We will be going back!', '2025-03-28 01:43:27.305', '2025-03-28 01:43:27.305'),
	('cm8s4c5l5000ojp0ppbqda79b', 'ChIJnVXWw_3RRIYRrdWBcLCiuyU', 'places/ChIJnVXWw_3RRIYRrdWBcLCiuyU/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfamJ2NTJnRRAB', '2 months ago', 5, 'here is what you need to know before coming here:

upon entering we were greeted warmly and immediately seated it was a slow night for them on a Friday night but then again you do not just walk into this place without at least $100 a person to really enjoy all they have to offer

so the buffet all you can eat that''s about 60 bucks a person then of course they include 20% gratuity automatically cover your waiter

so I was gifted two gift cards to this place and they were very respectfully able to quickly just confirm and look up the balances on those gift cards and confirm I have learned just a hard way in the past always make sure when you are gifted something just double check before you even start the actual balance you were told is done to gift cards is actually on the gift cards

we immediately received it they took care of us they got us immediately drinks and they have by the way lots of drink options both alcoholic and non-alcoholic

My mom got a nice sparkly water with plenty of lime and a fancy wine glass

they accommodated me and got me hot water with lemons and lots and lots of hot water and lemons throughout the night which hit the spot I''m a huge fan of especially this time of season hot water and lemons!

by the way nothing here is cheap even the lemons and limes I could tell were organic fresh

immediately got us some rolls which I declined to save my appetite as a new I was coming here for the meat the meat and did I mention the meat!

they quickly got our plates got us a little cards did you flip like you do with all Brazilian steak places you''ve lifted up green to let the person know you''re still wanting more and let the person who comes by know if you want but you have to offer or not

And this night I tried over a dozen different variations of beef before finally getting to the lamb and I can tell you right now this place hit the spot and every way imaginable on the pallet

also they have a bar area for those that want to sip on any number of a thousand different variations of wine to have here this is one of their specialties to have wine to appease just about everybody''s pallet I can imagine

but this night I did not come for wine I came for meat!

and to treat my mom out who enjoyed all you can eat salad bar that was a part of the $60 price

My mom later don''t shared to see regretted maybe getting a little too much from the salad bar not more the meats!

so you got all variation kinds of shrimp pork chicken wrapped in pork chicken that by the way just even just get the chicken leg not wrapped in chicken that''s like marinated and honey and melts in your mouth the meat was literally some of the best chicken I''ve ever eaten in my entire life and that''s saying something

also they brought us some different sauces to try and I can tell you I loved all of them

lots of handicap options lots of options for the kids and also fancy men''s and women''s restrooms.

The lamb chops are the best ever I''ve ever a tasted in my entire life melted in my mouth highly recommend them!
Lamb steak was also amazing!

beef ribs or melt in your mouth with that just perfect combination of marination of just combination of seasonings and freshness and that charcoal that I love the mouth aftertaste

they had a orange sauce that''s sort of like a Chipotle but with a kick perfect my all-time favorite had to bring me multiples of it marinated just about everything in that stuff and sucked it up off my plate was absolutely delicious

also they''re green Verde salsa verde sauce was phenomenal with the lovely after kick burned it up

also did I mention I live dangerously hot so they brought me fresh cooked peppers with onions marinated and spices the light by a mouth on fire and every way imaginable to go with my food :-D

My mom opted for the flavorful and got lots of the tomatillo sauce which was phenomenal as well and goes with just about everything but a combination of flavors.

Also nothing came off as extra salty everything came off it''s just high quality & everyone here works as a team phenomenal service!', '2025-03-28 01:43:27.305', '2025-03-28 01:43:27.305'),
	('cm8s4c7es000pjp0p7ghk842i', 'ChIJR6i24x7NRIYRpi83Gih24BU', 'places/ChIJR6i24x7NRIYRpi83Gih24BU/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRcHVEd0F3EAE', '3 weeks ago', 5, 'I was blown away by everything! So much, I end up taking another plate to go!! It was my very first time trying Cava, so I wanted to start small. I was shocked to see the kind people in front of me order a Kids Pita, and all it came with!! For only $6.85 plus tax! Who knew I love hummus?!? The spicy chicken with the spicy sauce ( the red one) was soooo good and if that didn’t get me, the AMAZING customer service I received from all of the ladies on the line, including the cashier. Alysa, Sophie, Cyn, I hope I got those names right, and all the ladies who helped me. They were patient, helpful and very nice. They didn’t rush me or look at me crazy for not knowing a lot of the food items! I will be coming by more! Thanks for all you guys do! Oh and shout out to the manager who was assisting everyone when needed.', '2025-03-28 01:43:29.669', '2025-03-28 01:43:29.669'),
	('cm8s4c7es000qjp0pk113igzn', 'ChIJR6i24x7NRIYRpi83Gih24BU', 'places/ChIJR6i24x7NRIYRpi83Gih24BU/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmeGNpWTdRRRAB', '2 months ago', 3, 'For the 3rd time, the avocados had black spots all over, so I took them out & tossed them in the garbage.  This is the exact reason I stopped going to the Arboretum & it''s usually with takeout.  So now I will check before leaving, so if my avocados are black I''ll just request a refund because you should know better than to serve that mess.  I was loving the Harissa Chicken. Very disappointed AGAIN!', '2025-03-28 01:43:29.669', '2025-03-28 01:43:29.669'),
	('cm8s4c7es000rjp0pqvpevmwh', 'ChIJR6i24x7NRIYRpi83Gih24BU', 'places/ChIJR6i24x7NRIYRpi83Gih24BU/reviews/ChZDSUhNMG9nS0VJQ0FnSURIdklXMU5BEAE', '6 months ago', 5, 'The survice was excellent. Thanks to Janie, Alisa and Grace. They helped us make a selection that we were happy with. The blue berry lavender was amazing. We stopped in for a cold beverage. The food smelled so good that we had to try it. 10 out of 10 we will be coming back ❤️.', '2025-03-28 01:43:29.669', '2025-03-28 01:43:29.669'),
	('cm8s4c7es000sjp0pkhqw9g9x', 'ChIJR6i24x7NRIYRpi83Gih24BU', 'places/ChIJR6i24x7NRIYRpi83Gih24BU/reviews/ChdDSUhNMG9nS0VJQ0FnSURQM2ZyejB3RRAB', '3 months ago', 5, 'JC and Jaymin created a smooth and enjoyable experience at Cava domain! JC was my first point of contact here, incredibly friendly and explained all I needed to build the bowl. Having great staff makes a world of difference.

Location itself had great natural lighting and was clean, perfect spot to grab dinner rolling out of the Domain for the day.

Those pickled onion could keep me going for days! 🤝', '2025-03-28 01:43:29.669', '2025-03-28 01:43:29.669'),
	('cm8s4c7es000tjp0p39icwfdt', 'ChIJR6i24x7NRIYRpi83Gih24BU', 'places/ChIJR6i24x7NRIYRpi83Gih24BU/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYeWNiMTdBRRAB', '5 months ago', 5, 'I had a bowl with white rice, corn, spicy broccoli, sweet chicken, and pickled onions. The flavors were great! The sweet chicken and spicy broccoli balanced each other perfectly, and the pickled onions added a nice tangy touch. Everything tasted fresh and went well together. Would definitely recommend!', '2025-03-28 01:43:29.669', '2025-03-28 01:43:29.669'),
	('cm8s4ccju000ujp0p66lmbc7b', 'ChIJBx9zSnLNRIYRaOL0d79BQ7c', 'places/ChIJBx9zSnLNRIYRaOL0d79BQ7c/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRNGRxQVZBEAE', '3 weeks ago', 5, 'This place is such a gem! I love the mini golf course, and the drinks are delicious. The course is the right mix of fun, difficult and quirky! I highly recommend going here and playing a couple rounds of mini golf then grabbing an Orange Dreamsicle!!', '2025-03-28 01:43:36.33', '2025-03-28 01:43:36.33'),
	('cm8s4ccju000vjp0pscin88fj', 'ChIJBx9zSnLNRIYRaOL0d79BQ7c', 'places/ChIJBx9zSnLNRIYRaOL0d79BQ7c/reviews/ChZDSUhNMG9nS0VJQ0FnTURndThhNE9REAE', '4 weeks ago', 5, 'Tara, Noah, and LaSandra! 💯 seriously the most fun we could have had! Delicious food, such a fun course, best atmosphere. Thanks so much!', '2025-03-28 01:43:36.33', '2025-03-28 01:43:36.33'),
	('cm8s4ccju000wjp0p5cvhjn1b', 'ChIJBx9zSnLNRIYRaOL0d79BQ7c', 'places/ChIJBx9zSnLNRIYRaOL0d79BQ7c/reviews/ChdDSUhNMG9nS0VJQ0FnSURidTRQNzNnRRAB', '7 months ago', 4, 'Everything looked new, clean, and welcoming! They have a great choice of mocktails.  The queso had a great flavor and was a good sized appetizer to share. The wagyu burger had  delicious fresh taste! It was a bit better than the chicken sandwich. We initially planned to golf but then got so comfortable eating and catching up that we decided to rain check! The waiter was gracious to give us our time to visit with each other as it wasn’t too busy on a Thursday night!

Garage parking available not too far away. They do offer a military discount!', '2025-03-28 01:43:36.33', '2025-03-28 01:43:36.33'),
	('cm8s4ccju000xjp0p6dnzvq79', 'ChIJBx9zSnLNRIYRaOL0d79BQ7c', 'places/ChIJBx9zSnLNRIYRaOL0d79BQ7c/reviews/ChdDSUhNMG9nS0VJQ0FnTURRNTdxRG5RRRAB', 'a week ago', 4, 'really great place for spending fun time playing mini golf with friends, food was also great', '2025-03-28 01:43:36.33', '2025-03-28 01:43:36.33'),
	('cm8s4ccju000yjp0pv7kb0pnj', 'ChIJBx9zSnLNRIYRaOL0d79BQ7c', 'places/ChIJBx9zSnLNRIYRaOL0d79BQ7c/reviews/ChdDSUhNMG9nS0VJQ0FnSURudWViZ253RRAB', '3 months ago', 5, 'Perfect for a date night! Highly recommend! Mini Golf course was not hard at all and made for a great experience. Staff was great. Both food and drinks were on point!', '2025-03-28 01:43:36.33', '2025-03-28 01:43:36.33'),
	('cm8s9u1k20000l70vwz1ocm73', 'ChIJJ7D7i84J3IARHjL0tSiD_jY', 'places/ChIJJ7D7i84J3IARHjL0tSiD_jY/reviews/ChZDSUhNMG9nS0VJQ0FnSURfOVktVlhREAE', '2 months ago', 5, 'Sky Deck in Del Mar is one of my favorite spots, and I’m so glad it’s close to home! I go there at least once a week, whether it’s with family, friends, or guests from out of town, and sometimes by myself😊. It’s got such a cool vibe with its unique decor, beautiful setting, and something to offer for everyone.

The food options are amazing: some of the best ramen I’ve had, yummy sushi at The Glass Box, and the bar, Understory with cute, unique drinks with cool presentation. Overall, great, unique vibe. My kids can’t get enough of the croissants and coffee from the bakery, so it’s a win for all of us.

Plus, right underneath Sky Deck is Jimbo’s, a cool natural grocery store. I usually swing by there after a visit. Overall, Skydeck is a versatile and family-friendly spot, and I feel lucky to have it nearby!', '2025-03-28 04:17:19.97', '2025-03-28 04:17:19.97'),
	('cm8s9u1k20001l70vwev3izr7', 'ChIJJ7D7i84J3IARHjL0tSiD_jY', 'places/ChIJJ7D7i84J3IARHjL0tSiD_jY/reviews/ChZDSUhNMG9nS0VJQ0FnSURYdnByNE9REAE', '2 months ago', 5, 'The skydeck is an amazing family hangout place. There''s something for every age group to enjoy! Great restaurant choice that covers Thai, Mexican, Italian, and casual dining options. There''s so many other shopping options and quick dessert places too.', '2025-03-28 04:17:19.97', '2025-03-28 04:17:19.97'),
	('cm8s9u1k20002l70v2bsdw72q', 'ChIJJ7D7i84J3IARHjL0tSiD_jY', 'places/ChIJJ7D7i84J3IARHjL0tSiD_jY/reviews/ChdDSUhNMG9nS0VJQ0FnSUNibXJLQ25BRRAB', '8 months ago', 5, 'This is such a neat place for dinning experience.  I recently went with a friend and we got appetizers and share plates so that we could try different cuisine.

