It did get chilly with the large garage doors wide open when it was cold outside.', '2025-03-28 04:17:19.97', '2025-03-28 04:17:19.97'),
	('cm8s9u1k20004l70vygc7gtbb', 'ChIJJ7D7i84J3IARHjL0tSiD_jY', 'places/ChIJJ7D7i84J3IARHjL0tSiD_jY/reviews/ChdDSUhNMG9nS0VJQ0FnSUNkcDZfc3ZRRRAB', 'a year ago', 5, 'Very cool place to go sit back have a few beers and eat several different kinds of food. You can go up here and get your beer and then you can order from all the restaurants downstairs and they will bring it to you. You have a very nice view of del mar', '2025-03-28 04:17:19.97', '2025-03-28 04:17:19.97'),
	('cm8sewu1b0000jv11j8vr0s0d', 'ChIJpXBMUJscv4cRkkotim7-rtU', 'places/ChIJpXBMUJscv4cRkkotim7-rtU/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzM1lETzFnRRAB', '4 months ago', 1, 'I use to like ordering pizzas from this place, but not any more. The pizzas come out soggy and raw. I don''t know how you mess that up, you can see how bad it is! Don''t order pizzas from here. The pizza was in one piece, the photo was after I tried to pick up a couple of slices and you can see the raw dough in the second photo.', '2025-03-28 06:39:28.271', '2025-03-28 06:39:28.271'),
	('cm8sewu1b0001jv11o2hfscdv', 'ChIJpXBMUJscv4cRkkotim7-rtU', 'places/ChIJpXBMUJscv4cRkkotim7-rtU/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzNmNpUFR3EAE', '4 months ago', 1, 'Everywhere I can see it says this place opens up at 5 am waiting to get that Casey’s Coffee and here here it is 5:05 am

I see the people in the kitchen doing their job, but the whole store is still dark management isn’t doing their job by making sure the store opens when it’s supposed to and they don’t have any employees to do the job. So what’s the point of management if they can’t even set an example for employees..

I guess I’ll go give my money somewhere else 11-16-24', '2025-03-28 06:39:28.271', '2025-03-28 06:39:28.271'),
	('cm8sewu1b0002jv11d7nb3j7y', 'ChIJpXBMUJscv4cRkkotim7-rtU', 'places/ChIJpXBMUJscv4cRkkotim7-rtU/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2dnVLUkdnEAE', '3 months ago', 5, 'My son and I stopped here last night to pick up something to eat. I was impressed with how cheerful and friendly everyone was. It made for a really nice, welcoming, atmosphere you don''t usually encounter at a gas station. Makes me wish this was my local station.', '2025-03-28 06:39:28.271', '2025-03-28 06:39:28.271'),
	('cm8sewu1b0003jv110gwntco4', 'ChIJpXBMUJscv4cRkkotim7-rtU', 'places/ChIJpXBMUJscv4cRkkotim7-rtU/reviews/ChZDSUhNMG9nS0VJQ0FnSUNKLTdYYUpBEAE', 'a year ago', 1, 'My pizza had the veggies added AFTER the pizza was cooked and the pizza itself wasn''t even warm. Some training on how to slice a pizza would be nice because I have never had pizza cut into 1, 2, and 3 inch wedges before and I''m not a fan. Hands down worst pizza ever received from Casey''s. 0/10 won''t recommend or order from.', '2025-03-28 06:39:28.271', '2025-03-28 06:39:28.271'),
	('cm8sewu1b0004jv11v8ci4fvf', 'ChIJpXBMUJscv4cRkkotim7-rtU', 'places/ChIJpXBMUJscv4cRkkotim7-rtU/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzeXRhdUNREAE', '4 months ago', 1, 'Order a pizza online 2hr prior for pickup. Get there and everyone is on their cell phone. As soon as I say I''m here for the order they finally look up and haven''t even put my order in the oven yet.', '2025-03-28 06:39:28.271', '2025-03-28 06:39:28.271'),
	('cm8sezojv0005jv11ohpp6bv7', 'ChIJVVURQajLj4ARmkHLBpE-KP4', 'places/ChIJVVURQajLj4ARmkHLBpE-KP4/reviews/ChdDSUhNMG9nS0VJQ0FnTUR3eUx5Wm1BRRAB', 'in the last week', 4, 'Interesting concept and a cute icecream place right outside Santa Clara University. We tried their signature ‘founder’ flavor with espresso and really enjoyed it, although the waffle had a slight eggy taste.', '2025-03-28 06:41:41.131', '2025-03-28 06:41:41.131'),
	('cm8sezojv0006jv118h8h7087', 'ChIJVVURQajLj4ARmkHLBpE-KP4', 'places/ChIJVVURQajLj4ARmkHLBpE-KP4/reviews/ChZDSUhNMG9nS0VJQ0FnTURnMjdTMEZ3EAE', '4 weeks ago', 3, 'Interesting ice cream tacos with attractive flavors. But I wish they would offer on plates not just paper. Even the regular size is enough. 2 kiosks available to order. Would recommend trying.

Editing to add that we did ask for plate or anything to hold- to which we got a reply- “we use the same taco tray/boat for all orders”.', '2025-03-28 06:41:41.131', '2025-03-28 06:41:41.131'),
	('cm8sezojv0007jv11wwjw977c', 'ChIJVVURQajLj4ARmkHLBpE-KP4', 'places/ChIJVVURQajLj4ARmkHLBpE-KP4/reviews/ChdDSUhNMG9nS0VJQ0FnSUQ3eFBTN3J3RRAB', '7 months ago', 5, 'I loved Choco Tacos, so my son surprised me with a trip to Rocko''s on a recent visit. What a treat! Bright, fun graphics set the mood for an enjoyable experience. Loved all of the flavor options of ice cream and toppings. Got a little overwhelmed, so went with a menu option instead of a build your own.  Great move because Sugar Daddy was fabulous! Fun to watch them build, dip, and freeze your order. Loved that there were other menu options and coffee available. The copy is so much better than the original!', '2025-03-28 06:41:41.131', '2025-03-28 06:41:41.131'),
	('cm8sezojv0008jv11d6ouk9mz', 'ChIJVVURQajLj4ARmkHLBpE-KP4', 'places/ChIJVVURQajLj4ARmkHLBpE-KP4/reviews/ChdDSUhNMG9nS0VJQ0FnSUR6cXVIamxBRRAB', '9 months ago', 5, 'Tried this new ice cream place which serves ice creams in waffle taco shells which are frozen in liquid nitrogen. They are just delicious.
Pick one from their menu or create your own! :)

The staff is friendly and pretty quick with their service.', '2025-03-28 06:41:41.131', '2025-03-28 06:41:41.131'),
	('cm8sezojv0009jv11b77wwo06', 'ChIJVVURQajLj4ARmkHLBpE-KP4', 'places/ChIJVVURQajLj4ARmkHLBpE-KP4/reviews/ChZDSUhNMG9nS0VJQ0FnSURMaS1PS0d3EAE', '9 months ago', 5, 'Me and the family stumbled upon this ice cream gem after attending an event at Santa Clara University.  It’s across the street from the university.  It could be the greatest ice cream I’ve ever had.  I just had two scoops, but they are famous for their ice cream tacos.  When I’m in the area again I’ll definitely come here for ice cream.', '2025-03-28 06:41:41.131', '2025-03-28 06:41:41.131'),
	('cm8sf5wx7000ajv11fc325jsb', 'ChIJdYJdXltvv4cR3NZ55_3sjMo', 'places/ChIJdYJdXltvv4cR3NZ55_3sjMo/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmeV9lOXJRRRAB', '2 months ago', 4, 'You walk in and if you are not sitting at the bar, you have to wait in line and order. Then when your order is ready they call you to the back to pick it up. There are yummy homemade sauces near the pick up station for you to grab as well as pickles. They have gluten free and vegan hamburger buns and various non-meat patty options which was great for me. I ordered the “fire” (impossible) burger on a salad. It was good, not spicy enough though! They were sadly out of tofu fries. Overall, solid food and friendly staff.', '2025-03-28 06:46:31.916', '2025-03-28 06:46:31.916'),
	('cm8sf5wx8000bjv11jacgfcng', 'ChIJdYJdXltvv4cR3NZ55_3sjMo', 'places/ChIJdYJdXltvv4cR3NZ55_3sjMo/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2M05LQlJnEAE', '3 months ago', 5, 'We can hear on a Sunday afternoon and ordered the Kobe burger with truffle fries and a local beer. Excellent fresh taste! Very cool inclusive vibes and friendly helpful staff. 10/10 is a new favorite. Good job guys!', '2025-03-28 06:46:31.916', '2025-03-28 06:46:31.916'),
	('cm8sf5wx8000cjv11yhhngskj', 'ChIJdYJdXltvv4cR3NZ55_3sjMo', 'places/ChIJdYJdXltvv4cR3NZ55_3sjMo/reviews/ChdDSUhNMG9nS0VJQ0FnSUR2N2Ffa2xnRRAB', '3 months ago', 5, 'Arrived just after opening. The line was to the door within 10 minutes, but it moved quickly. We ordered shakes, a beer, two appetizers, two burgers, a corn dog and chicken tenders. Everything was amazing except the chicken tenders that my daughter claimed were so dry even ketchup couldn''t help!

The atmosphere  in this restaurant is the most chill I''ve experienced in a long time and we will come back whenever we''re in town for another game.', '2025-03-28 06:46:31.916', '2025-03-28 06:46:31.916'),
	('cm8sf5wx8000djv113nsutfdg', 'ChIJdYJdXltvv4cR3NZ55_3sjMo', 'places/ChIJdYJdXltvv4cR3NZ55_3sjMo/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBaXRxbFlBEAE', 'a month ago', 5, 'Love this place.  The best burgers!! Had a great conversation with the bartender Sammy today.  Very nice young lady!', '2025-03-28 06:46:31.916', '2025-03-28 06:46:31.916'),
	('cm8sf5wx8000ejv1187sbklt3', 'ChIJdYJdXltvv4cR3NZ55_3sjMo', 'places/ChIJdYJdXltvv4cR3NZ55_3sjMo/reviews/ChZDSUhNMG9nS0VJQ0FnSUMxeE5EdEFnEAE', 'a year ago', 5, 'Best burger in town in my opinion!
The menu options are fantastic, they have specials all the time as well.
Delicious burgers, and a vast assortment of fries. They make their own sauces and pickles too!
The milkshakes are phenomenal, especially the adult options.
They can get extremely busy! The line sometimes out the door. That can make the wait time a little rough, but so worth it.', '2025-03-28 06:46:31.916', '2025-03-28 06:46:31.916'),
	('cm8sg5ydt000fjv11g94ggx3d', 'ChIJkR9atLRvyYcRdfC6J0dZ5as', 'places/ChIJkR9atLRvyYcRdfC6J0dZ5as/reviews/ChZDSUhNMG9nS0VJQ0FnSURfd3BmSVlBEAE', '2 months ago', 4, 'Had a nice lunch, fair price for enchilada plate and a beer.

Had a miscommunication with waitress regarding my order. I would have been fine eating it as-is but they wanted to make it right without asking, I was impressed.

Food: sauces on enchiladas were quite tasty and freshly made. One of the better mole sauces I have had. Rice was very bland, beans were also bland, but more flavor than rice. Ground beef was just ok but had a nice fresh flavor. Chicken was good. Spinach (enchilada) was also fresh and tasty.

Nicer and cleaner than the average local family Mexican restaurant. Would recommend and would return.', '2025-03-28 07:14:33.425', '2025-03-28 07:14:33.425'),
	('cm8sg5ydt000gjv11sbho4el3', 'ChIJkR9atLRvyYcRdfC6J0dZ5as', 'places/ChIJkR9atLRvyYcRdfC6J0dZ5as/reviews/ChZDSUhNMG9nS0VJQ0FnTURReWE2aUdnEAE', '2 weeks ago', 5, 'Mexican food heaven is here. Since being from Texas I was missing this food and finally I found one. Everything I have tried so far is super delicious. The employees here are superb and well trained. Good luck to everybody here 👍', '2025-03-28 07:14:33.425', '2025-03-28 07:14:33.425'),
	('cm8sg5ydt000hjv11w03wd9ch', 'ChIJkR9atLRvyYcRdfC6J0dZ5as', 'places/ChIJkR9atLRvyYcRdfC6J0dZ5as/reviews/ChdDSUhNMG9nS0VJQ0FnSURGenF1aHNBRRAB', 'a year ago', 5, 'This was our first time visiting this restaurant and it was impactful. The servers were awesome. The waiter was so helpful and kind. The kids absolutely loved their meals. We ALL got full and took home two to go trays. The atmosphere was subtle and welcoming. Super impressionable and we will be eating here again when we are all together once more.', '2025-03-28 07:14:33.425', '2025-03-28 07:14:33.425'),
	('cm8sg5ydt000ijv112qexnfgx', 'ChIJkR9atLRvyYcRdfC6J0dZ5as', 'places/ChIJkR9atLRvyYcRdfC6J0dZ5as/reviews/ChdDSUhNMG9nS0VJQ0FnSUNyeU52Mi13RRAB', '8 months ago', 3, '1st time visiting this place as we were in from Texas. My food, the chicken enchiladas, was not bad. But my sister and nephews were not. Their food was drenched in cheese sauce. My sister specifically asked for NO cheese sauce. They brought her the wrong item and then brought the correct item drenched. I would most likely not visit here again.', '2025-03-28 07:14:33.425', '2025-03-28 07:14:33.425'),
	('cm8sg5ydt000jjv111yoskbtj', 'ChIJkR9atLRvyYcRdfC6J0dZ5as', 'places/ChIJkR9atLRvyYcRdfC6J0dZ5as/reviews/ChZDSUhNMG9nS0VJQ0FnSURmME91cFJREAE', '2 months ago', 5, 'Consistently the best spot for good Mexican inspired food. The service is great, food is hot and fresh, portions are large enough to actually fill you up and the price point is very fair. Great for a date night for 2 or a large crowd. I’ve even had business meetings here for 15 people and they were very accommodating. 10 stars.', '2025-03-28 07:14:33.425', '2025-03-28 07:14:33.425'),
	('cm8shtjqz0000jr0phctv0kew', 'ChIJw0m48PUA3IARdD9tnTL67Wc', 'places/ChIJw0m48PUA3IARdD9tnTL67Wc/reviews/ChdDSUhNMG9nS0VJQ0FnSURmbE8ycDVBRRAB', '2 months ago', 5, 'Best doughnut place in San Diego. Watching the doughnut swim is a very cool experience for children and even adults. Got even a fresh and warm doughnut! 🍩 Thanks! ♥️', '2025-03-28 08:00:53.819', '2025-03-28 08:00:53.819'),
	('cm8shtjqz0001jr0p2q5wqjl2', 'ChIJw0m48PUA3IARdD9tnTL67Wc', 'places/ChIJw0m48PUA3IARdD9tnTL67Wc/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfaE9QdGd3RRAB', '2 months ago', 1, 'This use to be a good place. I recently bought a dozen and the employees seems not interested in serving. Once I paid the employee just pushed the box to me. I had to ask for a bag. They didn''t even place is correctly on the bag. :( disappointed with the service.', '2025-03-28 08:00:53.819', '2025-03-28 08:00:53.819'),
	('cm8shtjqz0002jr0pd5wfpmor', 'ChIJw0m48PUA3IARdD9tnTL67Wc', 'places/ChIJw0m48PUA3IARdD9tnTL67Wc/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfNjhMODlnRRAB', '2 months ago', 5, 'The last few times I’ve been on the weekend in the morning, always hot freshly made donuts! Nothing like a dozen glazed. The iced coffee and iced lattes are also very good from here! Enjoy the cinematic of the donuts on the assembly line! 😁', '2025-03-28 08:00:53.819', '2025-03-28 08:00:53.819'),
	('cm8shtjqz0003jr0pfq06pyyz', 'ChIJw0m48PUA3IARdD9tnTL67Wc', 'places/ChIJw0m48PUA3IARdD9tnTL67Wc/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3aklxZ0xREAE', 'in the last week', 5, 'Picked up my birthday donuts (3). And purchased a Hershey''s special donut.

Great fast and friendly service.', '2025-03-28 08:00:53.819', '2025-03-28 08:00:53.819'),
	('cm8shtjqz0004jr0p1bjooeux', 'ChIJw0m48PUA3IARdD9tnTL67Wc', 'places/ChIJw0m48PUA3IARdD9tnTL67Wc/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzOXAyZUVREAE', '4 months ago', 4, 'Okay so this is normally one of the spots I hit if I want a HOT 🍩 donut because if you come at that right moment you can get one right off the rack HOT. Well yesterday 11/13/24 was World Kindness Day and they were offering a free dozen to the first 500 people.  Okay so I strolled in at 1259pm. A nice lady greeted me with a HOT glaze donut. I was dancing. At that moment there was noone ordering donuts inside but my daughter and I. We''ll a young lady walked to the counter to take my oder. I asked about the special free dozen, her response was "We sold out at 7am this morning, so the special ended. " I said to her you served 500 people at 7am this morning.  She was like, "Yes." So, I was so skeptical about that because it just didn''t make sense. So I said to her, can you please give me the HOT donuts cause I can see them on the belt. She picks up a dozen already made and says,"These are hot. We''ll I paid for them again asking about them serving 500 people at 7am. I get to the car and the donuts were COLD!! Like a normal shelf donut. I was so disappointed at Jasmine (the name on my receipt) cause I feel like she was just over it and that made me the customer not leave with a HOT dozen. I mean it''s whatever I had to pay, but I could have least left with what I asked for.', '2025-03-28 08:00:53.819', '2025-03-28 08:00:53.819'),
	('cm8skq01t0005jr0p8uyhr0n9', 'ChIJ1bwjGQCxj4ARk3g2XaSpZDY', 'places/ChIJ1bwjGQCxj4ARk3g2XaSpZDY/reviews/ChdDSUhNMG9nS0VJQ0FnTURROVoyRDZBRRAB', '2 weeks ago', 5, 'This is our go-to takeout spot, and we regularly pick up food from here. The service is great, with a friendly team at the front. The food quality is consistently excellent, and there’s a great variety of options to choose from. The coffee and breakfast dishes are among my favorites. The restaurant is always clean, and the seating is quite comfortable.

Pro tip: Weekday/ weekend  brunch is a must!', '2025-03-28 09:22:07.17', '2025-03-28 09:22:07.17'),
	('cm8skq01t0006jr0pu7tpwpld', 'ChIJ1bwjGQCxj4ARk3g2XaSpZDY', 'places/ChIJ1bwjGQCxj4ARk3g2XaSpZDY/reviews/ChdDSUhNMG9nS0VJQ0FnTURRcDZhUnJRRRAB', 'a week ago', 5, 'Good restaurant to try. Good ambience and food is good too. When you visit you should definitely try Dosa and Filter coffee. You should get Idly batter home so that you can make dosa at home.', '2025-03-28 09:22:07.17', '2025-03-28 09:22:07.17'),
	('cm8skq01t0007jr0pnbrnpzwi', 'ChIJ1bwjGQCxj4ARk3g2XaSpZDY', 'places/ChIJ1bwjGQCxj4ARk3g2XaSpZDY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNINWN5TFdREAE', '5 months ago', 5, 'Simple vegetarian food. Authentic South Indian flavors. Not too spicy, loved their sambar & tomato chutney. Vada and Idly are their top items. Filter coffee is real deal!', '2025-03-28 09:22:07.17', '2025-03-28 09:22:07.17'),
	('cm8skq01t0008jr0pkmoywtxa', 'ChIJ1bwjGQCxj4ARk3g2XaSpZDY', 'places/ChIJ1bwjGQCxj4ARk3g2XaSpZDY/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBMi0zWG1RRRAB', 'a month ago', 5, 'Best Idli in Mountain View. It’s melt in the mouth. Even the medu vada was really very crispy and flavourful. Their portion size is pretty decent so value for money is also good!!', '2025-03-28 09:22:07.17', '2025-03-28 09:22:07.17'),
	('cm8skq01t0009jr0ph1wsqsho', 'ChIJ1bwjGQCxj4ARk3g2XaSpZDY', 'places/ChIJ1bwjGQCxj4ARk3g2XaSpZDY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNQNlBlWlZnEAE', '3 months ago', 3, 'Loved the idli and masala dosa when this idli express chain opened. The filter coffee amazing!! Compared to other idly express, this place has a nice seating area!

But this week and the week before that, the benne masala dosa felt like fried oil was used to make it. Not sure what is happening….', '2025-03-28 09:22:07.17', '2025-03-28 09:22:07.17'),
	('cm8sxjpb90000jl0mkwazlr0t', 'ChIJOeGYLltvv4cRFQXi4Obzqpw', 'places/ChIJOeGYLltvv4cRFQXi4Obzqpw/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3bzVtWmRBEAE', 'a week ago', 1, 'My daughter''s favorite place to go to when back in Lawrence. We are visiting from Oregon.So I tried it this morning. Big disappointment at least for my friend and I. We both ordered the French toast with berries and cream. Only I never got mine. My friend decided to share hers with me while I waited and we ended up eating her so it wouldn''t get cold and I decided to cancel my order. When going back to cancel it. I was told The order never got put in even though it was on the same ticket. Sure I got a I''m sorry and money back on it but I was really disappointed. I''ll go to Lady Bird next time. Excellent service. Excellent food.', '2025-03-28 15:21:08.323', '2025-03-28 15:21:08.323'),
	('cm8sxjpb90001jl0mpuwvcsxm', 'ChIJOeGYLltvv4cRFQXi4Obzqpw', 'places/ChIJOeGYLltvv4cRFQXi4Obzqpw/reviews/ChdDSUhNMG9nS0VJQ0FnSURQN01HanhRRRAB', '3 months ago', 5, 'Perfectly cozy cafe, reminds me a lot of when I lived in Japan. This cafe is what all should strive to feel like. Home made fresh baked bread, which they also use in their food. Friendly staff. I mentioned splitting 1 sandwich with my grandpa, and they served them to us on separate plates and gave us each a pickle, which they didnt have to do. So much care went into serving us and we could tell!', '2025-03-28 15:21:08.323', '2025-03-28 15:21:08.323'),
	('cm8sxjpb90002jl0mh1lipkn4', 'ChIJOeGYLltvv4cRFQXi4Obzqpw', 'places/ChIJOeGYLltvv4cRFQXi4Obzqpw/reviews/ChdDSUhNMG9nS0VJQ0FnSURIMC1pVTlnRRAB', '6 months ago', 5, 'The food here was amazing! In my opinion, their croissant sandwich and their breakfast bowl were delicious. In the croissant sandwich, there was melted cheese, ham, on a fluffy croissant. And by fluffy, I mean fluffy, like biting down on air The breakfast bowl was fantastic, with delicious potatoes, kale and mushrooms, topped with eggs. I will head here again, just to try their lunch menu!', '2025-03-28 15:21:08.323', '2025-03-28 15:21:08.323'),
	('cm8sxjpb90003jl0m5b8e7yhp', 'ChIJOeGYLltvv4cRFQXi4Obzqpw', 'places/ChIJOeGYLltvv4cRFQXi4Obzqpw/reviews/ChdDSUhNMG9nS0VJQ0FnSUQ3MnBEcmh3RRAB', '7 months ago', 5, 'What a quaint bakery with outstanding quality artisan breads and baked goods.  The breakfast and lunch menu is sure to satisfy even the pickiest of eaters.

It’s well worth the one block walk off of mass street. They have a great patio that’s in the shade where you can enjoy your meals or coffee.

Staff is attentive and the place is clean with great bathrooms too.

The biscuits and gravy is always a great way to start the day', '2025-03-28 15:21:08.323', '2025-03-28 15:21:08.323'),
	('cm8sxjpb90004jl0m2b7rd0cl', 'ChIJOeGYLltvv4cRFQXi4Obzqpw', 'places/ChIJOeGYLltvv4cRFQXi4Obzqpw/reviews/ChdDSUhNMG9nS0VJQ0FnTURBODhiRW5RRRAB', 'a month ago', 5, 'One of my favorite places on Mass for coffee and brunch. Their food is always fresh and delicious, and the location is great for cozy people-watching.

The staff is great, I only knocked off a star because you very much have to fend for yourself during the morning rushes. The service counter is difficult to reach through the crowd and you''re not always guaranteed a seat, so just be prepared if you go during peak hours.

Overall, I consider it a must-visit if you''re in town and I take all of my friends there if they''ve never been!', '2025-03-28 15:21:08.323', '2025-03-28 15:21:08.323'),
	('cm8sxrc400005jl0m40fzjxhx', 'ChIJk-AnftL9vocRERjeZQlggS4', 'places/ChIJk-AnftL9vocRERjeZQlggS4/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3bVptdFV3EAE', 'a week ago', 5, 'I love Pineapple Dream! Great prices and tasty flavors that change weekly. I have always had a great experience and would recommend this place to anyone looking for a sweet treat.', '2025-03-28 15:27:04.465', '2025-03-28 15:27:04.465'),
	('cm8sxrc400006jl0mghrkg79z', 'ChIJk-AnftL9vocRERjeZQlggS4', 'places/ChIJk-AnftL9vocRERjeZQlggS4/reviews/ChZDSUhNMG9nS0VJQ0FnTURncDRIeFV3EAE', '4 weeks ago', 5, 'First time finding this place and loooooved it! So good and very impressed with price you pay and amount you get! Will definitely be a regular, especially for summer', '2025-03-28 15:27:04.465', '2025-03-28 15:27:04.465'),
	('cm8sxrc400007jl0moa84d3q5', 'ChIJk-AnftL9vocRERjeZQlggS4', 'places/ChIJk-AnftL9vocRERjeZQlggS4/reviews/ChZDSUhNMG9nS0VJQ0FnSURSNlB1d2ZBEAE', 'a year ago', 4, 'Nice ice cream or whip dessert 🍨 in Topeka, Kansas

Cool mellow vibe inside.  It''s pretty straightforward. The menu is simple.

I got the pineapple whip, and it was great. Not Hawai''i Dole good but definitely a contender.
They have outdoor seating. And a drive-thru for your convenience.', '2025-03-28 15:27:04.465', '2025-03-28 15:27:04.465'),
	('cm8sxrc400008jl0mq48knx58', 'ChIJk-AnftL9vocRERjeZQlggS4', 'places/ChIJk-AnftL9vocRERjeZQlggS4/reviews/ChZDSUhNMG9nS0VJQ0FnSUR4bkpHb0tnEAE', 'a year ago', 5, 'Mahalo! This place truly is a dream. I have had the pineapple whip at the Dole plantation in Hawaii and at Disney World and let me tell you, this is it. The pineapple whip here is the reason I come back. Oh, the the others flavors are good as well.', '2025-03-28 15:27:04.465', '2025-03-28 15:27:04.465'),
	('cm8sxrc400009jl0mz7ndvuev', 'ChIJk-AnftL9vocRERjeZQlggS4', 'places/ChIJk-AnftL9vocRERjeZQlggS4/reviews/ChZDSUhNMG9nS0VJQ0FnSURULU4yb0V3EAE', '10 months ago', 5, 'So delicious! My family and I love Pineapple Dream. I am gluten and dairy free so my food restrictions make it challenging to have treats at most restaurants in town. Not at Pineapple Dream! Everyone in my family is able to get the flavor they enjoy and part of the fun is looking up the flavors ahead of time. They change the flavors weekly and have many flavors that rotate in and out with the seasons. It’s worth waiting for Peppermint in the winter and Shamrock Mint in the spring!', '2025-03-28 15:27:04.465', '2025-03-28 15:27:04.465'),
	('cm8t1aukq0000jp0kxn36jjy7', 'ChIJH4_F49Kaa4cRZO6CggKBYwo', 'places/ChIJH4_F49Kaa4cRZO6CggKBYwo/reviews/ChdDSUhNMG9nS0VJQ0FnTUR3NUpXSXJBRRAB', 'in the last week', 5, 'Had an awesome specialty coffee. The outdoor patio with live street music and the warmth of the morning sun is a wonderful thing.', '2025-03-28 17:06:13.706', '2025-03-28 17:06:13.706'),
	('cm8t1aukq0001jp0kx09ctojo', 'ChIJH4_F49Kaa4cRZO6CggKBYwo', 'places/ChIJH4_F49Kaa4cRZO6CggKBYwo/reviews/ChdDSUhNMG9nS0VJQ0FnSUNQcHJ1XzhnRRAB', '4 months ago', 5, 'Great place in downtown Golden to chill out! My dog loves it, too!', '2025-03-28 17:06:13.706', '2025-03-28 17:06:13.706'),
	('cm8t1aukq0002jp0klmfxi87h', 'ChIJH4_F49Kaa4cRZO6CggKBYwo', 'places/ChIJH4_F49Kaa4cRZO6CggKBYwo/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYZy1pNUlBEAE', '5 months ago', 2, 'Froyo being one of the few foods I can stomach while pregnant, I’ve been touring all the local spots. This place is the worst so far. If you like overly sweet artificial flavors (and no tart) then maybe you’ll like it here.', '2025-03-28 17:06:13.706', '2025-03-28 17:06:13.706'),
	('cm8t1aukq0003jp0kyxiuw8pn', 'ChIJH4_F49Kaa4cRZO6CggKBYwo', 'places/ChIJH4_F49Kaa4cRZO6CggKBYwo/reviews/ChdDSUhNMG9nS0VJQ0FnSUNIemJqQWp3RRAB', '6 months ago', 2, 'Nothing crazy to ride home about. Super over priced like all the other reviews are saying, and it’s just typical self-serve frozen yogurt. We got way more than we wanted because we didn’t realize how fast it came out. The mango was icy and 100% sugar. The cookies and cream was eh. I didn’t mind that someone put on the toppings as I’m not picky about that, but overall super over priced and definitely not worth it. It was an impulse sweet treat! Staff were nice', '2025-03-28 17:06:13.706', '2025-03-28 17:06:13.706'),
	('cm8t1aukq0004jp0kp1vuukzp', 'ChIJH4_F49Kaa4cRZO6CggKBYwo', 'places/ChIJH4_F49Kaa4cRZO6CggKBYwo/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYbzllN0pREAE', '5 months ago', 1, 'Absolutely a joke.  Needs to shut down. $28 for 2 small icy, NOT FROZEN YOGURT, watery attempts at a dessert disappointment. Don’t mess with Dairy if you’ve never been to Wisconsin', '2025-03-28 17:06:13.706', '2025-03-28 17:06:13.706'),
	('cm8t1ay1b0005jp0ktr4dzx4v', 'ChIJs_jMnq6ba4cRQZYv80O1fnw', 'places/ChIJs_jMnq6ba4cRQZYv80O1fnw/reviews/ChdDSUhNMG9nS0VJQ0FnTUNReVpYVTVnRRAB', '3 weeks ago', 5, 'We started visiting Humble House in summer 2023 while visiting our best friends in Golden. I quickly became hooked. The coffee is amazing, and the people are so incredibly nice. It is a must do *multiple times* whenever we are out to visit. Businesses like this is what keep downtowns thriving. Cannot wait for our 2025 visit this fall!', '2025-03-28 17:06:18.192', '2025-03-28 17:06:18.192'),
	('cm8t1ay1b0006jp0ke0cqykly', 'ChIJs_jMnq6ba4cRQZYv80O1fnw', 'places/ChIJs_jMnq6ba4cRQZYv80O1fnw/reviews/ChdDSUhNMG9nS0VJQ0FnSUNINnJTUzN3RRAB', '6 months ago', 5, 'Humble House Cafe is a true gem in Golden! From the moment you walk in, you''re greeted with warmth and kindness that makes you feel right at home. The atmosphere is cozy, whether you''re inside enjoying the art-filled space or outside on the cute patio. I had a delicious nitro cold brew that was absolutely perfect. I even found a cool "Welcome to Colorful Colorado" souvenir that added a special touch to my visit. The Sojourner breakfast sandwich on an everything bagel was amazing, though a bit messy (in the best way!). Even when it''s busy, the service is quick, and the staff is always friendly. I was recommended to visit by Laura Long, and I''m so glad I did! Whether you''re grabbing a quick coffee or settling in for a relaxing brunch, Humble House Cafe is a must-visit. Highly recommended!', '2025-03-28 17:06:18.192', '2025-03-28 17:06:18.192'),
	('cm8t1ay1b0007jp0knv54pmma', 'ChIJs_jMnq6ba4cRQZYv80O1fnw', 'places/ChIJs_jMnq6ba4cRQZYv80O1fnw/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnOVpMalVBEAE', 'a month ago', 5, 'Great spot in Golden! Coffee was great and quite inviting atmosphere to work and gather. We were by the door and the draft was quite cold but other than that we loved this spot!', '2025-03-28 17:06:18.192', '2025-03-28 17:06:18.192'),
	('cm8t1ay1b0008jp0kcotmcluw', 'ChIJs_jMnq6ba4cRQZYv80O1fnw', 'places/ChIJs_jMnq6ba4cRQZYv80O1fnw/reviews/ChdDSUhNMG9nS0VJQ0FnSURubmU2Q2lnRRAB', '5 months ago', 5, 'Great place! Has some cute gift items, small pastries, and delicious breakfast sandwiches! Their coffee, smoothies, and tea menu are unique! You can even add cinnamon toast crunch to the top of your drink!', '2025-03-28 17:06:18.192', '2025-03-28 17:06:18.192'),
	('cm8t1ay1b0009jp0kl8cj7u17', 'ChIJs_jMnq6ba4cRQZYv80O1fnw', 'places/ChIJs_jMnq6ba4cRQZYv80O1fnw/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRMnFLYmJ3EAE', '3 weeks ago', 5, 'Love this place!!!  Great Vibe!!  Real flowers on the tables. Pastries were amazing. Coffee was yummy. Pricing structure was not clear so that could be improved. I think they charged for a mug to stay and drink but then I think that might have been a charge for a larger drink. Also, I paid for coffee with milk $4 and then was charge more for regular milk. So that part could be worked on from a customer point of view. But I wish I had a place like this in our town, I would be there all the time. Whoever owns this cafe did a fabulous job putting it together. Lots of love. ❤️', '2025-03-28 17:06:18.192', '2025-03-28 17:06:18.192'),
	('cm8t1az1z000ajp0k3zg1qfgk', 'ChIJdUUM8dKaa4cR8-EPhVSqCHo', 'places/ChIJdUUM8dKaa4cR8-EPhVSqCHo/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2NV9pdVl3EAE', '3 months ago', 4, 'Nice little cafe just under the “Welcome to Golden,” sign. Enjoyed a beer with lunch, had the Thunderbird turkey sandwich. Food is good, the service is decent, the atmosphere is terrific!', '2025-03-28 17:06:19.512', '2025-03-28 17:06:19.512'),
	('cm8t1az1z000bjp0kek4vlf75', 'ChIJdUUM8dKaa4cR8-EPhVSqCHo', 'places/ChIJdUUM8dKaa4cR8-EPhVSqCHo/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3OVB6NlRREAE', 'in the last week', 5, 'Came in on a beautiful Sunday afternoon, and this place was definitely busy.  The sandwiches we had were absolutely delicious, all ingredients were fresh. Better than the franchise competitors on the same street. The pumpkin bread was the best I’ve ever had, and it was gluten free. We had Arnold palmers which were perfect. I am so excited to come back and try more of the menu, including the coffee! Naiarah helped us out today and her service was exceptional! She went above and beyond during our experience. My fiancé and I spent our visit planing our many future trips to Windy Saddle this summer. A definite new Golden favorite! We won’t be coming to town again without stopping by Windy Saddle! I’m upset we’ve been missing out for too long!', '2025-03-28 17:06:19.512', '2025-03-28 17:06:19.512'),
	('cm8t1az1z000cjp0kbr65606d', 'ChIJdUUM8dKaa4cR8-EPhVSqCHo', 'places/ChIJdUUM8dKaa4cR8-EPhVSqCHo/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRNDd5VTFBRRAB', '3 weeks ago', 5, 'I’ve given a mapping talk in this café in the past and it was great to be back… This time for breakfast. It was so incredible. I had a avocado toast with an egg on it and lots of sprouts… And the fruit too. Thank you all. Oh and the dark roast coffee was superb.', '2025-03-28 17:06:19.512', '2025-03-28 17:06:19.512'),
	('cm8t1az1z000djp0kb1t9iy0t', 'ChIJdUUM8dKaa4cR8-EPhVSqCHo', 'places/ChIJdUUM8dKaa4cR8-EPhVSqCHo/reviews/ChZDSUhNMG9nS0VJQ0FnSUNINWYtNERBEAE', '6 months ago', 5, 'I needed a pick me up on the way down from a wedding in the mountains, and we stopped into Windy Saddle Cafe. over Labor Day weekend(!)   and they were packed- both inside and outside. The line moved quickly and the staff were incredibly kind and helpful. There were people of all ages and walks of life, lots of laughter and it looked like the kind of place where everyone is welcome. I tasted my first sip and was overjoyed when I found out that they were serving my favorite espresso EVER  by Kaladi Coffee. If I lived close by I would go there every day. They have dairy and gluten free food options, a play area for kids, adorbs store merch and a cute little library. Not to mention the perfect location to take a picture under the Golden arch and it''s a block away from the creek. I''ll stop by again and take better pictures and get more of that yummy coffee again soon!', '2025-03-28 17:06:19.512', '2025-03-28 17:06:19.512'),
	('cm8t1az1z000ejp0ktxfkap0k', 'ChIJdUUM8dKaa4cR8-EPhVSqCHo', 'places/ChIJdUUM8dKaa4cR8-EPhVSqCHo/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzdG9pcy1nRRAB', '4 months ago', 5, 'The best strawberry chocolate cheesecake I ever had, coupled with one of the best lattes ever - one can’t ask for more than this to be happy :)
BTW, the service was prompt and courteous..', '2025-03-28 17:06:19.512', '2025-03-28 17:06:19.512'),
	('cm8t1b2df000fjp0kv0f8igc9', 'ChIJZVdjhPOba4cR0e3Q4w3jUDM', 'places/ChIJZVdjhPOba4cR0e3Q4w3jUDM/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRcXFDVFNnEAE', '3 weeks ago', 5, 'Red Silo cup… I fill you up!

The day after flying into Denver, Cassey, Caleb and I went to Golden to do some exploring. I asked if we could stop somewhere for coffee since that’s my jam and so we took to exploring the downtown area of Golden for that sweet sweet caffeine hit.

We had a few options but Red Silo won since I was looking for a more traditional coffeehouse versus some place that just served coffee. So, we dipped in and got in line for some espresso delish.

But! Their espresso machine was currently broken so I was heartbroken to not get my usual americano. With that depressing news, I had to think quick for something else. I settled on a cold brew and eyed the delicious-looking baked goods in the display case as Cassey placed her order.

While you can sit in and enjoy your coffee, we were on an adventure so we took our drinks to-go. Plus with all the foot traffic coming and going, it might not be the most relaxing place to sip and sit.

The cold brew was pretty decent. My brain is pretty hardwired for americanos so it took a few sips to adjust to the cold brew but once I did, it was pretty tasty. Not my usual cup of…. tea but not bad overall. Maybe adding some flavor to this would’ve kicked it up a notch since I was out of my norm but it was pretty decent and did it’s job.

The baristas were super friendly and accommodating to trying to make the drinks people wanted besides us. Having a broken espresso machine must be stressful for the staff but the baristas took it in stride and did great.

If you find yourself wandering around Golden and need some coffee for your walk, Red Silo will get you jittery.', '2025-03-28 17:06:23.811', '2025-03-28 17:06:23.811'),
	('cm8t1b2df000gjp0ksjyhj55i', 'ChIJZVdjhPOba4cR0e3Q4w3jUDM', 'places/ChIJZVdjhPOba4cR0e3Q4w3jUDM/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBbjZDVTFRRRAB', 'a month ago', 5, 'HUGE fan of Red Silo- Golden! My friend David introduced me to it, and it''s been my favorite in the area since my first visit.  The staff here is always friendly and super knowledgeable about their coffee – you can tell they’re passionate about what they do. The shop can get busy on weekends, but they move the line quickly, so you’re never waiting too long.

Their roasted coffee is hands down the best in the area, and I really appreciate that all their offerings are single-origin, which is pretty impressive! It''s clear they take a lot of care in sourcing quality beans.

I also love the convenience of being able to order ahead online, and it’s a great touch that they offer digital gift cards – perfect for gifting to coffee lovers. Highly recommend this place for anyone who appreciates good coffee and a welcoming vibe!', '2025-03-28 17:06:23.811', '2025-03-28 17:06:23.811'),
	('cm8t1b2df000hjp0k6t786k8u', 'ChIJZVdjhPOba4cR0e3Q4w3jUDM', 'places/ChIJZVdjhPOba4cR0e3Q4w3jUDM/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBNzk3V1NREAE', 'a month ago', 5, 'The coffee is great. The baked goods are also hard to pass up each time I go in. I recommend the cinnamon rolls! Also, my wife has dairy and gluten allergies and they are very accommodating with orders. Staff is genuinely friendly. Can’t recommend Red Silo enough!', '2025-03-28 17:06:23.811', '2025-03-28 17:06:23.811'),
	('cm8t1b2df000ijp0k923e0rp9', 'ChIJZVdjhPOba4cR0e3Q4w3jUDM', 'places/ChIJZVdjhPOba4cR0e3Q4w3jUDM/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzbzR5bllBEAE', '4 months ago', 5, 'The girls working were super nice and helped us with the snow coming and what we could do.   Super friendly and the coffee was awesome.    They have a nice little sitting area in the back that is super nice. Great place and worth the stop', '2025-03-28 17:06:23.811', '2025-03-28 17:06:23.811'),
	('cm8t1b2df000jjp0kngnfj77d', 'ChIJZVdjhPOba4cR0e3Q4w3jUDM', 'places/ChIJZVdjhPOba4cR0e3Q4w3jUDM/reviews/ChZDSUhNMG9nS0VJQ0FnSURidmU3V01BEAE', '7 months ago', 5, 'This is my favorite espresso place in town.  I enjoy an Americano with heavy cream at the bottom of the cup.  They did not disappoint, perfect cup of coffee to greet the day.

Also, based on another review I saw, I need to tell you that they really are Service Dog Friendly.', '2025-03-28 17:06:23.811', '2025-03-28 17:06:23.811'),
	('cm8t1b6g20000kw0j5xce3d0a', 'ChIJ28Sda9Oaa4cRFHYz1aFYtWQ', 'places/ChIJ28Sda9Oaa4cRFHYz1aFYtWQ/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3OU1xZ2t3RRAB', 'a week ago', 5, 'I love love love this place! I got an iced chai latte and the breakfast burrito and both were amazing. It was really crowded but I was still able to find a spot to enjoy my breakfast and read my book. All the employees were very nice and conversational. I will say it is a little expensive but the burrito was huge. I’ll definitely be stopping by again!!', '2025-03-28 17:06:29.09', '2025-03-28 17:06:29.09'),
	('cm8t1b6g20001kw0jsgaf0u7i', 'ChIJ28Sda9Oaa4cRFHYz1aFYtWQ', 'places/ChIJ28Sda9Oaa4cRFHYz1aFYtWQ/reviews/ChdDSUhNMG9nS0VJQ0FnSURfbFl1eW13RRAB', '2 months ago', 4, 'Overall this is an amazing spot! My family and I loved it! Extremely respectful, helpful, and nice staff. Super clean restaurant. Fast service, and even BETTER FOOD! We enjoyed our coffees as well. Thank you for making our Denver vacation great!', '2025-03-28 17:06:29.09', '2025-03-28 17:06:29.09'),
	('cm8t1b6g20002kw0jptq6j2je', 'ChIJ28Sda9Oaa4cRFHYz1aFYtWQ', 'places/ChIJ28Sda9Oaa4cRFHYz1aFYtWQ/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBcGYzTVdnEAE', 'a month ago', 5, 'Fantastic food, even at their busiest hour everyone working so kind and helpful. Delicious food and drinks. The line moves fast and the food comes out even faster once you find a seat. Nice outdoor seating available.', '2025-03-28 17:06:29.09', '2025-03-28 17:06:29.09'),
	('cm8t1b6g20003kw0jrtrzfgk2', 'ChIJ28Sda9Oaa4cRFHYz1aFYtWQ', 'places/ChIJ28Sda9Oaa4cRFHYz1aFYtWQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzNE8tVndnRRAB', '4 months ago', 5, 'Love this gem of a place!!! Delicious coffee, their seasonal apple cider old fashioned, and vegan breakfast burritos were yummy! We went there yesterday and came back today. Loved that I could get some work done on my laptop too. My favorite thing was how attentive and friendly the staff were! They go above and beyond here. Highly recommend!', '2025-03-28 17:06:29.09', '2025-03-28 17:06:29.09'),
	('cm8t1b6g20004kw0jzjrm6sd2', 'ChIJ28Sda9Oaa4cRFHYz1aFYtWQ', 'places/ChIJ28Sda9Oaa4cRFHYz1aFYtWQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUNud05mQjZ3RRAB', '6 months ago', 5, '9/9/24
Café 13 was a fantastic breakfast spot! My husband, mother-in-law, and I enjoyed the fully loaded avocado toast, a delicious coffee bun, (definitely get this to try if you’re into a ‘not too sweet’ dessert option) and a phenomenal kombucha on tap! The latte was smooth and perfectly made. Service was quick, and we loved the self-seating option outside. Highly recommend this cozy café to anyone looking for a relaxed and tasty start to their day!', '2025-03-28 17:06:29.09', '2025-03-28 17:06:29.09'),
	('cm8t1ouxu0000jl0zn5qggccq', 'ChIJ4xEqKwC1RIYRfk1S-UosQ84', 'places/ChIJ4xEqKwC1RIYRfk1S-UosQ84/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3a3RINlp3EAE', 'a week ago', 5, 'So happy San Ginés opened on South Lamar in Austin. This place has a great international vibe, attentive, helpful and kind staff, a dog friendly patio, tasty drinks and killer food! I came on a Sunday for brunch and enjoyed the music, people watching and perfect weather all from the outdoor bar with our English Bulldog in tow. Shout out to our  bartender, Pablo who took excellent care of us. We’ll be back as often as we can ❤️', '2025-03-28 17:17:07.362', '2025-03-28 17:17:07.362'),
	('cm8t1ouxu0001jl0ziwz6teft', 'ChIJ4xEqKwC1RIYRfk1S-UosQ84', 'places/ChIJ4xEqKwC1RIYRfk1S-UosQ84/reviews/ChZDSUhNMG9nS0VJQ0FnSURfc3FxYllREAE', '2 months ago', 5, 'The churros were perfect! Crunchy, tasty even on their own 😍 the Spanish dipping chocolate was thick, high quality and not overly sweet. Just like Europeans do it!!

The space is very cute with a lot more seating inside and outside than it seemed from pictures. People were so kind and nice!

My new favorite dessert place!', '2025-03-28 17:17:07.362', '2025-03-28 17:17:07.362'),
	('cm8t1ouxu0002jl0zfpcvkmg6', 'ChIJ4xEqKwC1RIYRfk1S-UosQ84', 'places/ChIJ4xEqKwC1RIYRfk1S-UosQ84/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzNFlIRlp3EAE', '4 months ago', 5, 'Despite the wait this place is great. It''s best to think of this as a lounge that has food rather than a restaurant. They cook out of a trailer so there is not a huge kitchen in the back. The seating inside is lovely, the outdoor patio has plenty of shaded tables and couches. The food is excellent. The cocktails were good, if pricey.  The chocolate and churros were as good as anything I had in Spain.', '2025-03-28 17:17:07.362', '2025-03-28 17:17:07.362'),
	('cm8t1ouxu0003jl0zzzjx624k', 'ChIJ4xEqKwC1RIYRfk1S-UosQ84', 'places/ChIJ4xEqKwC1RIYRfk1S-UosQ84/reviews/ChdDSUhNMG9nS0VJQ0FnSUR2djhMd3p3RRAB', '3 months ago', 5, 'So glad this place is finally open.
Austin has plenty of good Asian, Mexican, and BBQ joints...but direly misses European flavors.

I only had the Catalan coffee.
But will return for a proper meal  of tapas and cocktails soon.

Very good vibe and staff from first impression.', '2025-03-28 17:17:07.362', '2025-03-28 17:17:07.362'),
	('cm8t1ouxu0004jl0z9fgzi8b5', 'ChIJ4xEqKwC1RIYRfk1S-UosQ84', 'places/ChIJ4xEqKwC1RIYRfk1S-UosQ84/reviews/ChdDSUhNMG9nS0VJQ0FnTURRa2RTMzBRRRAB', '2 weeks ago', 4, 'Churros are delicious! Just like Madrid — except that they don’t serve the chocolate in a glass mug but use a paper cup (which is very wasteful). Atmosphere and aesthetic are amazing. Parking spots are extremely small and limited.', '2025-03-28 17:17:07.362', '2025-03-28 17:17:07.362'),
	('cm8t4czba0005jl0zz4yuhsbb', 'ChIJCar0f49ZwokR6ozLV-dHNTE', 'places/ChIJCar0f49ZwokR6ozLV-dHNTE/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3cExHaVZREAE', 'in the last week', 5, 'This place tastes completely different from when I first came from Korea over ten years ago. Back then, I couldn’t understand why it was so popular—I couldn’t even finish it and ended up throwing it away. But this time? It was a genuinely delicious sandwich. I’m not sure what changed—maybe it’s because I added cheese, or maybe I’ve just gotten used to American flavors—but one thing’s for sure: this place is definitely worth a visit. Highly, highly recommended. Adding cheese makes pastrami sandwich much better I guess.', '2025-03-28 18:31:52.007', '2025-03-28 18:31:52.007'),
	('cm8t4czbb0006jl0zazdjie32', 'ChIJCar0f49ZwokR6ozLV-dHNTE', 'places/ChIJCar0f49ZwokR6ozLV-dHNTE/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3dTktN2ZBEAE', 'a week ago', 5, 'Phenomenal Pastrami. Chicago native and this blows Manny out of the water!  Hand carved super tender flavorful Pastrami. Add Swiss and Saurkraut. A little pricey but one sandwich is massive and can easily feed two adults. Old school vibes with no nonsense employees. Alot of history on the walls. Get an iconic egg cream. Arrived at opening time and had no wait. Pefect way to start the day. KATZ the original often imitated but never duplicated. Will visit again before I head back to Chicago. Definitely a gem.', '2025-03-28 18:31:52.007', '2025-03-28 18:31:52.007'),
	('cm8uc2vp70002jv0k51jnkzgo', 'ChIJ1ZqqhKtpsocRQLCiBfTTipk', 'places/ChIJ1ZqqhKtpsocRQLCiBfTTipk/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnOHFYU0h3EAE', 'a month ago', 1, 'The burgers were barley warm. Then buns seem to be stale and the cheese wasn''t melted. It took over 20 minutes to get our food because the fries were not cooked. If this was the first time I ate at braums I would never eat at another one again.', '2025-03-29 14:55:43.867', '2025-03-29 14:55:43.867'),
	('cm8t4czbb0007jl0zglfb541n', 'ChIJCar0f49ZwokR6ozLV-dHNTE', 'places/ChIJCar0f49ZwokR6ozLV-dHNTE/reviews/ChdDSUhNMG9nS0VJQ0FnTURRbDV5NDdRRRAB', 'a week ago', 5, 'Katz’s is a well known NY staple. It is so popular that it is often crowded with long lines, but well worth the wait. Consider going on week day morning or late evening. We were there at 9:00 and found a seat easy. The portions are big and the food is tasty. We split a Ruben ( plenty to go around), steak fries, pea soup and a square potato knish. It was all very good, even though half the pickles that come with the sandwich it were fresh , not pickled at all.', '2025-03-28 18:31:52.007', '2025-03-28 18:31:52.007'),
	('cm8t4czbb0008jl0z3jfig4mp', 'ChIJCar0f49ZwokR6ozLV-dHNTE', 'places/ChIJCar0f49ZwokR6ozLV-dHNTE/reviews/ChdDSUhNMG9nS0VJQ0FnTURRcG8zODFBRRAB', '2 weeks ago', 5, 'Probably the most iconic Pastrami Sandwich in the world; tender, generous, moist and full of flavor. A must in NY city. Also, the other deli specialties are worth it: nova and bagels, potato latkes, and the cheese blintzes. The waitstaff is very friendly and helpful and the atmosphere is typical delicatessen. I highly recommended a visit to this Institution!', '2025-03-28 18:31:52.007', '2025-03-28 18:31:52.007'),
	('cm8t4czbb0009jl0z3cci1zz6', 'ChIJCar0f49ZwokR6ozLV-dHNTE', 'places/ChIJCar0f49ZwokR6ozLV-dHNTE/reviews/ChZDSUhNMG9nS0VJQ0FnSURfdy1qTENnEAE', '2 months ago', 5, 'Simply put, the best pastrami sandwich I have ever had.  I went Sunday morning which had no line whatsoever.   The pickles were pickling the bread was breading and the mustard lived up to the hype.  Pastrami was 28.95 a bit steepbut in my opinion well worth it.  The carvers were very friendly and the decor was a who’s who from Mike Tyson to Ben Stiller.  A true NYC dining experience that is unlike any other.  Highly recommended', '2025-03-28 18:31:52.007', '2025-03-28 18:31:52.007'),
	('cm8t4dbdi000ajl0zsta8912r', 'ChIJRVNrRZWUC0cRM6LLQSJbLOk', 'places/ChIJRVNrRZWUC0cRM6LLQSJbLOk/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2NmN1NWZ3EAE', '3 months ago', 2, 'The food was actually quite good, I have tasted several dishes and most of them were tasty, but not inordinate. The service on the other hand was terrible - the first time the waitress came to our table she wandered off without double-checking everyone has ordered, which had me waiting for her to return with drinks so I could order. As it took quite long, I tried asking a different person, who said they would forward my order, and yet, when the waitress finally came with my companions'' drinks, mine wasn''t there, so I asked her personally, and it took her about 10 minutes to get my glass of wine. And the experience continued in this manner throughout the evening. Since this is not the cheapest place, I would expect something more.', '2025-03-28 18:32:07.639', '2025-03-28 18:32:07.639'),
	('cm8t4dbdi000bjl0zfe0szuu8', 'ChIJRVNrRZWUC0cRM6LLQSJbLOk', 'places/ChIJRVNrRZWUC0cRM6LLQSJbLOk/reviews/ChZDSUhNMG9nS0VJQ0FnSUNQbnJTNFlnEAE', '4 months ago', 5, 'Wow!  What an incredible experience.  This place is a warm and cozy respite from the cold Czech weather.  We went early on a Friday night without reservations and were able to be seated immediately.  The food was absolutely incredible.  We tried a lasagna with Foie Gras which was spectacular and then one of three fish special of the evening - grilled Turbot with clams and a sauce that was to-die-for.  Overall the price was pretty high, but completely worth it.  The food was so delicious!', '2025-03-28 18:32:07.639', '2025-03-28 18:32:07.639'),
	('cm8t4dbdi000cjl0z72b3lxcu', 'ChIJRVNrRZWUC0cRM6LLQSJbLOk', 'places/ChIJRVNrRZWUC0cRM6LLQSJbLOk/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzNmJHTXVnRRAB', '3 months ago', 4, 'What a lovely place!
Great atmosphere. Superb service. The first and second courses were very tasty and then came the steaks 🥩 which were okay (no more than that) and over cooked. The Tiramisu desert was amazing which came with a good Espresso.', '2025-03-28 18:32:07.639', '2025-03-28 18:32:07.639'),
	('cm8t4dbdi000djl0z6dakw3kw', 'ChIJRVNrRZWUC0cRM6LLQSJbLOk', 'places/ChIJRVNrRZWUC0cRM6LLQSJbLOk/reviews/ChZDSUhNMG9nS0VJQ0FnSURfc1BpU0lBEAE', '2 months ago', 5, 'Amazing place. Great service. Beautiful atmosphere and food and drinks. Quite pricey but you also need to live a bit, right?', '2025-03-28 18:32:07.639', '2025-03-28 18:32:07.639'),
	('cm8t4dbdi000ejl0zvd63fkak', 'ChIJRVNrRZWUC0cRM6LLQSJbLOk', 'places/ChIJRVNrRZWUC0cRM6LLQSJbLOk/reviews/ChdDSUhNMG9nS0VJQ0FnTURBM3VIVzRBRRAB', 'a month ago', 5, 'Very nice restaurant, tasty steaks and antipasti, great selection of wine and cheese from all over the Italy. Great place for a date or business event.', '2025-03-28 18:32:07.639', '2025-03-28 18:32:07.639'),
	('cm8t4dwyq000fjl0zaggn0r98', 'ChIJZ4JX-VKVC0cREvoqN13UeB0', 'places/ChIJZ4JX-VKVC0cREvoqN13UeB0/reviews/ChZDSUhNMG9nS0VJQ0FnTURnX2VmVkxBEAE', '4 weeks ago', 5, 'Satisfied with ribs. We have tried with BBQ and Honey-Mustard sauce. Very tasty; 500 for one person is enough. Have expected more cheese in cheddar balls. Polite stuff, quite loud place in the evening. Mango lemonade is too sweet. Brownie with ice cream, heavy cream and peanuts is good, but not perfect. Expected more wet consistency. If you like ribs - recommend to visit :)', '2025-03-28 18:32:35.618', '2025-03-28 18:32:35.618'),
	('cm8t4dwyq000gjl0zkvq5gwrl', 'ChIJZ4JX-VKVC0cREvoqN13UeB0', 'places/ChIJZ4JX-VKVC0cREvoqN13UeB0/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2aXQ3Q1lREAE', '3 months ago', 5, 'Absolutely fantastic experience! The restaurant truly knows how to serve pork at its finest. We were two people and ordered the pork knuckle and ribs, paired with refreshing light beers. The meat was perfectly cooked—juicy, tender, and full of flavor. The portions were generous, and the presentation was excellent. The beer selection complemented the dishes beautifully. The atmosphere was warm and welcoming, and the service was top-notch. Highly recommended for pork lovers! 5 stars without hesitation!', '2025-03-28 18:32:35.618', '2025-03-28 18:32:35.618'),
	('cm8t4dwyq000hjl0zf4aojqwg', 'ChIJZ4JX-VKVC0cREvoqN13UeB0', 'places/ChIJZ4JX-VKVC0cREvoqN13UeB0/reviews/ChdDSUhNMG9nS0VJQ0FnTURnemU2Ynl3RRAB', 'a month ago', 5, 'If you''re a fan of mouthwatering, perfectly cooked ribs, Ribs of Prague is the place to be. Located in the heart of Prague, this restaurant specializes in tender, juicy ribs that are cooked to perfection. The menu offers a variety of rib preparations, each more delicious than the last. Whether you prefer them smoked, grilled, or with a savory glaze, you''re guaranteed a flavorful experience.

The ambiance of the restaurant is cozy and welcoming, with rustic decor that complements the hearty dishes served. The staff is friendly, attentive, and knowledgeable, ensuring that you feel right at home throughout your meal.

What sets Ribs of Prague apart is their commitment to quality. The ribs are always fresh, and the sides, like crispy fries and refreshing salads, perfectly accompany the main dish. The sauces served with the ribs are flavorful and varied, allowing you to tailor your meal to your liking.

Whether you''re a local or just visiting, Ribs of Prague is a must-visit for any meat lover. The combination of great food, excellent service, and a lively atmosphere makes it a top choice for anyone seeking a satisfying dining experience in Prague. Highly recommended!', '2025-03-28 18:32:35.618', '2025-03-28 18:32:35.618'),
	('cm8t4dwyq000ijl0zzcf4uz27', 'ChIJZ4JX-VKVC0cREvoqN13UeB0', 'places/ChIJZ4JX-VKVC0cREvoqN13UeB0/reviews/ChdDSUhNMG9nS0VJQ0FnTURRc2VlYnNBRRAB', '2 weeks ago', 5, 'The most spicy sauce is spicy 🥵!!! Lol… Only go for it if you know you can tolerate spicy food. 500grams/half a kg Spare ribs  or Pork knuckle is good for one person. Reasonable price to be honest! One of the best ribs I’ve had! 😋🤤 Staff are really friendly 🫰🏻', '2025-03-28 18:32:35.618', '2025-03-28 18:32:35.618'),
	('cm8t4dwyq000jjl0z3wgtr4l5', 'ChIJZ4JX-VKVC0cREvoqN13UeB0', 'places/ChIJZ4JX-VKVC0cREvoqN13UeB0/reviews/ChdDSUhNMG9nS0VJQ0FnTURRLTRqRTF3RRAB', '2 weeks ago', 4, 'The taste of the food, welcoming, ambience etc was great. The service can be better, it might take time to find someone to order. The worst thing was the cleanness (or dirtyness may be) of toilets, it was the worst I saw amongst other Prague restaurants’ toilets', '2025-03-28 18:32:35.618', '2025-03-28 18:32:35.618'),
	('cm8t4ggvo000kjl0zzx85hh70', 'ChIJN4pELZWUC0cR-5UnDwqYpCo', 'places/ChIJN4pELZWUC0cR-5UnDwqYpCo/reviews/ChdDSUhNMG9nS0VJQ0FnTUNncmIyeHBRRRAB', 'a month ago', 5, 'Sia offers a trendy and informal atmosphere with outstanding service—professional and attentive servers make the experience even better. The food is absolutely delicious, made with high-quality ingredients. The Spicy Tuna salad was fantastic, full of fresh flavors, and the Peking duck was so well-portioned that I couldn''t even finish the plate. Some of the cocktails are great other are so so.
It’s relatively pricey for Prague, but well worth it.', '2025-03-28 18:34:34.74', '2025-03-28 18:34:34.74'),
	('cm8t4ggvo000ljl0z7hor68f1', 'ChIJN4pELZWUC0cR-5UnDwqYpCo', 'places/ChIJN4pELZWUC0cR-5UnDwqYpCo/reviews/ChZDSUhNMG9nS0VJQ0FnTURRdUx1WU5REAE', '2 weeks ago', 4, 'Everything is good: atmosphere, food, staff. Dishes were delicious and mild spicy (option to choose instead of spicy). Satisfied. But it was a misunderstanding: due to a big company of guests the waiter has forgotten to put down 2 main dishes. It was needed more time to wait than expected.', '2025-03-28 18:34:34.74', '2025-03-28 18:34:34.74'),
	('cm8t4ggvo000mjl0z104qev3x', 'ChIJN4pELZWUC0cR-5UnDwqYpCo', 'places/ChIJN4pELZWUC0cR-5UnDwqYpCo/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzMUlta3lnRRAB', '4 months ago', 5, 'Sia Restaurant is incredibly impressive, spanning three floors, each with its own unique kitchen concept. We sat at the bar on the lower level, right in front of the grill, which made for a memorable experience. Every dish was excellent, starting with the spicy tuna salad, delicious dim sum, and the standout duck served in two parts. The first part included duck breast with two sauces, vegetables, and mini sesame tortillas, and the second part was a stir-fried duck with noodles. The cocktails were also very well-made. Although it was a bit pricey by Prague standards, the flavors and experience were worth every crown. We thoroughly enjoyed our time there and will definitely return on our next visit!', '2025-03-28 18:34:34.74', '2025-03-28 18:34:34.74'),
	('cm8t4ggvo000njl0zvo9b0sz6', 'ChIJN4pELZWUC0cR-5UnDwqYpCo', 'places/ChIJN4pELZWUC0cR-5UnDwqYpCo/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzc3NTZnd3RRAB', '4 months ago', 5, 'This restaurant near the city center in Prague is a true gem for Asian cuisine lovers. Every dish I tried was exceptional, bursting with authentic flavors and beautifully presented. The range of flavors is impressive, and it’s clear a lot of care goes into each dish. The lemonades are also a standout—refreshing and perfectly paired with the meal. And, without a doubt, the highlight was the tapioca dessert. It’s absolutely incredible, the perfect ending to a fantastic dining experience. If you’re in Prague and craving quality Asian cuisine, this spot should be at the top of your list!', '2025-03-28 18:34:34.74', '2025-03-28 18:34:34.74'),
	('cm8t4ggvo000ojl0zwnias17g', 'ChIJN4pELZWUC0cR-5UnDwqYpCo', 'places/ChIJN4pELZWUC0cR-5UnDwqYpCo/reviews/ChZDSUhNMG9nS0VJQ0FnSURQN3MzdUVREAE', '3 months ago', 5, 'Great experience!
Huge restaurant with 3 different kitchens cooking various types of food - mostly Asian.

Food was very good, and the staff were kind and friendly.

Try the dragon fruit lemonade ( with or without alcohol) - beautifully served and very delicious highly recommended.

Will definitely come back next time in Prague.', '2025-03-28 18:34:34.74', '2025-03-28 18:34:34.74'),
	('cm8t4gzis0000l10ns4mzrj8q', 'ChIJExISyuuUC0cR-NxIRymexbs', 'places/ChIJExISyuuUC0cR-NxIRymexbs/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2ajY3NXhBRRAB', '3 months ago', 5, 'Very good, recommend. We booked a table for 18:15 but we arrived an hour before and they were so nice and they accept us. We ordered 4 dishes and they were all good - pizza, pasta arabiata, truffle risotto and sea brim fish. All was amazing!', '2025-03-28 18:34:58.901', '2025-03-28 18:34:58.901'),
	('cm8t4gzis0001l10n409kgug6', 'ChIJExISyuuUC0cR-NxIRymexbs', 'places/ChIJExISyuuUC0cR-NxIRymexbs/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2dHVXSVBnEAE', '3 months ago', 5, 'Fantastic Italian place!

Ordered the margharita pizza, which is a good indicator of whether they know what they''re doing or not, and was very satisfied with it. Everything we ordered was delicious - (margharita pizza, house iced tea appetizers of scallops and stracciatella, and pistachio panna cotta for dessert)

The service is great.

This restaurant is usually sold out in the evenings, at least during peak season. Make sure to get a reservation before you come, or try to come during the afternoons where the rush won''t be so much.

We paid about €80 for two people, including tip.

(They mention on the bill - "please tip your server, we suggest a 10% gratuity". It didn''t sit well with me, since Prague isn''t necessarily a place where there''s a tipping culture, and they shouldn''t try to bring it here. We would''ve tipped regardless since the service was good)', '2025-03-28 18:34:58.901', '2025-03-28 18:34:58.901'),
	('cm8t4gzis0002l10nv0hlm159', 'ChIJExISyuuUC0cR-NxIRymexbs', 'places/ChIJExISyuuUC0cR-NxIRymexbs/reviews/ChdDSUhNMG9nS0VJQ0FnTURBNy1xTnl3RRAB', 'a month ago', 5, 'The food was delicious, I had a bufalina which was perfect and my bf had the steak with risotto which was to die for. Our dishes took some time to arrive so the waiter offered us the dessert on the house as an apology (he really was a very nice and funny waiter!!). The panna cotta was also delicious, I can only recommend this place!! :)', '2025-03-28 18:34:58.901', '2025-03-28 18:34:58.901'),
	('cm8t4gzis0003l10nj4kw2sk7', 'ChIJExISyuuUC0cR-NxIRymexbs', 'places/ChIJExISyuuUC0cR-NxIRymexbs/reviews/ChdDSUhNMG9nS0VJQ0FnSURuaDVfeG5RRRAB', '5 months ago', 5, 'The best place we ate in Prague. Originally we tried the night before but they were full not surprisingly, but they were really welcoming to us to return that we booked for the following evening. The food and the service is on point, along with the exquisite wine selection. The waiter who served us was very patient and informative to us. I would definitely like to visit again and would recommend it to anyone visiting Prague.', '2025-03-28 18:34:58.901', '2025-03-28 18:34:58.901'),
	('cm8t4gzis0004l10n0mxzqerq', 'ChIJExISyuuUC0cR-NxIRymexbs', 'places/ChIJExISyuuUC0cR-NxIRymexbs/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBcFBIcmhnRRAB', 'a month ago', 5, 'The scallops were too salty, but my friend and I really enjoyed the ossobuco alla Milanese! The tiramisu was also delicious. Overall, a great spot for Italian food in Prague.', '2025-03-28 18:34:58.901', '2025-03-28 18:34:58.901'),
	('cm8t8sww60000lg1zbe0gg7pj', 'ChIJn9tgnuO0RIYRx7hQVxuGG7U', 'places/ChIJn9tgnuO0RIYRx7hQVxuGG7U/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzemNLd2NREAE', '4 months ago', 5, 'Liked it! Came here as part of a city tour. Friendly staff. We got samplers before deciding on what we wanted to get. The flavors are great. Even the small cup is a good sized serving. It''ll fill you up.

Parking can be an issue. Our tour operator probably knew where to park his bus or has an agreement with the establishment in front of where he parked. Otherwise, it might be an issue finding a parking spot.', '2025-03-28 20:36:13.831', '2025-03-28 20:36:13.831'),
	('cm8t8sww60001lg1zzlkeglpy', 'ChIJn9tgnuO0RIYRx7hQVxuGG7U', 'places/ChIJn9tgnuO0RIYRx7hQVxuGG7U/reviews/ChdDSUhNMG9nS0VJQ0FnTURRX055U3FBRRAB', '2 weeks ago', 5, 'This establishment offers a truly exceptional gelato experience. The affogato, in particular, demonstrates a masterful balance of sweetness and flavor. Pricing is reasonable, and the service was commendable by Lainey.', '2025-03-28 20:36:13.831', '2025-03-28 20:36:13.831'),
	('cm8t8sww60002lg1zut3nol7u', 'ChIJn9tgnuO0RIYRx7hQVxuGG7U', 'places/ChIJn9tgnuO0RIYRx7hQVxuGG7U/reviews/ChZDSUhNMG9nS0VJQ0FnSURqMmRTbUpnEAE', '10 months ago', 5, 'This is a great little gelato place. They have some delicious gelato with our favorite flavors being Coffee, chocolate chip and the pineapple sorbet. The place gets packed and I felt bad there was only one server. She was great though. The layout is simple and the plants in the window look great. It’s a small shop so just two tables inside and another on the front porch. We stood outside to eat and it was fine. Overall a great little place to grab some tasty gelato on a hot day. #gelato', '2025-03-28 20:36:13.831', '2025-03-28 20:36:13.831'),
	('cm8t8sww60003lg1zcq3zkkul', 'ChIJn9tgnuO0RIYRx7hQVxuGG7U', 'places/ChIJn9tgnuO0RIYRx7hQVxuGG7U/reviews/ChdDSUhNMG9nS0VJQ0FnTURRbHFEczZnRRAB', '2 weeks ago', 5, 'Fancy soft ice cream. Pretty creamy. The goat milk had an interesting flavor. The matcha also tasted like a unique type of milk. Very flavorful. The matcha was strong and high quality without being bitter. There was a good balance of sweetness.', '2025-03-28 20:36:13.831', '2025-03-28 20:36:13.831'),
	('cm8t8sww60004lg1za3g1y1jz', 'ChIJn9tgnuO0RIYRx7hQVxuGG7U', 'places/ChIJn9tgnuO0RIYRx7hQVxuGG7U/reviews/ChZDSUhNMG9nS0VJQ0FnSURidGNlQmZ3EAE', '7 months ago', 5, 'Been coming here for years and it’s consistently delicious every time. The Gelato and sorbet are made of quality ingredients and you can really taste the freshness. Had the malted milk and stracciatella flavors and husband had the salted caramel with the freshly made waffle cone today and it was excellent. Also had the pineapple sorbet and it was so refreshing in this heat. The person working today was so wonderful and let us try a bunch of different flavors and he made the best waffle cone', '2025-03-28 20:36:13.831', '2025-03-28 20:36:13.831'),
	('cm8t8szuq0005lg1zkuvc2t9f', 'ChIJdTe3_eK0RIYRF_JXAVN5X_U', 'places/ChIJdTe3_eK0RIYRF_JXAVN5X_U/reviews/ChZDSUhNMG9nS0VJQ0FnSURmbnNpU1dREAE', '2 months ago', 5, 'We were planning on taking our donuts to go, but the vibe here was so cute that we decided to stay. It was super picturesque, and oh my gosh we couldn’t shut up about the donuts. We would’ve loved to visit back when they had a restaurant, but the quality was as scrumptious as ever. Honestly not all that expensive considering the quality and location. If you want to park on their property you will have to pay a fee via a qr code, but there was other free parking not too far off. Definitely recommend!', '2025-03-28 20:36:17.666', '2025-03-28 20:36:17.666'),
	('cm8t8szuq0006lg1zgy9qhgmp', 'ChIJdTe3_eK0RIYRF_JXAVN5X_U', 'places/ChIJdTe3_eK0RIYRF_JXAVN5X_U/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRcjZYTlBBEAE', '2 weeks ago', 4, 'Great donuts, extremely filling and exactly what I was expecting. Read the reviews before ordering and was slightly apprehensive, but the service was great. My friends and I showed up right as they opened and got our donuts quickly. I ordered the Blackout donut.', '2025-03-28 20:36:17.666', '2025-03-28 20:36:17.666'),
	('cm8t8szuq0007lg1za4s6uttz', 'ChIJdTe3_eK0RIYRF_JXAVN5X_U', 'places/ChIJdTe3_eK0RIYRF_JXAVN5X_U/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnOWNLQ3FRRRAB', 'a month ago', 5, 'This was a last minute stop bc I happened to pass and I have been wanting to try so why not now! I am so glad that I did 🙏🏼🥳
I got the Black Betty which was insane in the best possible way, so if they''re all attacked with the same vengeance, then you really can''t choose a bad donut here. Absolutely worth it but to avoid the sugar crash, feel free to split into four, it''s that big 😁', '2025-03-28 20:36:17.666', '2025-03-28 20:36:17.666'),
	('cm8t8szuq0008lg1zrmbt26n6', 'ChIJdTe3_eK0RIYRF_JXAVN5X_U', 'places/ChIJdTe3_eK0RIYRF_JXAVN5X_U/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfMHVqMUlnEAE', '2 months ago', 5, 'Had heard rumours of Gourdough''s and those rumours were true, what an incredibly tasty, delectable treat. A doughnut experience this British guy won''t forget in a hurry.

In all honesty, couldn''t recommend this place more highly. I played it simple with my choice (the photo doesn''t do it justice) but it really didn''t disappoint.

I''ll definitely be back next time I''m in Austin, hopefully my arteries will be ready for round two. 🍩🍩', '2025-03-28 20:36:17.666', '2025-03-28 20:36:17.666'),
	('cm8t8szuq0009lg1zxvuixn9r', 'ChIJdTe3_eK0RIYRF_JXAVN5X_U', 'places/ChIJdTe3_eK0RIYRF_JXAVN5X_U/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRd2R2UnRRRRAB', '3 weeks ago', 5, 'I stopped by the Gourdough’s food truck, and it did not disappoint! I ordered the Dirty Berry, and it was delicious. The donut had the perfect balance—crispy on the outside, soft and fluffy on the inside. I highly recommend this place!', '2025-03-28 20:36:17.666', '2025-03-28 20:36:17.666'),
	('cm8t8tie80000lb0kq0gu3ci7', 'ChIJwTzX0ym1RIYRx_vsxHlQ2Sw', 'places/ChIJwTzX0ym1RIYRx_vsxHlQ2Sw/reviews/ChZDSUhNMG9nS0VJQ0FnSURieDduX0tnEAE', '6 months ago', 5, 'Great place to “get away” and enjoy amazing food. Our service with Murphy was great and we will definitely be back to try new things on the menu. We came for dinner and are excited to try the brunch.

4 weeks later: BRUNCH IS 5 STARS. So much flavor and fresh fruit with great brunch drinks. Adam was our server and he did a great job. It’s clear the entire staff upholds high standards.', '2025-03-28 20:36:41.697', '2025-03-28 20:36:41.697'),
	('cm8t8tie80001lb0k7wl8cxoy', 'ChIJwTzX0ym1RIYRx_vsxHlQ2Sw', 'places/ChIJwTzX0ym1RIYRx_vsxHlQ2Sw/reviews/ChdDSUhNMG9nS0VJQ0FnSURfMVlQcHlBRRAB', '2 months ago', 5, 'This restaurant is a must-visit brunch spot in Austin. The service, quality of food, interior, and atmosphere are wonderful. This time, the weather was colder; however, since they have a pretty good heating system on their outside patio, it was so nice to sit outside and stay warm.
We had been looking for a great Mexican brunch restaurant, and this one definitely met all our expectations and more. The service and attention to us as customers were amazing—so attentive and thoughtful. The food, without a doubt, was absolutely delicious.
We ordered Panuchos Benedict, Tacos de Castecán, Churros, mimosa and French press coffee. The eggs benedict were delicious, with a generous amount of meat and hollandaise sauce. The overall taste was wonderful and well-seasoned. The taco with pork belly was tasty, with cheese and mango habanero salsa that paired perfectly with the pork. We also loved the churros for dessert, especially since they were served with two types of sauces: dulce de leche and chocolate. I also ordered the French press coffee, which was excellent. They serve it in a large pot along with cream. I want to emphasize that this is a gluten-free restaurant.
The interior and overall ambiance are truly charming. We thoroughly enjoyed our brunch experience here!', '2025-03-28 20:36:41.697', '2025-03-28 20:36:41.697'),
	('cm8t8tie80002lb0kf2ulxumm', 'ChIJwTzX0ym1RIYRx_vsxHlQ2Sw', 'places/ChIJwTzX0ym1RIYRx_vsxHlQ2Sw/reviews/ChdDSUhNMG9nS0VJQ0FnSURmaHA3SHRnRRAB', '2 months ago', 5, 'Had a GREAT brunch! The service for our table of 11 was friendly and attentive. Our server did an incredible job and was super nice.

Everyone loved the food, plus the whole restaurant is gluten free. Really cool brunch menu! The atmosphere was beautiful and we are so excited to come back and try more of the menu 🥰', '2025-03-28 20:36:41.697', '2025-03-28 20:36:41.697'),
	('cm8t8tie80003lb0kfhat877j', 'ChIJwTzX0ym1RIYRx_vsxHlQ2Sw', 'places/ChIJwTzX0ym1RIYRx_vsxHlQ2Sw/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3MUtETVF3EAE', 'in the last week', 5, 'Beautiful place with great vibes and food. Everything we eat here was on point. Friendly service and delicious drinks. We will definitely come back y.', '2025-03-28 20:36:41.697', '2025-03-28 20:36:41.697'),
	('cm8uc2vp70003jv0k82dtzypa', 'ChIJ1ZqqhKtpsocRQLCiBfTTipk', 'places/ChIJ1ZqqhKtpsocRQLCiBfTTipk/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYc2YzMk5nEAE', '5 months ago', 5, 'The manager was awesome while we were there. She seen that tables were dirty, and she did not hesitate to go clean them herself. She is a team leader but did not delegate it to someone else she did it. That is the true sign of a leader to me. Great job.', '2025-03-29 14:55:43.867', '2025-03-29 14:55:43.867'),
	('cm8t8tie80004lb0kqvl7if3n', 'ChIJwTzX0ym1RIYRx_vsxHlQ2Sw', 'places/ChIJwTzX0ym1RIYRx_vsxHlQ2Sw/reviews/ChZDSUhNMG9nS0VJQ0FnTURnaGFQNkFnEAE', 'a month ago', 5, 'WOW WOW WOW!!! This is the best meal I’ve had in Austin!  Loved everything about this restaurant.  The decor is very chic with such a cool vibe.  The seating is so comfy with pillows.  There is a free parking lot behind the restaurant. Our server, Gary, was absolutely amazing!!! He was very attentive, friendly, funny and  so much FUN!

This is what we ordered…

Guacamole - served with tostada chips.  The guac was tangy and yummy.
Tuna Crudo - this was an explosion of flavor in your mouth.  It was sweet from the strawberries and oh so delicious.
Tuna Tostada - also so incredibly flavorful.  This was one of my faves.
Duck Panucho - this was pretty hearty
Camarones - the shrimp had a tangy flavor with the mangoes.  Seemed a bit overcooked and dry.
Lubina Pohchuc - the sea bass was super yummy as well.
Dulce de leche flan - the dessert was not too sweet and just enough to satisfy your sweet tooth.

Highly recommend!!! I’m definitely coming back here next time I’m in town!', '2025-03-28 20:36:41.697', '2025-03-28 20:36:41.697'),
	('cm8t8tnj70005lb0ko7loqyu2', 'ChIJfRArluO0RIYRjZvXTXpJK80', 'places/ChIJfRArluO0RIYRjZvXTXpJK80/reviews/ChdDSUhNMG9nS0VJQ0FnTURRbDctamtRRRAB', 'a week ago', 5, 'The pastries and sweet treats here are absolutely delicious!!!!! Freshly made each morning and served with a smile. The mixed berry eclair, cinnamon roll croissant, and blueberry muffin were all to die for, and let''s not forget cranberry lemonade. OMG, can''t wait to get back to Austin to visit.', '2025-03-28 20:36:48.355', '2025-03-28 20:36:48.355'),
	('cm8t8tnj70006lb0kh3tx2uw8', 'ChIJfRArluO0RIYRjZvXTXpJK80', 'places/ChIJfRArluO0RIYRjZvXTXpJK80/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2bWVHMW5BRRAB', '3 months ago', 5, 'I work at Don''s Automotive around the corner from La Patisserie and I come here quite often. Over the years, I have always been greeted like family and left with a delicious latte and a sweet or savory treat to get the day started. My all time favorites are the turkey & cheese croissants, the cro-brio donuts and of course the macarons[I''ll bring a 6-pack back to the shop occasionally to help with morale]. La Patisserie is a South Austin gem!', '2025-03-28 20:36:48.355', '2025-03-28 20:36:48.355'),
	('cm8t8tnj70007lb0k8mdd14cs', 'ChIJfRArluO0RIYRjZvXTXpJK80', 'places/ChIJfRArluO0RIYRjZvXTXpJK80/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYc2JmMGJnEAE', '5 months ago', 5, 'Cutest little shop! I wish I remember the gentleman’s name that was working. He was very kind and took the time to describe different types of pastries to me. The coffee was good and the pastries were tasty! Loved the vibes here. I will definitely be back next time I’m in Austin!', '2025-03-28 20:36:48.355', '2025-03-28 20:36:48.355'),
	('cm8t8tnj70008lb0k1a5ll0qa', 'ChIJfRArluO0RIYRjZvXTXpJK80', 'places/ChIJfRArluO0RIYRjZvXTXpJK80/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzcHNIQU13EAE', '4 months ago', 5, 'My neighborhood favorite!! I love bringing friends here and I visit weekly for coffee and a couple of macarons. I love trying the new macaron flavors they keep coming out with. Their signature cro brio has also been a long time favorite for me, as a lover of custard filled donuts... it''s like that but more dense and rich. It''s decadent. I highly recommend both the cinnamon sugar and chocolate iced versions. The staff are lovely and I''m truly grateful this little place has stuck around here for so many years. Keep it up, y''all!', '2025-03-28 20:36:48.355', '2025-03-28 20:36:48.355'),
	('cm8t8tnj70009lb0kfafaf48c', 'ChIJfRArluO0RIYRjZvXTXpJK80', 'places/ChIJfRArluO0RIYRjZvXTXpJK80/reviews/ChZDSUhNMG9nS0VJQ0FnTURROWUyX1F3EAE', '2 weeks ago', 5, 'Everything amazingly delicious! Gluten free macarons are the best I''ve ever tasted. ❤️ New Austin favorite - I''ll be back!', '2025-03-28 20:36:48.355', '2025-03-28 20:36:48.355'),
	('cm8t9s11l0000jp119kdfl6ww', 'ChIJ3ZuZn5KUC0cRnorbjPeGwn0', 'places/ChIJ3ZuZn5KUC0cRnorbjPeGwn0/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmeGVIUXNnRRAB', '2 months ago', 4, 'As a first-time guest I would like to commend your establishment for its inviting atmosphere and excellent service. The girl waiter were exceptionally accommodating and friendly, which greatly contributed to a positive impression during our visit. The quality of the drinks served was also noteworthy and added to the enjoyment of our evening.

However, I felt compelled to address an area that I believe could be improved upon. While the ambiance and service were top-notch, I was somewhat disappointed by the DJ performance and music selection. My group and I specifically chose your bar for the dance floor, hoping for an energetic and lively atmosphere. Unfortunately, throughout the evening, only a few patrons were dancing, and the majority of the guests seemed reluctant to join in. It is my opinion that perhaps the DJ could work on engaging the crowd more effectively and selecting music that resonates with a broader audience.

But still, we will definitely try this place again 👍', '2025-03-28 21:03:32.169', '2025-03-28 21:03:32.169'),
	('cm8t9s11l0001jp11zzn1hosy', 'ChIJ3ZuZn5KUC0cRnorbjPeGwn0', 'places/ChIJ3ZuZn5KUC0cRnorbjPeGwn0/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmeV9TTTZBRRAB', '2 months ago', 4, 'We were here for the NYE party and had a great time. Music was great and not too loud or quiet aswell. Staff was overall friendly.
Just a heads-up: A lot of the pictures from this club are not correct and show a different bar. Not really a problem but we did expect a different location haha', '2025-03-28 21:03:32.169', '2025-03-28 21:03:32.169'),
	('cm8t9s11l0002jp111a8qsfys', 'ChIJ3ZuZn5KUC0cRnorbjPeGwn0', 'places/ChIJ3ZuZn5KUC0cRnorbjPeGwn0/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnck9HX1RnEAE', 'a month ago', 5, 'We had a fantastic time at Nebe Bar! Honestly I wasn’t convinced when we first entered BUT my mind was quickly changed. We were able to sit at the bar despite the place being FULLY BOOKED! Bartender Dominic really took care of us - he even selected a cocktail for me. You can tell the staff really care and I cannot fault it!', '2025-03-28 21:03:32.169', '2025-03-28 21:03:32.169'),
	('cm8t9s11l0003jp119ekw2b29', 'ChIJ3ZuZn5KUC0cRnorbjPeGwn0', 'places/ChIJ3ZuZn5KUC0cRnorbjPeGwn0/reviews/ChZDSUhNMG9nS0VJQ0FnSURweTZyeUNBEAE', '8 months ago', 5, 'One of the best bars in Prague. Bar has great location, good atmosphere, offers many kind of cocktails and drinks. During their Happy hours, you can get one + one free chupito, and all their cocktails for great price (109 CZK). Maybe one minus is
really loud music, so you can''t really have a conversation.
The place is very popular so make sure you reserve your table before coming there.', '2025-03-28 21:03:32.169', '2025-03-28 21:03:32.169'),
	('cm8t9s11l0004jp11imupvw3l', 'ChIJ3ZuZn5KUC0cRnorbjPeGwn0', 'places/ChIJ3ZuZn5KUC0cRnorbjPeGwn0/reviews/ChZDSUhNMG9nS0VJQ0FnSUREXzdUYUJBEAE', '11 months ago', 5, 'Great club, became our go to club in Prague. The staff is incredibly friendly and listens to your wishes, they always have a smile on and we always felt extremely well treated.

The aesthetics are nice, there is a neon vibe, there are tables in the back / corner, at the bar and around the dance floor.
It''s not a big place but it''s not small either, for us a perfect mix of cozy, wild and always very enjoyable. We will be coming back!!

EDIT: Michelle is the best!! - Cheers from the Hawaiians!', '2025-03-28 21:03:32.169', '2025-03-28 21:03:32.169'),
	('cm8tbaeeh0007jr0noakqjiiv', 'ChIJxwHEqe4VkFQRiQZSYM_nKQQ', 'places/ChIJxwHEqe4VkFQRiQZSYM_nKQQ/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3bnRMeUJBEAE', 'a week ago', 5, 'Okay so this review is more about the ice cream (Molly Moon’s) Black Sesame.  Every year this flavor evolves, and this year’s edition had red bean in it. I’d never had these beans before, but it was amazing! Don’t be afraid of the beans!
Also, the woman who helped me and my grandpa was so patient and kind.', '2025-03-28 21:45:48.906', '2025-03-28 21:45:48.906'),
	('cm8t9s7vs0005jp11hoy3xtii', 'ChIJiT-HU-mUC0cRXk9HkdInzxo', 'places/ChIJiT-HU-mUC0cRXk9HkdInzxo/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRcVplYjVRRRAB', '3 weeks ago', 5, 'My wife and I went to the Agartha Jazzclub in Prague last weekend. The booking a few days before was absolutely uncomplicated, and there was also great email contact regarding some questions about the programme. We hadn''t had much contact with jazz before and couldn''t relate to this music. We went to see vibraphonist Radek Krampl at the club out of interest, and it was worth it! The music was very pleasant, the musicians were great. Unfortunately, we had to leave a little early. Until then it was a successful evening, a nice club in a beautiful old cellar vault from the Middle Ages. Nice staff, good bar with very reasonable prices. The acoustics were also very good for the small room. So we''d be happy to come back any time - even if we''re not jazz fans. Highly recommended for a nice evening!', '2025-03-28 21:03:41.032', '2025-03-28 21:03:41.032'),
	('cm8t9s7vs0006jp1194omn73l', 'ChIJiT-HU-mUC0cRXk9HkdInzxo', 'places/ChIJiT-HU-mUC0cRXk9HkdInzxo/reviews/ChdDSUhNMG9nS0VJQ0FnTUNndDc3aWtRRRAB', 'a month ago', 5, 'My son and I discovered this fabulous little jazz club when we took a wrong turning down a side road, but what a lucky mistake that was.

We booked online to see the Nick Haywood Quartet (double bass, piano, sax drums) that evening. It was my son''s first time at a jazz club and it couldn''t have been better.

The intimate atmosphere is what I imagine an underground 1950s jazz club was like minus the cigarette smoke!  The set was almost completely the quartet''s own compositions interspersed with stories and annecdotes and their passion for the music was obvious.

Guests ranged from late teens (my son) to retired couples and people from several nationalities.  Drinks were reasonably priced (we didn''t try the food because we had already eaten) and it was a relaxing and cool (in a jazz sense) way to spend a few hours.  We will definitely be back.

My top tip: book ahead online to avoid disappointment. And I think it is a bit cheaper than paying on the door.', '2025-03-28 21:03:41.032', '2025-03-28 21:03:41.032'),
	('cm8t9s7vs0007jp11lk5rd2ei', 'ChIJiT-HU-mUC0cRXk9HkdInzxo', 'places/ChIJiT-HU-mUC0cRXk9HkdInzxo/reviews/ChZDSUhNMG9nS0VJQ0FnTUNna01DNGNREAE', 'a month ago', 5, 'Live jazz by that you FEEL, played by experienced musicians - real humans 🎷🪘🎸🎙️
AghaRTA is an enjoyable blend of expert musicians and a casual, welcoming and warm atmosphere.
We had the pleasure of experiencing Kratochvil, Ackerman and Zangi on February 12th, who played and improvised blues and jazz to our delight 😎', '2025-03-28 21:03:41.032', '2025-03-28 21:03:41.032'),
	('cm8t9s7vs0008jp1176knafy2', 'ChIJiT-HU-mUC0cRXk9HkdInzxo', 'places/ChIJiT-HU-mUC0cRXk9HkdInzxo/reviews/ChZDSUhNMG9nS0VJQ0FnSURfd1BtY1FBEAE', '2 months ago', 5, 'Perfect night with jazz and drinks
Staffs are friendly and helpful
Even withouth reservations you could have nice back side seats as long as you arrive here early', '2025-03-28 21:03:41.032', '2025-03-28 21:03:41.032'),
	('cm8t9s7vs0009jp11y40cef36', 'ChIJiT-HU-mUC0cRXk9HkdInzxo', 'places/ChIJiT-HU-mUC0cRXk9HkdInzxo/reviews/ChZDSUhNMG9nS0VJQ0FnSUN6a2Y2SUZREAE', '9 months ago', 5, 'I visited Prague for an event and wanted to listen to some jazz, so I checked the evening lineups at a few jazz clubs. I found a performance that matched my taste, made a reservation, and visited the club. The atmosphere matched what I had expected from the photos, and although the tables were a bit closer together than anticipated, the sound and performance were excellent, leaving me very satisfied. The staff were friendly, and I was pleasantly surprised that the performer greeted and introduced the performance in English, which gave the place an international feel. I was very pleased with the venue and would definitely like to visit again the next time I go to Prague.', '2025-03-28 21:03:41.032', '2025-03-28 21:03:41.032'),
	('cm8tba22n0000jr0n1xs6zvwp', 'ChIJj4m2RY8UkFQRfbvu27xpFOQ', 'places/ChIJj4m2RY8UkFQRfbvu27xpFOQ/reviews/ChdDSUhNMG9nS0VJQ0FnTURnLTduZW5nRRAB', '4 weeks ago', 4, 'Really enjoyed the whisky flight!  They have loads of fresh beer on tap and lots of drink options.  We had the appetizers and entree''s.  The food was good and presented well.', '2025-03-28 21:45:32.928', '2025-03-28 21:45:32.928'),
	('cm8tba22n0001jr0ndp04mvln', 'ChIJj4m2RY8UkFQRfbvu27xpFOQ', 'places/ChIJj4m2RY8UkFQRfbvu27xpFOQ/reviews/ChZDSUhNMG9nS0VJQ0FnSURYX295ZGZ3EAE', '5 months ago', 4, 'Stopped in for lunch but decided to get a few appetizers to share instead. The truffle cheese fries and chicken wings were incredible! Also tried the ahi tuna poke stack which was very unique and delicious. Decent amount of food for two people, and service was great! Will definitely be back to try more items on the menu.', '2025-03-28 21:45:32.928', '2025-03-28 21:45:32.928'),
	('cm8tba22n0002jr0nl9xo1tog', 'ChIJj4m2RY8UkFQRfbvu27xpFOQ', 'places/ChIJj4m2RY8UkFQRfbvu27xpFOQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUNId1BLUWJREAE', '4 months ago', 5, 'University Village is my go to shopping plaza but did not know about this place. Friends from Banana Republic introduced me for the late night happy hour that starts at 9 PM. We ordered everything on the happy hour menu which included the hamburger, mac & cheese balls, fried pickles, and truffle fries. We decided to substitute the normal fries for yam fries on the hamburger and the yam fries were delicious. We also ordered the chocolate cake which was made with Whistlepig bourbon. It was gooey and cakey in all the right ways with rich chocolate flavor (just a little too sweet for my taste). They serve Chandon Brut as their bubbles...very nice.', '2025-03-28 21:45:32.928', '2025-03-28 21:45:32.928'),
	('cm8tba22n0003jr0nj2hts9il', 'ChIJj4m2RY8UkFQRfbvu27xpFOQ', 'places/ChIJj4m2RY8UkFQRfbvu27xpFOQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUNiOXVPODNnRRAB', '8 months ago', 5, 'The carrot cake was the star of the show - literally the best I’ve ever had. I modified the fish tacos to be fried and was happy with my choice. Fries were great. The tuna salad was good but the tuna was just ok. Happy hour beer was a treat. Service was perfunctory. It’s worth a try if you’re in the neighbourhood.', '2025-03-28 21:45:32.928', '2025-03-28 21:45:32.928'),
	('cm8tba22n0004jr0nb6l3tbgq', 'ChIJj4m2RY8UkFQRfbvu27xpFOQ', 'places/ChIJj4m2RY8UkFQRfbvu27xpFOQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUNUN1ltLURREAE', '10 months ago', 4, 'Great atmosphere and service. Though the truffle cheese fries were tasty, the fish tacos was pretty bland. The fish could have been better seasoned. The salsa verde it came with had lot of flavor. So overall the dish was not bad. We got the fries complementary as part of some welcome offer, if you join their rewards program. The waiter was kind enough to let us know about the offer and give all the details.', '2025-03-28 21:45:32.928', '2025-03-28 21:45:32.928'),
	('cm8tbaeeh0005jr0nyyl5q7d6', 'ChIJxwHEqe4VkFQRiQZSYM_nKQQ', 'places/ChIJxwHEqe4VkFQRiQZSYM_nKQQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfeTZYeW1BRRAB', '2 months ago', 4, 'Cookies were warm and cooked all the way. Chewy consistency, great texture, and reasonable pricing. Cons: not a lot of options, small location and gets crowded easily, the “full size” of ice cream seemed like a small.  Overall good experience and a tasty treat for the family!🩵', '2025-03-28 21:45:48.906', '2025-03-28 21:45:48.906'),
	('cm8tbaeeh0006jr0nnw0nw7bx', 'ChIJxwHEqe4VkFQRiQZSYM_nKQQ', 'places/ChIJxwHEqe4VkFQRiQZSYM_nKQQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfcThyWGtRRRAB', '2 months ago', 4, 'cute little cookie and ice cream shop in the udistrict  !!

price for two cookies is about $5, so pretty good. they also have free ice water as well. the shop is rather small itself and when a line forms, it blocks the door a bit. the workers were pretty chill and seemed like they liked their jobs lol

the cookies were delicious just wish they were a bit warmer. overall we enjoyed our time here and will be back again (:', '2025-03-28 21:45:48.906', '2025-03-28 21:45:48.906'),
	('cm8tbaeeh0008jr0n76rowvu6', 'ChIJxwHEqe4VkFQRiQZSYM_nKQQ', 'places/ChIJxwHEqe4VkFQRiQZSYM_nKQQ/reviews/ChZDSUhNMG9nS0VJQ0FnSURINkl6VlhREAE', '6 months ago', 5, 'Today I visited Robin''s Great Cream and Cookies and tried their Starbeerwy Cream and Macklemore Cookies, and I must say, it was an unforgettable treat! The Starbeerwy Cream was incredibly smooth, with a perfect balance of sweetness and creaminess. It had a unique flavor that was both rich and refreshing. The Macklemore Cookies were equally impressive crispy on the outside and chewy on the inside, with just the right amount of sweetness. Each bite was packed with flavor, making them a delightful complement to the ice cream. The place itself was cozy, clean, and had a welcoming atmosphere. I will definitely be coming back to satisfy my sweet tooth!', '2025-03-28 21:45:48.906', '2025-03-28 21:45:48.906'),
	('cm8tbaeeh0009jr0nxxu0qlxo', 'ChIJxwHEqe4VkFQRiQZSYM_nKQQ', 'places/ChIJxwHEqe4VkFQRiQZSYM_nKQQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUNEd29iR3N3RRAB', 'a year ago', 5, 'As I was walking through University Village I could smell the delicious aroma of fresh baked cookies. I literally couldn’t help myself and headed directly to “Hello Robin” cookies. I walked in the door and was pleasantly greeted by three super friendly cookie makers. I absolutely knew what I wanted as it''s not my first visit to this amazing cookie shop. I ordered the Birthday Cake and the Mackles''more. Everyday can be a birthday with a birthday cake cookie!  The sprinkles literally make me smile. Mackles''more are a s''more cookie with a chunk of Theo chocolate.  These cookies are heaven on earth.  There are quite a few other deeeelish cookies.  But, these are my all time faves!

The store is clean. The staff is friendly and helpful.  All around great experience whenever I visit.  If you love cookies as much as I do...  Then you must give "Hello Robin" a try.  I absolutely recommend these cookies to cure your sweet tooth.', '2025-03-28 21:45:48.906', '2025-03-28 21:45:48.906'),
	('cm8tbaiz9000ajr0nigw2k7ym', 'ChIJN9G3RI8UkFQRYUs08BNRv3s', 'places/ChIJN9G3RI8UkFQRYUs08BNRv3s/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzdGF5R0VBEAE', '4 months ago', 3, 'The staff were very helpful and friendly, the food was delicious.
The takeaway time estimation was extremely precise, up to the minute.
We.loved the Burrito and Burrito bowls with the smoke brisket, but the chips where too much oily and salty, more than usual and we didn''t like them.
The restaurant though was very dirty. The floor was full of dirt, open bags everywhere and stains, which ruined the experience.
The tables weren''t very clean as well and it was hard to feel comfortable eating there, so eventually we decided to order take away.', '2025-03-28 21:45:54.837', '2025-03-28 21:45:54.837'),
	('cm8tbaiz9000bjr0nynrwzwpv', 'ChIJN9G3RI8UkFQRYUs08BNRv3s', 'places/ChIJN9G3RI8UkFQRYUs08BNRv3s/reviews/ChZDSUhNMG9nS0VJQ0FnSUM5OGFPS0xREAE', 'a year ago', 1, 'The Chipotle is great. Except this one obese man who ruins the entire service. He is so stingy it is insane. At every other Chipotle my bowl is full, to the brims. I have attached a picture of the bowl this guy serves. He gave a single scoop of rice. The woman served the cheese and veggies served more cheese and sour cream than there is rice and meat. Not because she gives absurdly high portions, but because this guy gives so little food. He’s constantly talking to people in the kitchen and has a smug look while he does this. I have never come across a fat individual who has been so stingy about food. I recommend not going to this location until after 5 when his shift ends.', '2025-03-28 21:45:54.837', '2025-03-28 21:45:54.837'),
	('cm8tbaiz9000cjr0nvjeewlsx', 'ChIJN9G3RI8UkFQRYUs08BNRv3s', 'places/ChIJN9G3RI8UkFQRYUs08BNRv3s/reviews/ChdDSUhNMG9nS0VJQ0FnSUM5amUtdDZnRRAB', 'a year ago', 1, 'I recently ordered from this location near University of Washington, and I''m disgusted to report I found multiple pieces of plastic wrap cooked into my food. This is a serious food safety issue, and it''s made me extremely wary of eating here again.

I contacted the customer service department immediately with photos and a request for an investigation and refund. Their lack of response is incredibly concerning. It shows a blatant disregard for customer safety and makes me question their overall kitchen practices.

Students and everyone else, be warned! Until this restaurant takes food safety seriously, I cannot recommend eating here. If you value your health, I suggest finding somewhere else for your meals.', '2025-03-28 21:45:54.837', '2025-03-28 21:45:54.837'),
	('cm8tbaiz9000djr0n1y7qe420', 'ChIJN9G3RI8UkFQRYUs08BNRv3s', 'places/ChIJN9G3RI8UkFQRYUs08BNRv3s/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRaEpXMHhBRRAB', '3 weeks ago', 5, 'Great service and great portions!', '2025-03-28 21:45:54.837', '2025-03-28 21:45:54.837'),
	('cm8tbaiz9000ejr0n8nrqnih8', 'ChIJN9G3RI8UkFQRYUs08BNRv3s', 'places/ChIJN9G3RI8UkFQRYUs08BNRv3s/reviews/ChdDSUhNMG9nS0VJQ0FnSURuclptN21BRRAB', '5 months ago', 2, 'Found this label in the meal. Not being picky about it, but it’s very unsafe and unprofessional and not being careful when processing food, as being a such big cooperation restaurant.', '2025-03-28 21:45:54.837', '2025-03-28 21:45:54.837'),
	('cm8tbakmm000fjr0nzrwgz1tk', 'ChIJj83EL2EVkFQRJZUWk6KIXn8', 'places/ChIJj83EL2EVkFQRJZUWk6KIXn8/reviews/ChZDSUhNMG9nS0VJQ0FnSURfNmJHUVV3EAE', '2 months ago', 5, 'During our recent visit to Bamboo Sushi at University Village in Seattle, we started with the hand roll trio from the happy hour menu, featuring one spicy tuna, one spicy albacore, and one spicy salmon hand roll. Additionally, we indulged in the honey crispy chicken. Both appetizers were flavorful and full of delightful nuances.

For our main course, we opted for a selection of rolls, including one spicy salmon hand roll, one tuna hand roll, one shrimp tempura hand roll, and the Bamboo wedge. While the food was good and flavorful, it did not stand out as exceptional, particularly considering the price, which seemed rather high for the quality of sushi offered.

Overall, Bamboo Sushi delivered a satisfying dining experience, though the value for money could be improved.', '2025-03-28 21:45:56.975', '2025-03-28 21:45:56.975'),
	('cm8tbakmm000gjr0nypct3y4f', 'ChIJj83EL2EVkFQRJZUWk6KIXn8', 'places/ChIJj83EL2EVkFQRJZUWk6KIXn8/reviews/ChZDSUhNMG9nS0VJQ0FnSUNmNWNfT1lREAE', '2 months ago', 4, 'Everything we ordered was good; first meal of the day, we’ve got: Miso Soup, Mini Kanpachi, Garden of Eden, Grilled Octopus, Crispy Brussels Sprouts, Dry mountain (cold Sake). I will come back for Kanpachi and Garden of Eden roll. Crispy Brussels Sprouts was almost too sweet while i was more craving for savory flavors.', '2025-03-28 21:45:56.975', '2025-03-28 21:45:56.975'),
	('cm8tbakmm000hjr0nsncuietz', 'ChIJj83EL2EVkFQRJZUWk6KIXn8', 'places/ChIJj83EL2EVkFQRJZUWk6KIXn8/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYNUtpaEhnEAE', '5 months ago', 5, 'Wow, I don’t usually go out of my way to review something, but both my wife and I loved the food so much that I had to. The food is GREAT. Service was friendly, and the photos of their fishing team was intriguing. It’s in the city so the prices are a bit expensive, but this is some of the best food I’ve had in years. Hats off to the chefs. We already devoured our food before we remembered to take a photo ha. Also almost everything was gluten free!', '2025-03-28 21:45:56.975', '2025-03-28 21:45:56.975'),
	('cm8tbawaf0007jl0j212vx40v', 'ChIJh130q6kVkFQRJ6oCy52XKxw', 'places/ChIJh130q6kVkFQRJ6oCy52XKxw/reviews/ChdDSUhNMG9nS0VJQ0FnSUNQOHZTdzZRRRAB', '4 months ago', 5, 'amazing asian fusion restaurant! I would highly recommend getting a coffee with your meal! My favorite would be the cream brulee egg coffee!  Another would be the Banh Mi Chao as it''s a classic Vietnamese breakfast. Note that the taste may be a bit more on the sweeter side for the flavoring! Thai tea french toast was an amazing part of the brunch meal!', '2025-03-28 21:46:12.088', '2025-03-28 21:46:12.088'),
	('cm8tbakmm000ijr0n1bgwrhgs', 'ChIJj83EL2EVkFQRJZUWk6KIXn8', 'places/ChIJj83EL2EVkFQRJZUWk6KIXn8/reviews/ChZDSUhNMG9nS0VJQ0FnSURYNmZqZ2ZBEAE', '5 months ago', 3, 'We are at U Village often and have tried most restaurants except Bamboo Sushi. Our adventurous-with-food 3 year old wanted sushi for dinner so this was the only option. Even at 5pm, there was a wait for a table, so surely this place must be good, right?

We ordered quite a few dishes to try including the Spicy Miso Soup, Tuna Crispy Rice, Agadeshi Tofu, Black Cod, Big Island Roll, Salmon Maki, Ikura and Scallop Nigiri.

The food, while presented beautifully, was good... In a mediocre way. I would consider this restaurant more a fusion or Japanese-inspired restaurant (catering to a less "diversified" palate) than a true sushi restaurant. Something just didn''t feel authentic about the food we were eating, and all of it being expensive. I mean, $6 for miso soup that tastes just like the instant kind you can buy at your Asian grocery store.

There are great sushi restaurant in Seattle, most are on the expensive side compared to what''s available in places like Vancouver, BC. But when you''re spending $140+ on sushi, there are so many options (Wataru & Shiro).

Probably won''t come here again unless it''s the ONLY option, but in my opinion it was not worth the wait or the price. None of the sushi chefs were Asian (let alone, Japanese) and the majority of the diners were Caucasian, those are usually a good indicator of what the food/experience will be like at an Asian restaurant. The dining experience was pleasant, and our server was really nice though 👍', '2025-03-28 21:45:56.975', '2025-03-28 21:45:56.975'),
	('cm8tbakmm000jjr0nfaacublo', 'ChIJj83EL2EVkFQRJZUWk6KIXn8', 'places/ChIJj83EL2EVkFQRJZUWk6KIXn8/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzLU5QeWJ3EAE', '4 months ago', 2, 'Mid , very mid besides a cool decor i just didn’t feel like any tastes were authentic for my roll, salmon was okay. But so was the rest of my food just okay, nothing really special except if you like to look fancy. Also wait time for a semi empty place was a little odd.', '2025-03-28 21:45:56.975', '2025-03-28 21:45:56.975'),
	('cm8tbauj70000jl0j5kkmd1iy', 'ChIJ_ziiFRYVkFQRc4axemYjm4w', 'places/ChIJ_ziiFRYVkFQRc4axemYjm4w/reviews/ChZDSUhNMG9nS0VJQ0FnSURYcWR1Vk1nEAE', '4 months ago', 5, '🥘FOOD🥘: 9/10
Quality: We LOVE Dough Zone! Like you see in the picture, the two of us ordered so much food! The kale salad is the best I have ever had, the sweet and sour flavors helps to cover the bitterness of the kale and the texture of the kale is everything! A very refreshing appetizer. And the dan dan noodle is always phenomenal! It was cooked to perfection. Very tender and flavorful.

Appearance: All the food looks great! The potstickers are looking like a beautiful art to me!

Portion size: Well, I always think that the portion could always be bigger! It would be more satisfying for the customers especially when they are hungry.

🧑🏻‍ Service🧑🏻‍: 8/10
Friendliness: Service is solid! The servers that served us are all very nice and friendly! Even thought we came there late and they are ready to close, they took us and still gave us great service!

Timeliness: Food arrived quite fast, we did not wait for too long and it came to us in nice and warm temperature.

Environment: Very clean and nice, The lighting is perfect and I loved how everything looks, very simple yet modern.

Location: Great location! Right next to U-village and underneat the apartment complex. It might be difficult to find parkings because the residents took all of the street parkings available. But it wasn’t too far if you parked at U-village and walked to Dough Zone!', '2025-03-28 21:46:09.811', '2025-03-28 21:46:09.811'),
	('cm8tbauj70001jl0jbb3efvv2', 'ChIJ_ziiFRYVkFQRc4axemYjm4w', 'places/ChIJ_ziiFRYVkFQRc4axemYjm4w/reviews/ChZDSUhNMG9nS0VJQ0FnSUN6OTRIYlVnEAE', '9 months ago', 4, 'I got the pan fried wontons with chili garlic sauce and Dan Dan noodles and they tasted great! Really loved how crispy the edges of the pan fried wontons were and juicy the chicken and veggie filling was. The Dan Dan noodles were the right amount of spicy for me and a nice combo with the dumplings.

I got a takeout and it came in a very nice bag as seen in the pics and it took maybe 20 minutes? But the restaurant wasn’t busy at the time. The only complaint I have is that the portions are sooooo small for the price. Especially the dan dan noodles which are $8 but I finished it in like 3 bites. Good meal for $15 but not very filling.', '2025-03-28 21:46:09.811', '2025-03-28 21:46:09.811'),
	('cm8tbauj70002jl0jrwj4qqev', 'ChIJ_ziiFRYVkFQRc4axemYjm4w', 'places/ChIJ_ziiFRYVkFQRc4axemYjm4w/reviews/ChdDSUhNMG9nS0VJQ0FnSUR6NWVQQXp3RRAB', '9 months ago', 4, 'The place was quite crowded last weekend. We were waitlisted for about 20 mins. There wasn’t any parking available.

It’s quite small place with not many tables available but if you like dumplings then you’d like it. We had 4 different dishes that came in relatively small portions. I’m quite disappointed that the beef buns’ beef wasn’t tasted like beef and not tender. Other dishes were just okay. I wouldn’t come back again as I can cook way better dumplings at home.', '2025-03-28 21:46:09.811', '2025-03-28 21:46:09.811'),
	('cm8tbauj70003jl0jd0a3rjux', 'ChIJ_ziiFRYVkFQRc4axemYjm4w', 'places/ChIJ_ziiFRYVkFQRc4axemYjm4w/reviews/ChdDSUhNMG9nS0VJQ0FnTURBc1k2dHp3RRAB', 'a month ago', 5, 'Very busy location depending on the time. Good food, although the cucumber appetizer is not worth the price.', '2025-03-28 21:46:09.811', '2025-03-28 21:46:09.811'),
	('cm8tbauj70004jl0jke2yqwyo', 'ChIJ_ziiFRYVkFQRc4axemYjm4w', 'places/ChIJ_ziiFRYVkFQRc4axemYjm4w/reviews/ChdDSUhNMG9nS0VJQ0FnSUN4cUxmUWdBRRAB', 'a year ago', 4, 'Was recommend to try this place by some friends when visiting Seattle. A little hard to find parking space and does get pretty busy.

Service was good, order was taken quickly as there’s a menu you tick off what you want. Food portions were on the smaller size but considering price it’s average.

Surprising the star of the show were the pan fried chicken dumplings!! Normally they’re dry but these one were nice and juicy on the inside and crispy on the outside. Would definitely come back for these!', '2025-03-28 21:46:09.811', '2025-03-28 21:46:09.811'),
	('cm8tbawaf0005jl0jyp1gykq6', 'ChIJh130q6kVkFQRJ6oCy52XKxw', 'places/ChIJh130q6kVkFQRJ6oCy52XKxw/reviews/ChdDSUhNMG9nS0VJQ0FnSURmamNhUnBnRRAB', '2 months ago', 5, 'M Cozy Fusion Cafe was definitely worth the drive!

We started with the Coffee Flight and it came with - Purple Haze Latte, Egg Coffee, Coffeeholic Dream and Vietnamese Coffee.
My personal favorites were the Egg Coffee and Vietnamese Coffee. The Coffeeholic Dream was just way too sweet for me.

We ordered the Chicken & Pandan Waffle and the Banh Mi Chao. First off the Pandan Waffle was fluffy and had the true flavor of Pandan (which i love!) and the chicken was crispy and the sauce was amazing!!

The real star of the show was the Banh Mi Chao. It comes with a baguette so you can dip it in the skillet. The rib eye was tender and paired well with pate, eggs, chua lua and tomatoes!

Also, 5/5 stars because the bathrooms were clean when we were there!

The laid-back atmosphere was also perfect for brunch for a group of five. We hope to be back!!!', '2025-03-28 21:46:12.088', '2025-03-28 21:46:12.088'),
	('cm8tbawaf0006jl0jibe6zwwc', 'ChIJh130q6kVkFQRJ6oCy52XKxw', 'places/ChIJh130q6kVkFQRJ6oCy52XKxw/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBaWRDUUVREAE', 'a month ago', 5, 'Delicious Vietnamese food. Went here the week prior for the chicken pandan waffles and bo luc lac (forgot to take pictures), and we enjoyed the food so much we came back for banh mi chao & banh mi chao beef stew.

Easy self order service. Atmosphere is chill, and the design of the restaurant is unique.', '2025-03-28 21:46:12.088', '2025-03-28 21:46:12.088'),
	('cm8tbawaf0008jl0jeqvu7rn2', 'ChIJh130q6kVkFQRJ6oCy52XKxw', 'places/ChIJh130q6kVkFQRJ6oCy52XKxw/reviews/ChZDSUhNMG9nS0VJQ0FnSUQ3NXVuU2NREAE', '7 months ago', 5, 'FIVE. THE BEST BRUNCH IVE EVER HAD EVER. let the photos speak for itself. but fair warning all our food plus tip and tax was around $80. starting off strong, the chicken wings were delicious! there was a unique glaze that created such a beautiful flavor profile. then, the ube pancakes were good, but not GREAT. it was very heavy and filling. i had extra so i took it home, but it got SO dry overnight in the fridge. i had to pair each pancake bite with two sips of water. my friend’s banh mi chao was good, from the two bites i stole. my latte was good, the ube was very flavorful and thick. my friend said her tiramisu latte was too salty? anywho, if you’re looking for a cute brunch spot for photos, this is your place!! the presentation is gorgeous and carried the average taste to a five star rating!', '2025-03-28 21:46:12.088', '2025-03-28 21:46:12.088'),
	('cm8tbawaf0009jl0jfgudts3l', 'ChIJh130q6kVkFQRJ6oCy52XKxw', 'places/ChIJh130q6kVkFQRJ6oCy52XKxw/reviews/ChZDSUhNMG9nS0VJQ0FnSURIcm96R1p3EAE', '6 months ago', 5, 'Just WOW: delicious food, great customer service and cannot forget that huge portion sizes. You can definitely go for brunch and come back with free Dinner. Owner is also super friendly and very caring towards customers. Definitely worth going!', '2025-03-28 21:46:12.088', '2025-03-28 21:46:12.088'),
	('cm8tbayqy000ajl0jrmz2s375', 'ChIJ_0xsUY8UkFQRekt-sjJOM88', 'places/ChIJ_0xsUY8UkFQRekt-sjJOM88/reviews/ChZDSUhNMG9nS0VJQ0FnSUNub3AzQlZnEAE', '6 months ago', 4, 'The food was decent. We ordered Tsukemen, Bento box, and salmon rice.
Tsukemen tastes great, but we would love it more if they have the option to replace the noodles with Kale noodles.

Bento box was just okay. The Vegas roll in the Bento box was a bit fried that we are not a huge fun of.

The salmon rice looks better in the menu picture with more Ikura on top of it. The taste is also just average.

Overall, since it is a ramen restaurant, we recommend ordering ramen.  As for the other small dishes,  you may find better options somewhere else.', '2025-03-28 21:46:15.274', '2025-03-28 21:46:15.274'),
	('cm8tbayqy000bjl0jz5m2kc9k', 'ChIJ_0xsUY8UkFQRekt-sjJOM88', 'places/ChIJ_0xsUY8UkFQRekt-sjJOM88/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfdDd5c1NnEAE', '2 months ago', 3, 'Decent ramen and subpar service. There is an initial rush to take your order before you open the menu, not putting in items your table orders and unfortunate ramen spills at the table.', '2025-03-28 21:46:15.274', '2025-03-28 21:46:15.274'),
	('cm8tbayqy000cjl0jkwdaib7e', 'ChIJ_0xsUY8UkFQRekt-sjJOM88', 'places/ChIJ_0xsUY8UkFQRekt-sjJOM88/reviews/ChZDSUhNMG9nS0VJQ0FnSURUX1lEOEVREAE', '10 months ago', 5, 'One of the best ramen dishes my family has ever had (I haven''t had as much as them)! I drank every last bit of the broth (forgot to take a picture of the full bowl!), and the pork belly tasted so fresh. It was excellent and I will definitely go back.', '2025-03-28 21:46:15.274', '2025-03-28 21:46:15.274'),
	('cm8tbayqy000djl0j2tfj4zks', 'ChIJ_0xsUY8UkFQRekt-sjJOM88', 'places/ChIJ_0xsUY8UkFQRekt-sjJOM88/reviews/ChZDSUhNMG9nS0VJQ0FnSUNsZ2RPVUFREAE', '8 months ago', 5, 'The soup noodle is excellent as usual. Do not recommend the dipping noodle - the soup is super greasy, the noodle was quite hard to chew. I had asked them to cook the noodle softer, but it didn’t make much difference. The karaage chicken was excellent - crispy and juicy and tender.', '2025-03-28 21:46:15.274', '2025-03-28 21:46:15.274'),
	('cm8tbayqy000ejl0jgnrt69rh', 'ChIJ_0xsUY8UkFQRekt-sjJOM88', 'places/ChIJ_0xsUY8UkFQRekt-sjJOM88/reviews/ChdDSUhNMG9nS0VJQ0FnSURicjhPMzhnRRAB', '7 months ago', 4, 'Ramen was delicious - I got the Kara Miso and my friend got the Miso ramen. They can adjust the salt level upon request which was perfect because it would have been salty for my personal taste. Kara Miso had a nice little kick of spice and the broth is rich so even though the regular size bowl seems small, with the other items we got - it was a good amount. Kaarage is ok - good flavor, but I think I am biased to Kizuki Ramen''s style if Kaarage. Sushi roll is ok - not super mind-blowing and could probably do without it given the price. Waiter came back the right amount of times to refill our water and didn’t hover over us too often. I would definitely come back to try other ramen flavors!', '2025-03-28 21:46:15.274', '2025-03-28 21:46:15.274'),
	('cm8tbayrp000kjr0nxs6v14ua', 'ChIJreTBgIcUkFQRKh_jcEGENNY', 'places/ChIJreTBgIcUkFQRKh_jcEGENNY/reviews/ChZDSUhNMG9nS0VJQ0FnSURQOW82YVJBEAE', '3 months ago', 5, 'Shocked this place doesn’t have better reviews! I’ve been going to this location the last two years and I ALWAYS get fresh fries, they have never messed up my order (even when ordering delivery), and the people who work there are always so nice. Always very impressed. Deserves 5 stars. Definitely the best location in seattle and may be the best McDonald’s location I’ve been to. Thanks for always making our experience positive!', '2025-03-28 21:46:15.302', '2025-03-28 21:46:15.302'),
	('cm8tbayrp000ljr0ntkoro7ln', 'ChIJreTBgIcUkFQRKh_jcEGENNY', 'places/ChIJreTBgIcUkFQRKh_jcEGENNY/reviews/ChZDSUhNMG9nS0VJQ0FnSUN6X19DeWNBEAE', '9 months ago', 1, 'This is the second time in as many visits that I was served the wrong item after ordering a 2 dollar breakfast sandwich using the mobile app. It seems like the store is trying to shortchange me for not paying full price for my order. I ordered a steak egg cheese biscuit but tell me how I was given bacon instead?!', '2025-03-28 21:46:15.302', '2025-03-28 21:46:15.302'),
	('cm8tbayrp000mjr0ntqr1s43h', 'ChIJreTBgIcUkFQRKh_jcEGENNY', 'places/ChIJreTBgIcUkFQRKh_jcEGENNY/reviews/ChdDSUhNMG9nS0VJQ0FnSUNoaEtQNDB3RRAB', '2 years ago', 5, 'Another rainy evening along Ravenna Park. I couldn’t resist stopping at my local McDonalds for a Happy Meal. The red box with the bright, yellow smile made me feel a lot better. My Quarter Pounder with Cheese Burger did get mixed up with another order, but I managed to get it replaced. Using the touch screen tablet was easy and convenient. It must be a very busy location.', '2025-03-28 21:46:15.302', '2025-03-28 21:46:15.302'),
	('cm8tbayrp000njr0nxpad095q', 'ChIJreTBgIcUkFQRKh_jcEGENNY', 'places/ChIJreTBgIcUkFQRKh_jcEGENNY/reviews/ChdDSUhNMG9nS0VJQ0FnTURRXzZTM2hBRRAB', 'a week ago', 5, 'One of the best mcdonalds. Very pricey however, it feels like it''s ran like a chic fil a which was cool very fast good food and nice staff.', '2025-03-28 21:46:15.302', '2025-03-28 21:46:15.302'),
	('cm8tbayrp000ojr0n0gb2jvyt', 'ChIJreTBgIcUkFQRKh_jcEGENNY', 'places/ChIJreTBgIcUkFQRKh_jcEGENNY/reviews/ChdDSUhNMG9nS0VJQ0FnTURRenNmMjZnRRAB', '2 weeks ago', 3, 'My fries were a little cold thought that was weird being around lunch time thought it would be fresh and they didn’t have much salt', '2025-03-28 21:46:15.302', '2025-03-28 21:46:15.302'),
	('cm8tbb0my000fjl0j4ykfqpm5', 'ChIJrSCXsYAUkFQRz6CAeOdb5Ik', 'places/ChIJrSCXsYAUkFQRz6CAeOdb5Ik/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3bnV5dXRRRRAB', 'a week ago', 5, 'My daughter and I had a day date with each other, and what a stupendous and amazing experience we had! There were so many tea choices to choose from! The treats were delectable, and the cakes we packed full of flavor! The atmosphere is fun and inviting. Overall, it''s was a truly magical time!', '2025-03-28 21:46:17.722', '2025-03-28 21:46:17.722'),
	('cm8tbb0my000gjl0jiw8fuqwt', 'ChIJrSCXsYAUkFQRz6CAeOdb5Ik', 'places/ChIJrSCXsYAUkFQRz6CAeOdb5Ik/reviews/ChdDSUhNMG9nS0VJQ0FnTURBaVpUUzh3RRAB', 'a month ago', 4, 'It was a wonderful Afternoon Tea experience today.  The food was very delicious and I especially liked the many loose teas.  The service was good, but I have to remind the server of my drink and a missing glass of water.  The water was provided at the table, but missing the drinking glasses.  Other than that it was great service.', '2025-03-28 21:46:17.722', '2025-03-28 21:46:17.722'),
	('cm8tbb0my000hjl0jbhn0n1ul', 'ChIJrSCXsYAUkFQRz6CAeOdb5Ik', 'places/ChIJrSCXsYAUkFQRz6CAeOdb5Ik/reviews/ChZDSUhNMG9nS0VJQ0FnSUNMLUxfekJ3EAE', '9 months ago', 5, 'Visited Queen Mary’s tea room for high tea. Our reservation was for three, unfortunately one of our party was ill and unable to attend. Our server was wonderful about putting together travel friendly treats to go so she didn’t miss out! The shop itself is lovely from the street and has a well curated and whimsical interior. We were a few minutes early for our reservation and were still seated right away. The tables are a little tight but the owner makes the most of the space available and it didn’t take away from the experience at all. The tea was wonderful and the savory parts of the high tea service were favorites with our party. This is a popular place but the service didn’t suffer for that at all. Analise was friendly and attentive and we enjoyed our time with her. Overall a great experience that I would recommend!', '2025-03-28 21:46:17.722', '2025-03-28 21:46:17.722'),
	('cm8tbb0my000ijl0j1e62bnwm', 'ChIJrSCXsYAUkFQRz6CAeOdb5Ik', 'places/ChIJrSCXsYAUkFQRz6CAeOdb5Ik/reviews/ChZDSUhNMG9nS0VJQ0FnSURuanFtN2RBEAE', '5 months ago', 5, 'We celebrated a birthday here and the gluten free options were fantastic! Jaime, our server, was wonderful and explained all the different tea and food options in great detail and gave recommendations based on what we were looking for. It was lovely to see how everyone worked together to create such a welcoming environment. Also very much appreciated the different shots of tea that were going around!', '2025-03-28 21:46:17.722', '2025-03-28 21:46:17.722'),
	('cm8tbb0my000jjl0jcdaoyybj', 'ChIJrSCXsYAUkFQRz6CAeOdb5Ik', 'places/ChIJrSCXsYAUkFQRz6CAeOdb5Ik/reviews/ChZDSUhNMG9nS0VJQ0FnSURWd0tMWWV3EAE', 'a year ago', 4, 'Tea rooms have a special meaning to me since I got engaged at one and I can''t believe I have never been to this one in Seattle. As soon as I walked in it was very inviting, very quaint & very nice. It is cramp quarters in there with the seating, but everything else was divine. There was four of us so we all decided to get the afternoon tea special and it wasn''t cheap. It was $72 each. I think the arrangement was more sweet and it was a little over-the-top with the sweetness but it was just ok.  If I go back I wouldn''t order this again but would order just a main dish. Need to experience once. The service and ambience was great. I just think it was overpriced for what you get. The tea was delicious. I felt rushed when ordering, so of course I just got my regular tea of choice. There was just so many to choose from on the tea menu, it was overwhelming. We got a couple of samples of tea while seated so that was a bonus. Very festive to have our girlfriends to get together for three holidays. I would definitely go back!', '2025-03-28 21:46:17.722', '2025-03-28 21:46:17.722'),
	('cm8tbb9bt000kjl0ju52jr1ow', 'ChIJ0QorBQ4VkFQR4AzylyqP4ME', 'places/ChIJ0QorBQ4VkFQR4AzylyqP4ME/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnd2F6b0JREAE', 'a month ago', 5, 'Yummy donut! I ordered the Chocolate Marshmallow one, and it wasn''t too sweet—just the way I love it. When I visited, there were about 5-6 different options to choose from. The matcha latte with oat milk (half sweet) was decent, but not amazing.

There are about 5-6 small tables, which aren’t ideal for large groups, but perfect for a small group chat or doing some work.', '2025-03-28 21:46:28.985', '2025-03-28 21:46:28.985'),
	('cm8tbb9bt000ljl0jf1pijcqy', 'ChIJ0QorBQ4VkFQR4AzylyqP4ME', 'places/ChIJ0QorBQ4VkFQR4AzylyqP4ME/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYX2EyLXJBRRAB', '5 months ago', 5, 'bangin coffee & donuts with chill vibes near the university village. i live not too far away so i usually bike here, have my lil treat, and then i bike back home

they have special seasonal donuts and drinks that rotate every month. so far, my favorites have been the strawberry cheesecake & the tiramisu donuts and the cardamom spiced latte.

the inside is cutely decorated and the service is always great. usually my coffee is made by adela (hope i''m spelling that right!) who is the nicest ever, awesome to yap with, and makes a meeeean coffee.

u village gets super crowded so if you want something sweet after finishing your shopping, general porpoise is the way to go!', '2025-03-28 21:46:28.985', '2025-03-28 21:46:28.985'),
	('cm8tbb9bt000mjl0jnaucwmqb', 'ChIJ0QorBQ4VkFQR4AzylyqP4ME', 'places/ChIJ0QorBQ4VkFQR4AzylyqP4ME/reviews/ChZDSUhNMG9nS0VJQ0FnSURmX2RxeGR3EAE', '2 months ago', 5, 'The cream donut was fantastic, the latte was lovely, and both the front staff were nice and helpful. The atmosphere was very chill, great to sip a coffee and enjoy a donut and get a little work done.', '2025-03-28 21:46:28.985', '2025-03-28 21:46:28.985'),
	('cm8tbb9bt000njl0jo19l6fer', 'ChIJ0QorBQ4VkFQR4AzylyqP4ME', 'places/ChIJ0QorBQ4VkFQR4AzylyqP4ME/reviews/ChdDSUhNMG9nS0VJQ0FnSURfX19fX2pRRRAB', 'a month ago', 5, 'I saw this shop when I passed by, it looked very cozy so I went in to take a look, it turned out to be a donut shop, the donuts there were quite delicious, a bit like Japanese donuts, not cheap, nice to have once in a while!', '2025-03-28 21:46:28.985', '2025-03-28 21:46:28.985'),
	('cm8tbb9bt000ojl0j77y19bdj', 'ChIJ0QorBQ4VkFQR4AzylyqP4ME', 'places/ChIJ0QorBQ4VkFQR4AzylyqP4ME/reviews/ChZDSUhNMG9nS0VJQ0FnSURPNllldUh3EAE', '2 years ago', 5, 'While totally unassuming from the outside,  it''s a true delight to be washed in bubble gum pink and sky blue when you walk in the door. The quality of their coffee is superb and even a standard drip tastes like a special treat which is a testament to their coffee making ability. Unfortunately no gluten free donuts are offered, so I cannot comment on those, but they did look and smell incredible and I don''t doubt they are absolutely worth the trip. Will definitely be back soon for coffee!', '2025-03-28 21:46:28.985', '2025-03-28 21:46:28.985'),
	('cm8tbzqlm000pjl0j3ujoke49', 'ChIJs6-KANy0RIYRRTcMhnhoFaE', 'places/ChIJs6-KANy0RIYRRTcMhnhoFaE/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzcDVTbTl3RRAB', '4 months ago', 5, 'After looking at reviews, I had to try all the food here.

So we made time to stop for lunch before heading back home.

So glad we did, the place is massive with plenty of seating inside and out.
We ordered our food with the attendant at the bar and he was so helpful with questions and attentive. The drink I got was absolutely delicious!

The food came out at a good time and everything was AMAZING, the food was delicious, fresh and just yummy!

I.am definitely coming back.', '2025-03-28 22:05:31.115', '2025-03-28 22:05:31.115'),
	('cm8tbzqlm000qjl0j9rv0b85p', 'ChIJs6-KANy0RIYRRTcMhnhoFaE', 'places/ChIJs6-KANy0RIYRRTcMhnhoFaE/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfMTVmelRREAE', '2 months ago', 4, 'Brew-pub in a warehouse serving beer, some wine, and a couple of ciders. Stage music on the schedule usually in the evenings. Surprisingly a lot of kids. Selection is good, a little loud (good or bad depending on your preferences). Free parking on our visit. Good visit, large space.', '2025-03-28 22:05:31.115', '2025-03-28 22:05:31.115'),
	('cm8tbzqlm000rjl0jj9tsfpfq', 'ChIJs6-KANy0RIYRRTcMhnhoFaE', 'places/ChIJs6-KANy0RIYRRTcMhnhoFaE/reviews/ChZDSUhNMG9nS0VJQ0FnSURuMGFPNWNBEAE', '5 months ago', 5, 'Consistently enjoyable brewery with huge indoor and outdoors seating areas, great stage for performance, and diverse menu of locally crafted draft beers.
Its long beer garden style tables make it a great place to bring or meet large parties of people.
They have a large parking lot and more parking along nearby streets.', '2025-03-28 22:05:31.115', '2025-03-28 22:05:31.115'),
	('cm8tbzqlm000sjl0jjzzbtme8', 'ChIJs6-KANy0RIYRRTcMhnhoFaE', 'places/ChIJs6-KANy0RIYRRTcMhnhoFaE/reviews/ChdDSUhNMG9nS0VJQ0FnSUNyby0yeTlBRRAB', '8 months ago', 5, 'Hell yeah! One of the most awarded and tenured among modern Austin breweries, and still going strong. Enjoyed collaborations with other breweries, generally focusing on lagers. Pizza was also huge and eat for the family. We all enjoyed the welcoming, diverse environment and graffiti art.', '2025-03-28 22:05:31.115', '2025-03-28 22:05:31.115'),
	('cm8tbzzp2000ujl0jh4fnhj2t', 'ChIJH-Sj5OK0RIYRjC-_RrNEotk', 'places/ChIJH-Sj5OK0RIYRjC-_RrNEotk/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBX2FtWGJREAE', 'a month ago', 5, 'I’m always saying that even if you’re not plant-based, you should definitely try some of the many incredible meals that are, and this restaurant is proof of that.

I had the “broccoli tofu salad”, and we also shared the sweet potato entrée—both were absolutely delicious.

The flavors were incredible, and the portions were generous, which made the unbelievably low prices even more surprising.

I also ordered a coffee, and it came in the biggest mug I’ve ever seen at a place like this.

They served water, which I always appreciate since it’s not common where I’m from.

Everything looked amazing. A fantastic experience overall!', '2025-03-28 22:05:42.903', '2025-03-28 22:05:42.903'),
	('cm8tbzzp2000vjl0jthiz76d0', 'ChIJH-Sj5OK0RIYRjC-_RrNEotk', 'places/ChIJH-Sj5OK0RIYRjC-_RrNEotk/reviews/ChZDSUhNMG9nS0VJQ0FnSURmaDdyNFRREAE', '2 months ago', 5, 'Oh my gosh, this place blew us away! Hands down one of the best vegetarian restaurants we’ve ever been to. Every single bite was incredible!! so fresh, flavorful, and creative. The food was just on another level.

And the drinks? Don’t even get me started. The green juices were so refreshing, and their healthy coffee options were so good- we couldn’t stop talking about how much we loved them. It’s the kind of menu where you want to try everything because it all looks amazing.

On top of that, our server was seriously the best. So friendly, helpful, and genuinely excited about the menu, which made the whole experience even better. You could tell they cared about making sure we had an awesome time.

This spot is officially a must-stop for us anytime we’re in Austin. If you love amazing food and drinks that are as healthy as they are delicious, you have to check it out. We’re already planning our next visit!', '2025-03-28 22:05:42.903', '2025-03-28 22:05:42.903'),
	('cm8tbzzp2000wjl0jzrynmfpi', 'ChIJH-Sj5OK0RIYRjC-_RrNEotk', 'places/ChIJH-Sj5OK0RIYRjC-_RrNEotk/reviews/ChZDSUhNMG9nS0VJQ0FnTURRMU5hTk93EAE', '2 weeks ago', 5, 'Loved the food and service here so much that we ate here twice on our trip to Austin! The blueberry cornbread and tofu scramble are particularly good. Low prices, great options for both vegans and vegetarians, a fantastic location, funky decor, and wonderful service. I’d recommend this to anyone who wants a good brunch in Austin.', '2025-03-28 22:05:42.903', '2025-03-28 22:05:42.903'),
	('cm8tbzzp2000xjl0j1osb90i0', 'ChIJH-Sj5OK0RIYRjC-_RrNEotk', 'places/ChIJH-Sj5OK0RIYRjC-_RrNEotk/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRNGRPcEJ3EAE', '3 weeks ago', 5, 'After a chaotic and exhausting day traveling to Austin, I headed straight here for a late lunch / early dinner. Loved everything I tried (purple cloud latte, mushroom fajitas, and double chocolate brownie a la mode - menu can mostly be made vegan). More importantly, loved the staff! I was too tired to get the names, but they were all super attentive, helped me charge my phone, and even gave me an emotional support brownie at the end!', '2025-03-28 22:05:42.903', '2025-03-28 22:05:42.903'),
	('cm8tbzzp2000yjl0joctl0q4x', 'ChIJH-Sj5OK0RIYRjC-_RrNEotk', 'places/ChIJH-Sj5OK0RIYRjC-_RrNEotk/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRbDVDbElnEAE', '3 weeks ago', 4, 'An Austin staple and highly recommend to all plant based and non plant based eaters. Service is very fast ! And food tastes great, love to have a vegan place in a city full of BBQ and meat heavy dishes!', '2025-03-28 22:05:42.903', '2025-03-28 22:05:42.903'),
	('cm8tc01bb000zjl0jdz7kb8ol', 'ChIJoYL62VG0RIYR32qP--UFmIQ', 'places/ChIJoYL62VG0RIYR32qP--UFmIQ/reviews/ChdDSUhNMG9nS0VJQ0FnSURfdGN2cTRBRRAB', '2 months ago', 5, 'We’ve been wanting to come here for a while since we pass by it so often ( I go to Peach House). These might be the best churros we’ve ever had. The traditional were perfect. Service was great. They’re super quick and they make them fresh.', '2025-03-28 22:05:45', '2025-03-28 22:05:45'),
	('cm8tc01bb0010jl0j2soebl8p', 'ChIJoYL62VG0RIYR32qP--UFmIQ', 'places/ChIJoYL62VG0RIYR32qP--UFmIQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYMUtQbFFREAE', '5 months ago', 5, 'Best churros I’ve ever had. Got plain churros and the campfire. Both were excellent. Churros have perfect crisp any chewiness. Has places to sit and enjoy the food.', '2025-03-28 22:05:45', '2025-03-28 22:05:45'),
	('cm8tc01bb0011jl0jjjji8sr5', 'ChIJoYL62VG0RIYR32qP--UFmIQ', 'places/ChIJoYL62VG0RIYR32qP--UFmIQ/reviews/ChdDSUhNMG9nS0VJQ0FnSURIdGNxVy1RRRAB', '6 months ago', 4, 'I tend to stop by when I’ve got a sweet tooth late at night since they’re open pretty late and it always hits the spot.

My go to is the apple pie churro with a scoop of ice cream: it’s super decadent, the churro is coated in caramel with apple pie filling, and is sooo hot the ice cream usually just melts off. Divine! And worth the 35432 calories!

There’s picnic tables to sit at and there’s a cute pink and purple wall that would be great for an ig photo shoot.', '2025-03-28 22:05:45', '2025-03-28 22:05:45'),
	('cm8tc01bb0012jl0jgs40iyxk', 'ChIJoYL62VG0RIYR32qP--UFmIQ', 'places/ChIJoYL62VG0RIYR32qP--UFmIQ/reviews/ChdDSUhNMG9nS0VJQ0FnTUNncXRqMnRBRRAB', 'a month ago', 5, 'We got the Campfire! It was delicious, and got some strawberry sauce on the side. Perfection!', '2025-03-28 22:05:45', '2025-03-28 22:05:45'),
	('cm8tc01bb0013jl0jub4jq70o', 'ChIJoYL62VG0RIYR32qP--UFmIQ', 'places/ChIJoYL62VG0RIYR32qP--UFmIQ/reviews/ChZDSUhNMG9nS0VJQ0FnSURQcmRHM0lnEAE', '3 months ago', 1, 'Got sick. Employee came back from break. Walked in with phone in hand, started making my order. No hand washing or gloves, and touched my food several times. Smells like heaven and digests like Hell.', '2025-03-28 22:05:45', '2025-03-28 22:05:45'),
	('cm8tc07950014jl0j2cvwonad', 'ChIJQxDp5f-1RIYREhw0DPYuRuI', 'places/ChIJQxDp5f-1RIYREhw0DPYuRuI/reviews/ChdDSUhNMG9nS0VJQ0FnSURQemJLd3FRRRAB', '3 months ago', 5, 'My boyfriend and I adore this place! We came to celebrate our anniversary and had a warm welcome. They had a card set up for us which was so touching. They also gave us complimentary bubbles and best service (as always!). Their food was amazing as well. We’re so happy we spent this special day here!', '2025-03-28 22:05:52.698', '2025-03-28 22:05:52.698'),
	('cm8tc07950015jl0jxhit4hlr', 'ChIJQxDp5f-1RIYREhw0DPYuRuI', 'places/ChIJQxDp5f-1RIYREhw0DPYuRuI/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2MDZTbUVnEAE', '3 months ago', 5, 'Been going here for years and never disappoints.   Good quality, reliable menu, excellent service and delicious food.   It''s nice to have some of the "old Austin" restaurants still around.  Last night had the Lasagna and the Spaghetti Vodka sauce and as usual both were outstanding.', '2025-03-28 22:05:52.698', '2025-03-28 22:05:52.698'),
	('cm8tc07950016jl0jldcf4w9w', 'ChIJQxDp5f-1RIYREhw0DPYuRuI', 'places/ChIJQxDp5f-1RIYREhw0DPYuRuI/reviews/ChZDSUhNMG9nS0VJQ0FnSURfdzZtLVp3EAE', '2 months ago', 5, 'One of the best Italian restaurants I''ve been to in a long time. My partner and I had split the pasta. We had the pappardelle bolognese and spaghetti cacio e pepe. This is a must go place. I ordered drinks and they were heavy handed. I had to get a side of pineapple juice. :) the dessert was awesome we had bread pudding. Im going to go back for sure. Im dying to try their ravioli.
Our server was the best and the atmosphere was great.', '2025-03-28 22:05:52.698', '2025-03-28 22:05:52.698'),
	('cm8tc07950017jl0jzptde70x', 'ChIJQxDp5f-1RIYREhw0DPYuRuI', 'places/ChIJQxDp5f-1RIYREhw0DPYuRuI/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBcWNUY1hREAE', 'a month ago', 5, 'Had a great meal here with my wife and daughter. We tried two appetizers and three pasta dishes. The Caicio E Pepe was our favorite, and our waitress, Laura was super nice and helped us figure out how to work the menu so we could try a large variety of food items.', '2025-03-28 22:05:52.698', '2025-03-28 22:05:52.698'),
	('cm8tc07950018jl0jy35n8kn9', 'ChIJQxDp5f-1RIYREhw0DPYuRuI', 'places/ChIJQxDp5f-1RIYREhw0DPYuRuI/reviews/ChdDSUhNMG9nS0VJQ0FnTUNndU9iUXFBRRAB', 'a month ago', 5, 'What a great time. Only went for an appetizer and drinks and the service was wonderful. I had one of the specialty cocktails (the Linus and Lucy) and it was strong but delicious. We ordered the burrata with sundried tomato ricotta with ciabatta. It was exquisite. Highly recommend visiting this place!', '2025-03-28 22:05:52.698', '2025-03-28 22:05:52.698'),
	('cm8tc0co50000ju0kvg5kne4s', 'ChIJu96UVvy0RIYRCPxWa4TSr6o', 'places/ChIJu96UVvy0RIYRCPxWa4TSr6o/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRN3NmeW93RRAB', '3 weeks ago', 5, 'A classic pizza spot, perfect for grabbing a slice or a whole pie. I was in town for a work trip, and this place came highly recommended. We stopped by on a Monday night, and parking was fairly easy--Home Slice Pizza patrons can use spots at the nearby church, which was a nice perk.

We sat at the bar, which gave us a great view of the chefs in action, expertly crafting pizzas. We ordered garlic knots, a slice of pizza each, and finished with cannoli and cookies for dessert. They offer pizza by the slice in classic options like cheese and pepperoni, and during our visit, they also had sausage, Sicilian, and broccoli and ricotta slices. I went with the broccoli and ricotta slice--perfectly crispy crust without being too hard.

Everything was delicious, and I''d definitely recommend this spot!', '2025-03-28 22:05:59.717', '2025-03-28 22:05:59.717'),
	('cm8tc0co50001ju0kz1u59ihi', 'ChIJu96UVvy0RIYRCPxWa4TSr6o', 'places/ChIJu96UVvy0RIYRCPxWa4TSr6o/reviews/ChdDSUhNMG9nS0VJQ0FnSUNQay1DSXRRRRAB', '4 months ago', 5, 'Despite always coming to Austin from Houston I have never tried Home slice until now. And it was delish! So tasty and even though they had big old lines they are fast super fast with getting orders out!

Easy to pay, they provide water for everyone. Limited seating but come on it''s pizza, you can walk around with it!

Give it a try!', '2025-03-28 22:05:59.717', '2025-03-28 22:05:59.717'),
	('cm8tc0co50002ju0kgxdqof3g', 'ChIJu96UVvy0RIYRCPxWa4TSr6o', 'places/ChIJu96UVvy0RIYRCPxWa4TSr6o/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnM29YSXBnRRAB', 'a month ago', 5, 'This is the best pizza I''ve had in my life. My wife and I flew to Austin for a valentines weekend getaway. Saturday night we finally got a chance to try Home Slice. Best decision ever. The place was crowded, why? Because, besides having the best pizza ever, the service was over the top exceptionally amazing. We will be going back here again and might just fly into town for a day to get a pie for lunch or dinner.', '2025-03-28 22:05:59.717', '2025-03-28 22:05:59.717'),
	('cm8tc0co50003ju0kn497w858', 'ChIJu96UVvy0RIYRCPxWa4TSr6o', 'places/ChIJu96UVvy0RIYRCPxWa4TSr6o/reviews/ChdDSUhNMG9nS0VJQ0FnSURfeV83N3J3RRAB', '2 months ago', 5, 'Home slice pizza, the crust was thin, crispy, flaky, very good. You order by the window and they''ll bring it to the door and call out your order. Outdoor picnic tables right on South Congress in South Austin makes it a great location. Perfect for a casual late night bite!', '2025-03-28 22:05:59.717', '2025-03-28 22:05:59.717'),
	('cm8tc0co50004ju0k85g0ivpg', 'ChIJu96UVvy0RIYRCPxWa4TSr6o', 'places/ChIJu96UVvy0RIYRCPxWa4TSr6o/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2OTVlem9RRRAB', '3 months ago', 5, 'I always come here planning to get one slice and inevitably end up walking back for more.  Their pizza slices are big, greasy, and absolutely delectable.  Located right in the heart of Austin, they have an indoor restaurant but I usually just go to the walk up window.  Service is pretty quick for how popular this place is.  Definitely worth a stop if you’re downtown!!!', '2025-03-28 22:05:59.717', '2025-03-28 22:05:59.717'),
	('cm8tc0r7o0005ju0kwnwsbh9j', 'ChIJQ3V4dNO0RIYRPQpT3XIzlfk', 'places/ChIJQ3V4dNO0RIYRPQpT3XIzlfk/reviews/ChZDSUhNMG9nS0VJQ0FnSUNIdl9UYUVREAE', '6 months ago', 5, 'Tasty pizza place in South Austin, that''s attached to a gas station, that a friend introduced me to. Nice, dog-friendly seating in a covered patio. The pizza was flavorful and they gave my dog, Bogart, some grilled chicken, which he gobbled up happily. 😋 🍕', '2025-03-28 22:06:18.564', '2025-03-28 22:06:18.564'),
	('cm8tc0r7o0006ju0k68ifq21l', 'ChIJQ3V4dNO0RIYRPQpT3XIzlfk', 'places/ChIJQ3V4dNO0RIYRPQpT3XIzlfk/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2eXBib2V3EAE', '3 months ago', 5, 'The pasta is spectacular and the pizza is delicious. I highly recommend this place to eat. It has a quiet atmosphere and excellent service.', '2025-03-28 22:06:18.564', '2025-03-28 22:06:18.564'),
	('cm8tc0r7o0007ju0kqiexxbdk', 'ChIJQ3V4dNO0RIYRPQpT3XIzlfk', 'places/ChIJQ3V4dNO0RIYRPQpT3XIzlfk/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYdzZYMFp3EAE', '5 months ago', 5, 'Best pizza in Austin 100% recommended
Excellent service', '2025-03-28 22:06:18.564', '2025-03-28 22:06:18.564'),
	('cm8tc0r7o0008ju0ku7jme8hm', 'ChIJQ3V4dNO0RIYRPQpT3XIzlfk', 'places/ChIJQ3V4dNO0RIYRPQpT3XIzlfk/reviews/ChdDSUhNMG9nS0VJQ0FnTUR3aVBQMGt3RRAB', 'in the last week', 5, 'Best pasta and pizza in whole South Austin. The texture of the pasta is just fabulous. Recommend it, if you’re craving for something pasta and pizza!!', '2025-03-28 22:06:18.564', '2025-03-28 22:06:18.564'),
	('cm8tc0r7o0009ju0kg51ilwyh', 'ChIJQ3V4dNO0RIYRPQpT3XIzlfk', 'places/ChIJQ3V4dNO0RIYRPQpT3XIzlfk/reviews/ChdDSUhNMG9nS0VJQ0FnSUNSM1pmeXJRRRAB', 'a year ago', 4, 'The tacos in the morning and fresh and good. They have a big selection. My only complaint is I wish they would use regular containers for salsa. They put the salsa in teeny tiny ziplock usually used for other things let’s just say… and makes it hard to not make a mess. The smell also seeps through the bag', '2025-03-28 22:06:18.564', '2025-03-28 22:06:18.564'),
	('cm8tc77tn000aju0kuvyl8942', 'ChIJndqjXQBLW4YR4e4Edn7JQ_8', 'places/ChIJndqjXQBLW4YR4e4Edn7JQ_8/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3LS1lbEdnEAE', 'a week ago', 5, 'Fig is a trendy yet romantic Italian spot with tasty dishes and great service.

We stopped in for a weeknight dinner and enjoyed all of our drinks and dishes.  Our server was helpful with our questions and attentive throughout our meal.

We split all of our dishes starting with the House Brioche Rolls and Octopus.  The rolls were heavenly and were paired with an incredibly tasty truffle butter.  I don''t know that I would ever skip on those any time I return to Fig.  The octopus was really interesting because it was battered and fried.  We have never had octopus served that way before and it was delicious!  We were a little underwhelmed by the portion size of the octopus for the price, but the flavor was definitely there.

For the entrees, we got the Pappardelle and Black Spaghetti.  The spaghetti was lovely, but we didn''t see any clams.  They might have been incorporated some other way... just wanted to mention that.  For us though, the pappardelle was the start of the meal.  The pasta was perfectly cooked and the sauce was super interesting.  I''ve never had a pasta dish with horseradish sauce before and I was not disappointed.

We look forward to coming back to Fig both for dinner and for a very tasty looking brunch menu.', '2025-03-28 22:11:20.027', '2025-03-28 22:11:20.027'),
	('cm8tc77tn000bju0k263fnzsi', 'ChIJndqjXQBLW4YR4e4Edn7JQ_8', 'places/ChIJndqjXQBLW4YR4e4Edn7JQ_8/reviews/ChZDSUhNMG9nS0VJQ0FnTURRMDRHelV3EAE', '2 weeks ago', 5, 'The atmosphere was great! The drinks were amazing, kudos to Kennedy! The food was indescribably delicious thanks to the requests from Ava! We had house brioche rolls, crispy potato’s, and the mushroom arancini (the best one). Then we followed with the rigatoni and it’s the best I’ve had! Lastly we finished it off with the chocolate bar and the coconut pannacotta!! Everything was excellent, will definitely be going again!', '2025-03-28 22:11:20.027', '2025-03-28 22:11:20.027'),
	('cm8v6xhpn000djv0nq0kp1yqk', 'ChIJH4kc7OD_24ARC4FtA0cUVug', 'places/ChIJH4kc7OD_24ARC4FtA0cUVug/reviews/ChZDSUhNMG9nS0VJQ0FnSUNmeEkyZ0lBEAE', '3 months ago', 5, 'Really enjoyed this speakeasy! The finger food and cocktails were great! We tried quite a few drinks and I would highly recommend the Jade Empress and Saigon Dreamer, along with the fries and chips.', '2025-03-30 05:19:20.555', '2025-03-30 05:19:20.555'),
	('cm8tc77tn000cju0kd549ren5', 'ChIJndqjXQBLW4YR4e4Edn7JQ_8', 'places/ChIJndqjXQBLW4YR4e4Edn7JQ_8/reviews/ChdDSUhNMG9nS0VJQ0FnSUR2cmJfeXFRRRAB', '3 months ago', 5, 'I recently had the pleasure of enjoying brunch at this modern Italian restaurant Fig Italian Kitchen and bar , and it was an absolute delight! The highlight of the meal was their Brioche French Toast, which was simply divine. The toast was perfectly golden, soft and fluffy. The cinnamon added a warm, aromatic sweetness that elevated every bite.

The presentation was stunning, with a dusting of powdered sugar and a side of fruits that balanced the dish beautifully. The service was attentive and friendly, and the ambiance of the restaurant—a perfect blend of chic and cozy—made the experience even more enjoyable.

This spot is a must-visit for brunch lovers looking for a unique twist on classic comfort food. I can’t wait to return and explore more of their dinner
menu!', '2025-03-28 22:11:20.027', '2025-03-28 22:11:20.027'),
	('cm8tc77tn000dju0kp992aw8r', 'ChIJndqjXQBLW4YR4e4Edn7JQ_8', 'places/ChIJndqjXQBLW4YR4e4Edn7JQ_8/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBcnA3b053EAE', 'a month ago', 5, 'We had anazing meal here for my birthday. Our server (Gigi) was so welcoming and  knowledgeable about the wine and food menus. Everything we ordered had special flavors we couldn’t have replicated at home. Delicious!', '2025-03-28 22:11:20.027', '2025-03-28 22:11:20.027'),
	('cm8tc77tn000eju0klzbdzfna', 'ChIJndqjXQBLW4YR4e4Edn7JQ_8', 'places/ChIJndqjXQBLW4YR4e4Edn7JQ_8/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnNnFTcUVREAE', 'a month ago', 5, 'We had a wonderful experience at Fig. The food was excellent. It was the warm and inviting staff that made our evening; however. The chefs took care to make our friend with allergies an excellent dinner with no issue at all, one of the waitresses, Ava, took a selfie with me to send to her mom because we share a name, and our server, Jesse, was so kind and attentive - he even gave us a bottle of Acqua Panna to go. The chefs mentioned they would sell us bottles of infused olive oil when we wanted. It felt like dining with family. 10/10 would dine again.', '2025-03-28 22:11:20.027', '2025-03-28 22:11:20.027'),
	('cm8tc78lv000fju0kgq4g3spx', 'ChIJFQYtgw61RIYRyCHWD7xpm4A', 'places/ChIJFQYtgw61RIYRyCHWD7xpm4A/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzX2FLUUNREAE', '4 months ago', 5, 'Stopped in for a quick drink before leaving town. The atmosphere was great with good music and enough TVs to watch all of the Sunday football games. The camping chairs were interesting and something I’ve never seen at a bar before and all appeared to be in great shape!', '2025-03-28 22:11:21.043', '2025-03-28 22:11:21.043'),
	('cm8tc78lv000gju0kjrfi1wdh', 'ChIJFQYtgw61RIYRyCHWD7xpm4A', 'places/ChIJFQYtgw61RIYRyCHWD7xpm4A/reviews/ChdDSUhNMG9nS0VJQ0FnSURELTRfU3l3RRAB', '11 months ago', 5, 'This place was so much fun! We came on a Saturday night and there was a great live band playing. Lots of people there but not overly packed. People were dancing but there was also a section where people were sitting around fire places which was very cute. Definitely recommend coming here for a drink!', '2025-03-28 22:11:21.043', '2025-03-28 22:11:21.043'),
	('cm8tc78lv000hju0krmjxg57i', 'ChIJFQYtgw61RIYRyCHWD7xpm4A', 'places/ChIJFQYtgw61RIYRyCHWD7xpm4A/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmdTYyTXdRRRAB', '2 months ago', 5, 'Great place for cowboy hats and boots stepping out. Lots of people and crowded if you like that atmosphere. More women than men for sure and great for the 25-30yr old zone. Live music is great and game days are fun', '2025-03-28 22:11:21.043', '2025-03-28 22:11:21.043'),
	('cm8tc78lv000iju0k8ajgzxen', 'ChIJFQYtgw61RIYRyCHWD7xpm4A', 'places/ChIJFQYtgw61RIYRyCHWD7xpm4A/reviews/ChdDSUhNMG9nS0VJQ0FnSURab2F2QXp3RRAB', 'a year ago', 4, 'Went in and was surprised they were giving out free voodoo ranger beer for some event. It was full, but the atmosphere was nice, very lively. They had a live band with good music, a game where a good toss sent a volunteer into a tub of water. Real cool. Had a good time.', '2025-03-28 22:11:21.043', '2025-03-28 22:11:21.043'),
	('cm8tc78lv000jju0kgsv90o8s', 'ChIJFQYtgw61RIYRyCHWD7xpm4A', 'places/ChIJFQYtgw61RIYRyCHWD7xpm4A/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYcWFLS25BRRAB', '5 months ago', 3, 'The atmosphere is fun and lively. The food was ok, your typical bar or finger food. It was good but it wasn’t as great as many people on the reviews claim it to be. The musicians were really good. Would come again to listen to the music and relax with family/friends.', '2025-03-28 22:11:21.043', '2025-03-28 22:11:21.043'),
	('cm8tc7dbe0000lb0pk8b2en4d', 'ChIJHa8koQ61RIYRDD-niQj3Y3w', 'places/ChIJHa8koQ61RIYRDD-niQj3Y3w/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3NWJpMFVREAE', 'a week ago', 5, 'Really cool spot and great customer service.  Awesome vibe that seems to come from the employees themselves.  My favorite bar in Austin.  One taco, the food truck on property is delicious and fair price', '2025-03-28 22:11:27.146', '2025-03-28 22:11:27.146'),
	('cm8tc7dbe0001lb0pom4amm9a', 'ChIJHa8koQ61RIYRDD-niQj3Y3w', 'places/ChIJHa8koQ61RIYRDD-niQj3Y3w/reviews/ChZDSUhNMG9nS0VJQ0FnSURYanRhekNBEAE', '5 months ago', 1, 'I went here for my 25th birthday, and i traveled from Washington state. A bartender claimed l was too drunk. I had been here from 12 AM to 2 am with no trouble, and then someone bumped into me and I was told to leave. I cannot recall who the bartender was, but I would not recommend this bar. It is currently 3 AM and I guarantee if I was too drunk, I could not write this review.', '2025-03-28 22:11:27.146', '2025-03-28 22:11:27.146'),
	('cm8tc7dbe0002lb0pquvyj612', 'ChIJHa8koQ61RIYRDD-niQj3Y3w', 'places/ChIJHa8koQ61RIYRDD-niQj3Y3w/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2ekpIaFZBEAE', '2 months ago', 5, 'Only food trucks in the area and service is whack at the back/interior bar, but it is what it is! Great party atmosphere. Freindly people, lots of TVs and open space, DJ is amazing', '2025-03-28 22:11:27.146', '2025-03-28 22:11:27.146'),
	('cm8tc7dbe0003lb0pt2tgfk5l', 'ChIJHa8koQ61RIYRDD-niQj3Y3w', 'places/ChIJHa8koQ61RIYRDD-niQj3Y3w/reviews/ChZDSUhNMG9nS0VJQ0FnTURBeDhYMUhBEAE', 'a month ago', 1, 'Bartender on Tuesday night was homophobic cut off from drinking me and a couple other apparent members of the lgbtq+ community. Felt very uncomfortable and singled out will never come back and I will be letting others know about my experience.', '2025-03-28 22:11:27.146', '2025-03-28 22:11:27.146'),
	('cm8tc7dbe0004lb0pt10asuxs', 'ChIJHa8koQ61RIYRDD-niQj3Y3w', 'places/ChIJHa8koQ61RIYRDD-niQj3Y3w/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzLTk3ZXBRRRAB', '4 months ago', 4, 'Seahawks and Seattle sports bar in Austin, TX! Some sweet drink deals for game days and friendly staff. Lots of TVs and a great vibe.', '2025-03-28 22:11:27.146', '2025-03-28 22:11:27.146'),
	('cm8tc7dbt0005lb0p6k5uskqd', 'ChIJW02GaiG1RIYR8ZZKBuZOWQg', 'places/ChIJW02GaiG1RIYR8ZZKBuZOWQg/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3MU0taEF3EAE', 'a week ago', 5, 'Enjoyed their happy hour Wednesday 5-9 pm & Thursday-Sunday 5-6:30 pm 50% off cocktails, bottles of wine, and the mezze menu.
Loved the burger with potatoes and the pistachio whipped feta. The hellfire was a wonderfully spicy and sweet drink.
I look forward to trying the ube atole and espresso martini made with chai.
They are just downstairs along a nice patch of Sixth Street. Paid parking is available along nearby streets.', '2025-03-28 22:11:27.161', '2025-03-28 22:11:27.161'),
	('cm8tc7dbt0006lb0pikusgx1m', 'ChIJW02GaiG1RIYR8ZZKBuZOWQg', 'places/ChIJW02GaiG1RIYR8ZZKBuZOWQg/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRdWYteFpREAE', '3 weeks ago', 5, 'Extended HH on Wednesdays. Half price cocktails, mezzes, and bottles of wine. Quirky, hipster, speakeasy vibe in the basement (they have an outdoor patio as well). Service was exceptional. Well made cocktails (try the Hellfire). Ordered a variety of mezzes - feta and olives, Moroccan humus, and pita bread are top notch. $2 oysters hit the spot. Brussels were awesome. The HH burger/fries and chicken skewer made it all a meal.

Non-HH food prices are still reasonable and cocktails are Austin appropriately priced. I''d like to see someone order that pitcher of espresso martinis!', '2025-03-28 22:11:27.161', '2025-03-28 22:11:27.161'),
	('cm8tc7dbt0007lb0p3ziri4qv', 'ChIJW02GaiG1RIYR8ZZKBuZOWQg', 'places/ChIJW02GaiG1RIYR8ZZKBuZOWQg/reviews/ChZDSUhNMG9nS0VJQ0FnSUNuNU9YQVlREAE', '6 months ago', 5, 'Fun, thematic ambiance. Dark and moody. Very clean. Discovered this place after stumbling upon info about the Nova Hospitality group and wanted to try it since The Well is so good. Thought it was uncanny that I just saw Jack Zimmermans name in the movie Wolfs, right after seeing his name as the owner of Nova a few days before. Congrats Jack on making the film! Will have to try Ten Ten next. Service was great! Will have to come back for live jazz night.', '2025-03-28 22:11:27.161', '2025-03-28 22:11:27.161'),
	('cm8tc7dbt0008lb0pkarawfcd', 'ChIJW02GaiG1RIYR8ZZKBuZOWQg', 'places/ChIJW02GaiG1RIYR8ZZKBuZOWQg/reviews/ChdDSUhNMG9nS0VJQ0FnSUQ3Z3BDY2lnRRAB', '7 months ago', 5, 'Lovely place for a night out in the downtown area, close to a lot of parking options.

The cocktails are awesome, I highly suggest trying clear paradise and the espresso martini.

The food and ambiance are very good too, it''s worth a visit or two.', '2025-03-28 22:11:27.161', '2025-03-28 22:11:27.161'),
	('cm8tc7dbt0009lb0p54u0kbw2', 'ChIJW02GaiG1RIYR8ZZKBuZOWQg', 'places/ChIJW02GaiG1RIYR8ZZKBuZOWQg/reviews/ChZDSUhNMG9nS0VJQ0FnSURUMmRiVlVBEAE', '10 months ago', 5, 'This is a restaurant with a sexy lounge vibe serving up Middle Eastern cuisine. We joined them on a Saturday afternoon for their happy hour (5pm - 6:30pm). We shared the dozen Raw Oysters ($2 ea.), the Jumbo Prawn Cocktail ($18), and the Mezze Platter ($42). All were fresh and tasty. The love of my life sampled a few of their Mini Tinis including the tasty chai-tinged Espresso Martini and the Disco Bird. The staff were friendly and attentive. We will definitely come back.', '2025-03-28 22:11:27.161', '2025-03-28 22:11:27.161'),
	('cm8tnsgfi0000kz0j06src2y0', 'ChIJvf2ZARYH3IAR4BiR6KZ6lJE', 'places/ChIJvf2ZARYH3IAR4BiR6KZ6lJE/reviews/ChZDSUhNMG9nS0VJQ0FnSURuMzVtNUFnEAE', '5 months ago', 3, 'Nice Outside dining space. The store is decorated with the M sign flag outside the structure. However, the toy of the happy meal is sold super fast as they might not get refills anymore of those popular toys.', '2025-03-29 03:35:46.734', '2025-03-29 03:35:46.734'),
	('cm8tnsgfi0001kz0j2bw732yd', 'ChIJvf2ZARYH3IAR4BiR6KZ6lJE', 'places/ChIJvf2ZARYH3IAR4BiR6KZ6lJE/reviews/ChZDSUhNMG9nS0VJQ0FnTURndlpibFNBEAE', 'a month ago', 4, 'Service was great. I had issues with my McD app but the person at the counter was quick to take care of the issue. Food came as expected. This location is extremely busy during lunch time so, make your order with plenty of time to spare. Nice staff. Good food. Parking can be an issue during lunch.', '2025-03-29 03:35:46.734', '2025-03-29 03:35:46.734'),
	('cm8tnsgfi0002kz0ji7vk6pt9', 'ChIJvf2ZARYH3IAR4BiR6KZ6lJE', 'places/ChIJvf2ZARYH3IAR4BiR6KZ6lJE/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2dC1heUhBEAE', '3 months ago', 1, 'Don''t ever go to this McDs! One of the worst McDonald''s ever been to. Consistently atrocious service. In Drive-thru Dec 15, 2 cars ahead of me. 22 minutes for 2 burnt egg mcmuffins, medium drink= $15. Unacceptable service! Won''t ever go back.  Phone number at window is red flag', '2025-03-29 03:35:46.734', '2025-03-29 03:35:46.734'),
	('cm8tnsgfi0003kz0jfg1jtywe', 'ChIJvf2ZARYH3IAR4BiR6KZ6lJE', 'places/ChIJvf2ZARYH3IAR4BiR6KZ6lJE/reviews/ChZDSUhNMG9nS0VJQ0FnTURRd2Vhd0ZREAE', '2 weeks ago', 1, 'PSA. Check your food before leaving/pulling off. ALL McDonald''s stores are NOTORIOUS at bagging old food, undress food for take-out and carry-out orders, even when you request fresh-cooked food. Staff has HORRIBLE ATTITUDE at 4770 Conroy Street, SD, CA. Staff DOES NOT value customers. McDonald''s Corporate completely checked out/not serious about customer satisfaction. The workers model Corporate''s customer-indifference. McDonald''s, bare minimum, train your staff not to serve old food. The norm should ALWAYS be fresh-cooked food, not a crap-shoot. Having to ALWAYS check your food before leaving.', '2025-03-29 03:35:46.734', '2025-03-29 03:35:46.734'),
	('cm8tnsgfi0004kz0jzv78ukjm', 'ChIJvf2ZARYH3IAR4BiR6KZ6lJE', 'places/ChIJvf2ZARYH3IAR4BiR6KZ6lJE/reviews/ChdDSUhNMG9nS0VJQ0FnTURROF9QUzVnRRAB', '2 weeks ago', 1, 'One of the worst McDonalds ever and that''s pretty bad.  Lunch time they will send you to the waiting area because they never get the food made fast enough.  I went to the drive in at 9:30 tonight, no one in line.  I ordered a shake, very simple.  I sat in the drive through and watched the lady look at me then sweep the entire food prep area and slowly go and dump the waste in the can all the way across the store.  She comes back into the drive thru area and looks at me kind of annoyed that I am there waiting for her.  She grabs a cup, puts her fingers in the inside of the cup then makes the shake for me.    She then handas me the shake with a fake smile and says nothing.  Needless to say I tossed it immediately.   The people who work at this store are terrible.  I understand these are pretty much the starter jobs for college kids and such but if this is how the business runs then maybe an entire re-staff is in order.  There was a time this location had no ice cream machine for weeks and was also closed randomly for days on end.  May want to cut your losses McDonalds and close this one!', '2025-03-29 03:35:46.734', '2025-03-29 03:35:46.734'),
	('cm8tpa4dq0000k00k9sw8vnxm', 'ChIJbza71pwI3IAR9p3b1qCjkC0', 'places/ChIJbza71pwI3IAR9p3b1qCjkC0/reviews/ChZDSUhNMG9nS0VJQ0FnSUNmcXVtc1pBEAE', '3 months ago', 5, 'We stopped here for a quick lunch. We were super impressed with the fresh ingredients and flavors. We ordered a Peruvian Steak sandwich and a Pork Belly Banh Mi sandwich. Both were delicious. Their homemade drinks were great as well. We''ll definitely be back next time we''re in the area!', '2025-03-29 04:17:30.542', '2025-03-29 04:17:30.542'),
	('cm8tpa4dq0001k00kmdui0ubz', 'ChIJbza71pwI3IAR9p3b1qCjkC0', 'places/ChIJbza71pwI3IAR9p3b1qCjkC0/reviews/ChdDSUhNMG9nS0VJQ0FnSURYazVtR19RRRAB', '4 months ago', 4, 'Reviewing the pork belly banh mi- I was expecting more from the spicy aioli it tasted like the generic spicy mayo which is one of my least favorite things that restaurants love to throw on anything. Other than that the sandwich was yummy was not unsatisfactory', '2025-03-29 04:17:30.542', '2025-03-29 04:17:30.542'),
	('cm8tpa4dq0002k00kwigtjs5x', 'ChIJbza71pwI3IAR9p3b1qCjkC0', 'places/ChIJbza71pwI3IAR9p3b1qCjkC0/reviews/ChdDSUhNMG9nS0VJQ0FnSUNEXzZqUzFnRRAB', '11 months ago', 5, 'This is the first time I tried our their food, it surprised me. I ordered a half soup halo Bahn Mi for dinner, it was delicious!! The Banh Mi sandwich is vegan but it tastes full of flavors. The atmosphere and service are both nice, the restaurant is clean and bright. I really enjoyed the experience here. The portion is a little small tho, I had to snack on something that afternoon.', '2025-03-29 04:17:30.542', '2025-03-29 04:17:30.542'),
	('cm8tpa4dq0003k00kh9186643', 'ChIJbza71pwI3IAR9p3b1qCjkC0', 'places/ChIJbza71pwI3IAR9p3b1qCjkC0/reviews/ChdDSUhNMG9nS0VJQ0FnTURReDRpVW93RRAB', '2 weeks ago', 5, 'Mendocino Farms is easily one of my favorite spots! Their vegan banh mi is my new addiction—so fresh, flavorful, and just perfect every time. The service is always great, and the food never misses. Love this place!', '2025-03-29 04:17:30.542', '2025-03-29 04:17:30.542'),
	('cm8tpa4dq0004k00khg47e2ak', 'ChIJbza71pwI3IAR9p3b1qCjkC0', 'places/ChIJbza71pwI3IAR9p3b1qCjkC0/reviews/ChdDSUhNMG9nS0VJQ0FnSUN6MUppMndBRRAB', '10 months ago', 5, 'Ya know, I haven''t had a bad meal here. I''ve had the Thai Mango Salad, Mama Chen''s Chinese Chicken Salad, and a bite of Street Corn Chicken Sandwich. All so so tasty! Everything tastes delicious and fresh.', '2025-03-29 04:17:30.542', '2025-03-29 04:17:30.542'),
	('cm8uc2vp70004jv0k0umb68bi', 'ChIJ1ZqqhKtpsocRQLCiBfTTipk', 'places/ChIJ1ZqqhKtpsocRQLCiBfTTipk/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnbHJqQjJ3RRAB', 'a month ago', 5, 'Purchased 20 sausage biscuits so my co-workers could enjoy breakfast on Valentine’s Day. Called ahead of time so my order would not derail their morning and it was prepared and ready to go the moment I arrived. Thank you!', '2025-03-29 14:55:43.867', '2025-03-29 14:55:43.867'),
	('cm8tpagjj0005k00ky249qcda', 'ChIJgX8i8E_L3IARQKmz75j1ncI', 'places/ChIJgX8i8E_L3IARQKmz75j1ncI/reviews/ChZDSUhNMG9nS0VJQ0FnSURMN2RDWUpBEAE', '2 weeks ago', 2, 'I was very excited to try this place, but was very disappointed. The wine served was room temperature. Disappointing to see they didn''t think about serving the wine at the proper temperature given that this is a wine place. My dish had very dry chicken and tasted ok. Two people on our table got pizzas and both said it was the worst pizza they ever had. There were also 4 flies hovering around the table which made the experience unpleasant. I hope this place improves and succeeds so we can have a good variety of local businesses, but drinking warm wine is a no-go for me.', '2025-03-29 04:17:46.303', '2025-03-29 04:17:46.303'),
	('cm8tpagjj0006k00k8y1pap7c', 'ChIJgX8i8E_L3IARQKmz75j1ncI', 'places/ChIJgX8i8E_L3IARQKmz75j1ncI/reviews/ChZDSUhNMG9nS0VJQ0FnSUR6NHFQTUF3EAE', '9 months ago', 5, 'This was my first time going and was very pleased. There is an adults only section as well as a family section. We had a large group, and it was fine. The wine selection I thought was great, and the way they explained the wine was helpful. Also the food was great and I want to try the rest of the items.', '2025-03-29 04:17:46.303', '2025-03-29 04:17:46.303'),
	('cm8tpagjj0007k00k715b7cuh', 'ChIJgX8i8E_L3IARQKmz75j1ncI', 'places/ChIJgX8i8E_L3IARQKmz75j1ncI/reviews/ChdDSUhNMG9nS0VJQ0FnSUNMd09hYXd3RRAB', '9 months ago', 5, 'Great food! The chicken and sausage pan roast is so delicious!!! And the service helped me pair my food with delicious rose on tap!!! I’ll be back :) thank you to Synthia for helping me out , great service. Very appreciated', '2025-03-29 04:17:46.303', '2025-03-29 04:17:46.303'),
	('cm8tpagjj0008k00kwqohnc9x', 'ChIJgX8i8E_L3IARQKmz75j1ncI', 'places/ChIJgX8i8E_L3IARQKmz75j1ncI/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzdnF2a1lnEAE', '4 months ago', 5, 'Love this place!', '2025-03-29 04:17:46.303', '2025-03-29 04:17:46.303'),
	('cm8tpar740009k00kp1ek67yp', 'ChIJYd0s5cnL3IARQAprBtGpfpQ', 'places/ChIJYd0s5cnL3IARQAprBtGpfpQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUNqbnVDQ1VnEAE', '11 months ago', 5, 'First time going on Friday and it was delicious. Had to come back again today for another round. So glad to have a unique food spot to go too . Flavors and texture was on point. Perfect for sweet and savory lovers. Will definitely be regulars.', '2025-03-29 04:18:00.112', '2025-03-29 04:18:00.112'),
	('cm8tpar74000ak00kpwf77j7h', 'ChIJYd0s5cnL3IARQAprBtGpfpQ', 'places/ChIJYd0s5cnL3IARQAprBtGpfpQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzNU02clZ3EAE', '4 months ago', 5, 'The spot is a great place to grab lunch or dinner locally with a casual vibe. It’s all about the kimchi butter shrimp. I love the story about how the owners made this place happen and with my new location in the shopping center for my business it’s a great place to indulge in huge flavor. Dine in or grab and go experience. It’s in a place with very modern high ceilings and 20 beers on top in the rodeo X Center. Owners are very friendly. Whether you want kimchi butter, chicken, or a spam musubi. They’ve got a very abridged menu, but the things they do they do very well. Check it out.', '2025-03-29 04:18:00.112', '2025-03-29 04:18:00.112'),
	('cm8tpar74000bk00k8p2290zx', 'ChIJYd0s5cnL3IARQAprBtGpfpQ', 'places/ChIJYd0s5cnL3IARQAprBtGpfpQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUMxc3B6eUZnEAE', 'a year ago', 5, 'I like their drinks. The taste is unique. The food is good but a bit too salty and oily, which makes you want more rice, the serve rice is only about half a cup. We end up bringing our left over meats home. The atmosphere is decent, it is a food court.', '2025-03-29 04:18:00.112', '2025-03-29 04:18:00.112'),
	('cm8tpar74000ck00ktxsi5qrd', 'ChIJYd0s5cnL3IARQAprBtGpfpQ', 'places/ChIJYd0s5cnL3IARQAprBtGpfpQ/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnaEtucVd3EAE', 'a month ago', 2, 'I''m really disappointed to have to leave a bad review. The staff was friendly and apologized for the wait. I ordered my food at 8:03 and didn''t get it till past 8:30. This wasn''t to big of a deal to me, it was my food that was disappointing. I ordered a regular mixed plate and a regular shrimp plate. Each plate was over $20 so I expected to get a similar portion to the a chain Hawaiian place that''s about half the price. What I got was the same as a half portion as a chain Hawaiian place. What really put the nail in the coffin for me was that neither of my orders were correct. In my mixed plate my chicken was spicy and my shrimp was regular, and in my shrimp plate the shrimp was spicy', '2025-03-29 04:18:00.112', '2025-03-29 04:18:00.112'),
	('cm8tpar74000dk00kdpn2nbuz', 'ChIJYd0s5cnL3IARQAprBtGpfpQ', 'places/ChIJYd0s5cnL3IARQAprBtGpfpQ/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRcEpfdVRBEAE', '3 weeks ago', 5, 'The Kimchi butter chicken is great. It is a good portion and the ala cart order is decent value. The shrimp is really tasty. It would be nice if there were more shrimp in the order though. The food is unique and they have nice seating in the area. We’ve been here several times and will be back.', '2025-03-29 04:18:00.112', '2025-03-29 04:18:00.112'),
	('cm8tparsl000ek00kvcpxhjzn', 'ChIJY64ZARQJ3IARH9jTSLm1Ogc', 'places/ChIJY64ZARQJ3IARH9jTSLm1Ogc/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzcFp1dUl3EAE', '4 months ago', 5, 'We came in on a Saturday night and had the greatest experience with Ethan. He was patient kind and professional, going out of his way to explain the flavors, and options for the freeze as it was our first time here. Incredible customer service.', '2025-03-29 04:18:00.886', '2025-03-29 04:18:00.886'),
	('cm8tparsl000fk00krff0pqve', 'ChIJY64ZARQJ3IARH9jTSLm1Ogc', 'places/ChIJY64ZARQJ3IARH9jTSLm1Ogc/reviews/ChdDSUhNMG9nS0VJQ0FnSURYNnNhQThBRRAB', '5 months ago', 5, 'The Del Mar Highlands Pressed Juicery always exceeds my expectations!

Henley is always friendly and knowledgeable. He makes the experience worth it!  Keep up the great work Henley! 🙏', '2025-03-29 04:18:00.886', '2025-03-29 04:18:00.886'),
	('cm8tparsl000gk00k5x27i5n4', 'ChIJY64ZARQJ3IARH9jTSLm1Ogc', 'places/ChIJY64ZARQJ3IARH9jTSLm1Ogc/reviews/ChdDSUhNMG9nS0VJQ0FnSUREaUoyRjJRRRAB', '11 months ago', 5, 'We were served by employee Jocelyn who was extremely nice and welcoming, especially since it was in the middle of a random Thursday. She was super friendly and recommended an acai bowl, which was pretty big for the price and good! Fruit seemed ripe and the granola was yummy. Juices that we sampled were good but perhaps a little expensive. Overall would go again!', '2025-03-29 04:18:00.886', '2025-03-29 04:18:00.886'),
	('cm8tparsl000hk00ko71pswkv', 'ChIJY64ZARQJ3IARH9jTSLm1Ogc', 'places/ChIJY64ZARQJ3IARH9jTSLm1Ogc/reviews/ChZDSUhNMG9nS0VJQ0FnSUQ5MGNfNEFnEAE', 'a year ago', 5, 'They are always nice and helpful. I came a few times for bowls and smoothies. Finally tried a 3 day cleanse and really enjoyed it. I had never done a juice cleanse, they were really helpful and giving the details.', '2025-03-29 04:18:00.886', '2025-03-29 04:18:00.886'),
	('cm8tparsl000ik00k8t4opf5w', 'ChIJY64ZARQJ3IARH9jTSLm1Ogc', 'places/ChIJY64ZARQJ3IARH9jTSLm1Ogc/reviews/ChZDSUhNMG9nS0VJQ0FnSURqbTdPTVlBEAE', '10 months ago', 5, 'Jocelyn is the best!!! Everytime I come in she is so welcoming, so kind and amazing at giving recommendations. Since I’ve started coming in she has always been so helpful and is the reason why I’ve become a pressed regular! In a world of Karen’s, be a Jocelyn.', '2025-03-29 04:18:00.886', '2025-03-29 04:18:00.886'),
	('cm8tpav7q000jk00kvuk26d1t', 'ChIJAWYSm0PL3IARvt9qP6J2q3w', 'places/ChIJAWYSm0PL3IARvt9qP6J2q3w/reviews/ChdDSUhNMG9nS0VJQ0FnSUNQOUxMeHlRRRAB', '4 months ago', 5, 'Nice, chill spot. Food court is great. Nice variety of beers. They are always rotating. They do a "steel the glass" event from time to time. I sometimes hang here after work with coworkers and have never had any issues. Bar tenders are attentive and quick to serve. No complaints.', '2025-03-29 04:18:05.319', '2025-03-29 04:18:05.319'),
	('cm8uqudhf000ejp0k3bj8qyg9', 'ChIJmYJk7y9rsocRlXD-Xv2ClyE', 'places/ChIJmYJk7y9rsocRlXD-Xv2ClyE/reviews/ChZDSUhNMG9nS0VJQ0FnSURfMWZxSFNREAE', '2 months ago', 5, 'Had the andoullie pizza. They let me substitute pepperoni for the veggies since I don''t like bell peppers and mushrooms.  It was unique and very good.', '2025-03-29 21:49:01.251', '2025-03-29 21:49:01.251'),
	('cm8tpav7q000kk00klrupbria', 'ChIJAWYSm0PL3IARvt9qP6J2q3w', 'places/ChIJAWYSm0PL3IARvt9qP6J2q3w/reviews/ChZDSUhNMG9nS0VJQ0FnSURidS1Ub1p3EAE', '7 months ago', 5, 'Brew Haven is a nice beer garden. They have a nice selection of beers and wines. You can also get things to go. You can sit and enjoy many big screen televisions. They also have an app that you can check into when you visit. You may be able to earn when you are on the app. They have a few non alcoholic items as well. Each week, they have different events and sometime pop up shops. During the week, they offer games such as table tennis and trivia nights. Sometimes, there is a dj as well. They are worth paying a visit.', '2025-03-29 04:18:05.319', '2025-03-29 04:18:05.319'),
	('cm8tpav7q000lk00k1ncn6cud', 'ChIJAWYSm0PL3IARvt9qP6J2q3w', 'places/ChIJAWYSm0PL3IARvt9qP6J2q3w/reviews/ChZDSUhNMG9nS0VJQ0FnSUNEbXRmOVpREAE', '4 months ago', 5, 'Trivia night Tuesday was fantastic, had food drinks and games...FUN!🎯🎯🎯🎯😄😄😄😄😄 🎙️🎤', '2025-03-29 04:18:05.319', '2025-03-29 04:18:05.319'),
	('cm8tpav7q000mk00koif03i4s', 'ChIJAWYSm0PL3IARvt9qP6J2q3w', 'places/ChIJAWYSm0PL3IARvt9qP6J2q3w/reviews/ChdDSUhNMG9nS0VJQ0FnSURSaExlOHNBRRAB', 'a year ago', 5, 'Good selection of beers from local breweries. I wish they had more stouts but I know they aren’t as popular so no big deal. Tables were clean and staff was friendly.', '2025-03-29 04:18:05.319', '2025-03-29 04:18:05.319'),
	('cm8tpav7q000nk00kg0xqn3ko', 'ChIJAWYSm0PL3IARvt9qP6J2q3w', 'places/ChIJAWYSm0PL3IARvt9qP6J2q3w/reviews/ChdDSUhNMG9nS0VJQ0FnSUNSenFxQXZBRRAB', 'a year ago', 5, 'Great little taproom. The Bearded Tang (I''m unsure if they''re house brand, or a takeover) brews were all well executed and restrained, rather than pushing boundaries. That''s what I like.

Pictured are the Bearded Tang pilsners and weisses.', '2025-03-29 04:18:05.319', '2025-03-29 04:18:05.319'),
	('cm8tpbj29000ok00kqi25ol0z', 'ChIJe2bQ9X41w4ARUSpIA-fhzSw', 'places/ChIJe2bQ9X41w4ARUSpIA-fhzSw/reviews/ChZDSUhNMG9nS0VJQ0FnTURRMWVmcFZBEAE', '2 weeks ago', 5, 'Stopped by for dinner on a busy Saturday.  Hubby and I were sat at our table within 20 minutes.  No time wasted our server Akira was on it! Quick  and professional.  Stella, Sam Adams and Blooming onion joined shortly after being seated.  My salmon and brussel sprouts were great but hubby''s steak was just a little too well.  Other than that great time and happy tummies.', '2025-03-29 04:18:36.226', '2025-03-29 04:18:36.226'),
	('cm8tpbj29000pk00kq8rx5291', 'ChIJe2bQ9X41w4ARUSpIA-fhzSw', 'places/ChIJe2bQ9X41w4ARUSpIA-fhzSw/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRbHJqSnl3RRAB', '3 weeks ago', 3, 'I ordered the Prime Rib dip and they barely put any meat on the roll, but would think maybe 3 oz for a $19.99 sandwich. Some of the meat was dry and there was no way to tell if it was prime rib because it was so thinly sliced it could’ve been roast beef. I assumed it was piece not paper thin meat.
Service was so slow, 15 mins to get the check and my card back, not going back there.', '2025-03-29 04:18:36.226', '2025-03-29 04:18:36.226'),
	('cm8tpbj29000qk00knvo3u7ig', 'ChIJe2bQ9X41w4ARUSpIA-fhzSw', 'places/ChIJe2bQ9X41w4ARUSpIA-fhzSw/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3dm9xWlZnEAE', 'a week ago', 5, 'As soon as my girlfriend and I walked in we were greated by the take out lady named Amanda.  This was not our first encounter with her. Amanda is AMAZING,  friendly, knowledgeable,  and funny. Made us feel like we were at home. I HIGHLY recommend if you are going to order take out ask for Amanda... definitely ordering take out again from outback steak house....', '2025-03-29 04:18:36.226', '2025-03-29 04:18:36.226'),
	('cm8tpbj29000rk00k3lsj3wvs', 'ChIJe2bQ9X41w4ARUSpIA-fhzSw', 'places/ChIJe2bQ9X41w4ARUSpIA-fhzSw/reviews/ChdDSUhNMG9nS0VJQ0FnSUNadzl1SDV3RRAB', 'a month ago', 5, 'This is my local outback. The food here is extremely good and flavorful. The service here is always impeccable with fast serving, and friendly staff. They set it up perfectly to create a good restaurant atmosphere and they do a great job. The manager Danny is out of this world amazing, and I think he should he in charge of a restaurant one day!!!(Corporate: take notes) This is an outstanding restaurant and I highly recommend it.', '2025-03-29 04:18:36.226', '2025-03-29 04:18:36.226'),
	('cm8tpbj29000sk00kj4qw2yfq', 'ChIJe2bQ9X41w4ARUSpIA-fhzSw', 'places/ChIJe2bQ9X41w4ARUSpIA-fhzSw/reviews/ChdDSUhNMG9nS0VJQ0FnSUNiMnZUbC1BRRAB', '8 months ago', 4, 'Nice place. Service was friendly and attentive. The $10 French onion soup was ok. Not a lot of cheese. The fettuccine with shrimp and steak was just ok. The steak wasn''t very flavorful.', '2025-03-29 04:18:36.226', '2025-03-29 04:18:36.226'),
	('cm8tpbpid000tk00km212qr7w', 'ChIJaSoDL-01w4ARICUo6BrEdbg', 'places/ChIJaSoDL-01w4ARICUo6BrEdbg/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRbE5pMldnEAE', '3 weeks ago', 1, 'They actually close at 9:30pm not 10pm please update your hours ! The worker said it has been changed since last summer !', '2025-03-29 04:18:44.581', '2025-03-29 04:18:44.581'),
	('cm8tpbpid000uk00ks65njfsb', 'ChIJaSoDL-01w4ARICUo6BrEdbg', 'places/ChIJaSoDL-01w4ARICUo6BrEdbg/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYMHVUNld3EAE', '5 months ago', 5, 'Everyone is incredibly nice, smiles, genuine and the best mango smoothie ever! I cant wait to go back. So much good energy 🙌', '2025-03-29 04:18:44.581', '2025-03-29 04:18:44.581'),
	('cm8tpc7iw0005kz0jz71mn431', 'ChIJ1W9MhoQ1w4AR30H0awec9qs', 'places/ChIJ1W9MhoQ1w4AR30H0awec9qs/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmNzZxNXRBRRAB', '2 months ago', 5, 'Kiara was fast, kind, and made a delicious drink. Will be returning on my next trip for the Vital Proteins Smoothie with my added "make it green"', '2025-03-29 04:19:07.928', '2025-03-29 04:19:07.928'),
	('cm8tpc7iw0006kz0juh888qp9', 'ChIJ1W9MhoQ1w4AR30H0awec9qs', 'places/ChIJ1W9MhoQ1w4AR30H0awec9qs/reviews/ChdDSUhNMG9nS0VJQ0FnTURRNDVQRi1RRRAB', '2 weeks ago', 2, 'I really hope this doesn''t ruin Kiara''s day but she seemed to be having a bad one already when I came in to juice it up today. I asked her to make two pina colada smoothies one with banana one without add mango. She didn''t bother to make one, so I had to order another, and when she finished making the smoothies she stacked the blenders inside of each other. She seemed very bothered by me even though I''d never met her in my life. This weird experience made my smoothie seem bland.', '2025-03-29 04:19:07.928', '2025-03-29 04:19:07.928'),
	('cm8tpc7iw0007kz0j7o4tmjjh', 'ChIJ1W9MhoQ1w4AR30H0awec9qs', 'places/ChIJ1W9MhoQ1w4AR30H0awec9qs/reviews/ChZDSUhNMG9nS0VJQ0FnSURrZzVhMk1nEAE', '5 years ago', 5, 'The service is fast and the smoothies were delicious and well prepared. The establishment was clean and organized, and smelled good like fresh fruit. The two staff members who were there worked without wasting time and were highly focused. I ordered a "mango mania" and "the greens" for the person I was with and we were not disappointed. The two orders before us were 3-4 drinks each and we didn''t wait long because of the efficiency of the staff. When I''m in the area I will definitely go back.', '2025-03-29 04:19:07.928', '2025-03-29 04:19:07.928'),
	('cm8tpc7iw0008kz0j5w0rr9dx', 'ChIJ1W9MhoQ1w4AR30H0awec9qs', 'places/ChIJ1W9MhoQ1w4AR30H0awec9qs/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2d3FySVp3EAE', '3 months ago', 1, 'Whoever the manager was on the shift was so rude to her poor employee. She was making the employee sit and watch her make a smoothie because she’s “told them so many times to not do it that way”. Maybe the employee did need to be refreshed on the order of making the smoothie, but the manager didn’t have to do it publicly in front of customers in attempt to humiliate the employee. Super unprofessional. I feel bad for the poor employee.', '2025-03-29 04:19:07.928', '2025-03-29 04:19:07.928'),
	('cm8tpc7iw0009kz0jysfblgic', 'ChIJ1W9MhoQ1w4AR30H0awec9qs', 'places/ChIJ1W9MhoQ1w4AR30H0awec9qs/reviews/ChZDSUhNMG9nS0VJQ0FnSURoOEktZ0RREAE', '11 months ago', 5, 'Updating my review I come here all the time to get my green juice always good service and tasty drinks this is my go to place when visiting Rancho Cucamonga', '2025-03-29 04:19:07.928', '2025-03-29 04:19:07.928'),
	('cm8tpi413000akz0jpdssn0gd', 'ChIJSzx0h0nL3IARwcXwXEFAXGM', 'places/ChIJSzx0h0nL3IARwcXwXEFAXGM/reviews/ChZDSUhNMG9nS0VJQ0FnSURib0xhOEZREAE', '8 months ago', 5, 'First time here and absolutely loved it!! The serving size for the cup of soft serve is actually a good size! The milk ice cream reminds me of Japan and their delicious soft serve. I got the strawberry with no boba. Sooo good! The cornflakes are the perfect touch. If I lived closer, I’d be there every day!', '2025-03-29 04:23:43.336', '2025-03-29 04:23:43.336'),
	('cm8tpi413000bkz0js49dsxko', 'ChIJSzx0h0nL3IARwcXwXEFAXGM', 'places/ChIJSzx0h0nL3IARwcXwXEFAXGM/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3ejhPLTZ3RRAB', 'a week ago', 1, 'Not worth the hype at all. Was not as good as it looked. Very unorganized, you can tell they don’t know their own menu very well. I waited for 15 minutes to give them plenty of time to make a simple drink. (Note: it was not busy at all at this time) they finally asked me if I was waiting for my order and then proceeded to say that “the machine did not register”. Would not come back. I wanted to try it at least, but good thing there’s many other better places around.', '2025-03-29 04:23:43.336', '2025-03-29 04:23:43.336'),
	('cm8tpi413000ckz0jdz1r3kvy', 'ChIJSzx0h0nL3IARwcXwXEFAXGM', 'places/ChIJSzx0h0nL3IARwcXwXEFAXGM/reviews/ChdDSUhNMG9nS0VJQ0FnSURuclBlSGh3RRAB', '5 months ago', 4, 'It’s resides at corner of inside complex .
It’s soft serve ice cream 🍦 . They give you samples in small cups . They have only 4 flavours chocolate, milk , mango and Ube . I tried Ube and milk . I liked it. In the egg puff ice cream they only doing combination of Ube and mango . They said no for Ube & milk . They don’t have separate seating space . It took more than 15 mints to prepare the ice cream .', '2025-03-29 04:23:43.336', '2025-03-29 04:23:43.336'),
	('cm8tpi413000dkz0joleraln8', 'ChIJSzx0h0nL3IARwcXwXEFAXGM', 'places/ChIJSzx0h0nL3IARwcXwXEFAXGM/reviews/ChdDSUhNMG9nS0VJQ0FnSURmeEpTd2hBRRAB', '2 months ago', 5, 'Excellent quality and an outstanding boss! Plus, their ice cream machine is always spotless, guaranteeing a safe and healthy treat for your kids. I’ve personally seen the boss diligently clean it after hours.', '2025-03-29 04:23:43.336', '2025-03-29 04:23:43.336'),
	('cm8tpi413000ekz0j3d8swwjz', 'ChIJSzx0h0nL3IARwcXwXEFAXGM', 'places/ChIJSzx0h0nL3IARwcXwXEFAXGM/reviews/ChZDSUhNMG9nS0VJQ0FnSUNEMmVtRFFREAE', '12 months ago', 4, 'I had a custom version of the taro paste and ice cream. Normally it comes with red beans but this night I wasn''t in the mood for them. The ice cream and taro paste combine well and are tasty. There''s ample parking around this Nobibi.', '2025-03-29 04:23:43.336', '2025-03-29 04:23:43.336'),
	('cm8uc1b840000js0riqxcp5xi', 'ChIJ9-AkKN9psocR2UGSt2X1aWw', 'places/ChIJ9-AkKN9psocR2UGSt2X1aWw/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnNzhEMUtREAE', 'a month ago', 5, 'I love this venue & community space! Opolis is always invested in giving a stage to locals and touring acts that range from just starting out to seasoned well-known artists. I love the variety of sounds and audiences this place draws while remaining a reliable community hub for gathering for food & drinks and hanging out on the patio.', '2025-03-29 14:54:30.676', '2025-03-29 14:54:30.676'),
	('cm8uc1b840001js0rkpkc6ewk', 'ChIJ9-AkKN9psocR2UGSt2X1aWw', 'places/ChIJ9-AkKN9psocR2UGSt2X1aWw/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRNU9pSFFBEAE', '3 weeks ago', 5, 'LOVE this place. Sage & Busty’s drag show is a must see. Opolis is keeping Norman awesome.', '2025-03-29 14:54:30.676', '2025-03-29 14:54:30.676'),
	('cm8uc1b840002js0rm7ovineu', 'ChIJ9-AkKN9psocR2UGSt2X1aWw', 'places/ChIJ9-AkKN9psocR2UGSt2X1aWw/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnMzVmNmxBRRAB', 'a month ago', 5, 'Excellent lil venue featuring wonderful local music as well as far ranging bands from around the globe. One of two solid vegan restaurants in Norman. Truly a staple of this area. Lovely all ages aspect to the venue, been coming here since I was 17 and will keep coming in till I’m 117.', '2025-03-29 14:54:30.676', '2025-03-29 14:54:30.676'),
	('cm8uc1b840003js0rgxldn8xl', 'ChIJ9-AkKN9psocR2UGSt2X1aWw', 'places/ChIJ9-AkKN9psocR2UGSt2X1aWw/reviews/ChZDSUhNMG9nS0VJQ0FnTUNndjZMc1BnEAE', 'a month ago', 5, 'I’ve been going to this venue for about twenty years. I even registered to vote here for the first time! Not to mention, I was able to book my show to mark off the venue bucket list. So many fond memories of sharing music & food with loved ones. Cheers to another twenty years. 🥂', '2025-03-29 14:54:30.676', '2025-03-29 14:54:30.676'),
	('cm8uc1b840004js0rijc76oog', 'ChIJ9-AkKN9psocR2UGSt2X1aWw', 'places/ChIJ9-AkKN9psocR2UGSt2X1aWw/reviews/ChZDSUhNMG9nS0VJQ0FnSUR4ak4zS0pREAE', 'a year ago', 5, 'June 2, 2023
I went to Opolis tonight and it was a blast. From what I gather a group of "fascinating and eclectic young individuals" have shown enterpreuneuship and taken ownership of this club in the recent past and are putting together a unique vision into action. This is a good place for entertainment at University of Oklahoma - good people, good times and great experiences.

I was a bit early and got introduced to these owners and it was the begining of the wonderful experience.
- I had the delicious house Pineapple punch with rum which was excellent and just one glass put a "buzz in my turban"
- I got to see the menu and noticed a yummy array of food but did not eat as I had already eaten my dinner! Will be there tomorrow to eat!
- The ambience of the place reflects on the warmth and friendly nature of the ownership! The bar was well stocked and well kept, the premises were very clean and there was a sense of pride in what was being done. The outside patio was very charming!
- The service was impeccable and as I mentioned in the earlier paragraphs there could not be a friendlier place! Thank you Addi, Lane, Eli, Sarah, Ethan and Julius for looking after me so well. You people are going to go places.

To summarize, I had an excellent experience on the above these three categories and I will be going to the dance party on the 3rd!! I strongly recommend this venue for anybody''s entertainment needs and a place to get together with friends!

As far as entertainment- there was an out of state "modern country western band," Tommy Goodroad and his band, and it was their first gig in Oklahoma. It was excellent stuff played by a very talented band with the artists playing a whole spectrum of originals and cover music.

Hope to see you all at the Opolis sometime soon. Have a great weekend!!

Regards
Baljit', '2025-03-29 14:54:30.676', '2025-03-29 14:54:30.676'),
	('cm8uc2vp70000jv0knprcz7l1', 'ChIJ1ZqqhKtpsocRQLCiBfTTipk', 'places/ChIJ1ZqqhKtpsocRQLCiBfTTipk/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzZ3N5d0dnEAE', '4 months ago', 4, 'Always great. Never disappoints. Staff greeted us upon entry. The staff all look like part time college students. In other words, it''s just a job. The cashier wasn''t friendly, just taking orders. Mayo or Mustard? Drink or Shake? Deduct a star for poor personnel at the register. Daniel, a cook I think, was happy to help me with a question when I picked up our order. The manager on duty was on top of things and making sure everyone was being served. If I wanted drive through service, I would have gone somewhere else.', '2025-03-29 14:55:43.867', '2025-03-29 14:55:43.867'),
	('cm8uc2vp70001jv0k8bqbhabq', 'ChIJ1ZqqhKtpsocRQLCiBfTTipk', 'places/ChIJ1ZqqhKtpsocRQLCiBfTTipk/reviews/ChZDSUhNMG9nS0VJQ0FnSUNOdnJUVFFnEAE', 'a year ago', 5, 'This Braums location is one of the best considering how the staff handles the large surge of Sooner fan.

The location is safe and adequate parking for large crowds.  Even with a drive thru line or line inside, the staff always does a great job of accommodating everyone and getting the orders our quickly.

Staff is the number #1 reason I continue to return to this Braums location.  The food is great at all locations.', '2025-03-29 14:55:43.867', '2025-03-29 14:55:43.867'),
	('cm8uc2ybn0005jv0k74wp3wg6', 'ChIJlYT6UYZCsocRVSX1SyBYYQw', 'places/ChIJlYT6UYZCsocRVSX1SyBYYQw/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmeXNmSTJ3RRAB', '3 months ago', 1, 'Well I am tired of it. The quality of service and food is bad overtime lately. The food is sloppily prepared and served. The staff always give the vibe that they are bothered to be there.I go to fast food places for my family as a treat. I am very disappointed in this Braum''s every time. It is the closest to me otherwise I''d go elsewhere and probably will from now on. I noticed another bad review on here about roaches. I did get one in a milkshake once from here. Their twist frozen yogurt is always different sizes. What I mean is there is no consistency, we''ll order 2 of the same thing but they will clearly be disproportionate. When we point it out we get treated like we''re in the wrong or dumb. This time we got one small cup twist and it was more like a mini. We were told to pull up and wait for the food being cooked, but it was cold when we ate it (we do not live that far). The burgers were made with the ingredients just pilled in one spot.  The kids burger was ordered as a burger with only ketchup, pickles and tomato, but it came with cheese anyway. My granddaughter does not like cheese but they seem to do that every time. Since we were not in front of the service window we just pulled away and didn''t check these things till we got home. Some of us started eating before realizing this and we did not want to go back. So my wife called, being tired of the poor quality and upset with the errors, hoped to inform the manager expecting he would offer to make things right. The manager, Kevin, treated her rudely and did not want to compensate, but only tell her to bring the food back. He eventually and reluctantly agreed to honor something for her next time. After the call he thought my wife hung up but she stayed on listening as he talked trash about her after the call. I am only posting this because i think there needs to be accountability.', '2025-03-29 14:55:47.267', '2025-03-29 14:55:47.267'),
	('cm8uc2ybn0006jv0kb0odsgsy', 'ChIJlYT6UYZCsocRVSX1SyBYYQw', 'places/ChIJlYT6UYZCsocRVSX1SyBYYQw/reviews/ChdDSUhNMG9nS0VJQ0FnSUQ1eHF5czB3RRAB', 'a year ago', 5, 'My go to place for ice-cream. The taste is very good and has lots of options for flavors. They are also have vegetarian ice creams where eggs are not used. We go at night with friends and spend some good time eating ice-creams and chatting with friends.', '2025-03-29 14:55:47.267', '2025-03-29 14:55:47.267'),
	('cm8uc2ybn0007jv0k8q98gd4u', 'ChIJlYT6UYZCsocRVSX1SyBYYQw', 'places/ChIJlYT6UYZCsocRVSX1SyBYYQw/reviews/ChdDSUhNMG9nS0VJQ0FnSURlNWV2VDh3RRAB', '2 years ago', 4, 'I was heading to the OU vs Kansas game this morning and stopped here for breakfast only. I ordered the biscuit and gravy with a coffee all under $4.  If you are looking for a quick, inexpensive no frills, hot breakfast with no server to tip this is the place to go. If you are eating in, order at the counter. They also serve lunch and have a selection of different ice cream flavors. There is a small grocery located here too. A drive thru is also available. The place was clean and the staff was pleasant and courteous. 👍', '2025-03-29 14:55:47.267', '2025-03-29 14:55:47.267'),
	('cm8uc2ybn0008jv0k0gzwzto1', 'ChIJlYT6UYZCsocRVSX1SyBYYQw', 'places/ChIJlYT6UYZCsocRVSX1SyBYYQw/reviews/ChZDSUhNMG9nS0VJQ0FnSUNQbnRYM0RBEAE', '4 months ago', 3, 'Just got lunch, the lady that handed me my food at the window had a bad attitude. I kept saying think you while looking at her because I was showing respect and kindness, she didn’t look at me once nor did she acknowledge the fact I kept saying thank you. She needs to either find a different job or learn to show kindness to others because she looked like she hated her life.', '2025-03-29 14:55:47.267', '2025-03-29 14:55:47.267'),
	('cm8uc2ybn0009jv0k9cymd79y', 'ChIJlYT6UYZCsocRVSX1SyBYYQw', 'places/ChIJlYT6UYZCsocRVSX1SyBYYQw/reviews/ChdDSUhNMG9nS0VJQ0FnSURmd3FmSzlBRRAB', '2 months ago', 1, 'The cream was watery, it looked like water. I came to eat ice cream and they gave me soup.', '2025-03-29 14:55:47.267', '2025-03-29 14:55:47.267'),
	('cm8uc48ot000ajv0k6smcgp6a', 'ChIJN_b1ObMVsocROFmq7824MLY', 'places/ChIJN_b1ObMVsocROFmq7824MLY/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzNWFfNG53RRAB', '4 months ago', 4, 'Been coming here for years. Called in early to get a reservation because they’re always busy, especially on the weekends. Wait was an hour and 10 minutes so I’m glad we called in early. 5 of us dined in tonight and 4 of us got steaks. We had a coupon for a free appetizer and chose the tater skins. Only one of our steaks were undercooked and had to be sent back. We also ordered a kids meal mac n cheese. Our waitress Chloe was amazing and kept the rolls coming. The cinnamon honey butter goes crazy. We will keep coming back.', '2025-03-29 14:56:47.357', '2025-03-29 14:56:47.357'),
	('cm8uc48ot000bjv0kcwwxytq6', 'ChIJN_b1ObMVsocROFmq7824MLY', 'places/ChIJN_b1ObMVsocROFmq7824MLY/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3NUlxT1Z3EAE', 'in the last week', 5, 'Waited for just a little bit on a super busy Sunday. I would say the wait was around 20 minutes, far better than I expected with hardly anywhere to park outside. When seated the waitress took amazing care of us, the rolls were amazing! As always! I got a fried pickle appetizer, so good! I also got a huge cheeseburger with mushrooms, and a bbq. So freaking good. For 3 people, 2 gettign steaks and one ordering 3 drafts, it wasn’t bad on price either! $100 before tip! Also if you’re eating out don’t forget to tip your amazing servers. They go above and beyond juggling several customers, ours did amazing! So prompt. Always had drinks for us!', '2025-03-29 14:56:47.357', '2025-03-29 14:56:47.357'),
	('cm8uc48ot000cjv0k6v1mr0eu', 'ChIJN_b1ObMVsocROFmq7824MLY', 'places/ChIJN_b1ObMVsocROFmq7824MLY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYeVp5NGJBEAE', '5 months ago', 5, 'This place is a well-oiled machine!  Food was outstanding, service was wonderful, staff was attentive and intuitive, and families piled in, ate their fill, celebrated events around us (with a big Texas Roadhouse style yeehaw requested from all around the celebrating person), and tables were quickly reset and filled again with visitors. It''s not the quietest place for a romantic dinner, but we didn''t let that stop us!  It''s a bit pricey, but the food was worth every penny. They do have a cool option where you can pick your own steak in the meat window as you enter, which was something I had forgotten about from years past. Their yeast rolls and honey butter are melt-in-your-mouth deliciousness, they''re mac and cheese may have been the best we''ve ever eaten, and we just love their salad with the thick cut grated cheddar, thick ranch dressing, and chopped eggs on top with great croutons.  They have buckets of peanuts at the table which were totally fun, too!  My husband got the prime rib, and I got the steak and chicken combo, and we both absolutely loved our choices. We would definitely celebrate there again!', '2025-03-29 14:56:47.357', '2025-03-29 14:56:47.357'),
	('cm8uc48ot000djv0k08pccrdz', 'ChIJN_b1ObMVsocROFmq7824MLY', 'places/ChIJN_b1ObMVsocROFmq7824MLY/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnaTRxcjh3RRAB', 'a month ago', 4, 'The food was good and the service was okay. The margarita was okay, I''ve had better ones at other texas roadhouse. Our server kept complaining about his day and how he wanted to quit, he kept making it akward for us. Maybe because it was valentines and the servers were overwhelmed but it was an okay experience.', '2025-03-29 14:56:47.357', '2025-03-29 14:56:47.357'),
	('cm8uc48ot000ejv0k4d0von7l', 'ChIJN_b1ObMVsocROFmq7824MLY', 'places/ChIJN_b1ObMVsocROFmq7824MLY/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3Nk9xM0F3EAE', 'a week ago', 5, 'From the moment we walked the customer service was excellent. Everyone was friendly went above and beyond to make sure we felt welcomed. We received and hand written note thanking us for visiting that location. We two different managers check on our services throughout out dinner. Food was hot, drinks were always filled. We will be back,  thank you', '2025-03-29 14:56:47.357', '2025-03-29 14:56:47.357'),
	('cm8uc4h39000fjv0kg13tgi29', 'ChIJVYE8p-8UsocREmIPSHBnsGE', 'places/ChIJVYE8p-8UsocREmIPSHBnsGE/reviews/ChZDSUhNMG9nS0VJQ0FnSUNOX05qd0dBEAE', 'a year ago', 5, 'Always a great place to stop. Friendly employees and a great selection of snacks and drinks to stock up for your road trip. There''s something here for everyone.', '2025-03-29 14:56:58.245', '2025-03-29 14:56:58.245'),
