24 hours my backside. Can''t get gas at 430 am.', '2025-03-29 14:56:58.245', '2025-03-29 14:56:58.245'),
	('cm8uc4h39000ijv0kieb6f8hx', 'ChIJVYE8p-8UsocREmIPSHBnsGE', 'places/ChIJVYE8p-8UsocREmIPSHBnsGE/reviews/ChZDSUhNMG9nS0VJQ0FnSURCOHREY2FREAE', '2 years ago', 1, 'Stopped in, and filled up my vehicle with Premium 5 days ago after getting down to +/- 30 miles to empty. All was good until yesterday. Got down to a quarter tank and my check engine light came on, and the power was noticeably less. Dash error message read “engine mis-fire.” Took it in immediately to have a mechanic look at it. His scan showed the same message and a few minutes later without hesitation, he said that I must’ve got a bad batch of watered down gas. I’ve never experienced this in my life, and I’m highly disappointed. I’ve never been to a Casey’s as I’m new to OK, and have gone to this same gas station twice back to back. I’ll never be returning. BUYER BEWARE!', '2025-03-29 14:56:58.245', '2025-03-29 14:56:58.245'),
	('cm8uc4h39000jjv0kxw2c7x85', 'ChIJVYE8p-8UsocREmIPSHBnsGE', 'places/ChIJVYE8p-8UsocREmIPSHBnsGE/reviews/ChZDSUhNMG9nS0VJQ0FnSURPaUplQ2NBEAE', '2 years ago', 4, 'Ok Casey’s has this program that you join this rewards program and save 10 cents a gallon every time you get gas I filled up today with premium 100 percent gas for 4.79 a gallon nice way to save some money anyway. They have a lot to choose from on their drinks and snacks they are going to that 10 cents off a gallon back if you give them a chance hey it’s a business they lost out with me my wife would not let me have an icee. Take care and be safe every Casey’s are different the new ones are very nice always clean and they have placed the correct staff for the area.', '2025-03-29 14:56:58.245', '2025-03-29 14:56:58.245'),
