	('cm8ucrfm10001lb0zjx5ww0k8', 'ChIJlRbIBwnY-4YRFe074AddceY', 'places/ChIJlRbIBwnY-4YRFe074AddceY/reviews/ChdDSUhNMG9nS0VJQ0FnSUR2a3JQbTNRRRAB', '3 months ago', 4, 'What can I say? This is a typical Starbuck''s. The staff is always knowledgeable and helpful. The only downside is that they have a small parking lot, but that obviously can''t be helped once you have seen the neighborhood. I recommend this as a good place to stop for a break as you pass by on the nearby I-20 (like the entrance and exit ramps are less than a quarter mile away).', '2025-03-29 15:14:49.417', '2025-03-29 15:14:49.417'),
