	('cm8ucrkov0006lb0zk87s3hfs', 'ChIJm7WCZ6XZ-4YRbQm9fXo8am4', 'places/ChIJm7WCZ6XZ-4YRbQm9fXo8am4/reviews/ChdDSUhNMG9nS0VJQ0FnSUM3eEx6WjZnRRAB', '7 months ago', 5, 'OMG OMG OMG the BEST BEST Caldo de Res EVER!!! So flavorful so delicious. Amazing rice!!!! This meal was so delicious I can’t wait to go back!!!', '2025-03-29 15:14:55.999', '2025-03-29 15:14:55.999'),
	('cm8ucrkov0007lb0zcou3r536', 'ChIJm7WCZ6XZ-4YRbQm9fXo8am4', 'places/ChIJm7WCZ6XZ-4YRbQm9fXo8am4/reviews/ChdDSUhNMG9nS0VJQ0FnSUN6bU1LYW5nRRAB', '10 months ago', 5, 'I’ve been looking for a great Mexican restaurant in midland for a while. This place is it. The food was fantastic, like my grandmother used to make. And the service was excellent. Server smiled and was attentive. Restaurant was clean. I can’t wait to come back. I’ll be bringing my friends and family next time.', '2025-03-29 15:14:55.999', '2025-03-29 15:14:55.999'),
	('cm8ucrkov0008lb0z3my4ojvy', 'ChIJm7WCZ6XZ-4YRbQm9fXo8am4', 'places/ChIJm7WCZ6XZ-4YRbQm9fXo8am4/reviews/ChZDSUhNMG9nS0VJQ0FnSUREbTlHU0RBEAE', '11 months ago', 1, 'Menudo was very bland too much meat not any posole and I asked for less meat. The torta was awful had a nasty red sauce that had no flavor but nasty at the same time they should really put it on the description or at least make an option to leave out red sauce. I spent 50$ and didn''t like anything but the queso. And the fries with the torta were disgusting definitely don''t recommend this place.', '2025-03-29 15:14:55.999', '2025-03-29 15:14:55.999'),
	('cm8ucrkov0009lb0zg0cky2te', 'ChIJm7WCZ6XZ-4YRbQm9fXo8am4', 'places/ChIJm7WCZ6XZ-4YRbQm9fXo8am4/reviews/ChdDSUhNMG9nS0VJQ0FnSUNlaGVmY29BRRAB', '2 years ago', 4, 'I adored the chicken Colombian Empanadas. I would definitely recommend them, though I wish they came with a side of rice. The service was okay, and I hated the flies. That’s definitely an issue that should be addressed. Regardless, I will be back!!', '2025-03-29 15:14:55.999', '2025-03-29 15:14:55.999'),
	('cm8ufuj5x000alb0z6s9ir0t0', 'ChIJQxdOgzet8TURpwjoogO_vB0', 'places/ChIJQxdOgzet8TURpwjoogO_vB0/reviews/ChdDSUhNMG9nS0VJQ0FnSUNRbklISm5BRRAB', '8 years ago', 5, 'The noodles taste good', '2025-03-29 16:41:12.838', '2025-03-29 16:41:12.838'),
	('cm8ui6xin0000lh0jlokr2v0v', 'ChIJ2WCqr8EA3IARYDGA6vJZ9ro', 'places/ChIJ2WCqr8EA3IARYDGA6vJZ9ro/reviews/ChdDSUhNMG9nS0VJQ0FnTURnd1p5LWlRRRAB', 'a month ago', 1, 'Used a buy one get one free combo meal, paid extra to change fires to jalepeno poppers and they send me one of the combos and an extra fry. On the bag no receipt was attached and on the tamper seal they did not write my name or how much items I had. I called the restaurant afterwards and told them the situation told me to go through the delivery app which I did do and they confirmed i infact ordered 2 combos, they then proceeded to hang up on me when I said I was infact still missing half my meal. the TLDR half my meal is missing and they didn’t label the bag properly so they could have just left the other half behind. When I call they hang up after I tell them the delivery app also shows I ordered 2 combos.', '2025-03-29 17:46:50.544', '2025-03-29 17:46:50.544'),
	('cm8ui6xin0001lh0jdqesqwy2', 'ChIJ2WCqr8EA3IARYDGA6vJZ9ro', 'places/ChIJ2WCqr8EA3IARYDGA6vJZ9ro/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzOWZYNkRBEAE', '4 months ago', 2, 'Dining room was closed early, in my opinion. We were there before 9pm. Went through drive through instead. They used AI to take order (man, companies really don''t want to pay for people). Was not given catchup for the fries, they didn''t even ask. Had to go through again to get some. A pretty low quality experience. Fries tasted like they were cooked in old oil. Won''t go here again.', '2025-03-29 17:46:50.544', '2025-03-29 17:46:50.544'),
	('cm8ui6xin0002lh0jkqi6v0r9', 'ChIJ2WCqr8EA3IARYDGA6vJZ9ro', 'places/ChIJ2WCqr8EA3IARYDGA6vJZ9ro/reviews/ChdDSUhNMG9nS0VJQ0FnSURuenJ2bTdBRRAB', '5 months ago', 1, 'I have never written a review in my life, never thought I really would write a review, because they tend to be emotional, misleading, or unhelpful. Whoever the shift leader was at this University City Location at 3:00 pm on October 5th needs to not be a shift leader. My experience was terrible, i drove out to University City during my girlfriends break to try and use the app to get some food, and with limited time it became frustrating. I asked for the two times I wanted, the deal didn’t go through, he tried again the deal ‘didn’t work’. So I compromised and gave him different options, and it didn’t work again. It only ever worked for items that made the bill more expensive than it should have been. However, whenever I gave him an item that qualified for the discount with another item that wasn’t as expensive supposedly it didn’t work. (The deal was a welcome purchase of anything over 1 dollar, you get one item amongst a list of items for free). After wasting my time, telling me it doesn’t work, not trying anything new, me compromising, and him walking away to no longer resolve the issue, her lunch break was coming to an end, and we had to drive back and leave. (we also tried to order through the app to save the hassle, but it wouldn’t work at this location) really frustrating that the in-app offer applies to any number of items, yet apparently it would only work if we spent more than 8 dollars over the expected amount. (was meant to only be a dollar or more)', '2025-03-29 17:46:50.544', '2025-03-29 17:46:50.544'),
	('cm8ui6xin0003lh0jb8wnn4m3', 'ChIJ2WCqr8EA3IARYDGA6vJZ9ro', 'places/ChIJ2WCqr8EA3IARYDGA6vJZ9ro/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmaFpxRHVnRRAB', '2 months ago', 1, 'Do not use this location! I walked in. There are like nine employees with in vision. They say we’ll be right with you and leave me standing at the counter for five minutes. I say I’m leaving because you’re not helping me. They say OK. In broken English, of course. We can only combat this nonsense with our dollars do not go here.', '2025-03-29 17:46:50.544', '2025-03-29 17:46:50.544'),
	('cm8ui6xin0004lh0jhlw2zeto', 'ChIJ2WCqr8EA3IARYDGA6vJZ9ro', 'places/ChIJ2WCqr8EA3IARYDGA6vJZ9ro/reviews/ChdDSUhNMG9nS0VJQ0FnSURfa0pxLXJ3RRAB', '2 months ago', 3, 'I hate the Ai ordering and they weren’t all that friendly either. I’ve never had someone get upset because I didn’t want ketchup.', '2025-03-29 17:46:50.544', '2025-03-29 17:46:50.544'),
	('cm8ui7un40005lh0jk7vf3gep', 'ChIJv1Gl4GsB3IARtizBrh3dn7I', 'places/ChIJv1Gl4GsB3IARtizBrh3dn7I/reviews/ChdDSUhNMG9nS0VJQ0FnTURROGVQMHdRRRAB', '2 weeks ago', 5, 'I had a peaceful experience, very cozy!', '2025-03-29 17:47:33.473', '2025-03-29 17:47:33.473'),
	('cm8ui7un40006lh0jxhlyn7yf', 'ChIJv1Gl4GsB3IARtizBrh3dn7I', 'places/ChIJv1Gl4GsB3IARtizBrh3dn7I/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYcnRuUDdRRRAB', '5 months ago', 5, 'The food is fresh and delicious, makes for an easy quick work lunch. The service is always immaculate! The quality being consistent is highly appreciated. If you’re looking for a quick and healthy meal, Greenspot is the perfect place!', '2025-03-29 17:47:33.473', '2025-03-29 17:47:33.473'),
	('cm8ui7un40007lh0j7t9qxfaq', 'ChIJv1Gl4GsB3IARtizBrh3dn7I', 'places/ChIJv1Gl4GsB3IARtizBrh3dn7I/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzM3VDZEhREAE', '4 months ago', 5, 'The Greenspot Salad Company is tucked back in the Governor Office Park. You can’t see it from Governor. All the food is extremely fresh, provides lots of choices, and is seriously delicious. You can choose a wrap, a bowl, or a salad. All the staff is very friendly.', '2025-03-29 17:47:33.473', '2025-03-29 17:47:33.473'),
	('cm8ui7un40008lh0jdgmus743', 'ChIJv1Gl4GsB3IARtizBrh3dn7I', 'places/ChIJv1Gl4GsB3IARtizBrh3dn7I/reviews/ChZDSUhNMG9nS0VJQ0FnTURBdV83V2NBEAE', 'a month ago', 5, 'Great spot for a healthy option. Wide variety of fresh quality ingredients. Excellent dressing options. Easy to use app. Highly recommended.', '2025-03-29 17:47:33.473', '2025-03-29 17:47:33.473'),
	('cm8ui7un40009lh0ja5axsszz', 'ChIJv1Gl4GsB3IARtizBrh3dn7I', 'places/ChIJv1Gl4GsB3IARtizBrh3dn7I/reviews/ChdDSUhNMG9nS0VJQ0FnSURuLVl5M3hBRRAB', '5 months ago', 5, 'I used to get a salad every day for lunch. I would go to the one in Mission Valley. I thought they had all closed down until I looked it up. I was very very wrong and I am so glad that I was! The Greek Salad is my absolute favorite. I add edamame to it along with the grass fed steak. Highly recommend. They also have an option where you can buy a bottle of their dressing! I got a bottle of the Greek Vinaigrette. If you are looking for a wonderful lunch the Greenspot is where it is at! The only thing is that I wish they either delivered out to Lakeside or had a closer location! Still absolutely amazing!', '2025-03-29 17:47:33.473', '2025-03-29 17:47:33.473'),
	('cm8ui873y0000l70is389vjzy', 'ChIJiS7Lvr4B3IARHYkob0bm9-U', 'places/ChIJiS7Lvr4B3IARHYkob0bm9-U/reviews/ChdDSUhNMG9nS0VJQ0FnSUQza3J6anFBRRAB', '4 months ago', 5, 'I ordered through the app today and was struggling to get my order through, all the staff was AMAZING and helped me trouble shoot. As they were aware I ordered through the app because I was in a rush they made my order immediately!! I come here often and the staff makes it a great experience', '2025-03-29 17:47:49.63', '2025-03-29 17:47:49.63'),
	('cm8ui873y0001l70imr68msxa', 'ChIJiS7Lvr4B3IARHYkob0bm9-U', 'places/ChIJiS7Lvr4B3IARHYkob0bm9-U/reviews/ChdDSUhNMG9nS0VJQ0FnSURmeDkzbG13RRAB', '2 months ago', 5, 'Clean, simple coffee shop. I always come here when in the UTC area. Online pick up orders are ALWAYS on time with no issues.', '2025-03-29 17:47:49.63', '2025-03-29 17:47:49.63'),
	('cm8ui873y0002l70iw8qf6qly', 'ChIJiS7Lvr4B3IARHYkob0bm9-U', 'places/ChIJiS7Lvr4B3IARHYkob0bm9-U/reviews/ChdDSUhNMG9nS0VJQ0FnSURkbzczSV9RRRAB', 'a year ago', 4, 'Ordered online. Order was ready when reached. Good ambiance. Nice location.', '2025-03-29 17:47:49.63', '2025-03-29 17:47:49.63'),
	('cm8ui873y0003l70ieo7cmre4', 'ChIJiS7Lvr4B3IARHYkob0bm9-U', 'places/ChIJiS7Lvr4B3IARHYkob0bm9-U/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYMWUzaUJREAE', '5 months ago', 5, 'First time trying Peet’s. Store was clean and efficient, and Rachel was very nice. My matcha latte was very good-I really liked that they actually blend it instead of just stirring. Plenty of indoor and outdoor seating too.', '2025-03-29 17:47:49.63', '2025-03-29 17:47:49.63'),
	('cm8ui873y0004l70icfp332l7', 'ChIJiS7Lvr4B3IARHYkob0bm9-U', 'places/ChIJiS7Lvr4B3IARHYkob0bm9-U/reviews/ChdDSUhNMG9nS0VJQ0FnSUNPZ2F2LXB3RRAB', '2 years ago', 2, 'I ordered two drinks that are meant to have a lot of foam, and I also ordered extra foam on mine. This is the drink they gave me with "extra foam." This drink was not sitting out for a while, I was there when they called my name. The drink is just okay, I thought it would be better. For the price and taste I''ll just go to Starbucks next time.', '2025-03-29 17:47:49.63', '2025-03-29 17:47:49.63'),
	('cm8ui8anv0005l70i0fnkq4ng', 'ChIJDfjBsM0A3IAR7Uzwn78mBKM', 'places/ChIJDfjBsM0A3IAR7Uzwn78mBKM/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnMVpXNkVREAE', 'a month ago', 5, 'I ordered the pastrami to go I choose to eat it inside and the tables were dirty I cleaned off what some crumbs were their and placed my paper bag as my place mat I loved the sandwhich I think the only thing was the mushrooms were stale', '2025-03-29 17:47:54.235', '2025-03-29 17:47:54.235'),
	('cm8ui8anv0006l70iikwaribv', 'ChIJDfjBsM0A3IAR7Uzwn78mBKM', 'places/ChIJDfjBsM0A3IAR7Uzwn78mBKM/reviews/ChdDSUhNMG9nS0VJQ0FnSUNPdjZDcXlnRRAB', '2 years ago', 5, 'I’m going to tell you something.
We visited on a Saturday afternoon. One gentleman was in charge and training another. He was a star! He multitasked, took orders and made the sandwiches. He remained calm and completed everything.
I got the Italian grinder and it was yummy.', '2025-03-29 17:47:54.235', '2025-03-29 17:47:54.235'),
	('cm8ui8anv0007l70i48ddxw9b', 'ChIJDfjBsM0A3IAR7Uzwn78mBKM', 'places/ChIJDfjBsM0A3IAR7Uzwn78mBKM/reviews/ChZDSUhNMG9nS0VJQ0FnSURRMHJtWkt3EAE', '5 years ago', 2, '2020
Right on brand. After blacklisting them for 2 years I went back and they made a perfectly delicious sandwich.  Came back 2 weeks later and they managed to build sandwiches for my wife and I comprised of all of our least favorite ingredients.  Of course we didn''t realize until 30 minutes later when we got home to eat. Which wich is in your to go bag is anyone''s guess.

2018
Constantly incapable of making what you write on the bag.  50/50 they screw something up.  When you luck in to getting what you order it''s good it''s super tasty.  Eat in or unwrap before you go, and let it all fall apart in the plastic bag.  Which Wich, for $10 a sandwich you need to get it together already!', '2025-03-29 17:47:54.235', '2025-03-29 17:47:54.235'),
	('cm8ui8anv0008l70i524phzya', 'ChIJDfjBsM0A3IAR7Uzwn78mBKM', 'places/ChIJDfjBsM0A3IAR7Uzwn78mBKM/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYMVozc1hnEAE', '5 months ago', 4, 'Nice people. Ordering system is a bit weird (writing on a paper bag). Clean store. Pricier than I expected.', '2025-03-29 17:47:54.235', '2025-03-29 17:47:54.235'),
	('cm8ui8anv0009l70i9twhv0c4', 'ChIJDfjBsM0A3IAR7Uzwn78mBKM', 'places/ChIJDfjBsM0A3IAR7Uzwn78mBKM/reviews/ChdDSUhNMG9nS0VJQ0FnSUR5MTZfTzVRRRAB', '4 years ago', 1, 'Ordered a french dip, cup of "broth" that tasted like beef bullion was put in the bag, sideways spilling most. Sandwich was this tiny bare thing, just bread and a little beef.', '2025-03-29 17:47:54.235', '2025-03-29 17:47:54.235'),
	('cm8ui8cwz000al70id98olb1i', 'ChIJN3RrLt8B3IAR-qfPvselheA', 'places/ChIJN3RrLt8B3IAR-qfPvselheA/reviews/ChdDSUhNMG9nS0VJQ0FnSUM5dnVUQnZRRRAB', 'a year ago', 5, 'I was craving sushi after church this past Sunday and looked up places close to where I live and URBN sushi stood out because of the good reviews. And it did not disappoint! I ordered the spicy shrimp roll & the bulgogi roll (pictured), and both were absolutely delicious and fresh, and a generous portion size. I have never tried beef with sushi, but it’s a yummy combo and I’m a fan. The complimentary edamame was a nice treat! And I ordered one of the cherry flavored house sodas and it was refreshing. The server was so kind & attentive— excellent customer service, and this restaurant is incredibly clean. This is definitely going to be my go to sushi spot in SD!', '2025-03-29 17:47:57.155', '2025-03-29 17:47:57.155'),
	('cm8ui8cwz000bl70if2ke7gsh', 'ChIJN3RrLt8B3IAR-qfPvselheA', 'places/ChIJN3RrLt8B3IAR-qfPvselheA/reviews/ChZDSUhNMG9nS0VJQ0FnSURYdHZEY0J3EAE', '5 months ago', 5, 'One of our favorite places to eat in San Diego! The food is fantastic—absolutely delicious. I highly recommend trying the Miso Ramen and the California Beach set!', '2025-03-29 17:47:57.155', '2025-03-29 17:47:57.155'),
	('cm8ui8cwz000cl70iolwy1i1p', 'ChIJN3RrLt8B3IAR-qfPvselheA', 'places/ChIJN3RrLt8B3IAR-qfPvselheA/reviews/ChZDSUhNMG9nS0VJQ0FnSURMM2VyakxBEAE', '9 months ago', 5, 'Nice Japanese restaurant in the area. I liked that beside sushi you can also get a variety of combination options (teriyaki, tempura, etc) and noodle dishes. There were also many interesting rolls to try. We each opted for a dinner combination with teriyaki and a specialty sushi roll. Sushi was fresh and portions in the combination were large. We had leftovers fo another meal. Waiters were friendly and checked on us. Would come back again to try some of the sushi specials.', '2025-03-29 17:47:57.155', '2025-03-29 17:47:57.155'),
	('cm8ui8cwz000dl70io0fn37jb', 'ChIJN3RrLt8B3IAR-qfPvselheA', 'places/ChIJN3RrLt8B3IAR-qfPvselheA/reviews/ChZDSUhNMG9nS0VJQ0FnSURPdEphdkNnEAE', '2 years ago', 5, 'The sushi was amazing and the service was fantastic. Everyone is super friendly.

The spicy garlic edamame is a must have!

We had the Ex-Girlfriend (a no rice roll), the Bulgogi roll, the Red Hot Chili Pepper roll and the Spicy Yellowtail Delight roll (which was a recommendation). I honestly can''t pick a favorite because they were all phenomenal.

Have to come back and try more of their menu. Thanks for the wonderful service!!', '2025-03-29 17:47:57.155', '2025-03-29 17:47:57.155'),
	('cm8ui8cwz000el70ii4vurbl6', 'ChIJN3RrLt8B3IAR-qfPvselheA', 'places/ChIJN3RrLt8B3IAR-qfPvselheA/reviews/ChdDSUhNMG9nS0VJQ0FnSURmLXB2T19BRRAB', '2 months ago', 5, 'Decided on URBN for a date night and it did not disappoint. From the start, the staff was super kind and friendly. We went on a Saturday night and there was no wait time, there’s plenty of seating available. We ordered a LOT of food and every thing was delicious. From the tempura veggies, miso soup & bao buns, to the sashimi & specialty rolls…I was surprised that this place didn’t have a  higher rating. I highly recommend it if you’re looking for a nice chill spot with delicious food and great service. You HAVE to try the ‘no rice’ rolls! The ex-girlfriend roll was my absolute favorite.', '2025-03-29 17:47:57.155', '2025-03-29 17:47:57.155'),
	('cm8ui8f90000fl70it6xtr157', 'ChIJqfH07dMG3IARV0wJvztqJSI', 'places/ChIJqfH07dMG3IARV0wJvztqJSI/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3ak5yMFBnEAE', 'in the last week', 4, 'I recently dined at this family-owned Lebanese restaurant, and it was a nice experience. The service was prompt and friendly. The salads were freshly prepared and full of flavor. For vegetarians, there is a great selection, including delicious falafel, cheese and spinach samosas, and veggie pizza. Meat lovers will enjoy the BBQ combo, which includes well-seasoned kabobs, tender chicken, and ribs. They offer the famous Lebanese row ground beef, but you need to request it a couple of days ahead. Also the desserts were authentic and absolutely delightful. This restaurant has been serving the community for 12 years, and with its recent remodel, it offers a refreshed and inviting atmosphere.', '2025-03-29 17:48:00.18', '2025-03-29 17:48:00.18'),
	('cm8ui8f90000gl70iu75mun3e', 'ChIJqfH07dMG3IARV0wJvztqJSI', 'places/ChIJqfH07dMG3IARV0wJvztqJSI/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3N19ucnVnRRAB', 'a week ago', 4, 'Nice and remodelled Lebanese restaurant with an outdoor and indoor seating.  A wide variety of options the satisfy vegetarian and meat lovers.  They served the food quickly and everything was delicious.  If you order Falafel, make sure to get it over cooked a bit to make sure the inside is cooked.  If you are craving Kuba Neaa ( the raw meat) you need to order it in advance.  They accept walk in and reservations too.', '2025-03-29 17:48:00.18', '2025-03-29 17:48:00.18'),
	('cm8ui8f90000hl70i5jy4drj9', 'ChIJqfH07dMG3IARV0wJvztqJSI', 'places/ChIJqfH07dMG3IARV0wJvztqJSI/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYb2ZLQXpRRRAB', '5 months ago', 5, 'Have had dinner several times with a friend and will order for take out. We always like to try a new appetizer when eating in. They have a quaint small patio to sit outside that is much more delightful than sitting inside. At night, they have small lights all around outside as well which is nice. I love the grilled chicken salad here! It is truly delicious and very refreshing to have. You can order it half or full size. I also enjoy drinking a glass of wine if dining in and their wine options never disappoint. The waiters sometimes may take a bit to come to you but others will also come by to see if anything is needed.', '2025-03-29 17:48:00.18', '2025-03-29 17:48:00.18'),
	('cm8ui8f90000il70i4eeaaoa5', 'ChIJqfH07dMG3IARV0wJvztqJSI', 'places/ChIJqfH07dMG3IARV0wJvztqJSI/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3a09fcVd3EAE', 'a week ago', 5, 'One of the best Lebanese food I have had here in USA. Hands down their biryani was out of the park kind of dish. Other dishes ordered by my party were good as well. The service was kind of slow.
They have beautifully decorated outdoor seating .', '2025-03-29 17:48:00.18', '2025-03-29 17:48:00.18'),
	('cm8ui8f90000jl70ig7g0vveo', 'ChIJqfH07dMG3IARV0wJvztqJSI', 'places/ChIJqfH07dMG3IARV0wJvztqJSI/reviews/ChZDSUhNMG9nS0VJQ0FnSURYaE9DSGJREAE', '5 months ago', 5, 'My first time dining here for lunch and it was a really good experience. I got the Pistachio Chicken salad half-order (also added the Beef Shawarma) and I really liked it. The portion is very generous. We didn''t have to wait long for food to come out. For dessert, Bird''s Nest has the right amount of sweetness. Definitely recommend this restaurant.', '2025-03-29 17:48:00.18', '2025-03-29 17:48:00.18'),
	('cm8ui8klz000kl70i874tdjax', 'ChIJbYW1s80A3IAR2G7HjI_FQtA', 'places/ChIJbYW1s80A3IAR2G7HjI_FQtA/reviews/ChdDSUhNMG9nS0VJQ0FnTURBamR2MzR3RRAB', 'a month ago', 3, 'Surprisingly little emphasis on sustainability. I dined in, but I was still given conventional single-use plastic utensils, a disposable bowl, and a lid despite ordering a wrap that already came wrapped in paper. There was no recycling or compost, only a trash can. I didn’t see any indicators that they sourced more-sustainable ingredients. The menu lacked clear labels for allergens and such.', '2025-03-29 17:48:07.127', '2025-03-29 17:48:07.127'),
	('cm8ui8klz000ll70i466nu68r', 'ChIJbYW1s80A3IAR2G7HjI_FQtA', 'places/ChIJbYW1s80A3IAR2G7HjI_FQtA/reviews/ChdDSUhNMG9nS0VJQ0FnSUNoajhTcTlRRRAB', '2 years ago', 2, 'Great concept, obviously açaí bowls are a great option for a healthy meal. I was disappointed with mine. First off they forgot the strawberry and peanut butter. It was not terribly busy and very easy to notice it’s missing. I didn’t notice myself until I got home. Anyway, the bowl made me feel bloated and the açaí left a funny after taste. Too much flax seed. Not my favorite bowl. The bottled turmeric shot was good. My friend loved hers, but I am a lot pickier with quality food. I would give it a second shot, but not likely.', '2025-03-29 17:48:07.127', '2025-03-29 17:48:07.127'),
	('cm8ui8klz000ml70iyx0y6xkj', 'ChIJbYW1s80A3IAR2G7HjI_FQtA', 'places/ChIJbYW1s80A3IAR2G7HjI_FQtA/reviews/ChdDSUhNMG9nS0VJQ0FnSURJcHNXRmhBRRAB', '6 years ago', 5, 'Great açaí bowls! They are quite large and were very filling. The flavors were also really good and they have a ton of options. We had the açaí bowl and a special bowl for the month which was also delicious. Definitely download the app! The points program is pretty good and they give you a free bowl on your birthday 👍🏻', '2025-03-29 17:48:07.127', '2025-03-29 17:48:07.127'),
	('cm8ui8klz000nl70ivjtbxdxj', 'ChIJbYW1s80A3IAR2G7HjI_FQtA', 'places/ChIJbYW1s80A3IAR2G7HjI_FQtA/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3dnEzSk53EAE', 'a week ago', 2, 'Bowl had very little chicken.    I much prefer Luna grill, Cava,', '2025-03-29 17:48:07.127', '2025-03-29 17:48:07.127'),
	('cm8ui8klz000ol70ibxv4bqlr', 'ChIJbYW1s80A3IAR2G7HjI_FQtA', 'places/ChIJbYW1s80A3IAR2G7HjI_FQtA/reviews/ChZDSUhNMG9nS0VJQ0FnSURMaC1xb0JBEAE', '9 months ago', 5, 'Awesome healthy choice of food & drink. Nice people to work with. Lately I''ve been getting lunch there once or 2x per week (and I am driving from Petco Park).
The set up is nice, the reason for the 4 star atmosphere is due to tight eating area but NO deal breaker at all.', '2025-03-29 17:48:07.127', '2025-03-29 17:48:07.127'),
	('cm8ujgex8000pl70izdwcgq19', 'ChIJGcUsss0A3IARHbf45PwwokY', 'places/ChIJGcUsss0A3IARHbf45PwwokY/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3OS1tZnpnRRAB', 'a week ago', 5, 'We got here during the lunch rush, a party of 11, and right after another very big order, but our food was out FAST, it was delicious, cheap, staff was very friendly, and the owner even threw in truffle parmesan fries for free.', '2025-03-29 18:22:12.62', '2025-03-29 18:22:12.62'),
	('cm8ujgex8000ql70ino2aqn4v', 'ChIJGcUsss0A3IARHbf45PwwokY', 'places/ChIJGcUsss0A3IARHbf45PwwokY/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2dVBtTk93EAE', '3 months ago', 5, 'So so good! Affordable! Fun! And just plain good! I have not been to a place like this in forever. I got the basic burger for the burger deal and it was perfect 👌🏼
