	('cm8ujj826000ul70itjhbzebf', 'ChIJRRWZj8aSsYcRUBhR6kYQMNk', 'places/ChIJRRWZj8aSsYcRUBhR6kYQMNk/reviews/ChdDSUhNMG9nS0VJQ0FnSUNiNGZuX2tnRRAB', '7 months ago', 5, 'I''m going to say that honestly this is the best pizza spot in Guthrie not even close...now my wife prefers gluten free but in the end for the price and quality', '2025-03-29 18:24:23.694', '2025-03-29 18:24:23.694'),
	('cm8ujj826000vl70i92t06yt1', 'ChIJRRWZj8aSsYcRUBhR6kYQMNk', 'places/ChIJRRWZj8aSsYcRUBhR6kYQMNk/reviews/ChdDSUhNMG9nS0VJQ0FnSURLdXZiZW93RRAB', '3 years ago', 5, 'We''re not from Guthrie and we visited for a random reason and stumbled across this hidden gem. The pizza crust is amazing. The quality of ingredients scream good-hometown- pizza and you can tell they put a lot of love in what they do here. We will be back!', '2025-03-29 18:24:23.694', '2025-03-29 18:24:23.694'),
	('cm8ujj826000wl70igf5u8yac', 'ChIJRRWZj8aSsYcRUBhR6kYQMNk', 'places/ChIJRRWZj8aSsYcRUBhR6kYQMNk/reviews/ChZDSUhNMG9nS0VJQ0FnTURRNEpXdlBnEAE', '3 weeks ago', 5, 'I was just passing through town and our group needed pizza. This is a good choice for delicious pizza.', '2025-03-29 18:24:23.694', '2025-03-29 18:24:23.694'),
	('cm8ujj826000xl70ijstwhj48', 'ChIJRRWZj8aSsYcRUBhR6kYQMNk', 'places/ChIJRRWZj8aSsYcRUBhR6kYQMNk/reviews/ChdDSUhNMG9nS0VJQ0FnSURIeDV6enh3RRAB', '6 months ago', 2, 'Shady looking gas station.   The restroom is behind the counter and you walk through this weird little area for supplies.  Needs to be renovated . Entrance has 2 doors you walk through back to back, odd when you are trying to come and someone else is trying to go out.', '2025-03-29 18:24:23.694', '2025-03-29 18:24:23.694'),
	('cm8ujj826000yl70ilwrovj26', 'ChIJRRWZj8aSsYcRUBhR6kYQMNk', 'places/ChIJRRWZj8aSsYcRUBhR6kYQMNk/reviews/ChZDSUhNMG9nS0VJQ0FnSURfaHBydVNBEAE', '2 months ago', 5, 'Love this place!! pizza is really good!! Super nice people', '2025-03-29 18:24:23.694', '2025-03-29 18:24:23.694'),
	('cm8ujjwdv0000gs0mr2krb3mo', 'ChIJ1egH9wYbmocRBLEJRfiBKQ8', 'places/ChIJ1egH9wYbmocRBLEJRfiBKQ8/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzOXFtbW1nRRAB', '4 months ago', 5, 'Went on Thursday for Indian and it was good. Took enough home for a second meal.', '2025-03-29 18:24:55.22', '2025-03-29 18:24:55.22'),
	('cm8ujjwdv0001gs0myuaz2qhs', 'ChIJ1egH9wYbmocRBLEJRfiBKQ8', 'places/ChIJ1egH9wYbmocRBLEJRfiBKQ8/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzcXFUdzZRRRAB', '4 months ago', 5, 'We had a great meal at Lincoln Manor.  The food is reasonably priced and portions are spot on.  The sirloin is really nice.  The chicken fried chicken stole the show.  It might be the best around.  Service was perfect.  The decor is a little odd but it’s extremely clean and quiet in the dining room despite the sports bar being adjacent.  I recommend everyone give this place a try.', '2025-03-29 18:24:55.22', '2025-03-29 18:24:55.22'),
	('cm8ujjwdv0002gs0m0l3kr7sq', 'ChIJ1egH9wYbmocRBLEJRfiBKQ8', 'places/ChIJ1egH9wYbmocRBLEJRfiBKQ8/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzdUpQZS1RRRAB', '4 months ago', 5, 'We’re occasional diners here, always have great service, atmosphere cozy and clean', '2025-03-29 18:24:55.22', '2025-03-29 18:24:55.22'),
	('cm8ujjwdv0003gs0mhim8iv8j', 'ChIJ1egH9wYbmocRBLEJRfiBKQ8', 'places/ChIJ1egH9wYbmocRBLEJRfiBKQ8/reviews/ChZDSUhNMG9nS0VJQ0FnSUNndTY3cU9REAE', '2 years ago', 4, 'My previous review of this restaurant gave it one star. I''m thrilled that the Lincoln Manor, closed for three years, is back under new owners! They are still ironing out some minor issues (staff is hard to find), but you should call for a reservation and check them out!

You can''t go wrong with the appetizer choices: pepper jack cubes got devoured in minutes by our table; the falafel is crunchy and fluffy inside; the bruschetta is excellent: crunchy and fresh; and the portabella strips are a win for anyone who likes mushrooms.
The BLT is crispy and salty and delicious, especially with the excellent battered french fries. The chicken-fried chicken is well-cooked and flavorful; the brown gravy is packed with tasty seasoning. The shrimp scampi could have been drained a little better, but the pasta was nicely done and the shrimp were plump and juicy.

If you can''t get a reservation in the dining room, check out the bar! Tanya makes a mean Bloody Mary and is working on some signature drinks. Appetizers are always available in the bar, and (depending on how busy the kitchen is) you can often get burgers in the bar as well -- sometimes even the full menu!
I hope the new owners are able to find enough staff to support how popular their restaurant is bound to be!', '2025-03-29 18:24:55.22', '2025-03-29 18:24:55.22'),
	('cm8ujjwdv0004gs0ma7tqiaeg', 'ChIJ1egH9wYbmocRBLEJRfiBKQ8', 'places/ChIJ1egH9wYbmocRBLEJRfiBKQ8/reviews/ChdDSUhNMG9nS0VJQ0FnSUQ5OWZEa2t3RRAB', 'a year ago', 5, 'We came here based on recommendation from the hotel we were staying at.    We could not have been more pleased.    We ordered ribeye and filet steak.   Both were cooked perfectly.    The steak had wonderful flavor.   The vegetable was fresh mixed carrots cauliflower and brocolli, it was delicious.    The staff was attentive yet not hovering.    Tablecloths on the tables was a welcoming addition.   Finally a wonderful homemade raspberry cheesecake.    The cost was extremely reasonable.   Definitely a place to have dinner.', '2025-03-29 18:24:55.22', '2025-03-29 18:24:55.22'),
	('cm8uqrz6y0000la0mdcu7gh8s', 'ChIJzzReAb9rsocRFIvKG5of9X0', 'places/ChIJzzReAb9rsocRFIvKG5of9X0/reviews/ChdDSUhNMG9nS0VJQ0FnSUNudklDYWpBRRAB', '6 months ago', 5, 'First time at the location. Very clean and organized. Was busy to it being a new week but didn''t have to wait very long at all for my order. Staff kind and working hard! Peabut butter ft snickers, Twix, confetti cake, and birthday cake ft oreo. Was our selection and it was delicious. 10/10 recommend. Don''t walk, RUN  and get some Crumble!', '2025-03-29 21:47:09.418', '2025-03-29 21:47:09.418'),
	('cm8uqrz6y0001la0mef3pni1k', 'ChIJzzReAb9rsocRFIvKG5of9X0', 'places/ChIJzzReAb9rsocRFIvKG5of9X0/reviews/ChdDSUhNMG9nS0VJQ0FnSURIaWM2dTZ3RRAB', '6 months ago', 5, 'I enjoy the weekly new flavors and service is always fast and nice. I love the simplicity of the pink packaging. I also love how it smells inside the place! I would recommend this to everyone . I love the choices that they have and the way you can either purchase mini cookies or regular. I personally like the Minis!', '2025-03-29 21:47:09.418', '2025-03-29 21:47:09.418'),
	('cm8uqrz6y0002la0m0k2iir47', 'ChIJzzReAb9rsocRFIvKG5of9X0', 'places/ChIJzzReAb9rsocRFIvKG5of9X0/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzdjd1ZUNREAE', '4 months ago', 5, 'Super lightning  fast service! Smiles on faces. Accurate order... Very pleased. Will return when in the area!
