	('cm8uqslqq0005la0moanh5r9m', 'ChIJ-zulcO1rsocRj9UVJG0ocMg', 'places/ChIJ-zulcO1rsocRj9UVJG0ocMg/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnbWNpU19RRRAB', 'a month ago', 3, 'Food was ok, but they are way more expensive than other Mexicans restaurants in the area. A margarita is $15, I can get an awesome one at other places for $7-$9 and beers are to high also. Don’t think we’ll be back.', '2025-03-29 21:47:38.642', '2025-03-29 21:47:38.642'),
	('cm8uqslqq0006la0mi6o984ga', 'ChIJ-zulcO1rsocRj9UVJG0ocMg', 'places/ChIJ-zulcO1rsocRj9UVJG0ocMg/reviews/ChZDSUhNMG9nS0VJQ0FnSUNQaUp1SFVBEAE', '4 months ago', 5, 'Harold was wonderful got great service! The manager Gio was so sweet. The margarita in a bag was soooo good! Highly recommended!!', '2025-03-29 21:47:38.642', '2025-03-29 21:47:38.642'),
	('cm8uqslqq0007la0mc9ashnzu', 'ChIJ-zulcO1rsocRj9UVJG0ocMg', 'places/ChIJ-zulcO1rsocRj9UVJG0ocMg/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3NXBPTFp3EAE', 'a week ago', 5, 'First off. The greeting, the young ladies were absolutley adorable.!!  Our server Anna was adorable and did a really nice job!!

