Overall nice little place to eat. Price point was a bit high, but manageble. We''d stop back in if we were in the area.', '2025-03-29 21:47:38.642', '2025-03-29 21:47:38.642'),
	('cm8uqslqq0008la0ma592q1bi', 'ChIJ-zulcO1rsocRj9UVJG0ocMg', 'places/ChIJ-zulcO1rsocRj9UVJG0ocMg/reviews/ChZDSUhNMG9nS0VJQ0FnSURfbGQtYVBREAE', '2 months ago', 5, 'So good! It’s all good! The place is clean, atmosphere is fun, and the service is quick and friendly! We will definitely be back, thank you!', '2025-03-29 21:47:38.642', '2025-03-29 21:47:38.642'),
	('cm8uqslqq0009la0muq4hm65v', 'ChIJ-zulcO1rsocRj9UVJG0ocMg', 'places/ChIJ-zulcO1rsocRj9UVJG0ocMg/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBbGVUUGxBRRAB', 'a month ago', 1, 'When walking in the music was way too loud and didn’t go with ambiance. We were seated and brought chips, but waited over 10 minutes before finally going up to host counter to ask why no one had even taken our drink order. As we waited for a waitress we couldn’t even hear each other talking at the table because the music was so loud. The manager finally turned it down. Then the waitress came back a while later to take our drink and meal orders. I can say they brought the food out pretty quick. For the price, the food was mid at best. Small servings and each plate is $15-$20. We will not recommend nor will we return to eat here.', '2025-03-29 21:47:38.642', '2025-03-29 21:47:38.642'),
	('cm8uqsu180000jp0kjwltryqo', 'ChIJM7DcBU5rsocR7d6WaG2jgr8', 'places/ChIJM7DcBU5rsocR7d6WaG2jgr8/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBZzV6S1RREAE', 'a month ago', 5, 'I went here to celebrate my birthday. I was craving Korean BBQ but was not aware of the all you can eat Menu. This was a surprise to me. It was not cheap, but it was so worth it. My personal favorite was the wine pork belly🤤 to die for. My boyfriend and I were so shocked to see how professional everyone was. We had an amazing server, and he was so kind to introduce us to the restaurant and attend to all our needs. The service was so amazing and worth every penny. I loved this place, and I definitely recommend, I will be coming back to this place. (P.S it''s $8 per person if food is not finished. We ended up fighting for our lives, trying to eat all the food we ordered. Proceed with caution and planning, haha.)', '2025-03-29 21:47:49.388', '2025-03-29 21:47:49.388'),
	('cm8uqsu180001jp0ku4tg9cxf', 'ChIJM7DcBU5rsocR7d6WaG2jgr8', 'places/ChIJM7DcBU5rsocR7d6WaG2jgr8/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzN2VuS0xBEAE', '4 months ago', 3, 'This was the first time, I ever went to a Korean BBQ Restaurant. Looking at most recent reviews, I am wondering if this is not the norm or what. Honestly idk 😐 . We enjoyed the food and will admit that we were lost at what to order. Then we saw those around us ordered and decided to make a mental note to try those next time. The glass noodles were good and we liked the grilled teriyaki chicken. Interestingly enough we really liked the to-go order of glass noodles and sesame beef more so than what we ordered while dining in.', '2025-03-29 21:47:49.388', '2025-03-29 21:47:49.388'),
	('cm8uqsu180002jp0kzyn6fjwe', 'ChIJM7DcBU5rsocR7d6WaG2jgr8', 'places/ChIJM7DcBU5rsocR7d6WaG2jgr8/reviews/ChZDSUhNMG9nS0VJQ0FnSUNmb2NfSVN3EAE', '3 months ago', 5, 'The food was amazing! Loved the side dishes that they give (kimchi, radish, beansprouts, can’t remember the other two) the service was good. It was our first time and the way the server explained it was easy to understand. It was a little empty when we came but my partner and I enjoy it when it’s not too busy. Over all I recommend the restaurant, it is worth the time and money!', '2025-03-29 21:47:49.388', '2025-03-29 21:47:49.388'),
	('cm8uqsu180003jp0k9urhnf29', 'ChIJM7DcBU5rsocR7d6WaG2jgr8', 'places/ChIJM7DcBU5rsocR7d6WaG2jgr8/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYblpYU2p3RRAB', '5 months ago', 4, 'The beef bulgogi marinade was really good. The side dishes were good. Pretty decent selection as well. Ended up soaking the pork belly in the bulgogi marinade before cooking. Turned out nice. Kind of expensive', '2025-03-29 21:47:49.388', '2025-03-29 21:47:49.388'),
	('cm8uqsu180004jp0kk5omdlk8', 'ChIJM7DcBU5rsocR7d6WaG2jgr8', 'places/ChIJM7DcBU5rsocR7d6WaG2jgr8/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzNUpqVF9RRRAB', '4 months ago', 5, 'Contemporary decor restaurant, grills in every table. The food was very good . Pleasant service .', '2025-03-29 21:47:49.388', '2025-03-29 21:47:49.388'),
	('cm8uqtbkw0005jp0knzqlbk8o', 'ChIJlUdlZCYVsocRV_H7pq6dBWY', 'places/ChIJlUdlZCYVsocRV_H7pq6dBWY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNWc2RENEhnEAE', 'a year ago', 5, 'I just had an experience here I so desperately needed. Hands down the BEST falafels I have ever had, the flavor and texture reminded me of my great grandma cooking. 😭 I absolutely will be back often. The flavor was GREAT and the woman behind the counter was so sweet. ❤️ My husband and I are both so glad to have found this gem so close to home.', '2025-03-29 21:48:12.129', '2025-03-29 21:48:12.129'),
	('cm8uqtbkx0006jp0k1gq6jx4b', 'ChIJlUdlZCYVsocRV_H7pq6dBWY', 'places/ChIJlUdlZCYVsocRV_H7pq6dBWY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNGc2MtMkx3EAE', 'a year ago', 4, 'I ordered the Gyro Plate, it was actually really yummy! The meat was very fresh and flavorful, not too greasy. Quality cuts of lamb. The fries are hot and crispy, perfectly cooked and has a nice flavor to them. The salad was interesting, not exactly what I was expecting from a greek salad, but it was tasty nonetheless. The tzatziki sauce was good but nothing to write home about. Good creamy sauce not runny like some places. Fantastic taste!

The service was good, the gentleman was very polite and brought me my food. The atmosphere is a nice quiet little hole in the wall restaurant style, good if you want a quiet peaceful lunch.

Only real complaint (which is a very minor one) is I feel the portion size to price ratio is just a tad off. There wasn''t enough meat to justify the $12 price. It was so good that I was disappointed when I ran out lol.

Overall, great spot definitely will return!

P.S. I found it a little humorous that the sign outside by the street says "cheese stake".', '2025-03-29 21:48:12.129', '2025-03-29 21:48:12.129'),
	('cm8uqtbkx0007jp0k93af0ce2', 'ChIJlUdlZCYVsocRV_H7pq6dBWY', 'places/ChIJlUdlZCYVsocRV_H7pq6dBWY/reviews/ChdDSUhNMG9nS0VJQ0FnSURmd3N2d3V3RRAB', '2 months ago', 5, 'The food was incredible and the owners are incredibly nice. Will definitely be coming back. Had the Mediterranean chicken and rice and a gyro. Both were fantastic!', '2025-03-29 21:48:12.129', '2025-03-29 21:48:12.129'),
	('cm8uqtbkx0008jp0ka2piu8ad', 'ChIJlUdlZCYVsocRV_H7pq6dBWY', 'places/ChIJlUdlZCYVsocRV_H7pq6dBWY/reviews/ChZDSUhNMG9nS0VJQ0FnSURtMnRTTUZBEAE', '3 years ago', 5, 'This was my third time to visit in a month. Their gyro platter is delicious. Their portions are very large and the small dine in space is very clean. I tried their baklava and it is so tasty. You will enjoy your visit. This might be my new favorite place!', '2025-03-29 21:48:12.129', '2025-03-29 21:48:12.129'),
	('cm8uqtbkx0009jp0kbda83ckv', 'ChIJlUdlZCYVsocRV_H7pq6dBWY', 'places/ChIJlUdlZCYVsocRV_H7pq6dBWY/reviews/ChdDSUhNMG9nS0VJQ0FnTURBMy15ZTJRRRAB', 'a month ago', 5, 'So good! I enjoy it every time😊 If ypu haven''t tried it you definitely should!', '2025-03-29 21:48:12.129', '2025-03-29 21:48:12.129'),
	('cm8uqudhf000ajp0ksf1hi72p', 'ChIJmYJk7y9rsocRlXD-Xv2ClyE', 'places/ChIJmYJk7y9rsocRlXD-Xv2ClyE/reviews/ChZDSUhNMG9nS0VJQ0FnSURQMmVYZk1BEAE', '3 months ago', 4, 'We ordered through DoorDash and were pleasantly impressed with the food. The taco salad was flavorful and the chicken strips were good. They didn’t include a dipping sauce for the chicken strips which was disappointing.
We will definitely try this place out in person next time.', '2025-03-29 21:49:01.251', '2025-03-29 21:49:01.251'),
	('cm8uqudhf000bjp0kvb6mc9l8', 'ChIJmYJk7y9rsocRlXD-Xv2ClyE', 'places/ChIJmYJk7y9rsocRlXD-Xv2ClyE/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3dVlDX093EAE', 'a week ago', 4, 'Manager was great for service however our waiter not so much. He seemed to hide from us. 1st beers he brought us were not Ice cold as they had probably been sitting out at bar for over 10 minutes, since he first put our order in and we had to flag him down when we eventually saw him to remind him we had ordered beer.  Refills didn''t come and after about 10 minutes we flagged down the manager to get our food and drinks delivered. Overall a great place to watch the game if you get any of the other wait staff who seemed to be great. Tables that ordered way after us got their stuff way before we did. I would give the place another chance to see if we got better service.', '2025-03-29 21:49:01.251', '2025-03-29 21:49:01.251'),
	('cm8uqudhf000cjp0k89kq2mux', 'ChIJmYJk7y9rsocRlXD-Xv2ClyE', 'places/ChIJmYJk7y9rsocRlXD-Xv2ClyE/reviews/ChZDSUhNMG9nS0VJQ0FnSURiN0t6Q053EAE', '7 months ago', 4, 'Nice place! We came here this afternoon with a large party. We were sat quickly. They have a large variety of food and drinks that are reasonably priced, and the lots of indoor and outdoor seating. The servers also did a very good job!', '2025-03-29 21:49:01.251', '2025-03-29 21:49:01.251'),
	('cm8uqudhf000djp0kk3fxjth9', 'ChIJmYJk7y9rsocRlXD-Xv2ClyE', 'places/ChIJmYJk7y9rsocRlXD-Xv2ClyE/reviews/ChdDSUhNMG9nS0VJQ0FnTURRXzRINnBBRRAB', '2 weeks ago', 5, 'Louie''s offers great food with gluten-free options at reasonable prices. Customer service is priority and the food is served warm and it''s always delicious. We love the atmosphere and the bartenders, servers, and cooks are the best.', '2025-03-29 21:49:01.251', '2025-03-29 21:49:01.251'),
	('cm8uqtk5t000ala0m7hav1xnn', 'ChIJ6eSxHiNrsocR99bw-DLH_2c', 'places/ChIJ6eSxHiNrsocR99bw-DLH_2c/reviews/ChdDSUhNMG9nS0VJQ0FnTURRNk5xTm5RRRAB', '3 weeks ago', 2, 'Came here on a whim, not expecting anything much since it’s a busy Saturday, but ended up paying $42 for 2 people and ordered a french vanilla cold brew that had spoiled milk in it (thankfully this was taken off the bill). My order was wrong and from overhearing the tables around us there were constant issues.', '2025-03-29 21:48:23.249', '2025-03-29 21:48:23.249'),
	('cm8uqtk5t000bla0m2pg9m5bm', 'ChIJ6eSxHiNrsocR99bw-DLH_2c', 'places/ChIJ6eSxHiNrsocR99bw-DLH_2c/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3NTZTNFFBEAE', 'a week ago', 4, 'Overall, really good. The worker that served us was named Alberto. He was really nice and pretty fun. Overall good attitude about helping us. He helped us with the coupons and veterans discount. Highly recommend during the day!', '2025-03-29 21:48:23.249', '2025-03-29 21:48:23.249'),
	('cm8uqtk5t000cla0m225x3bz3', 'ChIJ6eSxHiNrsocR99bw-DLH_2c', 'places/ChIJ6eSxHiNrsocR99bw-DLH_2c/reviews/ChZDSUhNMG9nS0VJQ0FnTUNndGZfMldREAE', 'a month ago', 4, 'Nathan was our server & he was amazing! Friendly, helpful with order, checked back frequently and made it to work on a very crappy day! Food was decent. Cheese was not melted and not hot but could have to do with what I assume was a lack of staff after a snow/ice storm. Would definitely try again under better circumstances. Keep up the great service Nathan!', '2025-03-29 21:48:23.249', '2025-03-29 21:48:23.249'),
	('cm8uqtk5t000dla0mz4amz8b0', 'ChIJ6eSxHiNrsocR99bw-DLH_2c', 'places/ChIJ6eSxHiNrsocR99bw-DLH_2c/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3dU1PSnBBRRAB', 'a week ago', 5, 'Awesome 👌 Food was great and our personal server was so kind and expressed great vibes. Too bad I didn''t ask her name...I''d definitely mention her on this review. The other workers showed great service also. ☺️👌', '2025-03-29 21:48:23.249', '2025-03-29 21:48:23.249'),
	('cm8uqtk5t000ela0m22bl6hao', 'ChIJ6eSxHiNrsocR99bw-DLH_2c', 'places/ChIJ6eSxHiNrsocR99bw-DLH_2c/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2OTh2R25nRRAB', '3 months ago', 2, 'Services was terrible. Did not provided us with eating utensils. Had to ask for then. Ordered Sweet tea but brought plain tea. Did not come to ask if things were good for us. Asked twice to get refills on tea. Food wasn''t bad but forgot the avocados on my sandwich. Waitress brought more but never apologized. Just set it on the table and left. Waitress might not have had a good day. Never was friendly nor seemed to care. Spent most of her time talking to other employees. Would''ve liked to have sent a picture.', '2025-03-29 21:48:23.249', '2025-03-29 21:48:23.249'),
	('cm8uqu2il000fla0mzgppxz9s', 'ChIJ-8xCoDtrsocRgvRehuzYGxI', 'places/ChIJ-8xCoDtrsocRgvRehuzYGxI/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfdDczQ013EAE', '2 months ago', 1, 'Come on Chick-fil-A, the size of the "nuggets" is ridiculous now. The eight piece is more like eight half-bites. Everything I get from this location is room temperature now also, it never seems fresh anymore. In addition to shrinking the nuggets, why did Chick-fil-A get rid of coleslaw? Needless to say, they''ve lost my business.', '2025-03-29 21:48:47.038', '2025-03-29 21:48:47.038'),
	('cm8uqu2il000gla0mgnwfoe35', 'ChIJ-8xCoDtrsocRgvRehuzYGxI', 'places/ChIJ-8xCoDtrsocRgvRehuzYGxI/reviews/ChdDSUhNMG9nS0VJQ0FnSUNudU5hODB3RRAB', '6 months ago', 4, 'We dined in on a Saturday evening  Drive thru was long but no line inside. Food was great, got exactly what we wanted. My only complaint was having to wait 5 minutes in line for a refill. We missed coming here while under construction so we’re happy is over and they’re open again.', '2025-03-29 21:48:47.038', '2025-03-29 21:48:47.038'),
	('cm8uqu2il000hla0m7if6bqf6', 'ChIJ-8xCoDtrsocRgvRehuzYGxI', 'places/ChIJ-8xCoDtrsocRgvRehuzYGxI/reviews/ChZDSUhNMG9nS0VJQ0FnTURnX052dmN3EAE', 'a month ago', 5, 'I very rarely write reviews, but the experience I had yesterday was so amazing I felt inspired to write a review about it. I showed up around 45 minutes before closing to dine in, so I would have completely understood if the staff had been a little tired and non-conversational. But to my surprise it was, in fact, the exact opposite! The staff was so extremely kind and helpful! Reese was one of the sweetest, friendliest people I have ever met in any establishment I’ve ever frequented! It was an absolute pleasure to speak to her! There was also a young man whose name I didn’t catch, but he was delightful as well. Amazing staff you guys have! :)', '2025-03-29 21:48:47.038', '2025-03-29 21:48:47.038'),
	('cm8uqu2il000ila0ma2e2l2kf', 'ChIJ-8xCoDtrsocRgvRehuzYGxI', 'places/ChIJ-8xCoDtrsocRgvRehuzYGxI/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3aUlDMURREAE', 'in the last week', 1, 'I go to Chick-fil-A at a minimum once a week & this location has messed up my order literally every single time for the past 2 months. We’ve returned numerous times over entire meals or multiple sandwiches missing. Today, I door dashed & once again- I’m missing an item, my sauces are mixed up and kale salad didn’t come with the nuts. Every time we have gone, The managers are subpar. They don’t really do anything to make it extra right besides giving us the missing items, So that we are unable to eat as a family. This is the single worst Chick-fil-A experience I’ve ever had And will be driving out of my way from now on to go to a different location (Probably not Norman because the owner owns both of them🥴)', '2025-03-29 21:48:47.038', '2025-03-29 21:48:47.038'),
	('cm8uqu2il000jla0mnbw4g4vi', 'ChIJ-8xCoDtrsocRgvRehuzYGxI', 'places/ChIJ-8xCoDtrsocRgvRehuzYGxI/reviews/ChdDSUhNMG9nS0VJQ0FnTURBOTZ1SDR3RRAB', 'a month ago', 5, 'Very slow service. Service is not like it used to be. They created another lane for drive thru and ever since it’s been slow. Very rarely go because of how long the wait is for food. Then they bring your food out and it starts getting cold before you can even get in line because you might be stuck behind four cars and you have to wait for them to move first. So by time you get your food home and get it out to feed everyone it’s usually pretty cold', '2025-03-29 21:48:47.038', '2025-03-29 21:48:47.038'),
	('cm8uqu2md000kla0mwyuj8535', 'ChIJDU4hISNrsocRs_URZ5eMY8M', 'places/ChIJDU4hISNrsocRs_URZ5eMY8M/reviews/ChZDSUhNMG9nS0VJQ0FnSURQNW8zZGZ3EAE', '3 months ago', 5, 'Buffalo Wild Wings never disappoints! I had the Mango Habanero wings—my absolute favorite—and they were perfectly spicy and flavorful. I also tried the ultimate nachos with fries, and everything was absolutely delicious. Great food, great atmosphere, and amazing service. Can’t wait to come back!', '2025-03-29 21:48:47.173', '2025-03-29 21:48:47.173'),
	('cm8uqu2md000lla0mubfr9fb4', 'ChIJDU4hISNrsocRs_URZ5eMY8M', 'places/ChIJDU4hISNrsocRs_URZ5eMY8M/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2cmVPRERBEAE', '3 months ago', 4, 'So the place is pretty neat. Lots of places to sit and depending on your style ir if you''re with family or just thr guys you have seating options from 3 different areas.  Service was fast. I thought the wings were good. Was jot a fan of the quest, it was extremely watered down and they forgot my guacamole in my trio. Didn''t notice till I got home so I wasn''t going to drive back. Prices are as average as anywhere else.', '2025-03-29 21:48:47.173', '2025-03-29 21:48:47.173'),
	('cm8uqu2md000mla0mm1bjgiby', 'ChIJDU4hISNrsocRs_URZ5eMY8M', 'places/ChIJDU4hISNrsocRs_URZ5eMY8M/reviews/ChZDSUhNMG9nS0VJQ0FnSUNQaTdLSWFBEAE', '4 months ago', 1, 'No wonder this place is always empty.  The smell of this place is like an old carpet. I can see only teenagers "working" at this place. More of a hiding in the back. I waited more than 20 minutes, and the wings came cold . You can taste old meat. I had it before at the same place, I forgot about it. Now I will remember.  Don''t come back here again.  Add some pictures of empty place and gross old wings.', '2025-03-29 21:48:47.173', '2025-03-29 21:48:47.173'),
	('cm8uqu2md000nla0m3uvo9wux', 'ChIJDU4hISNrsocRs_URZ5eMY8M', 'places/ChIJDU4hISNrsocRs_URZ5eMY8M/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnMmJhNHp3RRAB', 'a month ago', 5, 'Nathan was an exceptional waiter! Food is on point. Good on a cold snowy day. He warmed our hearts with the best wings and burgers we’ve had.! Just when you’re ordering drinks, make sure you ask him for heavy on the alcohol.', '2025-03-29 21:48:47.173', '2025-03-29 21:48:47.173'),
	('cm8uqu2md000ola0mhjiy6tn8', 'ChIJDU4hISNrsocRs_URZ5eMY8M', 'places/ChIJDU4hISNrsocRs_URZ5eMY8M/reviews/ChdDSUhNMG9nS0VJQ0FnSUNwZ2E3aG93RRAB', 'a year ago', 3, 'We’re in OKC for a basketball tournament and our team visited this location for lunch. We had a party of 30 and was seated very quickly. Our server, Emily, was awesome! She wasn’t provided any help and took care of us all wonderfully! It did take some time for our food and drinks to arrive, but overall the experience was good.', '2025-03-29 21:48:47.173', '2025-03-29 21:48:47.173'),
	('cm8uqu7op000pla0m793uc6vx', 'ChIJmanhl8UUsocREYdUxRKzel4', 'places/ChIJmanhl8UUsocREYdUxRKzel4/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzdlo2Skh3EAE', '4 months ago', 5, 'I''ve only ordered delivery from here twice so can''t really rate atmosphere. Both times the food has been absolutely amazing and flavorful. Portions are very generous as well.

The lamb curry had a nice spice and very tender meat. If you don''t like spice The chicken korma is creamy, sweet, and full of flavor. The chicken was slightly dry but still delicious.

In the pictures, I got the butter chicken and it is soooo flavorful, low on the spiciness, chicken was fall apart tender, they added extra yogurt sauce to my order and I''m not sure if it was for the butter chicken but I added some and it added even more creaminess which I love.

The biryani was so fluffy and seasoned beautifully. I added lamb to mine and the lamb was soooo tender and flavorful. I also added some of the yogurt sauce to the biryani and it was so yummy.

The meat samosa were huge and packed full of meat and delicious. The sauces that went with it were phenomenal.

The mango lassi, was yummy with a mild mango flavor.

I did not like the pickles flavor was just to sour.

Overall I love this food and would love to try the buffet so I can try multiple different dishes.', '2025-03-29 21:48:53.737', '2025-03-29 21:48:53.737'),
	('cm8uqu7op000qla0me7bok964', 'ChIJmanhl8UUsocREYdUxRKzel4', 'places/ChIJmanhl8UUsocREYdUxRKzel4/reviews/ChdDSUhNMG9nS0VJQ0FnSUNOcTRtbDZnRRAB', 'a year ago', 4, 'Initially the host at door wasn''t very engaging or helpful,but he got better! Food is yummy I just feel for price portions are small.  It is very clean even bathroom! TV too loud.this was our second visit, we would like to eventually try all the dishes!', '2025-03-29 21:48:53.737', '2025-03-29 21:48:53.737'),
	('cm8uqu7op000rla0mkmmt30zh', 'ChIJmanhl8UUsocREYdUxRKzel4', 'places/ChIJmanhl8UUsocREYdUxRKzel4/reviews/ChdDSUhNMG9nS0VJQ0FnTUR3NUozcW93RRAB', 'in the last week', 5, 'I had an amazing experience at Himalayan Cuisine! The food was absolutely delicious, with rich flavors and authentic spices. The service was exceptional, friendly staff, quick service, and a warm, welcoming atmosphere. Will definitely come back and highly recommend this place.', '2025-03-29 21:48:53.737', '2025-03-29 21:48:53.737'),
	('cm8uqu7op000sla0mllwukxtb', 'ChIJmanhl8UUsocREYdUxRKzel4', 'places/ChIJmanhl8UUsocREYdUxRKzel4/reviews/ChdDSUhNMG9nS0VJQ0FnSURyb0pmVXNRRRAB', '8 months ago', 5, 'Very delicious food! I love the style of cooking they use. Everything we had was very good! Chicken vandaloo and goat jalfrezi. Yum!! The chicken garlic cheese Naan is insane. Highly recommend. This place deserves a lot more than 4.3 stars!', '2025-03-29 21:48:53.737', '2025-03-29 21:48:53.737'),
	('cm8uqu7op000tla0m8lmpe1cz', 'ChIJmanhl8UUsocREYdUxRKzel4', 'places/ChIJmanhl8UUsocREYdUxRKzel4/reviews/ChZDSUhNMG9nS0VJQ0FnSURUX3ZLS0hREAE', '10 months ago', 4, 'Great little Indian cuisine joint located right off i35. I definitely recommend ordering the lamb dishes as their chicken was quite dry. Also, they have really good garlic Nan bread. Make sure you get the sauces that go with it. The tamarind sauce is amazing. The two ladies that work there are very kind and give good suggestions.', '2025-03-29 21:48:53.737', '2025-03-29 21:48:53.737'),
	('cm8uquesz000fjp0ktq5x1hb1', 'ChIJERfyOS5rsocRHfXhS3vWPTI', 'places/ChIJERfyOS5rsocRHfXhS3vWPTI/reviews/ChdDSUhNMG9nS0VJQ0FnSURmaFByQ3Z3RRAB', '2 months ago', 5, 'Beautiful restaurant! No wait.  wonderful service. Our server was so sweet and attentive. Ordered the Italian nachos, and do not recommend. Seemed like a bunch of random stuff unattractively piled together.
The Caesar salads and pastas, however, were amazing.
The Asiago spinach chicken pasta was some of the best pasta I’ve ever had. Their pasta trio was wonderful as well. Very well priced! Under $60 for 2 people.  Very much recommend.', '2025-03-29 21:49:02.963', '2025-03-29 21:49:02.963'),
	('cm8uquesz000gjp0k1dgcf234', 'ChIJERfyOS5rsocRHfXhS3vWPTI', 'places/ChIJERfyOS5rsocRHfXhS3vWPTI/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfX3RlWk9REAE', '2 months ago', 2, 'I will start with the positive aspects
The restaurant boasts a pleasant ambiance, making it a nice spot for dining. Quick seating was a plus; we were able to get a table right away. The prices are very reasonable, offering good value for the experience. Wait staff was very pleasant as was the manager. Unfortunately the food quality fell short.

Crab Cakes: Overcooked and lacked flavor
Salmon: Overcooked and mushy
Spicy meatballs: Arriving gray and bland

Possibly other dishes are better but what we had was more along the lines of High School cafeteria food.', '2025-03-29 21:49:02.963', '2025-03-29 21:49:02.963'),
	('cm8uquesz000hjp0kpj3bss3v', 'ChIJERfyOS5rsocRHfXhS3vWPTI', 'places/ChIJERfyOS5rsocRHfXhS3vWPTI/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBOFpfR3F3RRAB', 'a month ago', 4, 'The alfredo was very bland with no flavor. The spaghetti and meatballs were ok, the marinara was a little too sweet. The breadsticks were 100% made from frozen breadsticks instead of fresh. The only thing with flavor was the bruschetta. Not the same Oliveto I remember going to a few years ago', '2025-03-29 21:49:02.963', '2025-03-29 21:49:02.963'),
	('cm8uquesz000ijp0kckba65tk', 'ChIJERfyOS5rsocRHfXhS3vWPTI', 'places/ChIJERfyOS5rsocRHfXhS3vWPTI/reviews/ChdDSUhNMG9nS0VJQ0FnSUNIcF9MS3lBRRAB', '6 months ago', 5, 'This place hits the spot! We came in around opening time so it wasn’t busy at all. Service was amazing. I didn’t have to ask for refills. She immediately came to the rescue. Very friendly staff. The atmosphere is just peaceful. The food is fantastic. I definitely recommend dining in!', '2025-03-29 21:49:02.963', '2025-03-29 21:49:02.963'),
	('cm8uquesz000jjp0kr46ujdpc', 'ChIJERfyOS5rsocRHfXhS3vWPTI', 'places/ChIJERfyOS5rsocRHfXhS3vWPTI/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzb05QVmhBRRAB', '4 months ago', 5, 'My man and I went right around 8 pm for the happy hour appetizers, and they were AMAZING!
We started off with someone side Ceasar salads, and the lettuce was so fresh and crispy. They come with bread sticks, which are soft with a buttery garlic goodness, it''s like eating a cloud full of flavor. The Ceasar dressing is like an Italian style dressing and it comes with crispy croutons and topped with delicious cheese.
We ordered the bruchetta "sundae," which is served in a cute martini glass and comes with delicious toasted artesian bread. The bruchetta sundae consists of marinated tomatoes, olive oil, balsamic glaze, garlic, and fresh basil.

I have been to Italy, and even the Italians would eat this with fresh mozzarella cheese!

We then ordered the Italian nachos. Ya''ll! It''s like pizza, but on nachos!
The nachos consist of crispy wonton chips topped with Alfredo sauce, crispy pepperoni, Italian sausage, roasted red peppers, Kalamata olives, cheddar, mozzarella, and provolone cheeses. They are garnished with jalapeños, green onions, and drizzled with a balsamic glaze reduction.

For entrees, we ordered a Woodstone pizza, make it your own (build your own). This item was also on the 8 pm happy hour menu. I got the pesto garlic Alfredo sauce, pepperoni, Italian sausage, and chicken. I got extra cheese on top with a side of ranch, but this pizza did not need ranch at all!
The crust was crispy, buttery, and so delicious.

For the second entree, we ordered the shrimp scampi. The angel hair pasta was so flavorful! So buttery and garlicky! The shrimp were succulent and flavorful.

Everything we had was so fresh and delicious! Not to mention the staff are all very sweet and polite!

The happy hour menu consists of several appetizers, pizzas, and alcoholic drinks! We saved over 17 dollars by going to their happy hour! I highly, HIGHLY recommend it!', '2025-03-29 21:49:02.963', '2025-03-29 21:49:02.963'),
	('cm8uqwp8o000kjp0kvtasbm6v', 'ChIJ39MIzTtrsocRUl5IThZBQL8', 'places/ChIJ39MIzTtrsocRUl5IThZBQL8/reviews/ChdDSUhNMG9nS0VJQ0FnSURQbnFTb3p3RRAB', '3 months ago', 4, 'Chili''s. It had been awhile since I''ve had chili''s. Went on a Sunday evening.
Ordered the Surf N Turf Ribeye with broccoli and loaded mashed potatoes.  Steak was cooked perfectly medium rare and juicy, but a bit bland. The shrimp was amazing and had a great flavor. The broccoli was good but a little too crunchy and the mashed potatoes were good.
The waitress was sweet and very good at her job. Everything was timely and great. The restaurant was clean and a nice environment.', '2025-03-29 21:50:49.8', '2025-03-29 21:50:49.8'),
	('cm8uqwp8o000ljp0kanq6gxsa', 'ChIJ39MIzTtrsocRUl5IThZBQL8', 'places/ChIJ39MIzTtrsocRUl5IThZBQL8/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYby1yTFZ3EAE', '5 months ago', 4, 'We came in for a late lunch this Saturday. Our waitress Tammy was amazing. She kept our drinks full and had prompt service. I ordered my favorite thing here which is the honey chipotle chicken crispers, the 4 count. You have to get their ranch to go with it! My lunch was everything I could’ve asked for! My boyfriend ordered the baked wings with sauce on the side. He said flavor was there he just wished they were cooked a little longer. That is the only reason for the 4 stars. Most definitely coming back.', '2025-03-29 21:50:49.8', '2025-03-29 21:50:49.8'),
	('cm8uqwp8o000mjp0kwl8yds1k', 'ChIJ39MIzTtrsocRUl5IThZBQL8', 'places/ChIJ39MIzTtrsocRUl5IThZBQL8/reviews/ChZDSUhNMG9nS0VJQ0FnTURRNV9hdkxREAE', '2 weeks ago', 5, 'Went on a solo day date to Chili’s and it was an amazing experience! TaRon, the manager, met me at the door with a smiling face and immediately found me a clean booth to sit at. He was professional and attentive all the customers in the restaurant. My server was quick and friendly. My food was made correctly, tasted so good and was at the table super fast. Overall I had a great time and will definitely be going back soon!', '2025-03-29 21:50:49.8', '2025-03-29 21:50:49.8'),
	('cm8uqwp8o000njp0kohy9h27n', 'ChIJ39MIzTtrsocRUl5IThZBQL8', 'places/ChIJ39MIzTtrsocRUl5IThZBQL8/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzbFpLY3hnRRAB', '4 months ago', 5, 'The chips came out hot and fresh and they filled my marg to the TOP!!! I just had to leave a review!!! Definitely will come back :)', '2025-03-29 21:50:49.8', '2025-03-29 21:50:49.8'),
	('cm8uqwp8o000ojp0khabu6hyj', 'ChIJ39MIzTtrsocRUl5IThZBQL8', 'places/ChIJ39MIzTtrsocRUl5IThZBQL8/reviews/ChdDSUhNMG9nS0VJQ0FnSUNudHJQYXJRRRAB', '6 months ago', 1, 'Very disappointed. We love these salads and they are usually bomb except the last couple of times we have been shorted on chicken strips and didn’t get the Santa Fe sauce that’s suppose to be on there. Also the quac on it was not good at all we are very disappointed and probably won’t be back', '2025-03-29 21:50:49.8', '2025-03-29 21:50:49.8'),
	('cm8uqwy9z000pjp0k93vzehc3', 'ChIJfTcSVTtrsocRGY4E6bJjWXQ', 'places/ChIJfTcSVTtrsocRGY4E6bJjWXQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzbDkyRU53EAE', '2 months ago', 5, 'We''ve visited this store several times when we''re in the area. They have always been consistent with good service!! The smoothies we bought - Bahama Mama for Joe and an Island Green (no kale, add energizer) were delicious, flavorful and just what we were looking for!!! Unlike the Mustang store the day before - the Mustang manager (Alex) was rude, verbally abusive and showed disdain for us by making lousy smoothies we couldn''t drink!! We saw by the reviews that we weren''t the only ones getting messed up food, drinks, and attitude!!
Thank you too this store for serving us such good smoothies!!!', '2025-03-29 21:51:01.512', '2025-03-29 21:51:01.512'),
	('cm8uqwy9z000qjp0k17km8z9r', 'ChIJfTcSVTtrsocRGY4E6bJjWXQ', 'places/ChIJfTcSVTtrsocRGY4E6bJjWXQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUN4Mi1UQVVREAE', '2 months ago', 5, 'I usually get lunch from Tropical Smoothie Cafe, and I must say the staff is absolutely awesome! The manager, she is amazing—so helpful and kind. The food is always healthy, fresh, and delicious, which I really appreciate. Thank you so much for your excellent service!', '2025-03-29 21:51:01.512', '2025-03-29 21:51:01.512'),
	('cm8uqwy9z000rjp0kkz0b6ds0', 'ChIJfTcSVTtrsocRGY4E6bJjWXQ', 'places/ChIJfTcSVTtrsocRGY4E6bJjWXQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUNud29YdC1BRRAB', '6 months ago', 5, 'Tropical Smoothie Review

I recently visited Tropical Smoothie and had a delightful experience that I can’t wait to share. I ordered the Thai Chicken Salad, and it was nothing short of fresh and delicious. The flavors were vibrant, with a perfect balance of crunch and zest that made each bite enjoyable. It’s clear that they prioritize quality ingredients, and I appreciated the generous portion size as well.

The service was also commendable. The staff was friendly and efficient, ensuring my order was prepared quickly and accurately. It’s always nice to be greeted with a smile and feel valued as a customer.

One of the aspects I particularly enjoyed was the ambiance of the store. It was pleasantly quiet, allowing for a relaxing dining experience. I took advantage of the inviting atmosphere and savored my meal in peace, which is a rarity in many fast-casual dining spots.

Overall, my visit to Tropical Smoothie was a fantastic one. With fresh food, good service, and a calm environment, it’s definitely a place I’d recommend for anyone looking for a healthy and tasty meal. I look forward to trying more items from their menu in the future!', '2025-03-29 21:51:01.512', '2025-03-29 21:51:01.512'),
	('cm8uqwy9z000sjp0ki3aadpio', 'ChIJfTcSVTtrsocRGY4E6bJjWXQ', 'places/ChIJfTcSVTtrsocRGY4E6bJjWXQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUMtMnUtcE9REAE', '2 years ago', 5, 'One of my favorite afternoon places! I had the Peanut Paradise smoothie and a Buffalo Chicken Wrap and both were excellent. That Buffalo has some bite! The staff here were amazing! Good time all around.', '2025-03-29 21:51:01.512', '2025-03-29 21:51:01.512'),
	('cm8uqwy9z000tjp0kagxhngk8', 'ChIJfTcSVTtrsocRGY4E6bJjWXQ', 'places/ChIJfTcSVTtrsocRGY4E6bJjWXQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUMwenRmei1RRRAB', '5 years ago', 3, 'I usually like this place.  The food is good.  However today, my "power greens" bowl that is listed on their website as containing kale, spinach and romaine has nothing but shredded iceberg lettuce.  I called to tell them and the manager said the menu online is wrong because they are a franchise and their owner doesn''t want to have kale.   She did offer to remake it but I declined being about 15 min away one way.  She could have offered to replace it on a later visit, but all I got was "sorry about that hun."    Not the best resolution to my problem.  I guess this self proclaimed "heal conscious" restaurant thinks iceberg lettuce is somehow healthy?   So, in conclusion.  the food is usually right and usually good, and even while failing to resolve this mess up, she was still polite so they get 3 stars.', '2025-03-29 21:51:01.512', '2025-03-29 21:51:01.512'),
	('cm8uqxli3000ujp0k7fqfmb11', 'ChIJqUGpLztrsocR7AEZeosWrSg', 'places/ChIJqUGpLztrsocR7AEZeosWrSg/reviews/ChdDSUhNMG9nS0VJQ0FnSUNINkw3a2hnRRAB', '7 months ago', 4, 'I''ve always wondered why this place has a long line for the drive thru. Now I get it .... This was our first time EVER having Taco Casa and now whenever we have an itch for fast food tacos. This is it. I really liked my taco super salad 🌮 🥗 and he really liked his super burrito 🌯. Hands down, best option for fast food tacos. We have our Taco Bell 🔔 replacement (which we stopped eating YEARS AGO.', '2025-03-29 21:51:31.611', '2025-03-29 21:51:31.611'),
	('cm8uqxli3000vjp0kqvgzjhll', 'ChIJqUGpLztrsocR7AEZeosWrSg', 'places/ChIJqUGpLztrsocR7AEZeosWrSg/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2dVpxOWhBRRAB', '3 months ago', 5, 'This was my first time going to Taco Casa, and I shared this pic to show what I think of it! I am hooked! I got the Chilada with sour cream, and a taco lite (there''s nothing "lite" about it...it was huge )!!! My only complaint is that the chilada container has ridges and I couldn''t scrape out all the good bits on the sides! 🤣 The food was delicious and the staff was fast and friendly! I will definitely be back!', '2025-03-29 21:51:31.611', '2025-03-29 21:51:31.611'),
	('cm8uqxli3000wjp0k6i1wfb9n', 'ChIJqUGpLztrsocR7AEZeosWrSg', 'places/ChIJqUGpLztrsocR7AEZeosWrSg/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYejd1a1lREAE', '5 months ago', 5, 'Taco casa. What can I say about you that I haven’t said about other memorable experiences like learning to ride a bike or feeling the brisk morning dew on your bare feet? Like a sexy but reasonable Mexican American mistress you are always there when I need you. Even though sometimes I know you’re not good for me when I see you, when I smell you, it puts all of my unhealthy fears to rest. You are what I need. You make me believe it. You never let me down, except for that one time you were closed for Christmas Day. Your burritos are as big as the moon. Your taco, so fresh and ready to be snatched away. And tasting that sweet texmex nectar called sweet tea hits hard like the first time I listened to George Michael turned up all the way. Even the doors know when I’m here, they just open when I get close. I can’t quit you taco casa, even if I wanted to.', '2025-03-29 21:51:31.611', '2025-03-29 21:51:31.611'),
	('cm8uqxli3000xjp0kstq26fxs', 'ChIJqUGpLztrsocR7AEZeosWrSg', 'places/ChIJqUGpLztrsocR7AEZeosWrSg/reviews/ChdDSUhNMG9nS0VJQ0FnTURRenVxZXlBRRAB', '2 weeks ago', 3, 'We ran through the drive through in Oklahoma, near OKC. The lady taking our order was the nicest. The food was ok. We had burritos and super nachos. The nacho beans were hard as could be. The tomatoes were mushy and the meat was not warm. Not all locations we have been to, have this issue, I just can’t remember the city we were in. We were near OKC.', '2025-03-29 21:51:31.611', '2025-03-29 21:51:31.611'),
	('cm8uqxli3000yjp0k5bc1d620', 'ChIJqUGpLztrsocR7AEZeosWrSg', 'places/ChIJqUGpLztrsocR7AEZeosWrSg/reviews/ChdDSUhNMG9nS0VJQ0FnSUMxeVppUi1nRRAB', 'a year ago', 5, 'We got to town a little early today and stopped by Taco Casa to grab a taco snack, before headed to the kids for New Year’s.

I have to say, I was quite impressed! The restaurant is clean, fast, and efficient. The food was good, fresh, and quickly served! The people were friendly, professional, and very well coordinated!

This is the best fast food, Mexican experience I’ve had in many, many years! Highly recommend!', '2025-03-29 21:51:31.611', '2025-03-29 21:51:31.611'),
	('cm8uqxlkz000zjp0ktb2w363l', 'ChIJrdZtHfQUsocRjY0ZdLMEKls', 'places/ChIJrdZtHfQUsocRjY0ZdLMEKls/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzb0p1R3FRRRAB', '4 months ago', 5, 'Ordered the vegetable tempura, and it was perfection. The best temperua I''ve had in a long time.

Ordered the golden fantasy roll that has sweet mago on top, along with the Hawaii roll that is topped with kiwi. Both rolls are sweet and savory! I highly recommend it!

We also ordered the combination Japanese fried rice, which comes with chicken, steak, shrimp, and vegetables. I also highly recommend it!', '2025-03-29 21:51:31.716', '2025-03-29 21:51:31.716'),
	('cm8uqxlkz0010jp0kp86lqqgj', 'ChIJrdZtHfQUsocRjY0ZdLMEKls', 'places/ChIJrdZtHfQUsocRjY0ZdLMEKls/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzdVAyc0pREAE', '4 months ago', 4, 'Restaurant was packed Saturday evening but I understand why because the food is great. This location is much smaller than the others so it always packed. We started off with the dumplings and bbq squid and I always order the dancing chicken roll with a garden roll. Mine was delicious as always. My boyfriend ordered the chicken & shrimp hibachi. He did find a hair in his food which was unfortunate but we don’t hold it against them 🫶🏻 Hibachi comes with miso soup and salad. I would recommend going to any Volcano location!', '2025-03-29 21:51:31.716', '2025-03-29 21:51:31.716'),
	('cm8uqxlkz0011jp0k0grh87rl', 'ChIJrdZtHfQUsocRjY0ZdLMEKls', 'places/ChIJrdZtHfQUsocRjY0ZdLMEKls/reviews/ChdDSUhNMG9nS0VJQ0FnSURqd3JpazhRRRAB', '11 months ago', 5, 'Nice comfortable place to enjoy sushi. Service was excellent. Started with a seaweed salad and they also brought out pickled cucumbers with seaweed in addition to the salad. We then got two rolls that were delightful. Tried the layered cake mocha which was also delicious. Enjoined dinning here. 👍', '2025-03-29 21:51:31.716', '2025-03-29 21:51:31.716'),
	('cm8uqxlkz0012jp0kldcbux0u', 'ChIJrdZtHfQUsocRjY0ZdLMEKls', 'places/ChIJrdZtHfQUsocRjY0ZdLMEKls/reviews/ChZDSUhNMG9nS0VJQ0FnSUNibVBTcWRnEAE', '8 months ago', 5, 'This is the restaurant where I tried sushi for the first time. This is now my go-to sushi restaurant in the south metro. They have a huge selection. Every roll has pictures on the menu. The lunch box is a great value. Go check it out! You won’t be disappointed.', '2025-03-29 21:51:31.716', '2025-03-29 21:51:31.716'),
	('cm8uqxlkz0013jp0kcstg1j4n', 'ChIJrdZtHfQUsocRjY0ZdLMEKls', 'places/ChIJrdZtHfQUsocRjY0ZdLMEKls/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfMS1lYnlRRRAB', '2 months ago', 2, 'Was expecting an actual Hibachi grill, but decided to stay and give it a try. Got drinks fast but waited awhile for someone to take our order(small place, lots of servers). Ordered hibachi steak medium and hibachi filet mignon medium. Was surprised when I stirred the broth soup and there were small pieces of tofu. Very small portions, no flavor, both the steak and filet mignon were chewy, no flavor.
Definitely won’t be back.', '2025-03-29 21:51:31.716', '2025-03-29 21:51:31.716'),
	('cm8uqz4km000ula0m5t8bm7c4', 'ChIJrao68tMUsocRxq6yExct-FQ', 'places/ChIJrao68tMUsocRxq6yExct-FQ/reviews/ChZDSUhNMG9nS0VJQ0FnSURmNTlDa0N3EAE', '2 months ago', 5, 'Very kind staff with a unique selection of candy. I personally am addicted to their cheddar popcorn. Love visiting here.', '2025-03-29 21:52:42.982', '2025-03-29 21:52:42.982'),
	('cm8uqz4km000vla0mcxvqisxd', 'ChIJrao68tMUsocRxq6yExct-FQ', 'places/ChIJrao68tMUsocRxq6yExct-FQ/reviews/ChdDSUhNMG9nS0VJQ0FnSURIM3ZlWHBBRRAB', '6 months ago', 1, 'It’s a beautiful place with great, friendly service but everything is old and expired. I went there a few weeks ago with the kids and everything they got was old.', '2025-03-29 21:52:42.982', '2025-03-29 21:52:42.982'),
	('cm8uqz4km000wla0mc5wx48r6', 'ChIJrao68tMUsocRxq6yExct-FQ', 'places/ChIJrao68tMUsocRxq6yExct-FQ/reviews/ChdDSUhNMG9nS0VJQ0FnSURKb0xqaTR3RRAB', 'a year ago', 2, 'Stopped in for some ice cream which we were informed abruptly that they were out of as we entered the store. I don''t know if the lady was having a bad day or what but her tone came off as rude and made us feel unwelcomed. Probably will never be back honestly.', '2025-03-29 21:52:42.982', '2025-03-29 21:52:42.982'),
	('cm8uqz4km000xla0m38mfa49o', 'ChIJrao68tMUsocRxq6yExct-FQ', 'places/ChIJrao68tMUsocRxq6yExct-FQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUNHd05MZHpRRRAB', '3 years ago', 1, 'Visited today. Checked opening time Friday and today before leaving home. Website and sign on door said open at 10. I arrived at 10:40 and they were closed. Very disappointing and disappointed. I had picked up my 9 year old niece and was really looking forward to taking her. Not sure if I will return.', '2025-03-29 21:52:42.982', '2025-03-29 21:52:42.982'),
	('cm8uqz4km000yla0mz9eg7arj', 'ChIJrao68tMUsocRxq6yExct-FQ', 'places/ChIJrao68tMUsocRxq6yExct-FQ/reviews/ChdDSUhNMG9nS0VJQ0FnSURTaHFmYnRnRRAB', '4 years ago', 5, 'Absolutely LOVED it. What a cute place. My oldest daughter got some great candy and my youngest picked out a cool dipped cone with udderly delicious chocolate.  I ate some of it and it was Amazing.  The young lady there was so informative on the Gelato and the specialty candy. There was also a cute Boutique attached. I''m so glad we stopped by. So much popcorn as well and lots if neat ideas for Christmas gifts and stalking fillers. Of course I grabbed a few. Prices surprised me, I paid way less than I expected to so that was a big bonus. Definitely worth stopping', '2025-03-29 21:52:42.982', '2025-03-29 21:52:42.982'),
	('cm8uqz4lp000zla0ms9ixs2kh', 'ChIJN68zdC1rsocRY54_VDOoNtM', 'places/ChIJN68zdC1rsocRY54_VDOoNtM/reviews/ChdDSUhNMG9nS0VJQ0FnTURRNDVyWW1BRRAB', '2 weeks ago', 5, 'Obviously great drinks and boba! The workers were super locked in (which is good). The employees also happened to be super nice! Very, very sweet girls :D The place was so cutesy and they had board games and Jenga for customers to play! Lastly, they had the best ice. Oh yeahhh', '2025-03-29 21:52:43.022', '2025-03-29 21:52:43.022'),
	('cm8uqz4lp0010la0m1y3wdxke', 'ChIJN68zdC1rsocRY54_VDOoNtM', 'places/ChIJN68zdC1rsocRY54_VDOoNtM/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBdzQzTHp3RRAB', 'a month ago', 5, 'Amazing establishment, I highly recommend to all that are looking for a new spot to grab a refreshing drink or tasty treats. The staff is wonderful and give impeccable service to their guests. I’m definitely gonna be coming back on a regular basis and y’all should too.', '2025-03-29 21:52:43.022', '2025-03-29 21:52:43.022'),
	('cm8uqz4lp0011la0mpud1krwm', 'ChIJN68zdC1rsocRY54_VDOoNtM', 'places/ChIJN68zdC1rsocRY54_VDOoNtM/reviews/ChZDSUhNMG9nS0VJQ0FnSUNjNTl5Z2Z3EAE', '4 years ago', 5, 'We love the Boba and the vanilla, caramel and coffee flavored drinks with them. The employees are always very friendly and it''s never crowded. It has a very relaxed atmosphere and even board games, encouraging you to stay a while. It''s very clean and comfortable and we''ve never had a bad experience here. Great when you''re on the go too, really fast service!', '2025-03-29 21:52:43.022', '2025-03-29 21:52:43.022'),
	('cm8uqz4lp0012la0m79lsrgfl', 'ChIJN68zdC1rsocRY54_VDOoNtM', 'places/ChIJN68zdC1rsocRY54_VDOoNtM/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYX2MzV0V3EAE', '5 months ago', 5, 'Been over a decade since ive had boba on okc and wow it seems things have grown in a good way. The lady who helped us was kind and helped my 3 young girls who had never had boba before pick flavors they would each like while taking the time to give samples and explain them as well. All in all a great experience. I will most definitely return with my family!!!', '2025-03-29 21:52:43.022', '2025-03-29 21:52:43.022'),
	('cm8uqz4lp0013la0mqgcxs59h', 'ChIJN68zdC1rsocRY54_VDOoNtM', 'places/ChIJN68zdC1rsocRY54_VDOoNtM/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBM2F1S1p3EAE', 'a month ago', 3, 'Boba cafe is not a horrible place the boba is not bad but there’s another location I’d prefer over this one by Kohl’s off of telephone rd les then 5 mins south on city streets!! This specific location here on service road I’ve been too three times each time the pace wasn’t clean and the workers weren’t super welcoming and the workers have yet to not get on their phones after taking orders🤷🏽‍♀️😑good selection but definitely wouldn’t recommend over the other location I mentioned before!!', '2025-03-29 21:52:43.022', '2025-03-29 21:52:43.022'),
	('cm8uqzkn80014jp0kgw4pdx2l', 'ChIJN_rbeCRrsocR3VSZHIhK94I', 'places/ChIJN_rbeCRrsocR3VSZHIhK94I/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2bXZLY0ZBEAE', '3 months ago', 1, 'Food cold!!! Chicken tenders, had to wait 45 minutes-hour for food. Which I had to go inside to after waiting in drive thru for 4 minutes. In lane B . No one came to acknowledge me for 20 minutes then finally collected money and never came back. I saw cashier give my food to another customer! She never came back to bring correct order!!’ I had to go inside. Chicken tenders cold!!! Fries hot because ordered with no salt!!! I confronted her about giving my food to another customer she stated” I couldn’t take food back” I know that’s true but she never returned to me with any kind of apology!!’ She was rude and unconcerned!!! I strongly suggest no one eat at this restaurant!!! I will report this !!!! This is unprofessional and unacceptable behavior!!!', '2025-03-29 21:53:03.812', '2025-03-29 21:53:03.812'),
	('cm8uqzkn80015jp0ksitdfqlq', 'ChIJN_rbeCRrsocR3VSZHIhK94I', 'places/ChIJN_rbeCRrsocR3VSZHIhK94I/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzLUpMM2d3RRAB', '4 months ago', 1, 'This place is full of unorganized people serving old lettuce, and pieces of tomato that look like they came off of somebody else’s burger not to mention I got ajalapeño I didn’t know number ones had jalapeño!!!!', '2025-03-29 21:53:03.812', '2025-03-29 21:53:03.812'),
	('cm8v6xhpn000ejv0n9s5iyb2y', 'ChIJH4kc7OD_24ARC4FtA0cUVug', 'places/ChIJH4kc7OD_24ARC4FtA0cUVug/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnOWRtNmVnEAE', 'a month ago', 5, 'Beautiful speakeasy. Make sure you get a reservation cause if not you will have to wait at least 30min.
Drinks were so good, my personal favorite Manila San Juan. And the cookies were delicious.', '2025-03-30 05:19:20.555', '2025-03-30 05:19:20.555'),
	('cm8uqzkn80016jp0kwfksfdk9', 'ChIJN_rbeCRrsocR3VSZHIhK94I', 'places/ChIJN_rbeCRrsocR3VSZHIhK94I/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfM2FtY0lREAE', '2 months ago', 1, 'Consistently the worst customer service of any fast-food location in the metro. It never gets better at this location, just gradually worse. Orders appear to be filled randomly, not in the order that they are placed. Wait times of an hour or more are now common. There is no benefit to ordering in the app. Not only will your food not be ready at the designated time, you''ll be lucky to get it within 30 minutes of the time promised in the app. Customers at the counter are not greeted and are often completely ignored.', '2025-03-29 21:53:03.812', '2025-03-29 21:53:03.812'),
	('cm8uqzkn80017jp0kuwxaetzo', 'ChIJN_rbeCRrsocR3VSZHIhK94I', 'places/ChIJN_rbeCRrsocR3VSZHIhK94I/reviews/ChZDSUhNMG9nS0VJQ0FnSUNMM1BXcVpREAE', '9 months ago', 1, 'Very bad experience here. Two of my friends ordered chicken strips and both of them came out uncooked as you can see in these pictures. The lady we spoke with at the desk had an attitude, not wanting to give us a refund at first. Finally we received our refund after continuously telling her no we do not want a replacement. Make sure you check your food before eating here.', '2025-03-29 21:53:03.812', '2025-03-29 21:53:03.812'),
	('cm8uqzkn80018jp0ke6p5lgpy', 'ChIJN_rbeCRrsocR3VSZHIhK94I', 'places/ChIJN_rbeCRrsocR3VSZHIhK94I/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBdm9ieHpBRRAB', 'a month ago', 2, 'First of all, the staff here are usually very polite and the food is decent.

My biggest issue with this place is how long it takes to get food. Whataburger markets itself as a "fast food" restaurant, but it regularly takes me over 30 minutes to get my food here. I''m not sure if this is an issue with understaffing or just incompetence, but it''s really frustrating to consistently wait this long. I frequent other Whataburger locations and this one unfortunately stands out as the slowest by far.', '2025-03-29 21:53:03.812', '2025-03-29 21:53:03.812'),
	('cm8uqzo9s0019jp0k7sblanga', 'ChIJ9UbnmC1rsocRc3yI-TI8LlY', 'places/ChIJ9UbnmC1rsocRc3yI-TI8LlY/reviews/ChdDSUhNMG9nS0VJQ0FnSURfdzl1SGh3RRAB', '2 months ago', 3, 'We had 3 chicken sandwiches and 3 flavors that were NOT labeled. Sauce, for whatever reason, was all over our containers, and our chicken didn''t have any sauce on it. It seemed to be just seasoning. Fries we had melted cheese and were wonderful, chicken sandwiches were decent, wish we had option online for adding pickles. Over all decent taste could be an off night. This location was slammed, and a ton of cooks worked hard.', '2025-03-29 21:53:08.512', '2025-03-29 21:53:08.512'),
	('cm8uqzo9s001ajp0kwylcylm6', 'ChIJ9UbnmC1rsocRc3yI-TI8LlY', 'places/ChIJ9UbnmC1rsocRc3yI-TI8LlY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNqdi1Pd1pBEAE', '11 months ago', 2, 'The food is what it’s supposed to be wingstop food right, but it’s frustrating when I ask for hot honey flavor and well where’s the flavor those are dang plain!! Not to mention I didn’t ask for plain corn either, where’s the seasoning where’s the flavor that’s why I come to wingstop because they season their food but this is a constant issue particularly at this location either no seasoning at all or to much there’s no happy medium but I’ll leave this here for you all to decide.', '2025-03-29 21:53:08.512', '2025-03-29 21:53:08.512'),
	('cm8uqzo9s001bjp0ksva7v53y', 'ChIJ9UbnmC1rsocRc3yI-TI8LlY', 'places/ChIJ9UbnmC1rsocRc3yI-TI8LlY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYak5yZ0lnEAE', '5 months ago', 2, 'The boneless wings and fries would have been good if I could have tasted them. There was so much seasoning especially on the fries you couldn''t taste anything but the seasoning. We got bone in wings also with hickory BBQ and one bite I couldn''t handle it, they were hot.  The service was okay. The young lady taking our order was nice.', '2025-03-29 21:53:08.512', '2025-03-29 21:53:08.512'),
	('cm8uqzo9s001cjp0kzjg1qouv', 'ChIJ9UbnmC1rsocRc3yI-TI8LlY', 'places/ChIJ9UbnmC1rsocRc3yI-TI8LlY/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzcGQzVDBnRRAB', '4 months ago', 2, 'Decided to get some wings and fries for the the family and friends to enjoy. We ordered the 75 wings family pack and the wings where so OVERCOOKED and dried out, tasted like try to eat jerky. Now the fries where completely opposite, way under cooked and just soggy strings. Probably won''t ever give this location another try. Service was fast though', '2025-03-29 21:53:08.512', '2025-03-29 21:53:08.512'),
	('cm8uqzo9s001djp0kb5eamblj', 'ChIJ9UbnmC1rsocRc3yI-TI8LlY', 'places/ChIJ9UbnmC1rsocRc3yI-TI8LlY/reviews/ChdDSUhNMG9nS0VJQ0FnSUR1OUx6MTRBRRAB', '2 years ago', 4, 'Wings were good, Buffalo loaded fries were good, plain fries were okay. The plain fries had a garlic seasoning that I wasn''t big on but with ketchup you couldn''t taste the garlic. The flavors of wings we tried were Hawaiian, Garlic Parm, Mild, & Spicy Korean. All were good, the mild were one of the best mild flavored wings I''ve had.', '2025-03-29 21:53:08.512', '2025-03-29 21:53:08.512'),
	('cm8uqzobl001ejp0kx37938rw', 'ChIJVQR8GnNrsocRIIbZVuxSiUA', 'places/ChIJVQR8GnNrsocRIIbZVuxSiUA/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3OTZHaXJBRRAB', 'a week ago', 5, 'I’ve always heard how great this restaurant was but whenever I was in OKC or Moore, I was either too busy or they were too packed. I finally got to try the Moore location today and was I ever glad I did!!!
Toby Keith’s ILTB&G lives up to the hype!! From the moment you walk in, you’re greeted with a smile. The wait staff is super friendly and helpful- shout out to Amber! The manager came by on two different occasions to make sure everything was up to their apparently high standards.
The food came out quickly and piping hot and was TOO DIE FOR!!
I called my wife and she was upset because we don’t have one anywhere near our home. Guess we’ll just make an 8 hour lunch road trip!', '2025-03-29 21:53:08.577', '2025-03-29 21:53:08.577'),
	('cm8uqzobl001fjp0kj7vow4d2', 'ChIJVQR8GnNrsocRIIbZVuxSiUA', 'places/ChIJVQR8GnNrsocRIIbZVuxSiUA/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2b091N1pBEAE', 'a month ago', 3, 'Saturday afternoon at 12:30 ~ Seating was right away. Server was great.  Steak had too much fat.   The chili is spicy.
Twice eating at Toby Keith’s ~ NOT a fan.  Expensive and we have yet to eat something impressive.
I have no complaints about service ~ very nice.  The staff is quick to remove used dishes and allowed us plenty of time to visit ~ refilled drinks often.  Boxed up leftovers for us.', '2025-03-29 21:53:08.577', '2025-03-29 21:53:08.577'),
	('cm8uqzobl001gjp0k3gwpd7uv', 'ChIJVQR8GnNrsocRIIbZVuxSiUA', 'places/ChIJVQR8GnNrsocRIIbZVuxSiUA/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfeTZpUEp3EAE', '2 months ago', 5, 'If you are a fan of Toby Keith, this location is in his hometown and is not a franchise.  They proudly display an abundance of Toby Keith memorabilia.  The simple menu is very Toby Keith themed and you will be surprised at the variety once you see it.  The food was great!  Try the Heavenly Dinner rolls or the fried okra.   Very limited DRAFT beer menu but I hear that''s just the way it is in Oklahoma.  There were about 5 options but then all the traditional brands were available in cans or bottles.', '2025-03-29 21:53:08.577', '2025-03-29 21:53:08.577'),
	('cm8uqzobl001hjp0kkxqym2da', 'ChIJVQR8GnNrsocRIIbZVuxSiUA', 'places/ChIJVQR8GnNrsocRIIbZVuxSiUA/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2aW9XNktBEAE', '3 months ago', 5, 'Great place to eat. Comparable to all other eating establishments qhen it comes to cost.  Lexi is funny and personable and just awesome! Thank you to all the staff. Will be back.', '2025-03-29 21:53:08.577', '2025-03-29 21:53:08.577'),
	('cm8ur5yuo0021jp0k20m7pk6r', 'ChIJOc0UDV4XsocRIu5X8L-DgF8', 'places/ChIJOc0UDV4XsocRIu5X8L-DgF8/reviews/ChdDSUhNMG9nS0VJQ0FnSURQNW9UTHJ3RRAB', '3 months ago', 5, 'They were very nice and got my food ready in 10 mins - which was GOOD! i got the butter chicken with rice and naan because i wasn''t sure which i would prefer but both were super good. I went light on the spice which was just right.', '2025-03-29 21:58:02.16', '2025-03-29 21:58:02.16'),
	('cm8uqzobl001ijp0kouhnlfpg', 'ChIJVQR8GnNrsocRIIbZVuxSiUA', 'places/ChIJVQR8GnNrsocRIIbZVuxSiUA/reviews/ChZDSUhNMG9nS0VJQ0FnSUQ1c0wzS1RREAE', 'a year ago', 5, 'I absolutely LOVED the food at Toby Keith’s! It was my first time coming here and I’ll most definitely be back! The tumbleweed onions were amazing. My server recommended the ribs with green chili mac n cheese but, with no green chilis. I didn’t know you could take those off! The meal was delicious! I really liked the mac and cheese, it was perfect. The ribs were so tender and fell right off the bone too! My server was really nice and she had a lot of good recommendations! Great prices for such huge portions of food.', '2025-03-29 21:53:08.577', '2025-03-29 21:53:08.577'),
	('cm8uqztnw001jjp0ksagu39ao', 'ChIJu5Zh5S9rsocRsJSYeOhvm8A', 'places/ChIJu5Zh5S9rsocRsJSYeOhvm8A/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfaTdLMzZ3RRAB', '2 months ago', 5, 'Used to live in Moore when I was 5. This was the first place I had ever tried pad Thai at. It became my favorite after trying it here.

14 years later I visited here again as an adult, and I fell in love with it all over again. Some of the best Pad Thai you can find in the OKC area. The redesign of the place looks great. It''s some of the best Pad Thai I''ve ever tried, and best of all its only about $13 for a MASSIVE plate of it.

I hope this place is here to stay.', '2025-03-29 21:53:15.5', '2025-03-29 21:53:15.5'),
	('cm8uqztnw001kjp0kfvlposah', 'ChIJu5Zh5S9rsocRsJSYeOhvm8A', 'places/ChIJu5Zh5S9rsocRsJSYeOhvm8A/reviews/ChZDSUhNMG9nS0VJQ0FnSUN4Mi1uNlRREAE', 'a year ago', 5, 'The evil jungle curry is so good! I was worried itd be too hot. But not bad..just warm. Beef basil is delish. The noodles are very sweet. I wasnt crazy about it. But my adult daughter loved it. The red curry was great.  Cashew chicken really good. We had lunch special.', '2025-03-29 21:53:15.5', '2025-03-29 21:53:15.5'),
	('cm8uqztnw001ljp0kmnrftn4t', 'ChIJu5Zh5S9rsocRsJSYeOhvm8A', 'places/ChIJu5Zh5S9rsocRsJSYeOhvm8A/reviews/ChdDSUhNMG9nS0VJQ0FnSUNhZ3MyVDhnRRAB', '2 years ago', 5, 'AMAZING! Finally a great Thai restaurant!

We were quick to be seated and served. This always makes the experience, at times more than the food itself. Very hospitable and attentive staff.

Got spring rolls which were DELICIOUS, as you can see no picture. I failed you guys LOL we were so hungry and it was so perfect. Our entrees came out quick and fresh! Loved picking up the noodles and seeing all that steam mmm! Lots of flavors and textures, you can never go wrong with Pad Thai. We got spice level 4 on both our plates, it wasn’t really spicy. Spice level goes up to 5, next time I’ll try that! Not sure if they saw us and thought “huh let’s make it a little easy on then” LOL! Excited to come back and try other plates!', '2025-03-29 21:53:15.5', '2025-03-29 21:53:15.5'),
	('cm8uqztnw001mjp0kb6s9m0au', 'ChIJu5Zh5S9rsocRsJSYeOhvm8A', 'places/ChIJu5Zh5S9rsocRsJSYeOhvm8A/reviews/ChdDSUhNMG9nS0VJQ0FnSUM3d3JyT2h3RRAB', '7 months ago', 5, 'What amazing service this young guy took care of us We had not a clue as to what to get, but luckily, we had an amazing server who started us off by greeting us and feeding us. I got the pad Thai flat noodles and my sister got The soup definitely that I will never forget. We were also treated to Tea that taste amazing. Great place I love Milos, but this is something totally different!', '2025-03-29 21:53:15.5', '2025-03-29 21:53:15.5'),
	('cm8uqztnw001njp0knklnrpyy', 'ChIJu5Zh5S9rsocRsJSYeOhvm8A', 'places/ChIJu5Zh5S9rsocRsJSYeOhvm8A/reviews/ChdDSUhNMG9nS0VJQ0FnSUQyMTk2bHlBRRAB', '2 years ago', 5, 'The food is GREAT and portions are pretty big. I ordered Pad Thai and Papaya salad. If you want it spicy (heat level 1-5), request it because its worth it. Tastes like home and authentic. I had 5 spicy on both....so worth it. Couldn''t finish it because it was a lot of food!', '2025-03-29 21:53:15.5', '2025-03-29 21:53:15.5'),
	('cm8ur2oui001ojp0k1bnptnw5', 'ChIJ3ewTrmyDrYcRrWoZd5eZBPE', 'places/ChIJ3ewTrmyDrYcRrWoZd5eZBPE/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3NHEtN0R3EAE', 'in the last week', 5, 'Absolutely the best bbq I''ve had in years!! Visiting from Nebraska and would come back for it again. The ribs were outstanding, as was the slaw. Yum all the way around.', '2025-03-29 21:55:29.226', '2025-03-29 21:55:29.226'),
	('cm8ur2oui001pjp0kbcp0ziae', 'ChIJ3ewTrmyDrYcRrWoZd5eZBPE', 'places/ChIJ3ewTrmyDrYcRrWoZd5eZBPE/reviews/ChZDSUhNMG9nS0VJQ0FnTURnc3NPc0VREAE', 'a month ago', 5, 'I love Jake''s.  Beeneating here for 40 years. They have the best ribs around. They still serve full size ribs. None of the St Louis style ribs the the ends cut off. The potato salad, fried zucchini, green beans, and fries are still awesome.', '2025-03-29 21:55:29.226', '2025-03-29 21:55:29.226'),
	('cm8ur2oui001qjp0kwskucjll', 'ChIJ3ewTrmyDrYcRrWoZd5eZBPE', 'places/ChIJ3ewTrmyDrYcRrWoZd5eZBPE/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2d2RYek9nEAE', '3 months ago', 5, 'Absolutely exceptional!
We arrived late and weren''t sure we would be able to be seated, but we were told it was no problem and given a spot. The wait was about 20 minutes on a Friday night, but well worth it!  As a family of 4 we split the family meal (4 meats and 6 sides) - everything was excellent!  We had the pulled pork, 2x ribs, and brisket. The ribs were a clear standout, although everything was good, especially with the addition of their homemade bbq Sauce. The okra is out of this world - some of the best I''ve ever had! The fried zucchini and mushrooms were also incredible!
The Okie Fries were also extremely good and are absolutely worth ordering! They were the perfect ratio of potato, cheese, bacon, and chives! Absolutely wonderful.

There are Dr. Pepper signs all over the restaurant for good reason. They serve a perfectly balanced Dr. Pepper - none of the over watered or under-carbonated drinks that have become so common. Every detail of the food here is taken seriously and it shows!

Finally, our waitress Lisa was outstanding! She could not have been kinder or more patient. She was absolutely great about giving us time to order and explaining different dishes. Truly, probably the best and kindest waitress I have ever had the pleasure of interacting with. Lisa is fantastic!', '2025-03-29 21:55:29.226', '2025-03-29 21:55:29.226'),
	('cm8ur2oui001rjp0k89kmvohb', 'ChIJ3ewTrmyDrYcRrWoZd5eZBPE', 'places/ChIJ3ewTrmyDrYcRrWoZd5eZBPE/reviews/ChZDSUhNMG9nS0VJQ0FnSUNIdjVlVFRREAE', '6 months ago', 2, 'My husband and I went to Jake''s on a whim after heading out for a day trip. It smelled good. We got a salad and the lettuce was nasty and brown.  Spoiled.  The okra was over cooked and nearly broke a tooth. I got the sloppy Jake''s sandwich he got the smoked turkey. The sloppy Jake sandwich just smelled like it was burnt. Been sitting in a crock pot for hours. The  smoked turkey was ok. It was a strange huge slices.  The potatoe salad was not amazing. I didn''t like it.', '2025-03-29 21:55:29.226', '2025-03-29 21:55:29.226'),
	('cm8ur2oui001sjp0kab36l1zc', 'ChIJ3ewTrmyDrYcRrWoZd5eZBPE', 'places/ChIJ3ewTrmyDrYcRrWoZd5eZBPE/reviews/ChZDSUhNMG9nS0VJQ0FnSUNEdi1pbE5nEAE', '12 months ago', 5, 'It was a pleasant surprise to see they had calf fries and frog legs! I got those to go and even the next day they were EVERYTHING! It’s so much food my daughter ate my ribs after school. The staff is amazing and the kitchen has the food on your table very fast. Chickasha is our mid point for mom- daughter dates and the food never disappoints.', '2025-03-29 21:55:29.226', '2025-03-29 21:55:29.226'),
	('cm8ur2pba001tjp0kmm069bcn', 'ChIJ68dZQSRrsocRYUQZKQar1ko', 'places/ChIJ68dZQSRrsocRYUQZKQar1ko/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2d2VmYkh3EAE', '3 months ago', 4, 'Craving burgers so went to the local garage.  Service was good,  food was amazing as usual.  Had the Sticky Finger and egg o nater. Service was really good.
Always love the atmosphere when diving in.', '2025-03-29 21:55:29.83', '2025-03-29 21:55:29.83'),
	('cm8v7csx00004l50jhuetwm0v', 'ChIJFRJCqYj_24ARQGjyvJAbAeM', 'places/ChIJFRJCqYj_24ARQGjyvJAbAeM/reviews/ChZDSUhNMG9nS0VJQ0FnTURRNXFueURnEAE', '2 weeks ago', 5, 'I felt like I was stepping into a tiny restaurant in Japan! Excellent desserts and service. I can’t wait to return.', '2025-03-30 05:31:14.916', '2025-03-30 05:31:14.916'),
	('cm8ur2pba001ujp0kk9serbo8', 'ChIJ68dZQSRrsocRYUQZKQar1ko', 'places/ChIJ68dZQSRrsocRYUQZKQar1ko/reviews/ChdDSUhNMG9nS0VJQ0FnSUNMcElqR2h3RRAB', '9 months ago', 5, 'We were in the area for a movie (because Enid, Oklahoma is seriously lacking in the movie theater department), and we decide to check out this burger joint everyone''s been raving about. First time there, and let me tell you, it was FANTASTIC!

Their burger selection? Out of this world. You can pick from beef, bison, and some other options, but honestly, I didn''t get past the bison 😂. It was *so* good! You place your order up front, but they''ve got staff who bring your food right to your table and even offer to refill your drinks. Talk about service! The vibe in the place is super chill, too.

Long story short, if you''re in the area, do yourself a favor and swing by. We''re definitely coming back next time we''re around!', '2025-03-29 21:55:29.83', '2025-03-29 21:55:29.83'),
	('cm8ur2pba001vjp0kzgurl27k', 'ChIJ68dZQSRrsocRYUQZKQar1ko', 'places/ChIJ68dZQSRrsocRYUQZKQar1ko/reviews/ChdDSUhNMG9nS0VJQ0FnSURqejRLRGlRRRAB', '10 months ago', 5, 'Never have had a bad experience! Great burgers and loaded fries! Friendly, patient even when they are training. It''s just a loud place even when not busy', '2025-03-29 21:55:29.83', '2025-03-29 21:55:29.83'),
	('cm8ur2pba001wjp0kc0h09rbv', 'ChIJ68dZQSRrsocRYUQZKQar1ko', 'places/ChIJ68dZQSRrsocRYUQZKQar1ko/reviews/ChZDSUhNMG9nS0VJQ0FnSUNEc3NMSGVREAE', 'a year ago', 5, 'Went in with a group and were set up together in a most welcoming positive and professional manner! Food is consistently great along with eager staff for bar service! Never had a negative experience at any Garage in the OKC/Norman metroplex ever.', '2025-03-29 21:55:29.83', '2025-03-29 21:55:29.83'),
	('cm8ur2pba001xjp0kj9mnw3d1', 'ChIJ68dZQSRrsocRYUQZKQar1ko', 'places/ChIJ68dZQSRrsocRYUQZKQar1ko/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfNnVhc3lBRRAB', '2 months ago', 5, 'The food was great but the service was even better!!! It''s rare these days to have people check on you multiple times during your meal.  I highly recommend this restaurant if you want a burger!!', '2025-03-29 21:55:29.83', '2025-03-29 21:55:29.83'),
	('cm8ur5mdg0014la0mlfto6pe2', 'ChIJAwEPqzxrsocRA31z6HWLXh0', 'places/ChIJAwEPqzxrsocRA31z6HWLXh0/reviews/ChZDSUhNMG9nS0VJQ0FnTURnNDQtYUR3EAE', 'a month ago', 1, 'Never in my 62 years of life have I ever witnessed and heard such a horrible circumstance while enjoying my smoothie !!… Management is horrible here. I was in the lobby the other day and overheard what I believe was the manager it was, going off on one of their employees. Not a safe environment for anyone to work in. I hope whoever was getting scolded by him, leaves this toxic environment! I will gladly take my money elsewhere. I do not tolerate any kind of negativity no matter where I go as a customer. Everyone deserves kindness.', '2025-03-29 21:57:45.989', '2025-03-29 21:57:45.989'),
	('cm8ur5mdg0015la0mu6z5u7y1', 'ChIJAwEPqzxrsocRA31z6HWLXh0', 'places/ChIJAwEPqzxrsocRA31z6HWLXh0/reviews/ChdDSUhNMG9nS0VJQ0FnTUNROV8tNWlBRRAB', '3 weeks ago', 1, 'My smoothie was chunky. It was not blended well at all. When I finally got one sip, there was barely any smoothie and only ice and banana chunks. They also didn’t spell my name right. Do better tropical smoothie!😡', '2025-03-29 21:57:45.989', '2025-03-29 21:57:45.989'),
	('cm8ur5mdg0016la0miodhai3k', 'ChIJAwEPqzxrsocRA31z6HWLXh0', 'places/ChIJAwEPqzxrsocRA31z6HWLXh0/reviews/ChdDSUhNMG9nS0VJQ0FnSURVMS1uaDd3RRAB', '5 years ago', 4, 'Tropical Smoothie Cafe is generally pretty good. The service is nice and quick. When they’re in a rush their food quality tends to go slightly downhill, the smoothies will be bland. I got a quesadilla the other day the chicken was only at the very top and only cheese on 2/3s of it, which was a little annoying. Their food isn’t my favorite but it’s not bad. I generally only get their island detox smoothie because it’s one of the only ones with purely ingredients and no added sugar.', '2025-03-29 21:57:45.989', '2025-03-29 21:57:45.989'),
	('cm8ur5mdg0017la0mmutim8m8', 'ChIJAwEPqzxrsocRA31z6HWLXh0', 'places/ChIJAwEPqzxrsocRA31z6HWLXh0/reviews/ChdDSUhNMG9nS0VJQ0FnSURudHNuNTBRRRAB', '4 months ago', 3, 'Update: They did contact me eventually on the order and helped out. It seemed better next time I went.

Update: I did give this location another chance and unfortunately they did get my order wrong again. The server was very nice but refused to provide receipt, and this was around 8:30 so by the time I returned home to discover this was the wrong order, not able to return due to closure. I did call the store before close and there was no answer. I did provide feedback via a form that Tropical Smoothie had sent me and unfortunately yet to hear back. Sad I can’t return there any longer due to being treated that way. I can’t pay this much and be given the wrong order and no chance at a refund or response.

On a side note, I had ordered the quesadilla and there were all sorts of random things in it that didn’t appear to belong such as a black bean and pieces of chicken and rice when this was supposed to be a cheese only quesadilla. It had me doubting everything.

Original review: Frustrated, I come here all the time but it isn’t consistent service or quality. It sometimes takes a really long time to get your order (30+ mins) and at times is wrong or is messy. Usually ok, but you never know!', '2025-03-29 21:57:45.989', '2025-03-29 21:57:45.989'),
	('cm8ur5mdg0018la0m7f8hv4he', 'ChIJAwEPqzxrsocRA31z6HWLXh0', 'places/ChIJAwEPqzxrsocRA31z6HWLXh0/reviews/ChZDSUhNMG9nS0VJQ0FnSURIMWJmcGRREAE', '6 months ago', 1, 'Absolutely disappointed in how the supervisor and general manager treated me yesterday and today. I come to tropical smoothie at LEAST 3 times a week. Yesterday I called to make a Togo order, they said they don’t do call ins, I told them they do I’ve been here multiple times, the supervisor argued with me. So I did the justice of calling other stores to ask because I always have called in. The other stores confirmed there is a button to take call ins. So I called this morning to speak to the manager, they BOTH argued and treated me horribly over not wanting to take my order. Wouldn’t go here honestly due to costumer service issues. I spend hundreds of dollars here and recommend tropical smoothie to all my friends. Will not be going here anymore.', '2025-03-29 21:57:45.989', '2025-03-29 21:57:45.989'),
	('cm8ur5yuo001yjp0kgz53uzj2', 'ChIJOc0UDV4XsocRIu5X8L-DgF8', 'places/ChIJOc0UDV4XsocRIu5X8L-DgF8/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBbjZxTC13RRAB', 'a month ago', 5, 'Best and good priced food , I recommend my truck friends and everyone to come and enjoy . I tried all food carts in Oklahoma City, this is the best food found', '2025-03-29 21:58:02.16', '2025-03-29 21:58:02.16'),
	('cm8ur5yuo001zjp0kq0cc9hea', 'ChIJOc0UDV4XsocRIu5X8L-DgF8', 'places/ChIJOc0UDV4XsocRIu5X8L-DgF8/reviews/ChZDSUhNMG9nS0VJQ0FnSUNMNGRIWGFBEAE', '9 months ago', 3, 'Paneer paratha was really flavorful and tasty. However we didn’t really like the paneer curry. Curry was lacking flavors and the consistency was very thin. Paneer pakodas were ok.', '2025-03-29 21:58:02.16', '2025-03-29 21:58:02.16'),
	('cm8ur5yuo0020jp0kfw38wbjz', 'ChIJOc0UDV4XsocRIu5X8L-DgF8', 'places/ChIJOc0UDV4XsocRIu5X8L-DgF8/reviews/ChZDSUhNMG9nS0VJQ0FnSUROZ0t1aVd3EAE', 'a year ago', 5, 'We have been here multiple times and every time the quality of food is amazing. The food is made fresh. We have tried palak paneer, shahi paneer, paneer tikka masala, parathas, samosas and variety of desserts and more. They tasted so good every time. Love the freshly made chapatis too. They are very customer friendly and can customize the food to one’s palette. Their service is on time and the food is very authentic and tastes homely.', '2025-03-29 21:58:02.16', '2025-03-29 21:58:02.16'),
	('cm8ur5yuo0022jp0kpwun35rb', 'ChIJOc0UDV4XsocRIu5X8L-DgF8', 'places/ChIJOc0UDV4XsocRIu5X8L-DgF8/reviews/ChZDSUhNMG9nS0VJQ0FnSURYa1AzMkJ3EAE', '5 months ago', 5, 'Legitimately great authentic Indian food. OKC so badly needs more good Indian restaurants! This place is as close to home cooked food as we''ve found. The best part is that unlike pretty much every other Indian restaurant here, curry point''s food is actually NOT TOO OILY which is just amazing. Try this place out, you won''t be disappointed!', '2025-03-29 21:58:02.16', '2025-03-29 21:58:02.16'),
	('cm8uvdky40000l40pbynsw9ro', 'ChIJM8u4mDEXsocRNz67NSisC1o', 'places/ChIJM8u4mDEXsocRNz67NSisC1o/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3ejdibldnEAE', 'a week ago', 5, 'Tamashii in Midtown in OKC is literally my favorite place to eat in the world. The service is amazing always kind to customers willing to do what’s needed to make their people happy. True story my daughter was curious about the rice and burnt her finger slightly the manager paid for the meal no questions asked even offered to pay any bills had it been severe enough to go to the hospital I will never forget her kindness and attention.. literally the best ramen house in the world amazing food and  amazing people.', '2025-03-29 23:55:55.852', '2025-03-29 23:55:55.852'),
	('cm8uvdky40001l40pf23fdkt4', 'ChIJM8u4mDEXsocRNz67NSisC1o', 'places/ChIJM8u4mDEXsocRNz67NSisC1o/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3MHJta3RRRRAB', 'a week ago', 5, 'A Taste of Japan in America!

This ramen shop is the most authentic Japanese experience I''ve had in the U.S., and I''m thoroughly impressed! The atmosphere transported me to Japan with its warm greetings, quick service, and friendly staff. Special thanks to George (if I remember correctly), our amazing server who took great care of us!

I ordered the Miso Butter Corn Ramen, while my husband enjoyed the Tonkotsu Ramen with classic salt seasoning. The miso ramen was incredibly rich, with a deep miso flavor complemented by the sweetness of corn and butter. I almost finished the entire bowl of broth! The tonkotsu ramen offered a mild yet rich pork taste with plenty of umami, making it a true representation of Japan''s popular tonkotsu style. If you want to experience authentic Japanese flavors, I highly recommend trying the tonkotsu!

They also offer a vegan ramen option, so everyone can enjoy this authentic Japanese cuisine, regardless of dietary preferences. Next time, I''m looking forward to trying their garlic rice and karaage (Japanese fried chicken).', '2025-03-29 23:55:55.852', '2025-03-29 23:55:55.852'),
	('cm8uvdky40002l40pl87fx50c', 'ChIJM8u4mDEXsocRNz67NSisC1o', 'places/ChIJM8u4mDEXsocRNz67NSisC1o/reviews/ChdDSUhNMG9nS0VJQ0FnTUNndU9yNjd3RRAB', 'a month ago', 4, 'Great food, I got the Classic Tonkotsu with a spice bomb and its the best Ramen I''ve had since i was in St. Louis. the service was pretty good, it got fairly busy and our waitress kept pretty good attention on our table. the prices are very fair at around 13-15 a bowl. overall a good experience i will most definitely come back', '2025-03-29 23:55:55.852', '2025-03-29 23:55:55.852'),
	('cm8uvdky40003l40pzp73qvge', 'ChIJM8u4mDEXsocRNz67NSisC1o', 'places/ChIJM8u4mDEXsocRNz67NSisC1o/reviews/ChdDSUhNMG9nS0VJQ0FnTURRMGM2UGhBRRAB', '2 weeks ago', 5, 'It was my first time visiting here and I really enjoyed the food and the atmosphere. The garlic fried rice was amazing. Will be coming back!', '2025-03-29 23:55:55.852', '2025-03-29 23:55:55.852'),
	('cm8uvdky40004l40pdj8s4hpz', 'ChIJM8u4mDEXsocRNz67NSisC1o', 'places/ChIJM8u4mDEXsocRNz67NSisC1o/reviews/ChdDSUhNMG9nS0VJQ0FnSURfdjVIZXRBRRAB', '2 months ago', 5, 'This is not your basic Ramen.
Because our server Ray, was very knowledgeable on all the menu items, we had an amazing lunch and appetizer. Starting with the garlic rice, if you order that part of the funds go to the California relief for the wild fires.
Then I had the Japanese Curry Ramen. I switched out the pork belly for vegan chicken and it was amazing.
The best part is they have no problem switching out one ingredient for another.
Down to earth friendly environment.', '2025-03-29 23:55:55.852', '2025-03-29 23:55:55.852'),
	('cm8uvdv330005l40pyektqfyo', 'ChIJ6yBOpyZrsocRfcqB3yWvJVU', 'places/ChIJ6yBOpyZrsocRfcqB3yWvJVU/reviews/ChdDSUhNMG9nS0VJQ0FnSURucnR6cTdnRRAB', '5 months ago', 5, 'This place has very friendly and welcoming atmosphere! Got greeted and treated like family while we dined. Would recommend for friends date, regular date, or just for dinner! Definitely a relaxed way to spend dinner or lunch!

