	('cm8uvf3ol000bl40j3spi4j0u', 'ChIJkxjuR-w9socRxV0RNmwD83g', 'places/ChIJkxjuR-w9socRxV0RNmwD83g/reviews/ChdDSUhNMG9nS0VJQ0FnTURRXzQySHlRRRAB', '2 weeks ago', 1, 'This has always been are go too sushi but today at lunch 3/15/25 just seen a cook chopping red meat look to be frozen in the floor. Yes was on a cutting board with a trash bag under it. As we was leaving the restaurant, he took a broom and was sweeping up small pieces of meat.. The whole kitchen floor is now covered in raw meat! Miss the old manager.', '2025-03-29 23:57:06.789', '2025-03-29 23:57:06.789'),
