	('cm8uvdz4o000cl40pdaiplwm0', 'ChIJwYY87i9rsocRzdaWgIvkFRg', 'places/ChIJwYY87i9rsocRzdaWgIvkFRg/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBeXFmUEF3EAE', 'a month ago', 5, 'One of my favorite places to go for sushi in Moore!! The sushi is beyond exceptional and there is a ton of variety. Their entrees are better quality than regular takeout and are well seasoned. They have fresh, cute deserts in a case at the front you can get before or after your meal. I love the fact they have free refills and give you cute plastic cups you can take home with you. I give this place a stamp of approval and will be back!', '2025-03-29 23:56:14.232', '2025-03-29 23:56:14.232'),
	('cm8uvdz4o000dl40p8mrzih1t', 'ChIJwYY87i9rsocRzdaWgIvkFRg', 'places/ChIJwYY87i9rsocRzdaWgIvkFRg/reviews/ChdDSUhNMG9nS0VJQ0FnSUNmaWRERzFRRRAB', '2 months ago', 4, 'First time eating sushi, and it was a fun and delightful experience. The food was good as well as the service. Would recommend people try this spot if they have not already.', '2025-03-29 23:56:14.232', '2025-03-29 23:56:14.232'),
