	('cm8uve7uy0004l40jf2pv73ku', 'ChIJScspb-YTsocR_43NL3lUims', 'places/ChIJScspb-YTsocR_43NL3lUims/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRa01tYlF3EAE', '4 weeks ago', 5, 'WOWZA!!! First time going to this location and I’m impressed!! Beautiful interior, wonderful customer service, and even better delicious food!! The manager helped me pick out the thunder roll and General tso’s chicken(which were so delicious!) Can’t wait to be back!!', '2025-03-29 23:56:25.546', '2025-03-29 23:56:25.546'),
	('cm8uvet3q0005l40jxkglfefw', 'ChIJ5UQAxBY-socRYXTyBn1xcWE', 'places/ChIJ5UQAxBY-socRYXTyBn1xcWE/reviews/ChdDSUhNMG9nS0VJQ0FnSURSaHVfTDFRRRAB', 'a year ago', 1, 'The Takoyaki here is easily the worst Takoyaki I''ve had, it tasted under cooked and flavorless. I actually had to spit it out I couldn’t handle how bad it was after 2 pieces. I can’t understate how bad it was, it tasted like what I imagine gruel tastes like, it should be removed from the menu.

