	('cm8uvf3ql000gl40j7vlb8xdl', 'ChIJ9Sy2td4TsocRail9mnIkf8Y', 'places/ChIJ9Sy2td4TsocRail9mnIkf8Y/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2aHVEbFp3EAE', '3 months ago', 5, 'Had planned a special lunch date with Hubby and sushi was a MUST!!! Found that The Hayashi was in route and decided to stop in to see what they were all about!

