	('cm8uvf3ql000hl40ja903rhhp', 'ChIJ9Sy2td4TsocRail9mnIkf8Y', 'places/ChIJ9Sy2td4TsocRail9mnIkf8Y/reviews/ChZDSUhNMG9nS0VJQ0FnSURmbGRtTUdBEAE', '2 months ago', 5, 'such a calm and inviting place! The miso soup was the best I''ve ever had at a restaurant. tThe sesame chicken tempura roll was absolutely amazing, the texture, flavor, and presentation was all immaculate. would 100% recommend for a date.', '2025-03-29 23:57:06.862', '2025-03-29 23:57:06.862'),
	('cm8uvf3ql000il40jraqqs4ak', 'ChIJ9Sy2td4TsocRail9mnIkf8Y', 'places/ChIJ9Sy2td4TsocRail9mnIkf8Y/reviews/ChdDSUhNMG9nS0VJQ0FnSURucl9PWnNBRRAB', '5 months ago', 5, 'Great lunch deal 2 rolls for $20 dine in only. Great portions. Nigiri pieces were amazing. New management has definitely improved since last time I been. Hoping this place gets the business it deserves.', '2025-03-29 23:57:06.862', '2025-03-29 23:57:06.862'),
	('cm8uvf3ql000jl40jpth5jo5o', 'ChIJ9Sy2td4TsocRail9mnIkf8Y', 'places/ChIJ9Sy2td4TsocRail9mnIkf8Y/reviews/ChZDSUhNMG9nS0VJQ0FnSURIb29MS0p3EAE', '6 months ago', 5, 'From start to finish the experience  was great. The chef was friendly  and the owner was super nice, even greeted us to make sure our experience  was going well. The waitress was attentive  and made sure we had everything.  The food was even better, recommend the hot summer, just a bit of spice to make it oober nice. Will definitely  be returning', '2025-03-29 23:57:06.862', '2025-03-29 23:57:06.862'),
	('cm8v4hty80000jt0f47pc0g7f', 'ChIJx9zPH5v_24ARDIzlTANo1WI', 'places/ChIJx9zPH5v_24ARDIzlTANo1WI/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3M3FIRnBRRRAB', 'a week ago', 2, 'Wanted to try out Lolita''s in Claremont while charging the car... end result is hmmmm this restaurant is Pathetic. Yall can judge for yourselves. This is a $12 carne asada burrito. The taste is fine but the burrito is tiny.

It looks and weighs like a burrito supreme from Taco Bell.  What a disgrace to San Diego.', '2025-03-30 04:11:10.688', '2025-03-30 04:11:10.688'),
	('cm8v4hty80001jt0fn83kpyvq', 'ChIJx9zPH5v_24ARDIzlTANo1WI', 'places/ChIJx9zPH5v_24ARDIzlTANo1WI/reviews/ChdDSUhNMG9nS0VJQ0FnSUNuME9Tb3J3RRAB', '6 months ago', 5, 'Service was great. They were constantly cleaning tables as people left. I got a crispy chicken taco that was good, topped with the green salsa. I also ordered the fish taco and that was ok. I wish it was crispy fish, it was just a white fish with breadcrumb. We tried the rice and beans and it was ok. The service and crispy chicken taco is definitely worth coming back for.', '2025-03-30 04:11:10.688', '2025-03-30 04:11:10.688'),
	('cm8v4hty80002jt0fv1bfcfa7', 'ChIJx9zPH5v_24ARDIzlTANo1WI', 'places/ChIJx9zPH5v_24ARDIzlTANo1WI/reviews/ChZDSUhNMG9nS0VJQ0FnSURYbDdLb01BEAE', '4 months ago', 3, 'Came here often as an undergrad back in 2010. Got a California burrito. It wasn’t the same. Most of the burrito was fries. This place used to put a decent amount of meat. Times are tough.', '2025-03-30 04:11:10.688', '2025-03-30 04:11:10.688'),
	('cm8v4hty80003jt0fofqsy8nf', 'ChIJx9zPH5v_24ARDIzlTANo1WI', 'places/ChIJx9zPH5v_24ARDIzlTANo1WI/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYeklfeXlRRRAB', '5 months ago', 5, 'Very good food with large portions. Had the  carne asada Chimichanga, and it was great! The meat was 1/2 rolled in the shell, and the veggies and guacamole-sour cream were in the open flap. Unique and was like eating a taco salad. Also ordered chips and beans, which was way more than I could finish. While ordering, the manager came up and asked if he could help with the kiosk ordering system. For fast food restaurants, this was very good and I would highly recommend it.', '2025-03-30 04:11:10.688', '2025-03-30 04:11:10.688'),
	('cm8v4hty80004jt0fzam64f8n', 'ChIJx9zPH5v_24ARDIzlTANo1WI', 'places/ChIJx9zPH5v_24ARDIzlTANo1WI/reviews/ChZDSUhNMG9nS0VJQ0FnSUNQb09LQWVnEAE', '4 months ago', 5, 'Got the large carne asada fries and they did not disappoint. The meat was amazing and the portion of fries to meat was spot on. Highly recommend this location if you are looking to get Mexican food', '2025-03-30 04:11:10.688', '2025-03-30 04:11:10.688'),
	('cm8v632nr0000jv0n31fusqvu', 'ChIJI5AjfKL_24AR7k9J5Jee4pA', 'places/ChIJI5AjfKL_24AR7k9J5Jee4pA/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYcVpIeFVBEAE', '5 months ago', 5, 'One place we love to go to after dinner is Yomie’s Rice Yogurt. The staff members are always great and are friendly. I love that they give you suggestions and give you information on each one. The drinks are all made from fresh fruits and not frozen. They make their own type of yogurts. The drinks are flavorful and not too sweet. Tonight, we both tried one of their more popular drinks, Mango Pomelo Sago Yogurt. All I can say is that it was yummy and definitely satisfied me. We are looking forward to trying more of their flavors, including Durian.

Drink: Mango Pomelo Sago Yogurt', '2025-03-30 04:55:41.367', '2025-03-30 04:55:41.367'),
	('cm8v632nr0001jv0nzuzq9i75', 'ChIJI5AjfKL_24AR7k9J5Jee4pA', 'places/ChIJI5AjfKL_24AR7k9J5Jee4pA/reviews/ChdDSUhNMG9nS0VJQ0FnSUQ3NElQYWt3RRAB', '7 months ago', 1, 'I can think of no other place in Convoy than Yomie''s Rice Yogurt where I was treated as a second-class citizen.
I ordered one overpriced yogurt ($13.73!) for takeout.

After I picked up the yogurt and placed it in the cupholder of my car, I noticed the bottom was leaking. There was a crack at the bottom of the cup. I called the store. Little did I know, a lengthy process of gaslighting has begun.

First, denial: There is NO WAY our cup is leaking!

Second hoop: For me to prove the cup was leaking, I had to drive all the way back to the store and bring the leaky cup for them to examine.

After I showed the store the defective cup, the meticulous inspection of evidence has begun. To my shock, the lady from the shop now brought up the store cameras and played back the video and audio of my face with sound -- I had no knowledge I was being video and audio recorded and they''d have my footage forever without consent. She insisted that their cup was not leaking. The problem must be me.

The lady yelled:
"You must have dropped the cup!"
"We have opened the store for a whole year and it is impossible that our cups are defective!"
"There is no way this is our fault!"

I was subject to a ten-minute investigation under the Yomie police. I felt like I walked into a courtroom instead of a yogurt shop.

Of my experience with all the restaurants in Convoy, I have never been treated this poorly as a customer. I have never felt this bad, blamed, gaslighted.

No, I didn''t drop the cup. I didn''t pound the cup on to my cupholder. I didn''t intentionally break the cup so I can spend my entire night driving back to the store embroiled in a meaningless argument just to "scam" a $13 refund out of them.

But the lady wouldn''t let it go until I was beaten into a false confession. Unfortunately, this is not China, where I can bring up all the street cameras with facial recognition and prove to her that I didn''t do so. At least in America (outside of this store), we respect individual privacy.

This interaction has ruined my entire night.

I still cannot believe this one drink cost $13.73. It tasted nothing but like a yogurt you can make for yourself for a dollar.', '2025-03-30 04:55:41.367', '2025-03-30 04:55:41.367'),
	('cm8v632nr0002jv0ndl6zejnp', 'ChIJI5AjfKL_24AR7k9J5Jee4pA', 'places/ChIJI5AjfKL_24AR7k9J5Jee4pA/reviews/ChdDSUhNMG9nS0VJQ0FnSUNsNWQ2bG93RRAB', 'a year ago', 2, 'I was excited to try this place because I nearly saw the same drink at another boba place when this place specializes in rice and “healthy” concoctions.

Well, I am not a fan of this place. It’s all about preference and taste. If you’re into the tart Vietnamese yogurt / Italian yogurt like Oui or Noosa / Greek yogurt / Yakult then you’ll like this.

I got the avocado, took one sip and nearly spit it out. Not for me. It was so thick and sour.

It’s also expensive at $10.50 with tax for a small cup.', '2025-03-30 04:55:41.367', '2025-03-30 04:55:41.367'),
	('cm8v632nr0003jv0nmjcs3rz0', 'ChIJI5AjfKL_24AR7k9J5Jee4pA', 'places/ChIJI5AjfKL_24AR7k9J5Jee4pA/reviews/ChdDSUhNMG9nS0VJQ0FnSUM3cU1uYnlnRRAB', '7 months ago', 5, 'Genuinely not sure how this place doesn’t have more of a footprint! The drink options.l are absolutely delicious with tons of variety. Great price and absolutely work stopping by for a cold yogurt rice drink. The red rice absorbs the yogurt flavor and adds a tasty texture to a flavorful yogurt.', '2025-03-30 04:55:41.367', '2025-03-30 04:55:41.367'),
	('cm8v632nr0004jv0n3f746c0t', 'ChIJI5AjfKL_24AR7k9J5Jee4pA', 'places/ChIJI5AjfKL_24AR7k9J5Jee4pA/reviews/ChdDSUhNMG9nS0VJQ0FnSUNwbTZ2MHBBRRAB', 'a year ago', 5, 'have to say, I’m totally obsessed with their delicious yogurts! The flavors are oats and jujube yogurt, this is my classic go to, I really like the chewy taste from the oats, and jujube is really good for ladies; Strawberry Yogurt, I had this from the owner’s recommendation, it is superb! Half sugar is good and you can feel the little acidity from the fresh strawberries, I also like the tiny strawberry seeds to bite on; Peach Gum and Jujube, this is their new flavor, I know peach gum is very expensive and it’s really good for people. I do like this flavor a lot. While it’s a little expensive but the ingredients cost a lot, that makes sense to make it a little pricy; Avocado Yogurt, this is my type of breakfast! So yummy and healthy, it can give you energy the same time heal your tummy. I recommend Yomie’s Yogurt to everyone who wants to try. Their ingredients are super fresh and they make their yogurt from fresh milk. If you want something real fresh and healthy, you should come here.', '2025-03-30 04:55:41.367', '2025-03-30 04:55:41.367'),
	('cm8v6qu9y0000i20rxpqkce49', 'ChIJFbCbPyr_24AReOhf-dJFDgQ', 'places/ChIJFbCbPyr_24AReOhf-dJFDgQ/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2OHNhbTF3RRAB', 'a month ago', 5, 'TACOGASM! Might be the best Mexican food in all of San Diego. I had the most amazing California burrito I have had in my entire adult Mexican eating life.

The place is actually very small and although you can eat in it, I would suggest to take it to go and eat somewhere with a better atmosphere. But even though the place is small, the food makes up for everything.

They have a very small but delicious menu which I really appreciate because it tells me they’ve only focus on making a select items that are Very freaking good.

You can watch them make homemade tortillas right in front of you which explains why the food taste so good here.', '2025-03-30 05:14:10.246', '2025-03-30 05:14:10.246'),
	('cm8v6qu9y0001i20rdsk3hmh8', 'ChIJFbCbPyr_24AReOhf-dJFDgQ', 'places/ChIJFbCbPyr_24AReOhf-dJFDgQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUR2NjZTU2JREAE', '3 months ago', 4, 'Great tacos and burritos. Burrito has some beans in it and tacos are great with their fresh corn tortillas. Churros are also good. A little cakey (not custardy) but still delightful.

The issue with this place is that it took forever to get food. From ordering to receiving our food, it took 55 minutes.

With that said, all the staff was working quickly and constantly in the background. They were also very friendly. Perhaps we just came on a night where they were particularly busy.', '2025-03-30 05:14:10.246', '2025-03-30 05:14:10.246'),
	('cm8v6qu9y0002i20rw7vwo66h', 'ChIJFbCbPyr_24AReOhf-dJFDgQ', 'places/ChIJFbCbPyr_24AReOhf-dJFDgQ/reviews/ChdDSUhNMG9nS0VJQ0FnTUNnbWZ5ZmlBRRAB', 'a month ago', 5, 'Loved the food and the service!

We went to one over in La Jolla the night before and loved the tacos! There was a LONG ling to get in, and a LONG line for the salsa bar, both signs that we were in for a treat. We were not disappointed and the food was great! They have an amazing salsa verde, and aslo amazing cilantro dressing.

We also enjoyed a California Burrito as well as churros.

We were in town on vacation, and flying out the next morning, but wanted more tacos, so we found this Taco Stand, and hit it the next morning right when they opened at 10 AM to get a taco breakfast before heading to the airport.

We ordered 6 chicken tacos and one steak taco. After sitting down to wait for our food, they let us know that unfortunately they had run out of chicken the night before (Sunday), and new shipment hadn''t come in yet. So they upgraded all of our chicken tacos to steak tacos as not additional charge. They also gave us chips an quacamole at no charge. They were super friendly and very accomodating.

While my favorite is still the chicken tacos, the steak tacos as amazing as well. We had a great seat where we could watch them make the shells by scratch, and also make the tortilla chip as well.

Highly recommend this place to others looking for great tacos/burritos.', '2025-03-30 05:14:10.246', '2025-03-30 05:14:10.246'),
	('cm8v6qu9y0003i20rbdn604rg', 'ChIJFbCbPyr_24AReOhf-dJFDgQ', 'places/ChIJFbCbPyr_24AReOhf-dJFDgQ/reviews/ChZDSUhNMG9nS0VJQ0FnTURBOGU3Uk1REAE', 'a month ago', 5, 'My husband and I have been regular for about a year now! We LOVE IT 😍 the California burritos are only about $10 and super filling. They have amazing sauces as well! The service is always extremely friendly and are always super sweet if they accidentally mess up an order. The lady that helped us today is Tania. She had an amazing listening ear and was super sweet! She helped correct our order. I HIGHLY recommend this place. There’s many locations. Here and La Jolla are my favorite! If you are visiting or live here, check it out and enjoy yumminess!!!! 🥰✝️🕊️🙌🏼', '2025-03-30 05:14:10.246', '2025-03-30 05:14:10.246'),
	('cm8v6qu9y0004i20rebkgj34o', 'ChIJFbCbPyr_24AReOhf-dJFDgQ', 'places/ChIJFbCbPyr_24AReOhf-dJFDgQ/reviews/ChdDSUhNMG9nS0VJQ0FnTUNBc1lqVHFBRRAB', 'a month ago', 4, 'Not alot of places to sit but more like a takeout restaurant. Food was super good and the fries were really crispy even cold. Great for burritos and fries', '2025-03-30 05:14:10.246', '2025-03-30 05:14:10.246'),
	('cm8v6quhw0005i20rxun6rtho', 'ChIJA_UyqZf_24ARIOYMlXtjsHw', 'places/ChIJA_UyqZf_24ARIOYMlXtjsHw/reviews/ChdDSUhNMG9nS0VJQ0FnSURmOTVicHdRRRAB', '2 months ago', 5, 'Must try!!! One of the best acai bowls I’ve had. I’m pretty picky about my acai.

You choose your own toppings for a set price (just pay for a small, medium or large bowl). Great options to choose from.

My favorite thing is that their fruit is finely chopped into small pieces, so I was able to enjoy all contents of the bowl in every spoonful.

Will be back! :)', '2025-03-30 05:14:10.532', '2025-03-30 05:14:10.532'),
	('cm8v6quhw0006i20rh4f22e4p', 'ChIJA_UyqZf_24ARIOYMlXtjsHw', 'places/ChIJA_UyqZf_24ARIOYMlXtjsHw/reviews/ChZDSUhNMG9nS0VJQ0FnSUM0b0p5S2RBEAE', '5 years ago', 5, 'Super delicious acai bowls and paninis. Came back twice in two days, and my father came back just for the acai Bowl. Excellent prices, cute shop. Operating hours make it a little bit challenging to visit if you want to go in the evenings, but just make it work during the day to experience really really really good food', '2025-03-30 05:14:10.532', '2025-03-30 05:14:10.532'),
	('cm8v6quhw0008i20r5ozu3ems', 'ChIJA_UyqZf_24ARIOYMlXtjsHw', 'places/ChIJA_UyqZf_24ARIOYMlXtjsHw/reviews/ChZDSUhNMG9nS0VJQ0FnSUN4MGIzMEF3EAE', 'a year ago', 4, 'I got the acai bowl with strawberry, housemade granola, and goji berries.  It was good, but Ubatuba in LA is still my #1.  The way they make it is different from Ubatuba like the texture and flavor, but I would still go back to the spot when I crave for acai.  This spot is wayyyyyyy better than another spot I went to in SD.', '2025-03-30 05:14:10.532', '2025-03-30 05:14:10.532'),
	('cm8v6quhw0009i20r1ihfas4u', 'ChIJA_UyqZf_24ARIOYMlXtjsHw', 'places/ChIJA_UyqZf_24ARIOYMlXtjsHw/reviews/ChZDSUhNMG9nS0VJQ0FnSURfNE8yamN3EAE', '2 months ago', 5, 'Amazing acai bowl here and at much more reasonable price than at the beach.', '2025-03-30 05:14:10.532', '2025-03-30 05:14:10.532'),
	('cm8v6s7mx000ai20rjxpw45p1', 'ChIJjwwiDPn_24ARJ2gfQ7Pbrso', 'places/ChIJjwwiDPn_24ARJ2gfQ7Pbrso/reviews/ChdDSUhNMG9nS0VJQ0FnSUMwOWFqb2hRRRAB', '5 years ago', 5, 'Love this place! Great gourmet food', '2025-03-30 05:15:14.218', '2025-03-30 05:15:14.218'),
	('cm8v6s7mx000bi20ruextkozm', 'ChIJjwwiDPn_24ARJ2gfQ7Pbrso', 'places/ChIJjwwiDPn_24ARJ2gfQ7Pbrso/reviews/ChZDSUhNMG9nS0VJQ0FnSUNvdjdPUGVBEAE', '6 years ago', 5, 'I try to eat here whenever I can', '2025-03-30 05:15:14.218', '2025-03-30 05:15:14.218'),
	('cm8v6s7mx000ci20rcwpk3qjo', 'ChIJjwwiDPn_24ARJ2gfQ7Pbrso', 'places/ChIJjwwiDPn_24ARJ2gfQ7Pbrso/reviews/ChZDSUhNMG9nS0VJQ0FnSURZeHVURlVnEAE', '5 years ago', 5, 'Absolutely outstanding', '2025-03-30 05:15:14.218', '2025-03-30 05:15:14.218'),
	('cm8v6s7mx000di20r4shpz1gv', 'ChIJjwwiDPn_24ARJ2gfQ7Pbrso', 'places/ChIJjwwiDPn_24ARJ2gfQ7Pbrso/reviews/ChdDSUhNMG9nS0VJQ0FnSUNvdXIyWi1RRRAB', '6 years ago', 5, 'Was fun place', '2025-03-30 05:15:14.218', '2025-03-30 05:15:14.218'),
	('cm8v6xhjx0005jv0ns0umi2hj', 'ChIJ7QlKjpEB3IARtH5Cfq6S3aU', 'places/ChIJ7QlKjpEB3IARtH5Cfq6S3aU/reviews/ChdDSUhNMG9nS0VJQ0FnTUR3OUxiWjJBRRAB', 'in the last week', 5, 'The food here is excellent—I had the fettuccine Alfredo and orecchiette bosco, and both dishes were rich, flavorful, and perfectly cooked. The service was great too, making for an overall fantastic dining experience!', '2025-03-30 05:19:20.349', '2025-03-30 05:19:20.349'),
	('cm8v6xhjx0006jv0nkpy8d4zr', 'ChIJ7QlKjpEB3IARtH5Cfq6S3aU', 'places/ChIJ7QlKjpEB3IARtH5Cfq6S3aU/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfaGVhMjFnRRAB', '2 months ago', 5, 'What a gem! Loved the cozy and charming atmosphere. I’ve found owner operated establishments to be much better in terms of quality and service than the typical  restaurant. No exception here. The appetizers and pastas were all excellent. The tiramisu I’ll be dreaming about until I can return. Probably the best I’ve ever had. Enoteca Adriano is a must try!', '2025-03-30 05:19:20.349', '2025-03-30 05:19:20.349'),
	('cm8v6xhjx0007jv0npy3lmonb', 'ChIJ7QlKjpEB3IARtH5Cfq6S3aU', 'places/ChIJ7QlKjpEB3IARtH5Cfq6S3aU/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzanFYSk93EAE', '4 months ago', 5, 'The food is absolutely fantastic, definitely one of the best, if not the best, italian in San Diego! The pastas were amazing, so were the homemade gnocchis, and the Tiramisu is to die for! 10/10 would recommend this place!', '2025-03-30 05:19:20.349', '2025-03-30 05:19:20.349'),
	('cm8v6xhjx0008jv0nwpdysqha', 'ChIJ7QlKjpEB3IARtH5Cfq6S3aU', 'places/ChIJ7QlKjpEB3IARtH5Cfq6S3aU/reviews/ChRDSUhNMG9nS0VJQ0FnSUMzN0tnahAB', '4 months ago', 5, 'We recently had the pleasure of dining at Enoteca Adriano, and it was an unforgettable experience! From the moment we walked in, the lively atmosphere and the buzz of happy diners made it clear that this place is a local favorite. A couple walked out as we were walking in and said the food is so good and that we chose a great place! That’s always a good sign.

Under new ownership, Enoteca Adriano is elevating the dining experience while staying true to its beloved menu. One of the new owners stopped by our table to share his vision and commitment to quality, while asking us questions about where we are from and what brought us here. Our conversations added a personal touch that was truly refreshing.

Now, let’s talk about the food! We shared with the rigatoni porcini and the pesto burrata appetizer—both were exceptional. The rigatoni was rich and flavorful, perfectly cooked and complemented by the earthy porcini mushrooms. The pesto burrata was creamy and rich and complemented by fresh tomatoes and artichokes.

The service was impeccable and a testament to their new vision. Our dishes and silverware were replaced between courses, and they even split our meals for us since we were sharing. It’s the little touches like this that make a dining experience truly special.

What impressed us most was the reasonable, family-friendly pricing for such elevated Italian cuisine. Between $40-50 for wine bottles, $15-25 for appetizers, and $25-35 for all entrees. Enoteca Adriano is the perfect spot for both special occasions and casual nights out. I can’t recommend this restaurant enough—this place blew our minds! I can’t wait to return and explore more of their menu.

Disclaimer: the pictures of the entrees below is only half of a portion since they split it for us.', '2025-03-30 05:19:20.349', '2025-03-30 05:19:20.349'),
	('cm8v6xhjx0009jv0nvbkfv0h2', 'ChIJ7QlKjpEB3IARtH5Cfq6S3aU', 'places/ChIJ7QlKjpEB3IARtH5Cfq6S3aU/reviews/ChZDSUhNMG9nS0VJQ0FnTUNRM3FLaElBEAE', 'a week ago', 4, 'A must- visit Italian restaurant! The bolognese was rich, hearty, and full of deep, slow-cooked flavor - just how it should be. The bruschetta, though was the real stand out.  Every bite was a perfect mix of crispy bread, juicy tomato’s, and the right amount of garlic and basil.', '2025-03-30 05:19:20.349', '2025-03-30 05:19:20.349'),
	('cm8v6xhpn000ajv0njzl6axqn', 'ChIJH4kc7OD_24ARC4FtA0cUVug', 'places/ChIJH4kc7OD_24ARC4FtA0cUVug/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfc3NqMVJBEAE', '2 months ago', 5, 'This is a super cute Speakeasy! When you walk into the establishment, you’re invited to wait in a seated area for your table or sit at the bar. I definitely recommend making reservations especially on the weekends as it can be packed. The bartenders are very talented and skilled in their knowledge of the drinks. The food we tried were really good! Prices were reasonable as well. I’ve been twice so far.', '2025-03-30 05:19:20.555', '2025-03-30 05:19:20.555'),
	('cm8v6xhpn000bjv0n542lwx8x', 'ChIJH4kc7OD_24ARC4FtA0cUVug', 'places/ChIJH4kc7OD_24ARC4FtA0cUVug/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3MG82aERBEAE', 'a week ago', 5, 'This is my favorite speakeasy in San Diego, and I''ve been to about all of them. I love how the entire experience stays true to its theme of Asian apothecary from the moment you walk into the "pharmacy," go through the secret passage, and enter an artistic and  wooded-incense filled room. Even the bathrooms are themed. All of the drinks use unique ingredients and flavor profiles. The bar tenders are talented (with a knife!) and are helpful at suggesting drinks. The FOOD!!! Most speakeasies don''t even have food, but the food here is SO GOOD. The chips/dip is addicting, the duck, rice dishes, quail - all are delicious. I make it a point to come here and try a new thing every time. Plus they give you a cookie to go! I have not been disappointed!', '2025-03-30 05:19:20.555', '2025-03-30 05:19:20.555'),
	('cm8v6xhpn000cjv0nas7657d6', 'ChIJH4kc7OD_24ARC4FtA0cUVug', 'places/ChIJH4kc7OD_24ARC4FtA0cUVug/reviews/ChZDSUhNMG9nS0VJQ0FnSURmdjdMSVBREAE', '2 months ago', 5, 'Tucked inside Common Theory, this Chinese medicine inspired speakeasy is such a cool spot! I went with friends for drinks and didn’t try the food, but the menu looked eclectic and definitely intriguing. The highlight of the night (for me), though, was the miso cookie they brought at the end—quite possibly the best cookie I’ve ever had! It’s worth a visit just for that unique treat. Can’t wait to go back and explore more of what they have to offer!', '2025-03-30 05:19:20.555', '2025-03-30 05:19:20.555'),
	('cm8v70bwy000fjv0n9evx2ldz', 'ChIJrcZItHEA3IARN-EDv7w-jMs', 'places/ChIJrcZItHEA3IARN-EDv7w-jMs/reviews/ChZDSUhNMG9nS0VJQ0FnSUNfdHNPZEZnEAE', '2 months ago', 2, 'This store needs more staff. They tell you 15-20 minutes and 45 minutes later your food is ready. I called in my order at 5:50 PM and my food came out at 6:30 pm. They rarely have hot and ready and today, they told people they were out of stuff crust, out of cheese packets and had no hot and ready pizzas. When we walked in, it was 10 minutes until someone came to the counter to help the 5 people waiting to order.', '2025-03-30 05:21:33.01', '2025-03-30 05:21:33.01'),
	('cm8v70bwy000gjv0nuyv02rka', 'ChIJrcZItHEA3IARN-EDv7w-jMs', 'places/ChIJrcZItHEA3IARN-EDv7w-jMs/reviews/ChdDSUhNMG9nS0VJQ0FnSURQdUkzbzB3RRAB', '4 months ago', 5, 'Thanksgiving we had a funeral. My app didn''t want to work. When we arrived I wanted to buy a pizza. The guys were already cleaning up. And Bless these guys for being able making us a couple of pizzas 15 minutes before closing. Now that''s customer service at it''s finest.
God Bless you.', '2025-03-30 05:21:33.01', '2025-03-30 05:21:33.01'),
	('cm8v70bwy000hjv0necbo2km6', 'ChIJrcZItHEA3IARN-EDv7w-jMs', 'places/ChIJrcZItHEA3IARN-EDv7w-jMs/reviews/ChZDSUhNMG9nS0VJQ0FnSURidjhhalF3EAE', '7 months ago', 2, 'Showed up 5 minutes after the latest time my pizza would be ready and was told it would be another 15-20 minutes because it hadn’t been made yet. Then when I get home to look at my “Extramostbestest” pepperoni pizza, the crust tasted terrible and there was not many pepperonis on it. This is the 3rd or 4th consecutive time I have had time and food quality issues going to this location. They won’t pick up the phone at the restaurant or at corporate so it’s a gamble on what you get. Just terrible.', '2025-03-30 05:21:33.01', '2025-03-30 05:21:33.01'),
	('cm8v70bwy000ijv0nuz9ax320', 'ChIJrcZItHEA3IARN-EDv7w-jMs', 'places/ChIJrcZItHEA3IARN-EDv7w-jMs/reviews/ChZDSUhNMG9nS0VJQ0FnSUQzajl5RWF3EAE', '4 months ago', 1, 'After a long day of work this is what I get from these idiots, I purchased this and this is what I got. I’m beyond pissed, never again', '2025-03-30 05:21:33.01', '2025-03-30 05:21:33.01'),
	('cm8v70bwy000jjv0n829q4o42', 'ChIJrcZItHEA3IARN-EDv7w-jMs', 'places/ChIJrcZItHEA3IARN-EDv7w-jMs/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3ektxQmdBRRAB', 'a week ago', 1, 'Rude employees who don''t give a crap! You shouldn''t have to wait half an hour for one hot n ready! I will drive further for pizza just to avoid this Little Ceasars.', '2025-03-30 05:21:33.01', '2025-03-30 05:21:33.01'),
	('cm8v7bcr0000kjv0ndhn6dz69', 'ChIJl9vQL73_24AR86L0fTUPyrM', 'places/ChIJl9vQL73_24AR86L0fTUPyrM/reviews/ChZDSUhNMG9nS0VJQ0FnSURQZ3RlRUp3EAE', '3 months ago', 5, 'Stopped by for refreshment, the service was good and the bar had a classic sports bar vibe. I would recommend anyone to stop by for a drink or to catch the game if you''re looking for a laid back place to hang out and enjoy quality service.', '2025-03-30 05:30:07.309', '2025-03-30 05:30:07.309'),
	('cm8v7bcr0000ljv0nes6f77xx', 'ChIJl9vQL73_24AR86L0fTUPyrM', 'places/ChIJl9vQL73_24AR86L0fTUPyrM/reviews/ChZDSUhNMG9nS0VJQ0FnSUNIcGEtSFZ3EAE', '6 months ago', 5, 'Convenient location, helpful staff. Great spot to grab a drink and some food. Lots of TVs for enjoying  a game. Food is really good. Lots of indoor seating, a bar area, and some outdoor seating as well.

Lots of parking, but the lot can get busy. Street parking available.', '2025-03-30 05:30:07.309', '2025-03-30 05:30:07.309'),
	('cm8v7bcr0000mjv0no9z6j7x5', 'ChIJl9vQL73_24AR86L0fTUPyrM', 'places/ChIJl9vQL73_24AR86L0fTUPyrM/reviews/ChdDSUhNMG9nS0VJQ0FnSURCd1BuMzJBRRAB', '2 years ago', 5, 'This place is such a find! Great atmosphere, incredibly friendly staff, stellar food & surprisingly good prices. Good for families or just a friend''s night out. Eat in the bar area for sports nights, drinks & music or find more quiet in the large main dining room. Always had a fantastic experience here. Highly recommend the seared ahi, lemon chicken (my favorite) & the tri-tip rub - both the sandwich & the dinner are excellent. My go-to spot in San Diego.', '2025-03-30 05:30:07.309', '2025-03-30 05:30:07.309'),
	('cm8v7bcr0000njv0ni12y9tgd', 'ChIJl9vQL73_24AR86L0fTUPyrM', 'places/ChIJl9vQL73_24AR86L0fTUPyrM/reviews/ChdDSUhNMG9nS0VJQ0FnSUNvNE5DWTRRRRAB', '6 years ago', 5, 'Cool sports bar with a relaxed atmosphere and good service for a Wednesday night when there wasn''t that many people. Dinner was delicious and we were able to have a normal conversation without having to yell over any loud music. You also get a 360 degree view of sports games, motorsports, and anything else you''d be interested in watching on the plethora of TV''s hung throughout the place. They have a full kitchen that''s open until midnight; steaks, fish and chips, hamburgers, etc... They also have a full bar. Prices are middle of the road for dinner ranging from $8 for a sandwich to $25 for some steak. Highly recommend this place.', '2025-03-30 05:30:07.309', '2025-03-30 05:30:07.309'),
	('cm8v7bcr0000ojv0n03c9pmt1', 'ChIJl9vQL73_24AR86L0fTUPyrM', 'places/ChIJl9vQL73_24AR86L0fTUPyrM/reviews/ChZDSUhNMG9nS0VJQ0FnSUNJb2N6d2ZnEAE', '11 months ago', 5, 'In prime me fashion, I forgot to take the picture first 🫠

Friday Filet Night is probably the best deal in town, AND the tastiest! The gravy is spectacular and you can only use the tiny amount you actually need, but the smothered bites are probably the best ones 🤤😜', '2025-03-30 05:30:07.309', '2025-03-30 05:30:07.309'),
	('cm8v7bdx6000pjv0nhe9bpje1', 'ChIJJeUNaaP_24ARbBAdpVRDAW4', 'places/ChIJJeUNaaP_24ARbBAdpVRDAW4/reviews/ChdDSUhNMG9nS0VJQ0FnSUN3b3NMdHFRRRAB', '10 years ago', 4, 'I have yet to go to the store front location for this place, however, I have been to their truck and I do have to say that they are definitely a must try! I had their lasagna grilled cheese and it was tasty! The flavors really melded well, but there was just a tad too much ricotta on it.  Ive review their menu and was able to see what others were getting and I will definitely come back to try their meatball lollipops as well as the pesto fries.', '2025-03-30 05:30:08.826', '2025-03-30 05:30:08.826'),
	('cm8v7csx00000l50jvuj10um9', 'ChIJFRJCqYj_24ARQGjyvJAbAeM', 'places/ChIJFRJCqYj_24ARQGjyvJAbAeM/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3ODR2RkhBEAE', 'a week ago', 5, 'The matcha was really really good! The mango was also pretty good but MNGO does it better (unsurprisingly). Still, would definitely come back here!', '2025-03-30 05:31:14.916', '2025-03-30 05:31:14.916'),
	('cm8v7csx00001l50jqet9wvjs', 'ChIJFRJCqYj_24ARQGjyvJAbAeM', 'places/ChIJFRJCqYj_24ARQGjyvJAbAeM/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2cGF5WXR3RRAB', '3 months ago', 5, 'Sweet and creative treats that are always very adorably decorated. There’s fun stuff in the middle and great to share if you want a sweet treat that’s not as heavy as ice cream. Always enjoy there season stuff. We got the strawberry, match, and coffee one between 4 of us and they were all quickly gone.', '2025-03-30 05:31:14.916', '2025-03-30 05:31:14.916'),
	('cm8v7csx00002l50jb232g1ub', 'ChIJFRJCqYj_24ARQGjyvJAbAeM', 'places/ChIJFRJCqYj_24ARQGjyvJAbAeM/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfcHVXVnVRRRAB', '2 months ago', 5, 'Staff is unbelievably kind and considerate. My sister when she went to pick up our kakigori she accidentally dropped some of the ice on our plate. It was perfectly okay we could still eat it but the staff insisted on making us a brand new one and brought out an absolutely gorgeous one for free. The kakigori itself is delicious, we go probably twice a week. The atmosphere in the building is also really cool, the little booths are really neat so I’d totally recommend this place to anyone.
Kamigori on the left is the one my sister toppled and then we ate, kakigori on the right is the one they remade for free, thank you!', '2025-03-30 05:31:14.916', '2025-03-30 05:31:14.916'),
	('cm8v7csx00003l50j1k9ioq89', 'ChIJFRJCqYj_24ARQGjyvJAbAeM', 'places/ChIJFRJCqYj_24ARQGjyvJAbAeM/reviews/ChdDSUhNMG9nS0VJQ0FnTUNRM05tRHBBRRAB', '3 weeks ago', 5, 'Small and cute shop! Their shaved ice is not too sweet and looks too pretty to eat, it can be a tad pricey for the size.', '2025-03-30 05:31:14.916', '2025-03-30 05:31:14.916'),
	('cm8v7o4wa0005l50jf0lyyw5e', 'ChIJnzsZt1yGzYsRbtCtBbyFkrw', 'places/ChIJnzsZt1yGzYsRbtCtBbyFkrw/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnNmN6NFZnEAE', 'a month ago', 5, 'This was my first time ordering from Big Oven Pizza, and I will be back! I ordered a pepperoni and jalapeno pizza. It had plenty of flavor and a bit of kick too. The gentleman who helped me at the counter was very friendly and was the do it all person. The inside of the restaurant is clean, organized, and well lit. If you are looking for a NY style pizza, this is definitely a choice I would recommend in and around the Kearney Mesa area. It''s always nice to see small businesses open up. I can''t wait to try some other toppings on my next visit. Eat up!!!', '2025-03-30 05:40:03.658', '2025-03-30 05:40:03.658'),
	('cm8v7o4wa0006l50jf95shd4q', 'ChIJnzsZt1yGzYsRbtCtBbyFkrw', 'places/ChIJnzsZt1yGzYsRbtCtBbyFkrw/reviews/ChZDSUhNMG9nS0VJQ0FnSUNYeHZQb0hnEAE', '5 months ago', 5, 'The aroma of freshly baked pizza is hard to beat, especially when paired with a crisp, hazy IPA. This establishment shines not only in cleanliness but also in exceptional service. I indulged in an 18-inch large pizza, and it was a feast for the senses—visually stunning, fragrant, and utterly delicious. The crust is perfectly golden, embodying the care and dedication that is evident in every aspect of this place. Truly impressive!', '2025-03-30 05:40:03.658', '2025-03-30 05:40:03.658'),
	('cm8v7o4wa0007l50jdvwrqtpz', 'ChIJnzsZt1yGzYsRbtCtBbyFkrw', 'places/ChIJnzsZt1yGzYsRbtCtBbyFkrw/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3cGFYTkJ3EAE', 'in the last week', 5, 'Big Oven was recommended to me, and I was not let down. The pizza made the Detroit way is a mouth explosion of taste. The proportions of cheese and toppings are perfect. It''s a terrific place for a casual dinner because of the friendly atmosphere and the efficient personnel.', '2025-03-30 05:40:03.658', '2025-03-30 05:40:03.658'),
	('cm8v7o4wa0008l50jl0tfumoj', 'ChIJnzsZt1yGzYsRbtCtBbyFkrw', 'places/ChIJnzsZt1yGzYsRbtCtBbyFkrw/reviews/ChdDSUhNMG9nS0VJQ0FnTURnazZ6Qm9nRRAB', 'a month ago', 5, 'I''m constantly searching for the best places in town because I''m a great pizza aficionado. I recently discovered this undiscovered treasure at Kearny Mesa, and I''m delighted I did! The crust is well cooked, with a crispy exterior and a fluffy interior. The tastes are fantastic and the toppings are fresh. I''ve returned several times and have never been let down. The personnel is nice and helpful, and the service is excellent.', '2025-03-30 05:40:03.658', '2025-03-30 05:40:03.658'),
	('cm8v7o4wa0009l50jirb5gy37', 'ChIJnzsZt1yGzYsRbtCtBbyFkrw', 'places/ChIJnzsZt1yGzYsRbtCtBbyFkrw/reviews/ChdDSUhNMG9nS0VJQ0FnSUMzcWFMSi13RRAB', '4 months ago', 5, 'Awesome place nearby where I work whenever I feel like getting a good slice of pizza I always come to this place. Great price great quality of pizza as well. Highly recommend even for special occasions you could never go wrong with getting a full pie', '2025-03-30 05:40:03.658', '2025-03-30 05:40:03.658'),
	('cm8v7q8xe000al50jvtpzvezl', 'ChIJ1R8eX-v_24AROhyoBwmon1U', 'places/ChIJ1R8eX-v_24AROhyoBwmon1U/reviews/ChdDSUhNMG9nS0VJQ0FnTURBbmFQeHhBRRAB', 'a month ago', 3, 'We stumbled upon this place on a Saturday night. They had a small room available for our group of 6. There''s a 2 hr minimum per room which was the perfect amount of time for us.

The room was very clean and there were microphone covers. The employees were all very helpful and nice.

We just came from dinner but ordered their popcorn chicken and fries. The popcorn chicken was really good. We ordered tea and sodas too. Orders were taken at the counter outside the rooms but they will bring your food to your room.

Like some have said, the music is mostly Chinese and the selection of American music is very limited. That was a little frustrating.
We had to download their app on our iPhone to use. The machine in the room is in Chinese and so we couldn''t really use it directly to pull up songs we wanted. Everything was done through their unreliable app.', '2025-03-30 05:41:42.194', '2025-03-30 05:41:42.194'),
	('cm8v7q8xe000bl50jfehbx8qf', 'ChIJ1R8eX-v_24AROhyoBwmon1U', 'places/ChIJ1R8eX-v_24AROhyoBwmon1U/reviews/ChdDSUhNMG9nS0VJQ0FnTUR3eXJQYTZnRRAB', 'in the last week', 5, 'This was my first time ever coming here and I just want to say that Everything was excellent, from food/drinks to music.I loved that there was options for non alcohol drinkers. Had caffeine free tea and many other drinks. My friends enjoyed their alcohol drinks as well! Hosts were very attentive and patient in explaining the menu if we had any questions. Great atmosphere! Very clean and kept.
Hostess gave us clear instructions in how to navigate with karaoke. It seems at first  like there are no english songs options because of how the app is set up.the App that is used for karaoke, gets downloaded from app store and gets linked from phone app to tv. There are plenty English karaoke options if you type songs under search tab.
I had a wonderful birthday experience, I really appreciate how the hosts went out of their way to give us an exceptional customer service. I look forward to coming here again! Thank you so much guys!', '2025-03-30 05:41:42.194', '2025-03-30 05:41:42.194'),
	('cm8v7q8xe000cl50j1jebhbqn', 'ChIJ1R8eX-v_24AROhyoBwmon1U', 'places/ChIJ1R8eX-v_24AROhyoBwmon1U/reviews/ChZDSUhNMG9nS0VJQ0FnTURnMHNqNE53EAE', 'a month ago', 4, 'Amazing private karaoke rooms, gorgeous regul bayhrooms that smell so good, and the fruit plater served upon arrival are so fresh! 😍 my only suggestion would be to make sure to stay up to date on popular songs and frequently sung karaoke classics.', '2025-03-30 05:41:42.194', '2025-03-30 05:41:42.194'),
	('cm8v7q8xe000dl50j58rq0xxm', 'ChIJ1R8eX-v_24AROhyoBwmon1U', 'places/ChIJ1R8eX-v_24AROhyoBwmon1U/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2aF9DMXdRRRAB', '3 months ago', 5, 'When my son picked this place for his 18th birthday I did not know what to expect. This had to be my favorite place for a birthday party. The place was perfect the food was amazing and the service was exceptional. The place was full but you wouldn''t know it because the service we received was definitely one of a kind. I cant wait to go back. I forgot to take pictures of the food but it was great.', '2025-03-30 05:41:42.194', '2025-03-30 05:41:42.194'),
	('cm8v7q8xe000el50jmhg711do', 'ChIJ1R8eX-v_24AROhyoBwmon1U', 'places/ChIJ1R8eX-v_24AROhyoBwmon1U/reviews/ChdDSUhNMG9nS0VJQ0FnTURRenRYYzJBRRAB', '2 weeks ago', 5, 'Karaoke great, food great, service by Kutella excellent, parking not so great but that doesn’t ruin their rating. Awesome place to go with friends if you want something different!', '2025-03-30 05:41:42.194', '2025-03-30 05:41:42.194'),
	('cm8v7qlj6000fl50j3cdnfg8p', 'ChIJubb3CJT_24ARHsEq55a80xY', 'places/ChIJubb3CJT_24ARHsEq55a80xY/reviews/ChdDSUhNMG9nS0VJQ0FnSUNIbVk2TXBnRRAB', '6 months ago', 4, 'We were craving seafood and didn''t want to spend a ridiculous amount of money for small portions by the beach. We found this place in a small shopping center. Jason was our waiter and did a phenomenal job of explaining their procedures and menu selections. We ordered the "s and s"  and the chicken Alfredo plate. Both were stacked with protein. The only thing that I question, and not a knock to them, but I was under the impression that seafood would be cheaper because you''re closer to they bay, but it''s not. The restaurant charges an 18% surcharge on every ticket, which they notified us upon entry, then asked for a suggested tip afterward. Overall, it was a pleasant experience. Thank you, Jason.', '2025-03-30 05:41:58.53', '2025-03-30 05:41:58.53'),
	('cm8v7qlj6000gl50jp9aqdpw8', 'ChIJubb3CJT_24ARHsEq55a80xY', 'places/ChIJubb3CJT_24ARHsEq55a80xY/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBeWJiTVdnEAE', 'a month ago', 1, 'They put too much clams, meatless crabs, and tiny crawfish in the seafood bucket. For $140 more, I get absolutely nothing. Very bad experiencing! It’s sad because I have been a very loyal customer for many years. Time to explore other options I guess!', '2025-03-30 05:41:58.53', '2025-03-30 05:41:58.53'),
	('cm8v7qlj6000hl50jmoif9wuj', 'ChIJubb3CJT_24ARHsEq55a80xY', 'places/ChIJubb3CJT_24ARHsEq55a80xY/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3cjhMX2J3EAE', 'a week ago', 1, 'This place really needs to work on their customer service skills. Charging an 18% gratuity to your check automatically so then they don’t prioritize customer service. I tried to flag down a server 3 times and was ignored blatantly. Then when the manager came over he told me how busy they were with 7 tables in the restaurant. With 5 servers running around. Also they charge you sales tax on the gratuity. Seems a little shady…. The food was phenomenal. The cooks know what they are doing. Everything came out fast. The music was great. The staff just lacks basic empathy and customer service skills. I’d love to come in and run a guest interaction boot camp with your staff. I’d say work on that…. Your guest are your blood and what keeps you pumping. Betty was a great waitress but unfortunately I won’t reward negative behavior from an entire team. That’s a reflection. Food for thought.', '2025-03-30 05:41:58.53', '2025-03-30 05:41:58.53'),
	('cm8v7qlj6000il50j5hxb163a', 'ChIJubb3CJT_24ARHsEq55a80xY', 'places/ChIJubb3CJT_24ARHsEq55a80xY/reviews/ChZDSUhNMG9nS0VJQ0FnSUQ3bHNqTk9nEAE', '7 months ago', 4, 'This restaurant primarily offers seafood boils. When we arrived, the second thing the host mentioned was the mandatory 18% service fee, which we had to agree to in order to dine in. We ordered the "Bucket for One" combo, which was actually enough for more than one person. The food was tasty, with the garlic butter sauce standing out as particularly delicious. Overall, the food was good, but I was a bit disappointed by the mandatory 18% service charge.', '2025-03-30 05:41:58.53', '2025-03-30 05:41:58.53'),
	('cm8v7qlj6000jl50j8qxjdyhj', 'ChIJubb3CJT_24ARHsEq55a80xY', 'places/ChIJubb3CJT_24ARHsEq55a80xY/reviews/ChZDSUhNMG9nS0VJQ0FnSUNNOVotd0NBEAE', '5 months ago', 1, 'I visited this place again after almost a year. A year ago, there was a wait of over an hour on a Friday night, but this time, only 4 tables were occupied. I thought it was strange, but I still went in with high expectations. However, unlike a year ago, they told me that I had to agree to a clause that I would have to pay an 18% service charge before ordering before I could order. I usually pay an 18% to 20% service charge when I eat at restaurants on Friday nights, so I agreed and ordered. However, the staff were talking among themselves even though there were hardly any customers, so they didn''t come when I called them, and they didn''t give me the things they were supposed to bring. I had to ask 3 times to get a container to throw away the crab and shrimp shells, and I had to ask twice to get the bill. They didn''t do enough to get an 18% service charge. That''s when I realized why this restaurant was so empty. I will never visit this place again.', '2025-03-30 05:41:58.53', '2025-03-30 05:41:58.53'),
	('cm8v7qnpi000qjv0n1ohdqpy8', 'ChIJNzzLGZT_24ARBBci7G9Fgjg', 'places/ChIJNzzLGZT_24ARBBci7G9Fgjg/reviews/ChZDSUhNMG9nS0VJQ0FnSUMzX0lXcGRnEAE', '4 months ago', 5, 'My family and I have been to this place twice, and their food and service are exceptional each time. My favorite is the seafood fry sampler, but everything is top-notch. The lady who serves there is charming. We” ''ll go back. Thanks, Submarine staff, for being amazing 🤩', '2025-03-30 05:42:01.35', '2025-03-30 05:42:01.35'),
	('cm8v7qnpi000rjv0nphdoudnk', 'ChIJNzzLGZT_24ARBBci7G9Fgjg', 'places/ChIJNzzLGZT_24ARBBci7G9Fgjg/reviews/ChZDSUhNMG9nS0VJQ0FnSUM3OGZyX0FREAE', '7 months ago', 5, 'I''ve tried a lot of different seafood boiled and this one is my favorite! The flavors is on point! It coats the outside of the seafood but it also seep into the meat of the seafood so the seafood did not taste bland at all.

Everything is so well balanced and flavorful. I also go the garlic noodles. It was ok. The coconut snails was also good.

I love that they give you a side of the sauce to dip in and they are very generous with the fillers such as corn, sausage, and potatoes.

I would definitely recommend 10/10.', '2025-03-30 05:42:01.35', '2025-03-30 05:42:01.35'),
	('cm8v7qnpi000sjv0na4j4rlst', 'ChIJNzzLGZT_24ARBBci7G9Fgjg', 'places/ChIJNzzLGZT_24ARBBci7G9Fgjg/reviews/ChdDSUhNMG9nS0VJQ0FnSUN2cGVDUnN3RRAB', '3 months ago', 5, 'If you’re looking for a seafood feast that satisfies every craving, this is an absolute must-try. From the moment the dish arrived, the aroma of fresh spices and buttery goodness was irresistible.

The crab legs were perfectly cooked, tender, and full of flavor, while the shrimp and mussels practically melted in my mouth. The seasoning was spot on—buttery, garlicky, and delicious! The addition of corn, potatoes, and sausage completed the meal, soaking up all the savory juices for a satisfying bite every time.

Not only was the food impeccable, but the portions were generous. The service was friendly, and the atmosphere made the messy, hands-on dining experience even more enjoyable.', '2025-03-30 05:42:01.35', '2025-03-30 05:42:01.35'),
	('cm8v7qnpi000tjv0nl0i0cibj', 'ChIJNzzLGZT_24ARBBci7G9Fgjg', 'places/ChIJNzzLGZT_24ARBBci7G9Fgjg/reviews/ChdDSUhNMG9nS0VJQ0FnSUR5dDdUS3dRRRAB', '4 years ago', 5, 'I believe our servers name was Jose. He probably the nicest human being I’ve ever met. He deserves a hefty raise. Service was superb. Food was excellent. I came for the snails and the did not disappoint. The dish was also served with crispy Vietnamese baguette. Crawfish, oysters, scallops, garlic noodles were all good. Least favorite was was the lemongrass clams which just kind of plain.', '2025-03-30 05:42:01.35', '2025-03-30 05:42:01.35'),
	('cm8v7qnpi000ujv0nz1xk68rz', 'ChIJNzzLGZT_24ARBBci7G9Fgjg', 'places/ChIJNzzLGZT_24ARBBci7G9Fgjg/reviews/ChZDSUhNMG9nS0VJQ0FnSUQxc2NIa1ZBEAE', 'a year ago', 5, 'love this place! besides the good flavors and cooking, here are where this spot shines over other seafood boils:

- the gloves aren’t the cheap loose ones that make it easy to make an oily mess on your face
- the corn here just tastes better/is marinated better
- the sides and appetizers are so good here! Also the cajun fries are seasoned better than other spots!', '2025-03-30 05:42:01.35', '2025-03-30 05:42:01.35'),
	('cm8v7qpzm000vjv0n7xwavj6l', 'ChIJsYxS6TT_24ARglWgSVzTXI0', 'places/ChIJsYxS6TT_24ARglWgSVzTXI0/reviews/ChZDSUhNMG9nS0VJQ0FnTUR3MUpiYVlnEAE', 'in the last week', 5, 'Came in for some seafood.  All was tasty and great service.  The speciality tacos were great and the seafood tower was a lot of food.', '2025-03-30 05:42:04.306', '2025-03-30 05:42:04.306'),
	('cm8v7qpzm000wjv0nvaai349f', 'ChIJsYxS6TT_24ARglWgSVzTXI0', 'places/ChIJsYxS6TT_24ARglWgSVzTXI0/reviews/ChZDSUhNMG9nS0VJQ0FnSURYcU9MT01BEAE', '5 months ago', 4, 'Came here on a whim for a late night snack. We wanted to get the seafood tower but the price has gone up to $45 which doesn’t make sense for just the two us so we got the ceviche ($17) which was equally delicious.

At 7pm, they have tacos and techno menu. The music changed from hip hop to techno. We ordered Al pastor, birria and lengua. Meats were soft, tender and flavorful.

They serve breakfast items until noon and have Taco Tuesday specials.

I would come more often but parking is such a pain in the free lot. You’ll have to go to the paid parking structure and I recommend parking on the top outdoor level where it’s more spacious.', '2025-03-30 05:42:04.306', '2025-03-30 05:42:04.306'),
	('cm8v7qpzm000xjv0n2xspphzg', 'ChIJsYxS6TT_24ARglWgSVzTXI0', 'places/ChIJsYxS6TT_24ARglWgSVzTXI0/reviews/ChdDSUhNMG9nS0VJQ0FnSUNYeGNUUm5BRRAB', '5 months ago', 5, 'It''s a must try for the birria tacos! The green aguachile was on point as well as the micheladas. Was so excited to hear they opened a spot on Convoy, only downside was the parking. There is a parking structure   near by but you have to pay. I took 1 star off for super minimal seating. It''s a very small place & fills up quickly.', '2025-03-30 05:42:04.306', '2025-03-30 05:42:04.306'),
	('cm8v7qpzm000yjv0nugzobtcy', 'ChIJsYxS6TT_24ARglWgSVzTXI0', 'places/ChIJsYxS6TT_24ARglWgSVzTXI0/reviews/ChZDSUhNMG9nS0VJQ0FnSUN2MnJLRE1BEAE', '3 months ago', 5, 'A bit out of our way to try this place but well worth it that we''d definitely want to come back. Best fish taco I''ve had this side of the border. The fish ceviche was also very fresh and flavorful. My wife loved her ahi taco and the suerito was a great way to wash everything down. The birria sounded good and I look forward to trying it next time. Great ambiance and very friendly staff too.', '2025-03-30 05:42:04.306', '2025-03-30 05:42:04.306'),
	('cm8v7qpzm000zjv0ne0nhg636', 'ChIJsYxS6TT_24ARglWgSVzTXI0', 'places/ChIJsYxS6TT_24ARglWgSVzTXI0/reviews/ChdDSUhNMG9nS0VJQ0FnSUNiMHU3UXN3RRAB', '8 months ago', 5, 'Limited parking outside the restaurant but cars do move in and out quickly enough. Not many tables in the restaurant but there’s some tables outside the restaurant too. The seafood tacos are really good and the octopus is soft and flavorful. Drinks are good too.', '2025-03-30 05:42:04.306', '2025-03-30 05:42:04.306'),
	('cm8vz0m670000jx0ink5h4mti', 'ChIJWU_-Agz3wokRulJ-3g0Cug4', 'places/ChIJWU_-Agz3wokRulJ-3g0Cug4/reviews/ChZDSUhNMG9nS0VJQ0FnSURfOTZQUlhBEAE', '2 months ago', 5, 'I had a Korean-style pizza for the first time in a while, just like the ones I used to eat in Korea when I was younger. It was so delicious! The sweet potato cheese crust was amazing, too. I sprinkled some Tabasco on top …it made it even better!', '2025-03-30 18:25:35.551', '2025-03-30 18:25:35.551'),
	('cm8vz0m670001jx0ik2a602na', 'ChIJWU_-Agz3wokRulJ-3g0Cug4', 'places/ChIJWU_-Agz3wokRulJ-3g0Cug4/reviews/ChdDSUhNMG9nS0VJQ0FnSUNfczlMZW93RRAB', '2 months ago', 3, 'To be honest, I wanted to like this place more… Granted I am born and raised in Brooklyn so this definitely bias but the food was just alright, better than dominos but not really better than a your average corner pizza spot.  That sweet creamy white sauce they had was yummy though but what is up with the atmosphere?!?  A insta ramen noodles corner with a microwave to heat it up in a pizza spot?!  They have cheese burger and fries on the menu, it’s all over the place, it’s like 35%  deli/ cafeteria, so weird…

Overall I was just a little disappointed, the hot sauce packet on top of my pizza didnt help.  To be honest I had tastier k-pizza at a korean bakery.', '2025-03-30 18:25:35.551', '2025-03-30 18:25:35.551'),
	('cm8vz0m670002jx0iaeokf658', 'ChIJWU_-Agz3wokRulJ-3g0Cug4', 'places/ChIJWU_-Agz3wokRulJ-3g0Cug4/reviews/ChdDSUhNMG9nS0VJQ0FnSUNDakpHQm13RRAB', 'a week ago', 4, 'This place is more like a New York City deli than a pizzeria. They sell sandwiches, bagels, pizza, chips, drinks and more. I’ve tried their bagels on a few occasions but they are nothing to write home about. Their pizza is what I am a fan of. It’s not your typical NY slice, it’s Korean style pizza and I love it. Cheese and sweet potato stuffed crust, spicy chicken and bulgogi beef as toppings! It’s a little on the pricey end but worth it in my opinion. All pies come with 2 sodas. Takeout only during COVID-19.', '2025-03-30 18:25:35.551', '2025-03-30 18:25:35.551'),
	('cm8vz0m670003jx0i3uz09m3a', 'ChIJWU_-Agz3wokRulJ-3g0Cug4', 'places/ChIJWU_-Agz3wokRulJ-3g0Cug4/reviews/ChdDSUhNMG9nS0VJQ0FnSUQzaWZqczF3RRAB', '4 months ago', 5, 'Ordered takeout. Love the bulgogi pizza. Sweet potato cheese bites (the extra circle of the crust with sweet potato cheese mousse is a must try!)', '2025-03-30 18:25:35.551', '2025-03-30 18:25:35.551'),
	('cm8vz0m670004jx0iwuj8nqiq', 'ChIJWU_-Agz3wokRulJ-3g0Cug4', 'places/ChIJWU_-Agz3wokRulJ-3g0Cug4/reviews/ChdDSUhNMG9nS0VJQ0FnSURKZ011ZGhBRRAB', 'a year ago', 5, 'My first time trying Korean Pizza and WOW! It’s nothing like Italian Pizza, the crust was stuffed with cheese & sweet potato! Flavors i never experienced together, look out for the food review video in my YouTube channel “FRANJEZ.”', '2025-03-30 18:25:35.551', '2025-03-30 18:25:35.551'),
	('cm8vz0yfl0005jx0i9t2scgy8', 'ChIJ53W97vX3wokRS6aaSb0qrfs', 'places/ChIJ53W97vX3wokRS6aaSb0qrfs/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3dS1uYjhRRRAB', 'a week ago', 5, 'I had such a great experience at Bomdama Shabu Shabu! First of all, the restaurant was very clean, which made me feel comfortable and trust the quality.

All the vegetables were super fresh, and there were so many options to choose from. The meat was also really fresh and high quality.

I tried both the Vegetable Broth and Sukiyaki, and it was amazing to enjoy two different flavors in one meal.

To finish it off, the stick ice cream at the end was the perfect treat — it really completed the whole meal.

Everything was satisfying from start to finish. Highly recommend!', '2025-03-30 18:25:51.441', '2025-03-30 18:25:51.441'),
	('cm8vz0yfl0006jx0it5bz3o29', 'ChIJ53W97vX3wokRS6aaSb0qrfs', 'places/ChIJ53W97vX3wokRS6aaSb0qrfs/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3aDVqMXpRRRAB', 'a week ago', 5, 'The restaurant is exceptionally clean and neat, with walls showcasing a wide variety of fresh vegetables, noodles, fish cakes, tofu, and even fruits! The selection of broths is fantastic, and I particularly loved the garlic broth—it added an amazing depth of flavor to the meal.

The meat and seafood options were incredibly fresh, which made the whole experience even more enjoyable. I was pleasantly surprised by the additional food options available, which were surprisingly good!

For dessert, they offer Korean ice cream to round off the meal—definitely a highlight! I left feeling completely fulfilled and eager to return. The friendly staff also contributed to a wonderful dining atmosphere. Highly recommend this place if you''re a fan of shabu shabu!', '2025-03-30 18:25:51.441', '2025-03-30 18:25:51.441'),
	('cm8vz0yfl0007jx0ie658gjox', 'ChIJ53W97vX3wokRS6aaSb0qrfs', 'places/ChIJ53W97vX3wokRS6aaSb0qrfs/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3cmV6X0RREAE', 'a week ago', 5, 'I had such a great experience at Bomdama Shabu Shabu Hotpot in New Jersey! If you’re a hotpot lover or just someone who enjoys trying new flavors, this place is definitely worth visiting.

What really stood out to me was the wide selection of broths, meats, veggies, and add-ons — there’s something for everyone here. I personally tried the Dashi and Spicy Dashi broths, and both were packed with flavor. The dashi had that classic savory depth, while the spicy dashi had just the right kick without being overwhelming. Next time, I’m definitely trying their Mala broth — it sounds amazing!

The meat selection was super fresh, and they offered plenty of cuts to choose from. Veggie lovers will be happy too — they have a great assortment of greens, mushrooms, and other vegetables, plus noodles, seafood, and even unique hotpot toppings. It’s all you can eat, so you can really take your time and try everything.

Another plus? They finish off the meal with ice cream for dessert! It was the perfect sweet ending after a warm and hearty hotpot feast.

Overall, the quality of the ingredients, variety of options, and friendly service made this such a satisfying meal. I’m already looking forward to my next visit — definitely coming back to try that mala broth! Highly recommend if you’re in the area and craving a good hotpot experience.', '2025-03-30 18:25:51.441', '2025-03-30 18:25:51.441'),
	('cm8vz0yfl0008jx0iz4z7qcor', 'ChIJ53W97vX3wokRS6aaSb0qrfs', 'places/ChIJ53W97vX3wokRS6aaSb0qrfs/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3emIzOVdBEAE', 'a week ago', 5, '⭐⭐⭐⭐⭐ Amazing Shabu-Shabu Experience!

I had an incredible dining experience at [Restaurant Name]! The quality of the ingredients was outstanding—fresh, thinly sliced meats, crisp vegetables, and flavorful broths made every bite absolutely delicious.

The staff was friendly and attentive, making sure we had everything we needed. I especially loved the variety of dipping sauces that complemented the flavors perfectly. The ambiance was cozy and inviting, making it a great place to enjoy a meal with friends or family.

If you’re looking for authentic and high-quality shabu-shabu, this is definitely the place to go. Highly recommended, and I’ll definitely be coming back!', '2025-03-30 18:25:51.441', '2025-03-30 18:25:51.441'),
	('cm8vz0yfl0009jx0ie1pph9iv', 'ChIJ53W97vX3wokRS6aaSb0qrfs', 'places/ChIJ53W97vX3wokRS6aaSb0qrfs/reviews/ChZDSUhNMG9nS0VJQ0FnSURmOTRidGVREAE', '2 months ago', 5, 'This place offers a large variety of fresh side dishes, including vegetables, fish balls, mushrooms, fungus, kimchi, and noodles. There’s also a great selection of sauces. The broth is flavorful, and the utensils like plates, bowls, chopsticks, and tongs are clean and easily accessible.

The meat and seafood options aren’t very expansive but high quality, and I appreciated the non-fatty brisket option. Korean ice creams like Melona are available.

The restaurant is very clean, with excellent ventilation, so you don’t leave smelling like food. Each table has a divider for added privacy, and there’s plenty of space to dine comfortably.

The staff is friendly and helpful, especially the older Korean lady with glasses, who gave very homey vibe to the restaurant. There is a 90-minute wait but after paying we stayed there for about 20 minutes to eat ice cream and no one kicked us out.

There is no parking on premise but street parking was plentiful on a Friday evening.', '2025-03-30 18:25:51.441', '2025-03-30 18:25:51.441'),
	('cm8vz1l5k000ajx0ifvosopkd', 'ChIJa8gWL6f3wokRXEs_6noQhqQ', 'places/ChIJa8gWL6f3wokRXEs_6noQhqQ/reviews/ChdDSUhNMG9nS0VJQ0FnSURYb09PRjF3RRAB', '5 months ago', 5, 'Favorite spot for Korean fried chicken in NJ. 2nd time going, cause I really love their red hot pepper chicken, which is ACTUALLY spicy. Their chicken is always crispy on the outside and moist on the inside👌👌

Their hotdog was also crispy with an amazing chewy dough. Would recommend eating right away for a cheese pull. The cheese cooled down for me by the time I got home. Overall, love that it’s not greasy :)', '2025-03-30 18:26:20.888', '2025-03-30 18:26:20.888'),
	('cm8vz1l5k000bjx0itpd17ayo', 'ChIJa8gWL6f3wokRXEs_6noQhqQ', 'places/ChIJa8gWL6f3wokRXEs_6noQhqQ/reviews/ChZDSUhNMG9nS0VJQ0FnTUN3OU55NVdBEAE', 'a week ago', 5, 'First time trying this place & it was amazing. We got Korean Dogs but there was sooo many optionsss', '2025-03-30 18:26:20.888', '2025-03-30 18:26:20.888'),
	('cm8vz1l5k000cjx0ipz0sstf3', 'ChIJa8gWL6f3wokRXEs_6noQhqQ', 'places/ChIJa8gWL6f3wokRXEs_6noQhqQ/reviews/ChZDSUhNMG9nS0VJQ0FnSUNDenBfMUlREAE', '4 years ago', 5, 'My buddy and I went here this afternoon and I am so glad we did! This was my first time trying a Korean style fried chicken restaurant and I can’t believe I’ve been sleeping on this!

The menu isn’t too overwhelming but there are plenty of things I would love to try. This time we ordered the garlic soy and the hot and spicy tenders. We opted for the Tikkudak variety which means that after the chicken is fried they put it in the oven and bake it for an extra crispy texture.

The chicken was amazingly crispy and evenly coated in delicious sauce! My favorite was the garlic soy by far! The spicy chicken was hot but not absurdly spicy. I have a reasonably high tolerance for spice so if you are sensitive to it I would be careful! This was one of the few times I’ve had fried tenders when I didn’t feel the need to sink them in ranch. I’ll absolutely come back as I want to try some of the other flavors.

The people that run the restaurant are also super friendly and welcoming! I love local restaurants like this! Highly recommended!', '2025-03-30 18:26:20.888', '2025-03-30 18:26:20.888'),
	('cm8vz1l5k000djx0iwp7w3olw', 'ChIJa8gWL6f3wokRXEs_6noQhqQ', 'places/ChIJa8gWL6f3wokRXEs_6noQhqQ/reviews/ChZDSUhNMG9nS0VJQ0FnSURhcnBENFl3EAE', '3 years ago', 5, 'This is my new favorite Korean fried chicken spot. It’s rich in flavor and texture. The meat is more juicy than my previous go to (Boom Boom and Bon Chon) in the area. The staff is super welcoming and friendly. Very limited parking and seating, so it’s mostly a takeout spot. Highly recommend trying if you want the best Korean Fried chicken. My go to is the OG soy garlic and spicy wings. They also offer Korean corn dogs which seem to be really popular but I’ve yet to try them yet.', '2025-03-30 18:26:20.888', '2025-03-30 18:26:20.888'),
	('cm8vz1l5k000ejx0i7azomeen', 'ChIJa8gWL6f3wokRXEs_6noQhqQ', 'places/ChIJa8gWL6f3wokRXEs_6noQhqQ/reviews/ChZDSUhNMG9nS0VJQ0FnSURHNjRqS1BREAE', 'a year ago', 4, 'I start this review by saying I am a wing connoisseur, I''ve tried them all. With that said, these wings are pretty good. I live down the road so it''s an easy pickup compared to making the walk or drive down to MaMa''s. How do they compare? Different flavors for sure, wing size here is larger given the price difference between the two chains, breading is similar but slightly different. While you get more bang for the buck at MaMa''s, support your local businesses and stop by because of their variety. My go to flavor is the red hot pepper, if you are not a hot ones enjoyer, be aware because it''s actually spicy; significantly more than the spicy garlic. The kick reminds me of ghost pepper but I could be wrong. The spicy garlic was good but something about it keeps me from re-ordering it. For those wondering you can also get the sauce on the side if you want!', '2025-03-30 18:26:20.888', '2025-03-30 18:26:20.888'),
	('cm8vzkap5000fjx0isol3vd2w', 'ChIJtSplthD3wokR0cwHoOPDFJs', 'places/ChIJtSplthD3wokR0cwHoOPDFJs/reviews/ChdDSUhNMG9nS0VJQ0FnTURROGJpZW1RRRAB', '2 weeks ago', 4, 'This is a fantastic spot if you''re craving knife-cut noodles. We ordered a variety of dishes: Beoseot Kalguksu, 蘑菇刀切面 (Noodles Soup with Mushrooms), Maesaengi Kalguksu, 海藻面, (Noodles with Seaweed fulvescens), Deulkkae Kalguksu, 紫苏刀切面, (Noodles Soup with Wild sesame), and a Seafood and Green Onion Pancake. The portions were more than generous between the three of us. We each ended up taking half of our soup bowls home.

What I appreciate is that when you order the large noodle soup, they give you a separate small dish to cool down your noodles since the soup comes straight from the stove and is incredibly hot!

Each of the noodle soups stands out for its knife-cut noodles and unique, complex broths. The Mushroom Noodle Soup had a distinct umami flavor, with potatoes adding a starchy texture and a subtle heat in the seasoning. The Seaweed Noodle Soup was particularly notable for its seaweed and shredded cucumbers, which added freshness. It also had a slight kick of spice, which was a nice surprise. The Noodle Soup with Wild Sesame was the most indulgent. It had a rich, Alfredo-like sauce that coated the noodles perfectly. A touch of white pepper and ground sesame seeds gave it a lovely nutty flavor.

As for my favorite, the Seafood and Green Onion Pancake was sublime. It was loaded with seafood and green onions, though I wish it had been a bit crispier. The sauce served with it was tasty, but I prefer a bit more heat. Thankfully, they provided two 2 oz containers: one with jalapeños and the other with a spicy gochugaru-based sauce so I could adjust the heat to my liking.

The service was friendly, and while the place is cozy, it’s best suited for smaller groups. If you''re dining with more than four people, seating might be tricky.', '2025-03-30 18:40:53.802', '2025-03-30 18:40:53.802'),
	('cm8vzkap5000gjx0irlp5es50', 'ChIJtSplthD3wokR0cwHoOPDFJs', 'places/ChIJtSplthD3wokR0cwHoOPDFJs/reviews/ChZDSUhNMG9nS0VJQ0FnTUNBbDZlQ2V3EAE', 'a month ago', 5, 'It’s that place where you want to tell people about but also don’t so you don’t have to wait to get a table. Luckily I’ve never waited for a table but the place is always busy and the bowls all come out piping hot. When I mean hot, it’s hot enough where they give you a separate dish so you can cool down your bite before taking on some chewy noodles. I get the traditional chicken noodle soup if I just want a bowl of noodles to hug me, but sometimes get the spicy if I feel a cold or sore throat coming on.', '2025-03-30 18:40:53.802', '2025-03-30 18:40:53.802'),
	('cm8vzkap5000hjx0iqf63hrhu', 'ChIJtSplthD3wokR0cwHoOPDFJs', 'places/ChIJtSplthD3wokR0cwHoOPDFJs/reviews/ChZDSUhNMG9nS0VJQ0FnSURIM2REeVlnEAE', '6 months ago', 5, 'Craving Korean knife noodle in NJ? Then give Halmae Noodle a try. You won’t be disappointed.

I’ve been hesitant to give this restaurant a chance. The restaurant does not look appealing and menu options are too broad. That’s a red flag and I was questioning their quality even before I tried.

Boy, was I wrong! I only tried three items - knife noodle anchovy based, chicken based and steamed dumpling. They were all superb and the red sauce and diced Serrano pepper paired so perfectly. Two kinds of kimchi were perfectly seasoned and fermented. And the serving lady was extremely hospitable.

My conclusion. Halmae is the 2nd best Korean knife noodle restaurant in the Tri-state and the best one in NJ.', '2025-03-30 18:40:53.802', '2025-03-30 18:40:53.802'),
	('cm8vzkap5000ijx0intoq0zjb', 'ChIJtSplthD3wokR0cwHoOPDFJs', 'places/ChIJtSplthD3wokR0cwHoOPDFJs/reviews/ChdDSUhNMG9nS0VJQ0FnTUN3anRfaWlRRRAB', 'a week ago', 5, 'Halmae is one of my favorite Korean restaurants for many reasons. The portions are massive, the waitresses are always warm and friendly, and the food is consistently delicious every time I visit. The prices are very reasonable, and they have never once fallen short of my high expectations. I can confidently say this will remain my favorite Korean restaurant—unless I somehow find one that’s even better, but I highly doubt that will happen!', '2025-03-30 18:40:53.802', '2025-03-30 18:40:53.802'),
	('cm8vzkap5000jjx0i8im79162', 'ChIJtSplthD3wokR0cwHoOPDFJs', 'places/ChIJtSplthD3wokR0cwHoOPDFJs/reviews/ChZDSUhNMG9nS0VJQ0FnSURicWV6VkJ3EAE', '7 months ago', 4, 'Cute and moderately sized place. Some dishes were mediocre and others I would get again; the yook gae jang noodles (spicy beef and vegetables) were amazing - the broth was especially great. The fried beef and steamed beef dumplings were just OK as well as the spicy rice cake noodle stir fry (wasn''t spicy and little sweet). The chicken noodles are just OK as well.
There is street parking but metered.', '2025-03-30 18:40:53.802', '2025-03-30 18:40:53.802'),
	('cm8vzkllf0000ie0ks0zp2k7m', 'ChIJ5wrUXxf3wokR7DS4k3w_GC4', 'places/ChIJ5wrUXxf3wokR7DS4k3w_GC4/reviews/ChZDSUhNMG9nS0VJQ0FnTUNnczYyTkNREAE', 'a month ago', 4, 'Stopped by on a Saturday at around 10:45 to pick up a few rolls. Everything is premade, so it makes for a nice, quick lunch. Rolls are $7-$8, which is cheap especially since they''re made fresh in the morning. I think that''s even cheaper than the fridged Hmart ones. Plus, it''s packed with ingredients. They don''t skimp on the meat and it''s a good filling to rice ratio. We tried the grilled pork, beef, and fish cake kimbaps. They all tasted kind of similar but it was pretty good. We also had the dumplings, which I would skip because they just taste like the frozen Hmart mandus.

Definitely would come back the next time I''m craving some kimbap!', '2025-03-30 18:41:07.923', '2025-03-30 18:41:07.923'),
	('cm8vzkllf0001ie0kz6eaoqgy', 'ChIJ5wrUXxf3wokR7DS4k3w_GC4', 'places/ChIJ5wrUXxf3wokR7DS4k3w_GC4/reviews/ChZDSUhNMG9nS0VJQ0FnSURicjRLZlJ3EAE', '7 months ago', 3, 'It''s better than supermarket kimbob for sure. I wish rice was cooked bit softer. I purchased bunch of kimbobs before 8am on Saturday so I''m sure they were fresh but rice were bit hard for my taste. I did like the fact the spicy tuna''s tuna color wasn''t red/orange like other place. They add chopped green hot pepper in the tuna so if you mix up tuna with spicy tuna, you might get surprised. Lol. To sum up, these are good but I prefer Kokiri 코끼리 kimbob better.', '2025-03-30 18:41:07.923', '2025-03-30 18:41:07.923'),
	('cm8vzkllf0002ie0k6bhk84oo', 'ChIJ5wrUXxf3wokR7DS4k3w_GC4', 'places/ChIJ5wrUXxf3wokR7DS4k3w_GC4/reviews/ChdDSUhNMG9nS0VJQ0FnSUNEcDhLcndRRRAB', '12 months ago', 5, 'The absolute best. If you are expecting anything more from a $8 kimbap, it’s a crime. Kokiri kimbap nearby may have a chance to compete in the same level, but Kimbob Club outcompetes in my estimate.

Look at the thinly sliced piece of Kimbob. It’s huge and stuffed. Yet it’s sliced so thinly that it’s still a bite size. It takes a lot of skills to accomplish this feat. You probably understand this if you ever made kimbob on your own. Having that much rice and ingredients contained within that thin piece is a culinary feat.

And of course, it tastes great. All ingredients and rice are seasoned perfectly. Highly recommended if you are a lover of kimbob.', '2025-03-30 18:41:07.923', '2025-03-30 18:41:07.923'),
	('cm8vzkllf0003ie0kq1jueccf', 'ChIJ5wrUXxf3wokR7DS4k3w_GC4', 'places/ChIJ5wrUXxf3wokR7DS4k3w_GC4/reviews/ChZDSUhNMG9nS0VJQ0FnTURBMDVTT2ZnEAE', 'a month ago', 5, 'Delicious and fresh! Thin layer of rice and lots of filling. Spicy tuna has chopped up spicy peppers, so yummy. Love supporting small businesses!!', '2025-03-30 18:41:07.923', '2025-03-30 18:41:07.923'),
	('cm8vzkllf0004ie0k0q72shgy', 'ChIJ5wrUXxf3wokR7DS4k3w_GC4', 'places/ChIJ5wrUXxf3wokR7DS4k3w_GC4/reviews/ChdDSUhNMG9nS0VJQ0FnSUN1NUxDb213RRAB', '2 years ago', 4, 'Good variety of Korean rice rolls. My go to is their squid kimbob, absolutely delicious. $10 min if you want to charge it on your card. Takeout only. Friendly and inviting staff.', '2025-03-30 18:41:07.923', '2025-03-30 18:41:07.923');


